INSERT INTO `movie` VALUES ('1412', '仙剑五之云之凡', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 改编自单机游戏仙剑系列的电视剧《云之凡》将以90后审美为基调，在尽量遵循游戏原著的基础上，加入不少创新元素，故事更加生动，人物更加饱满。在特效方面，杜绝“五毛党”，邀请业界一流的韩国特效团队为奇幻场景保驾护航，力求给“仙剑”迷们带来一个满意的仙剑十年之约。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 二十年前，净天派因受到邪派卢戎部落长老的挑拨，与武林为敌，受到武林四大家族和蜀山围攻。教主姜世离送走已怀身孕的妻子欧阳倩，自己被蜀山镇压在禁洞中。二十年后，姜世离之子姜云凡偶遇身患怪病的唐雨柔、女娲后人小蛮及夜叉族二皇子龙幽后，他是净天派教主姜世离的儿子的消息不胫而走。被视为姜世离孽子的他，成为各家 ... 追杀的对象。 <br /></div>', '韩东君 郑元畅 娜扎 小彩旗 金晨', '国语', '2016', '0', '/data/images/574321ed9010b.jpg', '大陆', '2016-06-22 00:10:10', '13', '20', '40', '684', '仙侠剧', '更新至20集/共40集');
INSERT INTO `movie` VALUES ('1413', '女不强大天不容', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 都市报社主任郑雨晴人近中年，一心只想着提前过半退休的日子照顾女儿，没想到报社突发状况，她临危受命被任命为主编。郑雨晴到任后发现，报社中问题严重，变革也阻力重重。郑雨晴凭着自己的能力和一腔热血，用女性的柔婉、坚韧，终于让报社经营有了转机。但是新一波移动互联网浪潮又汹涌而来，使传统纸媒受到冲击，报社又面临着新的危机。在与女儿以及90后下属的相处中，郑雨晴渐渐明白，应该改变自己，尝试去学习新事物。郑雨晴开始了自己的蜕变，最终和团队一起走出了一片新天地。</div>', '海清 杜淳 陈小艺 张译 马苏 贾景晖 李野萍 高明 安悦溪', '国语', '2016', '0', '/data/images/574edef6a16fb.jpg', '大陆', '2016-06-21 22:23:27', '13', '37', '46', '685', '时装剧', '更新至37集/共46集');
INSERT INTO `movie` VALUES ('1414', '解密', '<div class=\"endtext\"><p>电视剧《解密》改编自作家麦家1991年创作的畅销同名小说，故事围绕数学奇才容金珍破解超级密码（紫密和黑密）展开。</p>\r\n<p>新中国建国初期，X国派出代号“觉醒者”为首的特务组织潜入我国，启用代号为“紫密”的高级密码进行联络，对我国国防建设造成重大破坏。特别单位 701郑当等人奉命在全国搜罗各类天才，为破译“紫密”乃至代表最高智力水平的“黑密”补充新鲜力量，有特殊数学天赋的“傻瓜天才”容金珍等人被发掘进入了701，一段隐秘而伟大的传奇故事徐徐展开。容金珍等人不仅要解开一部如天书般的密码，更要解开“701人”的“人生之密”——包括他们的身世之密、命运之密、个性之密、情怀之密。每个人都肩负着各自的使命，每个人内心都藏着自己的秘密，因为同一个信仰和目标，他们努力拼搏，只为证明共和国无名英雄们的价值。 </p></div>', '陈学冬 颖儿 郭京飞 印小天 经超 张哲瀚 安以轩 白庆琳 于波', '国语', '2016', '0', '/data/images/5767fd511550d.jpg', '大陆', '2016-06-21 22:16:00', '13', '4', '41', '686', '警务剧', '更新至04集/共41集');
INSERT INTO `movie` VALUES ('1415', '纯熟意外粤语', '<div class=\"endtext\">世上每日发生不同的事故，它们的出现，必然有因，才有果。<br />\r\n但世事总有始料不及，当人未能看清万物事出何因，便会将其统称为“意外”。<br />\r\n意外真的存在吗？<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">意外的岔路</span><br />\r\n<br />\r\n她叫殷然(蔡思贝饰)，是个聪明的少女，生于平凡的家庭，有一个圆满的童年。<br />\r\n16岁，她顶着拔尖生的光环中学毕业，志愿是做个救急扶危的医生。<br />\r\n26岁，她没有成为医生，却在保险公司委托的调查公司当调查员，追查保险赔偿意外的真相。<br />\r\n原因？就是那宗夺去其父母性命的交通意外，她认为事有蹊跷，却没获受理。<br />\r\n这天，她在医院里偶遇一位气宇轩昂的中年大叔，二人四目交投，由这一分钟开始，两人的生命变得不再平凡。<br />\r\n<br />\r\n<br style=\"font-weight:bold;\" />\r\n<span style=\"font-weight:bold;\">意外的邂逅</span><br />\r\n<br />\r\n中年大叔叫乔文杰(吴启华饰)，拥有四十多岁的外表，学识渊博，气度儒雅温文。令他在不同场合也引人注目。<br />\r\n自从送走亡妻后，从事古董买卖生意的他已甚少交际应酬，与管家张克莱(周骢饰) 过着不问世事的生活。<br />\r\n接过一通来电后，他赶往医院送别唯一至亲的最后一程。惊鸿一瞥，他与一名少女对目而视。<br />\r\n他与她成为了调查保险赔偿意外的拍档，关系愈走愈近，少女觉得自己喜欢了他。<br />\r\n他却偶遇了与亡妻一模一样的人。<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">意外的重逢</span><br />\r\n<br />\r\n凌若菲(李施嬅饰)背负着一个不幸的童年，父亲酗酒、有暴力倾向，母亲离家出走后，她便成为被虐待的目标。<br />\r\n她住在屋邨，朋友不多，但每次从家中“走难”时，邻家男孩总会为她带来药酒、食物。<br />\r\n那晚，夜阑人静，家里火光熊熊，全家人无一幸免，唯有她被及时救出。自此她恍若人球，辗转住在不同的寄养家庭，也再没有见过邻家男孩。<br />\r\n中学毕业后，她在保险界打滚，略有成绩。有日，一位风度翩翩的中年男士，说她与他亡妻的相貌几乎一样。<br />\r\n中年男士主动追求，她并没有接受爱意。因为她早已重遇了那位邻家男孩。<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">意外的破坏</span><br />\r\n<br />\r\n高大俊朗、聪明开朗、文武双全，父母、老师总以卓声扬(黎诺懿饰)为豪。<br />\r\n他喜欢喂饲流浪猫，因此认识了经常流连街头的柔弱女孩。他知道女孩生活很苦，予以照顾，可惜没多久，女孩搬走了。<br />\r\n升上大学后，他仍然受人簇拥爱戴，当中包括那位总爱与自己斗咀的学妹。<br />\r\n可是毕业那年，他与父亲出海，遇上突如其来的意外，失去了家人。<br />\r\n他痛不欲生，失踪了几年，再次出现的时候，已是一名律师。而且，他再次遇见那位柔弱女孩。二人互相同情对方的缺陷，成为了情侣。<br />\r\n有天，他碰上那位曾经有过暧昧关系的学妹。<br />\r\n她叫殷然。<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">意外的真相</span><br />\r\n<br />\r\n文杰、殷然、若菲、声扬的关系千丝万缕。<br />\r\n文杰与殷然调查不同保险赔偿的案件，渐发现那些所谓意外，仿佛有人在背后操纵。<br />\r\n四人相互的偶遇和人生中的不幸，果真纯属意外吗？</div>', '吴启华 蔡思贝 李施嬅 黎诺懿 滕丽名 曹永廉', '粤语', '2016', '0', '/data/images/574c4494cf263.jpg', '香港', '2016-06-21 21:56:26', '13', '17', '30', '686', '警务剧', '更新至17集/共30集');
INSERT INTO `movie` VALUES ('1416', '好先生', '<div class=\"endtext\"><p>陆远，一个在美国打拼，成为米其林主厨的中国汉子，美国那场惨烈的车祸没能要了他的命，倒是让他越是活得结实。此次回国，陆远有三个目的：把因车祸去世的哥们儿大彭的骨灰带回来，让他落叶归根；把大彭未满十八岁的女儿彭佳禾送回到她亲妈手上；自己找个僻静的地方，栓根绳儿上吊。</p>\r\n<p>就这样，一大一小两人踏上了回国之旅。等待他的是非到万不得已他不会触及的前妻甘敬和正在追求其前妻的老同学江浩坤。陆远表面平静，心里却紧张得要死，不知该以什么形象和心态面对甘敬，想来想去还是用一副渣男嘴脸，跟着彭佳禾一起住进了前妻家。</p>\r\n<p>陆远做的一切就是为了赢回前妻，却意外遇到了外形出众，却并非善类的小丫头片子江菜——江浩坤的妹妹，阴差阳错，两人成了欢喜冤家，并共事于江浩坤饭店后厨。啼笑皆非中，陆远终于想明白自己接下来的路应该何去何从，要想真正的改头换面，在哪儿跌倒的还得在哪儿爬起来。</p>\r\n<p>陆远的人生，就要任性，就要折腾…… </p></div>', '孙红雷 江疏影 王耀庆 车晓 张艺兴 关晓彤', '国语', '2016', '0', '/data/images/574ed7509f7bd.jpg', '大陆', '2016-06-21 21:37:41', '13', '42', '40', '685', '时装剧', '更新至42集/共40集');
INSERT INTO `movie` VALUES ('1417', '六扇门', '<div class=\"endtext\"><p>明朝中叶，老皇帝昏迷不醒，立储之事悬而未决，皇子和齐王觊觎皇位，明争暗斗，此时京城惊现连环杀人案，责成京师六扇门办理案件，六扇门统带申梓木本想和稀泥，却不想儿子申力行意外卷入案件当中，申梓木被迫带着申力行共同破案。申力行天赋异禀，很快破案，却也揭开了宫廷斗争的序幕。随着申力行调查的深入，案件牵扯越来越大，终于翻出了十多年前皇后犯下的一桩罪行，真相会影响皇位传承，也因为案件，申梓木被人暗害，申力行痛不欲生，却这时，皇帝病愈，齐王抓住机会将申力行破案的结果密奏皇上，龙颜大怒，皇子被软禁，齐王眼看即位，申力行突然发现杀死父亲的凶手是齐王的手下苏溢清，而这一切的缘起都是齐王所为，申力行为父报仇，将真相公之于众，逼得齐王走投无路起兵造反，在申力行的帮助下皇子平叛，最终顺利即位。</p></div>', '林峰 迪丽热巴·迪力木拉提 方中信 郭芮溪 应昊茗', '国语', '2016', '0', '/data/images/5768968dee399.jpg', '大陆', '2016-06-22 11:15:24', '13', '0', '0', '687', '古装剧', '全集/共40集');
INSERT INTO `movie` VALUES ('1418', '纯熟意外国语', '<div class=\"endtext\"><p>从事古董买卖生意的乔文杰（吴启华饰）温文尔雅，学贯中西，生活丰裕无忧，自送走亡妻庄颖儿（李施嬅饰）后一直过著独身生活，他的一切只有管家张克莱（周骢饰）知道。直到一天，文杰在医院遇见了任职保险公司调查员的殷然（蔡思贝饰），令他沉寂的人生泛起了涟漪，殷然竭尽所能在追查意外身亡的父母时，她发现原来自己的人生冥冥中与文杰有关，文杰为了可亲近殷然多一点，不惜加入调查公司，又认识向殷然展开追求的卓声扬（黎诺懿饰）；文杰与殷然渐渐查出很多意外背后仿佛有人所操纵，正当接近真相之时，文杰遇上了貌似亡妻的凌若菲（李施嬅饰）出现，但原来声扬与菲同样隐藏着不为人知的身世……</p></div>', '吴启华 蔡思贝 李施嬅 黎诺懿 滕丽名 曹永廉', '国语', '2016', '0', '/data/images/574e7f74b1d88.jpg', '香港', '2016-06-22 15:38:35', '13', '17', '30', '686', '警务剧', '更新至17集/共30集');
INSERT INTO `movie` VALUES ('1419', '末日孤舰第三季', '<div class=\"endtext\"><p>本剧制片人是大名鼎鼎的迈克尔·贝。故事根据同名畅销小说改编，主人公是美军驱逐舰内森·詹姆斯号。当一场全球性的大灾难（注：在原著中这场灾难指的是美国和前苏联之间的全面核战争）抹去地球上绝大多数人口后，这艘战舰因为所处的位置特殊而逃过一劫。现在船上的人不得不面对一个新的现实——他们可能是这个世界上为数不多的幸存者之一，他们在这个世界上的位置和以前已经完全不一样。</p></div>', '埃里克·迪恩 罗娜·迈特拉 亚当·鲍德温', '英语', '2016', '0', '/data/images/575f5fc620c6e.jpg', '欧美', '2016-06-21 10:05:55', '13', '2', '13', '688', '科幻剧', '更新至02集/共13集');
INSERT INTO `movie` VALUES ('1420', 'Doctors', '<div class=\"endtext\"><p>由吴忠焕执导，河明熙编剧，金来沅、朴信惠、尹均相、李圣经主演的月火剧。\r\n该剧是讲述踩着过去伤痛成为医生的两个男女，看尽人生百态后成长，开启人生只有一次的爱情的人类医学剧。</p></div>', '金来沅 朴信惠 尹均相 李晟京', '韩语', '2016', '0', '/data/images/576897292b784.jpg', '韩国', '2016-06-22 11:13:18', '13', '2', '16', '689', '医务剧', '更新至02集/共16集');
INSERT INTO `movie` VALUES ('1421', 'Beautiful Mind', '<div class=\"endtext\"><p>原名《Doctor弗兰肯斯坦》 ，韩国KBS月火迷你连续剧。该剧由 《成均馆绯闻》金泰姬编剧执笔。该剧讲述了拥有出众医术、不轻易流露感情的冷血医生在遇到心爱之人之后逐渐发生变化的故事。</p></div>', '张赫 朴洙垣', '韩语', '2016', '0', '/data/images/5768972be4157.jpg', '韩国', '2016-06-22 11:13:40', '13', '2', '16', '689', '医务剧', '更新至02集/共16集');
INSERT INTO `movie` VALUES ('1422', '怪物Monster', '<div class=\"endtext\"><p>该剧讲述了在极度贪婪的社会中，男主角挑战社会上层并进行复仇，最终收获爱情的故事。</p></div>', '姜至奂 成宥利 朴基雄 赵宝儿 郑雄仁 李德华', '韩语', '2016', '0', '/data/images/56f9effe017d9.jpg', '韩国', '2016-06-22 11:12:56', '13', '26', '50', '685', '时装剧', '更新至26集/共50集');
INSERT INTO `movie` VALUES ('1423', '琅琊榜', '<div class=\"endtext\"><p>十二年前七万赤焰军被奸人所害导致全军覆没，冤死梅岭，只剩少帅林殊（张哲瀚 饰）侥幸生还。十二年后林殊改头换面化身“麒麟才子”梅长苏（胡歌 饰），建立江左盟，以“琅琊榜”第一才子的身份重返帝都。梅长苏背负血海深仇，暗中帮助昔日挚友靖王（王凯 饰）周旋于太子（高鑫 饰）与誉王（黄维德 饰）的斗争之中，同时又遇到了昔日未婚妻——云南王郡主穆霓凰（刘涛 饰）却不能相见。梅长苏以病弱之躯为昭雪冤案、为振兴河山，踏上了一条黑暗又惊心动魄的夺嫡之路。</p></div>', '胡歌 刘涛 王凯 黄维德 高鑫 陈龙 吴磊 张龄心 张琰琰 瑯琊榜', '国语/粤语', '2015', '0', '/data/images/5739efac1531a.jpg', '', '2016-06-22 11:12:14', '13', '41', '47', '687', '古装剧', '更新至41集/共47集');
INSERT INTO `movie` VALUES ('1424', '爱回家之八时入席', '<div class=\"endtext\"><p>古晓臣（黎耀祥饰）任职的电视台正值多事之秋，管理层空降云飞飞（郭少芸饰）出任总经理进行大革新，晓臣负责监制的妇女节目首当其冲，新节目首天即遇意 外，晓臣随机应变，指派刚从会计部调来的秘书林小小（毛舜筠饰）上场顶替缺席的星级大厨，小小口才兼厨艺了得令节目爆红，晓臣威逼小小继续兼任节目主持， 小小讨价还价，以不解雇其发型师好友赵丽虹（汤盈盈饰）及固定上下班时间为交换条件，皆因小小上有比她年轻的孻叔林以默（陈国邦饰），下有同父异母的弟弟 林禾（吴伟豪饰），准时开饭是她的天职，工种转变后，这个女人仔耍尽法宝应付诸多要求的晓臣。相对事业正处于樽颈位的晓臣，步步为营，恐防飞飞派来当他副 导的殷欣（邵佩诗饰）是探子，谁料殷欣与小小一拍即合，两个女人更介入晓臣与老爸古力行（钟景辉饰）的感情，为古林两家带来了无法想象的冲击……</p></div>', '黎耀祥 毛舜筠 钟景辉 陈国邦 汤盈盈 胡渭康 马贯东 爱·回家之八时入席', '国语/粤语', '2016', '0', '/data/images/5702892916f50.jpg', '香港', '2016-06-22 00:11:24', '13', '57', '120', '685', '时装剧', '更新至57集/共120集');
INSERT INTO `movie` VALUES ('1425', '再见，老婆大人', '<div class=\"endtext\"><p>赵天材和妻子甄美仁因一件小事草率离婚，于是与老板黄松宁、同事龙小培同样沦为大龄失婚男。黄松宇因婚外情被前妻抓个正着而离婚；龙小培与90后富二代的婚姻纯粹不靠谱，属于闪婚闪离一族。离婚后，因为孩子、生活、工作、事业，赵天材与前妻总发生剪不断理还乱的纠葛，在恢复“自由”中，赵天材偶遇大学校花毕婷，几番来往，毕婷对赵天材心生好感。甄美仁在遇到中学同学柳金后，生活也风生水起，屡屡与成功男士见面约会，却被柳金捉弄得不轻。</p>\r\n<p>家庭解体后，梦想新生活的赵、甄二人，在历经挫折后，终于意识到原配的好，于是，决定复婚。同为失婚男，黄松宇最终也明白了婚姻的奥秘在于包容与珍惜；屌丝男龙小培事业终于有所起色，用进账第一笔钱给初恋柳金买了求婚戒指。三个失婚男终于找到生活的方向。 </p></div>', '霍思燕 杜江 王志飞 于越 许绍雄 何赛飞 赵文瑄 陈洁 康恩赫', '国语', '2016', '0', '/data/images/5753839d2b9e1.jpg', '大陆', '2016-06-20 22:20:10', '13', '33', '38', '685', '时装剧', '更新至33集/共38集');
INSERT INTO `movie` VALUES ('1426', '十二猴子第二季', '<div class=\"endtext\"><p>《十二猴子》根据1995年布鲁斯-威利斯主演的同名电影改编，是一部和《抗争》（Defiance）、《统治》（Dominion）类似的「后末世」（post-apocalyptic）题材剧集——这也是Syfy新总裁最钟情的题材，他上任后开发的所有常规剧集清一色是这种题材。原版电影的剧情描述为：（豆瓣电影）公元2035年，人类被12只猴子军研制的一种病毒侵袭，大部分人类都在这场病毒灾难中死亡，只有少数人侥幸逃生，但也只能在阴暗的地下，苟且偷生。科学家们决定派人穿越时光回到1996年追查12只猴子军的来历。囚徒詹姆斯-科尔（布鲁斯-威利斯）被挑选为志愿者。阴差阳错，科尔回到了1990年，当他向当时的人们描述未来的那场大灾难时，被当作精神病捉了起来并被医生凯瑟琳-雪莉（玛德琳-斯通）诊断为精神分裂症。科尔在病友病友杰弗里-戈因斯帮助下逃脱，回到了未来。因为没查清12只猴子军的来历，科尔再次被派回了1996年。科尔这次发现了12只猴子军的起源地在费城，他找到了医生凯瑟琳，二人一起展开了追查12只猴子军的冒险之旅。</p></div>', '阿曼达·舒尔 亚伦·斯坦福 泽利科·伊万内克 柯克·埃斯沃多 汤姆·诺南', '英语', '2016', '0', '/data/images/5705f30e79630.jpg', '欧美', '2016-06-20 16:45:53', '13', '9', '13', '688', '科幻剧', '更新至09集/共13集');
INSERT INTO `movie` VALUES ('1427', '权力的游戏第六季', '<div class=\"endtext\">故事发生在一个与我们自己的世界既相似又不似的世界——那里季节持续多年，有时甚至是几十年之久。故事的主线便发生在西方的形似不列颠岛的维斯特洛大陆上。由国王劳勃·拜拉席恩前往北地拜访他的好友——临冬城主暨北境守护艾德·史塔克开始，渐渐展示了这片国度的全貌。单纯的国王，耿直的首相，各怀鬼胎的大臣，拥兵自重的四方诸侯，全国仅靠着一根细弦维系着表面的和平，而当弦断之时，国家再度陷入无尽的战乱之中。而更让人惊悚的：那些远古的传说和早已灭绝的生物，正重新回到这片土地。</div>', '杰森·莫摩亚 伊恩·格雷 马克·艾迪 艾米莉亚·克拉克', '英语', '2015', '0', '/data/images/571e02f512b17.jpg', '欧美', '2016-06-20 16:37:43', '13', '9', '10', '690', '魔幻剧', '更新至09集/共10集');
INSERT INTO `movie` VALUES ('1428', '38师机动队', '<div class=\"endtext\"><p>讲述了首尔市政府机动队科长与骗子同心协力，为征收高额税金滞纳者的滞纳税金发生各种惊心动魄的故事。 </p></div>', '徐仁国 崔秀英 马东锡 赵宇振 宋钰宿 郑仁基 权泰元', '韩语', '2016', '0', '/data/images/576743d1bd48f.jpg', '韩国', '2016-06-20 09:16:18', '13', '2', '16', '685', '时装剧', '更新至02集/共16集');
INSERT INTO `movie` VALUES ('1429', '美女孔心', '<div class=\"endtext\"><p>讲述了一个生活崎岖坎坷的暖男律师安端泰，遇上了为就业准备的可爱女人孔心，两人刚开始每件事都会针锋相对，最后却不知不觉陷入了恋情的故事。</p></div>', '南宮珉 方敏雅 温朱莞 徐孝琳', '韩语', '2016', '0', '/data/images/5737c77a44cd3.jpg', '韩国', '2016-06-20 09:14:59', '13', '12', '16', '685', '时装剧', '更新至12集/共16集');
INSERT INTO `movie` VALUES ('1430', '狱中花', '<div class=\"endtext\"><p>讲述在监狱里出生的女主人公“玉儿”作为朝鲜律师制度人，以外知部为背景，为冤屈的百姓洗刷冤屈的故事。</p></div>', '陈世妍 高修 金秀妍 崔泰俊 朴珠美 郑俊浩 金美淑 全光烈', '韩语', '2016', '0', '/data/images/57258a8d634aa.jpg', '韩国', '2016-06-20 09:14:36', '13', '15', '50', '687', '古装剧', '更新至15集/共50集');
INSERT INTO `movie` VALUES ('1431', '对，就是那样', '<div class=\"endtext\"><p>讲述以在家族文化变幻的现代社会里的一个大家族通过描述一个人生活的意义，和收获爱情，克服矛盾等的幸福的模样展现出家族的珍贵和价值。</p></div>', '赵汉善 徐智慧 南奎丽 尹素怡 丁海寅 申素律 李顺载 金海淑', '韩语', '2016', '0', '/data/images/56c13e8bb6d38.jpg', '韩国', '2016-06-20 09:14:16', '13', '38', '60', '685', '时装剧', '更新至38集/共60集');
INSERT INTO `movie` VALUES ('1432', '五个孩子', '<div class=\"endtext\"><p>讲述单亲妈妈和单亲爸爸遇到第二次爱情，通过与家人之间的矛盾、和解、关爱寻找真正幸福的阳光温暖的家庭喜剧。</p></div>', '安在旭 苏幼珍 林秀香 申惠善 安宇延 权伍中 沈亨泽', '韩语', '2016', '0', '/data/images/56c90c131ee75.jpg', '韩国', '2016-06-20 09:13:57', '13', '36', '50', '691', '家族剧', '更新至36集/共50集');
INSERT INTO `movie` VALUES ('1433', '人在边缘粤语', '<div class=\"endtext\"><p>娥早年为救家人，诬陷凤杀人，凤不忿被冤枉，越柙而逃，失去踪影。 </p>\r\n<p>十八年後，娥长子光（刘青云）长大成人，任职惩教署，与女唱片骑师玲（陈法蓉）产生一段无花果式恋情，最後与华（黎美娴）共堕爱河。</p>\r\n<p>而凤之子龙（黎明）则误入歧途，被判入劳役中心，重遇光。龙故意与光为难，光有愧当年母亲所为，细心引导龙回归正途，重重波折後，龙终谅解光，二人和好，龙更与光妹宜（罗慧娟）相恋。 </p>\r\n<p>另一方面，凤重回香港寻找儿子，娥幼子基（林文龙）利欲薰心，先杀凤养子伟（戴志卫），更冒认是凤之子，藉此把握黑帮势力，无恶不作，还为灭口而错手杀死娥。 </p>\r\n<p>光见基丧心病狂， 决大义灭亲，与龙联手对付基……</p></div>', '黎明 刘青云 罗慧娟 黎美娴 林文龙 陈法蓉', '粤语', '1990', '0', '/data/images/5750dc2f04928.jpg', '香港', '2016-06-22 11:12:35', '13', '15', '18', '685', '时装剧', '更新至15集/共18集');
INSERT INTO `movie` VALUES ('1434', '亲爱的翻译官', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 法语系女硕士乔菲，从小立志做一名翻译。偶然一次机会她邂逅了翻译天才程家阳，而乔菲为躲避前男友高家明，误打误撞与程家阳结下梁子。不料在第二日的高翻院面试中，乔菲发现程家阳竟是自己的考官。两人带着对彼此的误会开始了一场较量。最终乔菲通过不懈努力，得到了程家阳的肯定；而两人在历经种种波折后，也终于确认了对彼此的感情。正当乔菲事业、爱情都如沐春风时，一场变故突袭而至，高家明也在此时再次介入乔菲的情感生活。种种现实和猜忌令乔菲与程家阳矛盾丛生，最终不得不分手。乔菲此后远走他乡进修法语，程家阳亦接受事业上的新挑战。两人各自历经成长，面临生死考验后，最终涅磐重生。乔菲终愿直面自己的感情，追求更高的职业理想；程家阳也找到了真正的自己。</div>', '杨幂 黄轩 高伟光 周奇奇 李溪芮 张云龙 王仁君', '国语', '2016', '0', '/data/images/57447cd22e3d1.jpg', '大陆', '2016-06-19 22:33:55', '13', '46', '35', '685', '时装剧', '更新至46集/共35集');
INSERT INTO `movie` VALUES ('1435', '怒江之战', '<div class=\"endtext\"><p>1942年，十万中国远征军溃败怒江，五万英灵长存边缅。时隔一年后，远征军军部得到密电，日军正在野人山中研制一种毒气弹，如果被日军得逞，怒江沿岸局势堪危，将直接影响到反法西斯战局。于是，军部决定派遣一支特别小分队，跨过怒江，潜入野人山阻止日军的阴谋。特别小分队的队员们克服野人山严苛的自然环境，步步为营，与日军斗智斗勇，展开了激烈而悲壮的抗争。与此同时，驻守怒江沿线的国军第36军与腾冲中共地下党紧密合作，营救人质，牵制日军，为小分队的行动提供了掩护和支援。几经坎坷磨难，特种小队二进二出野人山，终于在危机爆发关头摧毁日军的阴谋，为战局的扭转做出了重大贡献。不久后，远征军以野人山为突破口，拉开了滇西战略大反攻的序幕。</p></div>', '孙艺洲 贾青 赵毅新 李茂 王妍之', '国语', '2016', '0', '/data/images/5764c463807f1.jpg', '大陆', '2016-06-19 19:45:17', '13', '0', '0', '692', '网络剧', '全集/共43集');
INSERT INTO `movie` VALUES ('1436', '大仙衙门', '<div class=\"endtext\"><p>王元丰出身官宦世家，不爱钱财名利、不谙男女风月，却对解谜破案情有独钟。王元丰无意中救了被封印的狐仙小翠。小翠为报恩，嫁给他为妻。王元丰不开窍，不近女色，故两人同房不同床。小翠古灵精怪，常与元丰胡闹，让王母头疼不已。不料小翠的恶作剧，却阴差阳错帮助王家躲过王给谏的陷害，并且整治了贪官。王元丰因此得到百姓拥戴，当上县令。他为官正直清廉，在小翠的帮助下，破了很多奇案，百姓们称之为“大仙衙门”。好景不长，小翠因为时限已到，终究人狐殊途，离开元丰。深爱小翠的元丰失落病倒，小翠不忍，施法让元丰忘了自己，爱上钟氏女。一天，元丰偶然打开珍藏的画像，才想起从前小翠的样子，潸然泪下。</p></div>', '吴倩 王传君 陈奕 叶梓棠 李欣聪', '国语', '2016', '0', '/data/images/576651552120e.jpg', '大陆', '2016-06-19 16:01:26', '13', '0', '0', '692', '网络剧', '全集/共40集');
INSERT INTO `movie` VALUES ('1437', '魔女宝鉴', '<div class=\"endtext\"><p>该剧讲述了因诅咒变成白发魔女的公主与拥有热血青春的许浚之间的爱情与成长的奇幻浪漫史。</p></div>', '尹施允 金赛纶 郭时旸 李成宰 张熙珍', '韩语', '2016', '0', '/data/images/5737c7a160ba3.jpg', '韩国', '2016-06-19 10:49:26', '13', '12', '16', '685', '时装剧', '更新至12集/共16集');
INSERT INTO `movie` VALUES ('1438', '驱魔浪人第一季', '<div class=\"endtext\"><p>故事描述Kyle Barnes（Patrick Fugit）从小时候开始就遭到恶魔附身，长大成人后他决定踏上寻找答案的旅程，可是他很快发现这个「答案」有可能终结地球上所有的生灵。Philip Glenister扮演西弗吉尼亚一个福音派教会的Anderson牧师，嗜酒、好赌。他认为自己是上帝对抗邪魔的「圣战」中的一名战士。Gabriel Bateman扮演年仅八岁的Joshua Austin，住在城市的另一端。他可能被一个恶魔附身，而且与Kyle存在神秘的关联。Reg E. Cathey扮演俄亥俄州罗马市警察局长Giles，是Anderson的牌友。尽管他不像Anderson那样坚信「恶魔附身」之说，但他还是通过一系列事实对Anderson所说的「恶魔」有了清晰的认识。Julia Crockett扮演Kyle的母亲Sarah Barns，他让Kyle小时候生不如死。</p>\r\n<p>一开始人们认为她有精神疾病，但Kyle逐渐明白事情远比人们想象的要复杂。Wrenn Schmidt扮演Kyle的养姐姐Megan Holter，是个儿童心理学专家。她总是想帮助有心理问题的人恢复「正常」——特别是Kyle。她和Kyle一起经历了当年的家庭不幸，因此她也是个有人格缺陷的人。Kip Pardue扮演Megan的丈夫Mark Holter，是个小镇警察。他的脾气不好，因此经常闯祸。尽管Mark信教，但他同时是个怀疑论者，他从不相信「恶魔附身」这种鬼话。</p></div>', '派屈克·福吉特 琦普·帕杜 雷格·E.凯蒂 凯特·林恩·希尔', '英语', '2016', '0', '/data/images/574578d3223f0.jpg', '欧美', '2016-06-19 10:48:05', '13', '3', '10', '690', '魔幻剧', '更新至03集/共10集');
INSERT INTO `movie` VALUES ('1439', '最好的我们', '<div class=\"endtext\"><p>《最好的我们》是改编自八月长安同名小说的校园青春网络剧，由北京爱奇艺科技有限公司出品、小糖人文化传媒有限公司承制，刘昊然、谭松韵、王栎鑫联袂出演，刘畅导演，李嘉编剧。该剧讲述了耿耿和余淮同桌三年的故事。</p></div>', '刘昊然 谭松韵 王栎鑫 董晴 李家成', '国语', '2016', '0', '/data/images/570b54c11561f.jpg', '大陆', '2016-06-18 21:32:35', '13', '22', '24', '692', '网络剧', '更新至22集/共24集');
INSERT INTO `movie` VALUES ('1440', '性在有情粤语', '<div class=\"endtext\"><p>TVB最新喜剧《性在有情》由文伟鸿监制，大胆以“性”为题材，展现人对于性与婚姻及爱情的不同理解。张兆辉、陈敏之、江美仪、阮兆祥、许绍雄、沈震轩等在剧中饰演个性不同的汉子与淑女，谈情讲性，笑料百出。</p>\r\n<p>《性在有情》以轻松手法探讨男女、夫妻关系及性问题，剧中穿插大量与性有关的个案，涉及不同年龄层及不同背景的男女。首度合作的张兆辉与陈敏之分别饰演资深社工莫大雄和性治疗师林静儿，这对新婚夫妇虽具专业知识且助人为业，但自身却因老中幼同处一屋檐下而房事屡遭打击，窘境难于启齿。阮兆祥饰演的麻甩中佬甘昌及江美仪演绎的洁癖宅女莫小桃则是一对奇葩，二人完全相反的爱情观产生不少有趣的对比。此外，还有演技派的许绍雄及小宝饰演的一对惹笑的老夫少妻廖振祥和唐甜甜，型男沈震轩和靓女王君馨诠释的草食男杜德基与患性沉溺女孩钟瑛敏。</p>\r\n<p>剧中几对男女均面临种种千奇百怪的闺房问题，解决“棘手问题”的方法则令剧集笑料百出。文伟鸿表示，其中描写的现代男女、夫妻关系，均为现今都市人的写照，定必引起观众共鸣，而“性”亦是维系爱情与婚姻的其中一道重要桥梁，而非难于启齿的禁忌。</p></div>', '张兆辉 陈敏之 阮兆祥 许绍雄 陈嘉佳 沈振轩', '粤语', '2016', '0', '/data/images/57529757493b0.jpg', '香港', '2016-06-18 09:44:19', '13', '15', '20', '692', '网络剧', '更新至15集/共20集');
INSERT INTO `movie` VALUES ('1441', '三八线', '<div class=\"endtext\"><p>李长顺（张国强 饰）在鸭绿江边诞生长大，某日，他深爱的土地和赖以生存的村庄遭到了美军飞机的轰炸，往日宁静的村庄霎时间陷入一片火海，父老乡亲们的生命如同草介一般脆弱，转眼间就飞灰湮灭。目睹这一切的李长顺悲愤交加，他加入了志愿军，要上前线为国家效力，为乡亲们报仇。</p>\r\n<p>李长顺和战友们共同进退，尝尽了人间苦楚，亦携手经历了无数个命悬一线的危机关头，彼此之间结下了异常深厚的友谊，然而，无情的战争还是将他们接连从李长顺的身边夺走。心中怀揣着仇恨，李长顺永远都是第一个挺身而出拼杀在最前线上，他用他的汗水和鲜血，筑起了新中国璀璨的未来。</p></div>', '张国强 王挺 王学圻 曹曦文 汪裴 刘世龙 张洪睿', '国语', '2016', '0', '/data/images/5749caaf04c3d.jpg', '大陆', '2016-06-17 14:10:43', '13', '0', '0', '693', '战争剧', '全集/共38集');
INSERT INTO `movie` VALUES ('1442', '怪松镇第二季', '<div class=\"endtext\"><p>故事描述特工处探员Ethan Burke来到乡村小镇Wayward Pines（即本剧剧名）寻找两名神秘失踪的联邦探员。他没有得到想要的答案，反而遇到了更多的问题。这个地方就像有某种魔力一般，Ethan距离真 相越近，就越丧失自我——就连他的性格都变了。他不得不面对可怕的现实：他可能永远无法活着离开这地方。</p></div>', '杰森·帕特里克 尼姆拉特·考尔 汤姆·斯蒂文斯', '英语', '2016', '0', '/data/images/57634d094d12d.jpg', '欧美', '2016-06-17 09:12:38', '13', '4', '10', '688', '科幻剧', '更新至04集/共10集');
INSERT INTO `movie` VALUES ('1443', '是！尚先生', '<div class=\"endtext\"><p>该剧主要讲述了风尚集团继承人尚铂燃为找出母亲离世的真相而秘密潜入自家时尚杂志社“风尚集团”，并因此遭遇一段爱情与事业双重挑战的故事。</p>\r\n<p>风尚集团继承人尚铂燃为找出母亲离世的真相而秘密潜入时尚杂志社，在偶遇天真乐观的职场新人鹿小葵后，二人阴差阳错成为了职场对手兼同居室友，相互“厮杀”的同时对彼此逐渐产生好感，最终一起完成“复仇”大计并收获爱情。</p></div>', '陈学冬 欧阳娜娜 任言恺 邬君梅 翁虹 张可昀', '国语', '2016', '0', '/data/images/57634d19478c9.jpg', '', '2016-06-17 09:07:28', '13', '8', '28', '685', '时装剧', '更新至08集/共28集');
INSERT INTO `movie` VALUES ('1444', '好运罗曼史', '<div class=\"endtext\">[剧 名]: 好运罗曼史<br />\r\n[播 送]:韩国MBC<br />\r\n[类 型]:MBC水木剧 &nbsp;<br />\r\n[首 播]:2016年05月25日<br />\r\n[时 间]:每周三四晚间8点45分各播放一集 <br />\r\n[接 档]:Goodbye Mr.Black<br />\r\n[导 演]:金庆熙《儿子们》《荣耀之歌》《HERO》<br />\r\n[编 剧]:崔允娇<br />\r\n[主 演]:黄正音 柳俊烈 李洙赫 李清娥<br />\r\n[制 作]:凤凰天使TSKS韩剧社16年韩流冲击第35波 <br />\r\n[集 数]:16集<br />\r\n[简 介]: 讲述的是十分迷信的女生与专注于数学与科学的理工科男生相遇、相恋的故事。</div>', '黄静茵 柳俊烈 李洙赫 李清娥', '韩语', '2016', '0', '/data/images/574666211d6d0.jpg', '韩国', '2016-06-17 09:03:51', '13', '8', '16', '685', '时装剧', '更新至08集/共16集');
INSERT INTO `movie` VALUES ('1445', 'Master - 面条之神', '<div class=\"endtext\"><p>根据漫画家朴寅权的同名漫画《面条之神》改编，刻画为了复仇钻研面条技艺的男人的故事。</p></div>', '千正明 郑柔美 赵宰贤 李相烨 孔升妍 李日花', '韩语', '2016', '0', '/data/images/572189a99fc3f.jpg', '韩国', '2016-06-17 09:03:35', '13', '16', '20', '685', '时装剧', '更新至16集/共20集');
INSERT INTO `movie` VALUES ('1446', '戏子', '<div class=\"endtext\"><p>以乘着韩流的春风迅速成长的音乐产业为背景，讲述了曾经是韩国最大歌手娱乐公司KTOP的理事，现在是韩国最不堪入目的新设立芒果娱乐公司代表的成功史。</p></div>', '池晟 李惠利 姜敏赫 蔡贞安', '韩语', '2016', '0', '/data/images/57182bdac7527.jpg', '韩国', '2016-06-16 09:39:17', '13', '17', '16', '685', '时装剧', '更新至17集/共16集');
INSERT INTO `movie` VALUES ('1447', '玛嘉烈与大卫.绿豆篇', '<div class=\"endtext\"><p>《玛嘉烈与大卫系列 绿豆》于4月11日晚上11时首播，之后逢星期一、二播映。一向深受广大书迷热捧，由新晋作家南方舞厅编写的《玛嘉烈与大卫》系列中，ViuTV锁定改篇当中的《绿豆》，并邀请到林保怡 (饰演大卫)、周家怡 (饰演玛嘉烈)、廖碧儿 (饰演Diamond)、潘灿良 (饰演赵子龙) 以及汤怡 (饰演Candy)。</p>\r\n<p>大卫与玛嘉烈相识一年多， 大卫鼓起勇气向玛嘉烈提出同居的要求，玛嘉烈认为大卫现在租的地方不够两个人住，提出以她的居所作为彼此的安乐窝，但大男人的大卫却不希望搬进她的住处。最后二人达成共识，一起重新租一个空间大一点，又近玛嘉烈上班的地方。二人同居之后发生了大大小小有关生活习惯的争拗，却又令感情更进一步。</p></div>', '林保怡 周家怡 廖碧儿 汤怡 潘灿良', '粤语', '2016', '0', '/data/images/570c8cb18e470.jpg', '香港', '2016-06-22 11:11:56', '13', '0', '0', '685', '时装剧', '更新至21集');
INSERT INTO `movie` VALUES ('1448', '白熙回来了', '<div class=\"endtext\"><p>讲述杨白熙洗白身份，回到了阔别18年之久的家乡——一座安静的小岛之后展开的故事。</p></div>', '陈智熙 姜艺媛 金圣武 崔弼立', '韩语', '2016', '0', '/data/images/575626d483f2d.jpg', '韩国', '2016-06-15 09:19:31', '13', '0', '0', '685', '时装剧', '全集/共4集');
INSERT INTO `movie` VALUES ('1449', '大撲/大发', '<div class=\"endtext\"><p>讲述的是拥有王室血统、流落民间的平民王子与作为王子出生、拥有一切的王子之间关于爱、命运、王位之间展开的斗争，是2003年播出的《洛城生死恋》的古装版本。</p></div>', '张根硕 林智妍 尹珍熙 吕珍九 崔民秀 全光烈', '韩语', '2016', '0', '/data/images/56f9f03ceda9f.jpg', '韩国', '2016-06-15 09:18:51', '13', '0', '0', '687', '古装剧', '全集/共24集');
INSERT INTO `movie` VALUES ('1450', '吸血鬼侦探', '<div class=\"endtext\"><p>该剧主要讲述了某一天突然变成吸血鬼的私营侦探尹山(李准)，通过解决委托人的多样事件，从而揭开自身过去秘密的故事。</p></div>', '李准 吴政世 李世英 金允慧 李清娥 赵福来', '韩语', '2016', '0', '/data/images/570b874ea2539.jpg', '韩国', '2016-06-14 09:21:46', '13', '0', '0', '685', '时装剧', '全集/共12集');
INSERT INTO `movie` VALUES ('1451', '后菜鸟的灿烂时代', '<div class=\"endtext\"><p>为了挽救MUSE，董事长沈岳峰(陶传正饰)特地延揽传奇的企业经理人纪文凯(炎亚纶饰)担任公司CEO，而纪文凯上任后，第一个和他对上的就是“青梅竹马”锺雨棠(曾之乔饰)。</p>\r\n<p>两人梁子从小开始结下，学生时代每次都是锺雨棠占上风，出社会后，锺雨棠进入人人羡慕的Muse彩妆集团工作，纪文凯打零工打到国外去了，没想到风水轮流转，纪文凯摇身一变成为CEO，锺雨棠却被调到“废材处理中心”，成为业务三课的一员！两人又该如何相处？这对爱鸟是否找到他们职场、情场的春天？</p></div>', '曾之乔 炎亚纶 李运庆 茵芙 張洛偍 于子育', '国语', '2016', '0', '/data/images/56e656ecb5a44.jpg', '台湾', '2016-06-13 20:51:48', '13', '15', '20', '694', '偶像剧', '更新至15集/共20集');
INSERT INTO `movie` VALUES ('1452', '聂小倩', '<div class=\"endtext\"><p>《聂小倩》（英语：Nie Xiaoqian），原剧名《抢救21克的爱情》，2016年台湾偶像剧，本剧获得中华民国文化部104年补助高清电视节目一般型连续剧类新台币550万元、5.1声道150万元。由陈庭妮、李铭顺、莫子仪、纪培慧领衔主演。2015年3月开拍，中视于2016年2月21日晚上10点首播，将接档《必娶女人》，卫视中文台于2016年2月27日晚上10点播出。该片叙述聂小倩（陈庭妮饰）穿越500年，来到现代碰上转世的宁采臣（莫子仪饰），以及心里一直挂念她的道士燕赤霞（李铭顺饰），展开人鬼三角恋，剪不断、理还乱时，更遇上树妖姥姥（刘松仁饰演）的绝地复仇。</p></div>', '李铭顺 陈庭妮 莫子仪 纪培慧 龙劭华 王乐妍 张书伟 王书乔 谢翔雅', '国语', '2016', '0', '/data/images/57272ef00e768.jpg', '台湾', '2016-06-13 20:51:27', '13', '17', '20', '694', '偶像剧', '更新至17集/共20集');
INSERT INTO `movie` VALUES ('1453', '传教士第一季', '<div class=\"endtext\"><p>《传教士》改编自Vertigo公司的漫画，讲述一名德州传教士卡斯特穿越全美，寻找早已废弃职责的上帝，让他重拾往日责任的故事。这位名叫卡斯特的传教士被天使与魔鬼混合的超自然实体“创世纪”(Genesis)附身，能够号令那些听懂他话的人，一同寻找上帝的还有他昔日的女友和一名酗酒的爱尔兰吸血鬼。在路上他们会遇到许多超自然敌人，也需要克服很多困难。</p></div>', '多米尼克·库珀 鲁丝·内伽', '英语', '2016', '0', '/data/images/575626d04c81b.jpg', '欧美', '2016-06-13 20:51:07', '13', '0', '0', '690', '魔幻剧', '更新至03集');
INSERT INTO `movie` VALUES ('1454', '余罪2', '<div class=\"endtext\"><p>“那些千奇百怪的犯罪，形形色色的罪犯，成了我生活的一部分。我不得不像他们一样思考，不得不像他们一样行事，因为我无时无刻都在绞尽脑汁地想着，如何抓住他们……” 警校学生余罪从一场特殊的选拔开始，进入了生活和社会矛盾之中，成为一个卧底……2014年2月，由常书欣所撰的小说《 余罪》冲入百度搜索风云榜小说总榜前百，其中的言情情节更为小说增加了许多看点。主角是卧底？怎么样，够给力了吧？更何部在卧底期间他还陷入了一段缠绵绯恻的爱恋？更何况我们还有俊男美女出演------《家有儿女》中的张一山出演主角余罪，吴优、孙佳雨将出演本剧的女主角。</p></div>', '张一山 徐冬冬 吴优 张锦程 于笑', '国语', '2016', '0', '/data/images/5744ff6186865.jpg', '大陆', '2016-06-12 15:40:58', '13', '0', '0', '692', '网络剧', '全集/共12集');
INSERT INTO `movie` VALUES ('1455', '吉祥天宝', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 大明天启年间，京城，若楠听说父亲要把自己许配给王爷的次子朱天祥，表明她想嫁的是朱天宝！朱天宝不喜欢若楠，明知若楠暗中跟踪，故意流连青楼。杜三娘带徒弟孟小蝶从江南来京城送药，天宝偶遇来青楼送药的孟小蝶，天宝误以为小蝶是青楼女子，捉弄并借机强吻了小蝶，若楠见此幕生气离开。天宝去苏州寻找念念不忘的小蝶，侯兴国在天宝必经之路设伏将天宝扔下山崖，以为天宝必死无疑。山崖下，天宝被梦老爹救活却失去了记忆。天祥暗中在老王爷的茶中下毒，老王爷死后。天祥如愿继承王位。恢复记忆的天宝被天祥引入紫禁城，御林军将其围住，天宝蒙冤入狱。问斩当天，天宝急中生智，用计使皇帝迫不得已放了天宝。崇祯继位皇帝后，册封朱天宝为九品王爷，他的传奇故事也流进了市井乡野。</div>', '金起范 赵丽颖 朱梓骁 陈昱霖 廖碧儿 许明虎 王海祥 徐冬梅', '国语', '2016', '0', '/data/images/5757e00be9f6d.jpg', '大陆', '2016-06-11 10:25:56', '13', '0', '0', '692', '网络剧', '全集/共40集');
INSERT INTO `movie` VALUES ('1456', '格林第五季', '<div class=\"endtext\"><p>小红帽，睡美人，白雪公主和青蛙王子，甜美的童话中其实包裹着鲜血淋漓的罪案。在调查一桩女大学生神秘被害的案件时，春风得意的年轻警探Nick Burkhardt从姑妈处得知，自己是一个古老家族硕果仅存的后裔之一。这个家族拥有一个耳熟能详的名字--\"格林\"。\"格林\"们的使命就是用自己的火眼金睛以及智慧和勇气来维护人类与这些神秘生物之间的界限。 NBC已续订《格林》第五季。</p></div>', '大卫·君图力 罗素·霍恩斯比 比茜·图诺克 塞拉斯·威尔·米切', '英语', '2015', '0', '/data/images/56ad6b3ddd267.jpg', '欧美', '2016-06-07 09:10:26', '13', '0', '0', '690', '魔幻剧', '全集/共22集');
INSERT INTO `movie` VALUES ('1457', '爱情来的时候2粤语', '<div class=\"endtext\"><p>《爱情来的时候2德国篇》由佘诗曼及马国明主演。故事承接上辑的剧情，Crystal（佘诗曼 饰）与Oscar（马国明 饰），是上司与下属的关系，也是一对关系甜蜜的情侣。Crystal与Oscar一起出发到德国法兰克福公干，期间由于需要留在当地数天以等候客户的回复，是以得到了突如其来的几天甜蜜假期。</p>\r\n<p>在短短的假期中，Crystal兴奋地带着Oscar于这个自己当年留学的地方到处游览，也带Oscar探访昔日的师长，又到访自己向往的浪漫胜地。师长的叮咛、浪漫的气氛，令Crystal对二人的幸福未来掀起更热切的期待，心里更燃起待嫁新娘的满满幸福感。</p>\r\n<p>然而另一边厢，Oscar似乎在旅途中更感觉到二人现实间的距离，不是不想给对方幸福，而是不知自己是否有能力做得到。这一直被自己忽略的压力像是刹那间无限放大，直到现实一次又一次唤醒他有关自己与Crystal二人之间的距离，让他不得不考虑到Crystal值得找到一个比自己更好的人。到底爱她是仍要努力把她留在自己身边﹖还是应该为让对方能得到更大的幸福而狠心放手？</p>\r\n<p>爱情，最终能奏出幸福乐章？还是，到了终结的时候？</p></div>', '佘诗曼 马国明 黄翠如 洪永城 周柏豪', '粤语', '2016', '0', '/data/images/5749ca9f6ad07.jpg', '香港', '2016-06-04 10:47:39', '13', '2', '2', '692', '网络剧', '更新至02集/共2集');
INSERT INTO `movie` VALUES ('1458', '奇妙的时光之旅', '<div class=\"endtext\"><p>十年前，彭振东与谢佳欣邂逅并闪婚。但一场事故让彭家一夜崩塌。大难不死的彭振东改头换面变成韩若飞，他希望通过可以穿越时空的照相机救活死去的妻子，并还原当年事故的真相。</p></div>', '林心如 贾乃亮 徐璐 金圣柱 吴恙 李强', '国语', '2016', '0', '/data/images/5720e71d41f4b.jpg', '大陆', '2016-06-03 09:20:54', '13', '0', '0', '685', '时装剧', '全集/共24集');
INSERT INTO `movie` VALUES ('1459', '少林问道', '<div class=\"endtext\"><p>明朝嘉靖年间，嘉靖帝昏庸无能，朝廷被严党把持，内部朝政腐败，沿海倭寇横行，整个朝野被牢牢掌控在严党党魁——奸相严嵩之子严世蕃的手中，明朝危在旦夕。少林寺观海方丈隐居达摩洞后，少林僧众既心忧国难，又对前程一片迷茫。少林新收的俗家弟子程闻道、高剑雄、海大力与严氏父子有灭门之仇，因天分极高，被分别安排到达摩堂，药局和般若堂苦修武功、医道和禅学。为了达到控制少林为己所用的目的，严世藩借平倭之名调走了少林武僧团，又勾结少林叛徒疯头陀霸占少林，把一方禅林净土变成了人间炼狱。练功有成的程闻道等人在观海大师的暗中帮助下，带领少林僧众与疯头陀和严党周旋，最后铲除了疯头陀，并协助朝中的正义之士扳倒了严氏父子。</p></div>', '周一围 郭京飞 郭晓婷 是安 何赛飞 冯嘉怡 张治坚 周野芒', '国语', '2016', '0', '/data/images/574fea26d0249.jpg', '大陆', '2016-06-02 16:11:30', '13', '0', '0', '684', '仙侠剧', '更新至06集');
INSERT INTO `movie` VALUES ('1460', '绿箭侠第四季', '<div class=\"endtext\"><p>在一次惨烈的船难之后，身价亿万的花花公子奥利弗·奎因失踪了五年并被认定死亡，直到他被发现在一个偏远的太平洋小岛上生还了下来。当他回到位于星城的家时，迎接他的有他充满爱心的母亲莫伊拉，感情深厚的妹妹西娅，还有他最好的朋友汤米。但他们发现，奥利弗经过岛上严酷的生活，已经改变了许多。奥利弗隐藏了改变后的自我，想要弥补自己年轻时的所作所为。更主要的，他想要与前女友萝瑞尔·兰斯和好。在他重新与当初亲近的人联系上后，奥利弗秘密的给自己了一个新身份--一个名叫绿箭的义警，-来为自己家族所犯错误进行补偿，与社会的丑恶战斗，保护星城的荣耀。白天，他仍扮演以前的自己，一个有钱有势、没心没肺的情圣，由他忠实的私人司机兼保镖约翰·迪戈陪伴--而在夜晚的掩护下，他则小心翼翼地以自己的新身份行事。但是，兰斯的父亲昆汀·兰斯探长，决心要逮捕这个在他的城市中行动的义警。同时，奥利弗自己的母亲，莫伊拉，对于那次致命船难的了解远远超过她假装的那样--比奥利弗能够想象到的更加残忍。</p></div>', '斯蒂芬·阿美尔 凯蒂·卡西迪 薇拉·贺兰德 苏珊娜·汤姆森', '英语', '2015', '0', '/data/images/56a0b22375380.jpg', '欧美', '2016-06-01 16:33:29', '13', '0', '0', '688', '科幻剧', '全集/共23集');
INSERT INTO `movie` VALUES ('1461', '邻家律师赵德浩', '<div class=\"endtext\"><p>讲述大有前途的出色律师赵德浩因内部举报检察机关不正之风，瞬间失去拥有的一切，跌入无尽深渊后，进而展开“人生第二幕”的故事。</p></div>', '朴新阳 姜素拉 柳秀荣', '韩语', '2016', '0', '/data/images/56f9f0844f362.jpg', '韩国', '2016-06-01 14:14:34', '13', '0', '0', '685', '时装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1462', '宠物情缘', '<div class=\"endtext\"><p>任职警界的硕（古天乐），做事得过且过，其被动、消极的态度为警犬Rocky所鄙视，更处处刁难他，教他吃尽不少苦头。后Rocky在一次行动中受伤，硕于心不忍，决定收养它。</p>\r\n<p>硕邻居朗（宣萱）为爱犬之人，对硕待犬只的态度极度不满，因此当爱犬东东失踪时，郎认定乃硕所为，二人关系势成水火。时一只自来狗豆豆突然出现，弥补了郎的伤痕。不料，Rocky竟与豆豆共堕爱河，但见主人互不瞅睬，两只精灵狗儿顿觉头痛。</p>\r\n<p>郎好友珊（郑秀文）乃硕的房东，初与硕针锋相对，后在失恋失业时，得硕鼓励帮助，二人不知不觉间发展成情侣。珊转工后获新上司赏识，却因专注工作与硕渐生磨擦，终分手收场。硕在珊离港进修后，助郎收养被遗弃的小动物，二人日久生情。一年后，珊学成归来，郎无意中发现她对硕仍未忘情，惊觉自己横刀夺爱，内心矛盾，不知如何选择。</p></div>', '古天乐 郑秀文 宣萱 李珊珊 罗乐霖', '国语/粤语', '1999', '0', '/data/images/572ab5d79d3da.jpg', '香港', '2016-05-31 23:56:49', '13', '20', '20', '685', '时装剧', '更新至20集/共20集');
INSERT INTO `movie` VALUES ('1463', '柠檬初上', '<div class=\"endtext\"><p>该剧讲述了一群都市青年男女在爱情、亲情、友情的盘错纠结中挣扎与救赎的故事。</p>\r\n<p>左再骏与郑磊是大学好友，两个男人却有一个共同的八岁非亲生“女儿”妙妙。小檬是再骏与郑磊大学时代的爱慕对象，也是妙妙的妈妈，八年前，小檬去了美国留学后音讯全无。\r\n&nbsp;&nbsp;&nbsp; 八年后，小檬再次出现，再骏有太多的不谅解，小檬用行动感动再骏，再骏终于同意让小檬将妙妙带回上海。回到上海后郑磊与小檬走的很近，再骏醋意大发，不久后也来到上海，两个爸爸成了情敌，各自展开攻势，笑料百出。</p>\r\n<p>再骏意外碰到大学同学孙妮，孙妮大胆追爱，小檬心生醋意却不敢正视内心。郑磊看穿小檬内心所属主动退出，并遇到了麻辣女警花童丹，童丹的率真开朗感动了郑磊。最终小檬的秘密被慢慢揭开，再骏的真诚告白感动了小檬，无论将来发生了什么，两人都决定坚定地走下去。</p></div>', '刘恺威 古力娜扎 孙艺洲 康宁 朱泳腾 张杨果而', '国语', '2016', '0', '/data/images/573082ea4badd.jpg', '', '2016-05-31 20:42:35', '13', '0', '0', '685', '时装剧', '全集/共42集');
INSERT INTO `movie` VALUES ('1464', '那年青春我们正好', '<div class=\"endtext\"><p>高中时期，“叛逆少年”肖小军（郑恺饰）对“校花”刘婷（刘诗诗饰）一见钟情，却因父辈的感情纠葛不得不忍痛分手。毕业后，肖小军下海经商，刘婷则如愿考入美院，两个人隔阂差异越来越大。</p>\r\n<p>时过境迁，刘婷嫁人，然而婚后的刘婷并不幸福，当她发现丈夫郭海兵在欲望的驱使下，为了金钱不择手段迷失自我后，毅然选择了离婚。刘婷已离异，并仍然在为自己的梦想努力打拼，而肖小军则变成了年轻有为的高富帅，此时的肖小军在成功后一直没有忘记刘婷。</p>\r\n<p>毕业之后各奔东西的肖小军和刘婷在机缘巧合之下再次相遇在都市职场之中，两人的感情看似是两条永不相交的平行线。却因肖小军的坚持而逐渐有了交集。</p></div>', '刘诗诗 郑恺 种丹妮 刘洁 刘冬沁 王超 李浩轩', '国语', '2016', '0', '/data/images/5731d4e65cd7e.jpg', '大陆', '2016-05-31 20:21:57', '13', '0', '0', '685', '时装剧', '全集/共39集');
INSERT INTO `movie` VALUES ('1465', '隔离死城第一季', '<div class=\"endtext\">当一种致命对传染病在亚特兰大爆发时，很快大范围的城区被隔离，隔离区里的人只能靠自己活下去。其中一对相爱的人被戏剧性的分开，由此反映隔离区里的社会百态，人性的变化和伪英雄的出现。该剧改篇自比利时原创剧，Carl Joos创作。</div>', '克里斯·伍德 克劳迪娅·布莱克 汉娜·曼根·劳伦斯 大卫·吉雅西', '英语', '2016', '0', '/data/images/572ab4ca24c5b.jpg', '欧美', '2016-05-31 18:56:06', '13', '7', '13', '690', '魔幻剧', '更新至07集/共13集');
INSERT INTO `movie` VALUES ('1466', '疑犯追踪第五季', '<div class=\"endtext\">CBS续订疑犯追踪 第五季。本季只有13集，为最终季。</div>', '吉姆·卡维泽 迈克尔·爱默生 艾米·阿克 莎拉·夏希', '英语', '2016', '0', '/data/images/5729881279658.jpg', '欧美', '2016-05-31 18:55:49', '13', '9', '13', '686', '警务剧', '更新至09集/共13集');
INSERT INTO `movie` VALUES ('1467', '廉政行动2016', '<div class=\"endtext\"><p>由廉政公署与TVB联合制作的电视剧集《廉政行动2016》，全新一辑五集均取材自真实个案。有别于过往“廉政系列”剧集多以单元形式播映，《廉政行动 2016》五集却有连贯性，幕后大旗手－ 导演邱礼涛细谈构思。&nbsp; 五集故事涉及多宗廉署以往查办过的真实贪污案件，包括区议会贿选案、珠宝公司行贿导游案、银行贷款部贪污案、走私烟草案、上市公司诈骗案等。今辑演员阵容鼎盛，包括马国明、黎诺懿、唐诗咏、陈展鹏、郭嘉文、张国强、江美仪、傅嘉莉、姚子羚、郑丹瑞、姜大卫、叶翠翠、陈嘉辉、雪妮、杨诗敏等。</p>\r\n<p>剧中饰演廉署调查员的“马明”、展鹏与诺懿，以及演绎区议会补选候选人的郑丹瑞、珠宝公司创办人的“John哥”姜大卫等演员，率先披露各集的内容大纲、误入行贿歧途的原因……制作特辑还会送上剧集精彩片段，以及幕后花絮镜头。</p>\r\n<p>剧中一众干劲十足的廉署调查员“马明”、诺懿、诗咏、展鹏及新人郭嘉文，分享彼此角色关系之外，还细谈拍摄困难及感受。其中诺懿完成某场戏份后感到晕眩；嘉文则为剧集献出“第一次”，究竟怎么回事？廉署于1974年成立之前，香港社会贪污成风，见证廉署逐步发挥“肃贪倡廉”功能的张国强、John哥、雪妮等前辈演员，忆述廉署如何改变多代港人对于公平、廉洁的价值观。</p></div>', '陈展鹏 马国明 江美仪 傅嘉莉 蒋家旻 唐诗咏 黎诺懿 郭少芸 姚子羚', '国语/粤语', '2016', '0', '/data/images/5712e49b8bead.jpg', '香港', '2016-05-29 10:20:03', '13', '0', '0', '686', '警务剧', '全集/共5集');
INSERT INTO `movie` VALUES ('1468', '犯罪心理：国境之外', '<div class=\"endtext\"><p>《犯罪心理：国境之外 Criminal Minds: Beyond Borders》为《犯罪心理》的衍生剧，主要围绕FBI探员如何帮助国外居住的美国公民解决问题而展开。</p>\r\n<p>Gary Sinise：饰演Jack Garrett，在FBI待了20年，刚刚被指派负责这个部门。Tyler James Williams：饰演队中的技术分析员Monty，是个讨喜而又聪明的角色，平常在家工作，他对陷入困境的家庭以事无巨细的方式处理，协助队伍找到被遗留的线索，以及找到远在海外的真凶。Daniel Henney：Matt Simmons，不仅是一位在国外长大的军人还是一个居家好男人，喜欢探索和融入不同的文化，最重要的是他的侧写能力对整个团队致为关键。</p></div>', '安娜·冈 丹尼尔·海尼 加里·西尼斯 泰勒·詹姆斯·威廉姆', '英语', '2016', '0', '/data/images/56ec1f49a3023.jpg', '欧美', '2016-05-29 09:50:52', '13', '10', '10', '686', '警务剧', '更新至10集/共10集');
INSERT INTO `movie` VALUES ('1469', '火线下的江湖大佬国语', '<div class=\"endtext\"><p>何其爽（郑则仕饰）与柳卓南（黄光亮饰）从儿时好友至登上江湖两大头号人物，一路上风雨同路同甘共苦，后卓南因杀警入狱，著其爽照顾情妇苏佑琳（陈炜饰），二人竟瞒卓南暗渡陈仓结为夫妇，其爽随即退下火线转战餐饮业，与大姨苏佑妙（苑琼丹饰）和前妻所生的女儿何宽心（岑丽香饰）过著平凡日子。谁料卓南早释并投靠其爽，令兄弟情大受考验，更导致女儿宽心与男朋友廖守基（杨明饰）感情破裂，一头家濒临四分五裂，卓南更拉拢其爽东山再起，助他卷土重来，卓南的前妻叶芳菲（樊亦敏饰）失踪多年后再度出现，并揭开了一段不为人知的秘密，连累各人卷入一场风声鹤唳的江湖恩怨……</p></div>', '郑则士 陈炜 黄光亮 苑琼丹 杨明 岑丽香 陈山聪 李成昌', '国语', '2016', '0', '/data/images/571e1e5e2cfd5.jpg', '香港', '2016-05-29 09:50:35', '13', '0', '0', '685', '时装剧', '全集/共25集');
INSERT INTO `movie` VALUES ('1470', '火线下的江湖大佬粤语', '<div class=\"endtext\"><p>江湖是什么地方？有恩情、有仇怨、有结义、有背叛，满是刀光剑影。如何得知谁会助你一把，或在背后刺你一刀？只有退隐江湖，回归家庭，才能享受最真摰的温暖与安心。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">兄弟情谊不敌爱情 弟夺兄嫂退隐江湖</span></p>\r\n<p>何其爽(郑则士饰)是旧区街坊饭店老板，凭借精湛厨艺和“招牌”美食“豆腐火腩饭”赢得街坊称颂，还养活了一家四口，包括妻子苏佑琳(陈炜饰)、女儿何宽心(岑丽香饰)，及同住的大姨苏佑妙(苑琼丹饰)。其爽待人和善、笑脸迎人，原来廿多年前竟是江湖上名号响当当的“鬼见愁”，而其“大佬”，更是江湖上无人不识、绰号“过山乌”的柳卓南(黄光亮饰)！</p>\r\n<p>二人“兄弟”情深，当年凭狠劲在江湖上打出一片天。二人早年成家，卓南虽有娇妻，却处处留情；其爽对爱情专一，可惜发妻在女儿三岁时病逝，其爽为照顾爱女，暗萌退意。是时机，亦是天意，卓南于一次走私行动中误杀警察，终被缉捕归案……</p>\r\n<p>入狱前，卓南吩咐其爽接掌一切，并照顾自己最宠爱的情妇苏佑琳。其爽不负所托，却与佑琳日久生情，加上见佑琳真心疼惜宽心，其爽思前想后，不惜犯下弟夺兄嫂的江湖大忌，从此，与佑琳退隐江湖，开设“咀爽爽饭店”，过平淡生活。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">受冤廿载重获自由 兄弟协力重返江湖</span></p>\r\n<p>卓南被判三十年牢狱，其爽未忘兄弟情，每年都会前往探望，只是其爽心存歉疚，一直未有勇气对卓南坦白与佑琳之间的事。转眼二十年，当年杀警真凶突然自首，卓南得以提早出狱，却使其爽与佑琳的安稳生活掀起波澜。</p>\r\n<p>卓南盛年虚渡，但见其爽廿年来不离不弃，认定他比亲兄弟还要忠贞可信，未料其爽竟与佑琳瞒着自己结成夫妇，一时难以接受兄弟情义不敌男女之情，兄弟决裂。其爽不敢奢望原谅，只求卓南放过妻女。卓南权衡利害，终决定不作追究。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">三角关系梳理还乱 回头却陷家族仇怨</span></p>\r\n<p>其爽的女儿宽心幼时体弱，遂跟其爽好友高卡(李成昌饰)学习舞狮强身健体，病症果然不药而愈。宽心长大后虽成为投资顾问，却对醒狮愈发感兴趣，更成为龙狮队的中坚成员。宽心与大师兄高佳(陈山聪饰)一同成长，佳暗恋宽心多年，可惜神女无心，佳唯有把感觉藏在心中。</p>\r\n<p>一天，宽心遇上当警察的廖守基(杨明饰)，二人萌生爱意开展感情之际，方知道守基父亲廖国安(罗乐林饰)当年脚伤被逼退下警队前线，全拜卓南所赐，国安对卓南一帮人痛恨不已，得知何家背景后大力反对儿子与宽心交往。在旁默默守候的佳，眼看宽心在痛苦中挣扎，决定向她表白……</p>\r\n<p>宽心面对佳与守基难作抉择，暂且放下感情事，决以女子身份在男人把持的舞狮界闯一番成就，将不可能变成可能。宽心自信只要情够坚贞，就可以冲破一切障碍，与守基走到终点。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">江湖界限辽阔无边 极力奔逃为求自在</span></p>\r\n<p>其爽的心结虽解开，未料卓南却利用其爽的歉疚之情，要其爽助他东山再起，其爽内心矛盾不已。为报答南的宽容，终决定重出江湖，却不经不觉跌入南的圈套。佑琳早看穿卓南的企图力劝其爽勿再踏江湖，夫妻多次争执，佑琳却不愿离开自保，决定与夫共同进退。</p>\r\n<p>另一边厢，失踪多年的卓南前妻叶芳菲（樊亦敏饰）再度出现，并揭开了一段不为人知的秘密，连累各人卷入连场江湖恩怨……</p>\r\n<p>昔日其爽不惜一切离开江湖，以为可重过新生，却不知江湖之大，纵使远走廿年，却根本从没离开过。即使退到火线后，亦难免会给硝烟浓雾弄得薰眼呛咳，哪处才是真正安全之地，能真正自在生活？</p></div>', '郑则士 陈炜 黄光亮 苑琼丹 杨明 岑丽香 陈山聪 李成昌', '粤语', '2016', '0', '/data/images/571e1e5e2cfd5.jpg', '香港', '2016-05-27 21:45:35', '13', '0', '0', '685', '时装剧', '全集/共25集');
INSERT INTO `movie` VALUES ('1471', '闪电侠第二季', '<div class=\"endtext\"><p>闪电侠讲述了主人公被闪电击中后获得了超能力并维护正义的故事Barry Allen在11岁的时候，他的母亲死于一次离奇的恐怖事故，而他父亲更被错误指认为凶手，而他父亲的挚友，警探Joe West领养了他。现在Barry Allen已成为一个聪明﹑上进﹑讨喜的CSI鉴证分析员，与此同时他为了调查母亲死亡的真相，于是追踪起各种都市传说，也同时见识了先进的科技。</p>\r\n<p>近期Barry Allen迷上了由有远见的科学家Harrison Wells及其S.T.A.R.实验室团队开发的粒子加速器，其功能指对能量及医学界都会有飞跃的进步；然而在公开亮相当日（Barry Allen这角色先前曾在《绿箭侠 Arrow》里出场，于《绿箭侠》事情快完结时回去了中心城，亦为公开亮相当日），粒子加速器爆炸并引起了一股风暴，不少人因此丧命，而Barry Allen则被雷击。</p>\r\n<p>而从长达9个月的昏迷苏醒后，Barry Allen发现自己因祸得福，得到超高速的力量，令他决定使用此力量保护中心城。不过他随即发现他并非唯一一个「超人类」，自那事故后，中心城的失踪事故及不明原因死亡事件急剧增加，在预告片可看到，有人在爆炸事件后，成了能使出风暴之力的人。</p>\r\n<p>于是主角现在有了新目标，利用他的超高速保护市民，以及调查母亲死亡的真相，为父亲正名。虽然目前仅有部份密友及同事知道他的真面目，但世人将会都认识这位新英雄……闪电侠！</p></div>', '格里格·伯兰蒂 伽德纳·福克斯 戈夫·约翰斯', '英语', '2015', '0', '/data/images/569f7684db485.jpg', '欧美', '2016-05-25 18:02:15', '13', '0', '0', '688', '科幻剧', '全集/共23集');
INSERT INTO `movie` VALUES ('1472', '哥谭第二季', '<div class=\"endtext\"><p>FOX电视台预定了讲述蝙蝠侠世界的故事的新剧《哥谭市 Gotham》，该剧的主角并不是蝙蝠侠，而是戈登警长James Gordon。 该剧的制作人及编剧为《超 感神探 The Mentalist》的Bruno Heller，该剧将以全新的视角讲述戈登警长和那些哥谭市的罪犯们之间发生的故事。</p></div>', '本·麦肯锡 唐纳尔·罗格 大卫·马祖 西恩·帕特维 罗宾·泰勒', '英语', '2015', '0', '/data/images/56d531fab3dfe.jpg', '欧美', '2016-05-24 15:39:36', '13', '0', '0', '686', '警务剧', '全集/共22集');
INSERT INTO `movie` VALUES ('1473', '古战场传奇第二季', '<div class=\"endtext\"><p>Claire是一位已婚的战地护士，从1945年穿越到1743年的苏格兰。在那个一无所知的世界，她因为生命受到威胁而被迫嫁给英武浪漫的苏格兰战士Jamie。从此Claire的内心在两种截然不同的生活以及男人之间挣扎。</p></div>', '格拉汉姆·麦克塔维什 卡瑞·刘易斯 洛特·弗贝克', '英语', '2016', '0', '/data/images/570a597d2b957.jpg', '欧美', '2016-05-23 17:53:16', '13', '7', '13', '693', '战争剧', '更新至07集/共13集');
INSERT INTO `movie` VALUES ('1474', '行尸之惧第二季', '<div class=\"endtext\"><p>行尸走肉衍生剧行尸之惧，尸变才刚刚开始的时候，开始没人在意，以为只是普通的流感病毒，然而末日很快降临，人们猝不及防，他们根本无法理解这是怎么回事...</p></div>', '阿莉西娅·戴柏南·凯 克利夫·柯蒂斯 弗兰克·迪兰 金·迪肯斯 陈凌', '英语', '2016', '0', '/data/images/570b87c17e266.jpg', '欧美', '2016-05-23 17:52:20', '13', '7', '15', '690', '魔幻剧', '更新至07集/共15集');
INSERT INTO `movie` VALUES ('1475', '父亲的身份', '<div class=\"endtext\"><p>1948年初，青城一名美军少校被刺杀。南京国防部高官女婿俞北平被任命为特派员，受命调查此案。 同僚郑翊怀疑其真实身份，并启动了甄别程序。调查青城美军少校刺杀案，对俞北平既是机会也是陷阱。他的女儿徐丹妮在青城读书，思想左倾，处处与父亲为难。危机中，俞北平又与前妻之女、美军中尉林莎相逢。林莎身份神秘，暗中也对俞北平展开追踪。所谓美军少校刺杀案，实际是南京极右组织自导自演的一场阴谋，代号“比基尼”，目的要将美军驻守青城的西太洋舰队拖进中国内战。郑翊和俞北平的较量渐次升级，俞北平一方面要保护两个女儿，另一方面要完成组织任务。俞北平的亲情、友情和家庭，就此卷进了“比基尼”阴谋的漩涡，他的命运究竟会怎样？</p></div>', '陈建斌 俞飞鸿 曹卫宇 齐溪 任帅', '国语', '2016', '0', '/data/images/57288041cc79f.jpg', '大陆', '2016-05-21 09:28:21', '13', '36', '36', '693', '战争剧', '更新至36集/共36集');
INSERT INTO `movie` VALUES ('1476', '芝加哥警署第三季', '<div class=\"endtext\"><p>该剧是NBC新剧《芝加哥烈焰》（Chicago Fire）的衍生剧——《芝加哥烈焰》主要讲述消防员故事，而本剧主要讲述警察故事。芝加哥警署的第21辖区有两组完全不同的警察。其中一组是穿制服的警察，负责在街道上巡逻，直接打击和处理街头犯罪行为。另一组被称作情报组，负责打击危害这座城市的主要毒瘤——黑帮犯罪、毒品走私、高级别谋杀案，诸如此类。负责领导情报组的的是Hank Voight警官（Jason Beghe）。他是一个不怕破坏规矩的人——只要能维护正义，哪怕和法律对着干他也在所不惜。他为人强悍，要求严格，只有那些能上得刀山下得火海的人才能在他的手下当差。就拿Antonio Dawson侦探（Jon Seda）来说——尽管他与上司有过一段复杂的历史，但他对于指挥这样一个团队充满雄心。即便那意味着他每天都要和Voight闹矛盾，也阻止不了他要留下来的决心。那些街头巡警每天都在盯着情报组看，他们梦想得到升职并加入这个精英团队。而对于已经身在其中的人来说，这份工作每天都意味着挑战，他们必须为这座城市保驾护航并承担巨大的责任。有些时候责任会变成压力，而压力会带来心理和情感上的创伤——走出第21辖区的办公室，走入这些侦探的个人生活，你就会明白这句话的含义。</p></div>', '杰森·贝吉 乔恩·塞达 索菲亚·布什', '英语', '2015', '0', '/data/images/56a18e790bb14.jpg', '欧美', '2016-05-20 18:03:54', '13', '22', '23', '686', '警务剧', '更新至22集/共23集');
INSERT INTO `movie` VALUES ('1477', '私家法医第一季', '<div class=\"endtext\"><p>这是一部程序型罪案调查剧（单元剧），由来自《灵异妙探》（Psych）的Todd Harthan开发。\r\n\r\n    来见见私人病理学家中的「贝多芬」——聪明的Beaumont Rosewood Jr.医生（Morris Chestnut）是迈阿密最出色的私人病理学家，他拥有一家在美国国内技术最先进的的解剖实验室。他最擅长寻找尸体上的秘密，特别是那些迈阿密警署通常会忽视的秘密……</p>\r\n<p>只要你肯花钱雇他。尽管他一辈子都在和死亡打交道，但他更痴迷于生命本身。他自己身上有某种疾病，因此他决心抓住一切机会尽情享受——正所谓「人生得意须尽欢」。他的乐观精神让他的新搭档、愤世嫉俗的迈阿密警署侦探Karissa Villa（Jaina Lee Ortiz）感到不爽。虽然Karissa讨厌他永远玩世不恭的样子，但她无法否认Rosewood的天赋，他独特的观点总能为破案指明正确的方向。\r\n\r\n    Gabrielle Dennis扮演Rosewood的妹妹、实验室助手、「毒理学女王」Pippy；Anna Konkle扮演DNA专家Tara Milly Izikoff，绰号TMI（Too Much Information，万事通，知道许多别人并不想知道的事情），她同时是Pippy的（同性恋）未婚妻。</p>\r\n<p>Maggie Elizabeth Jones扮演Rosewood的邻居Millie，是一个很有前途的厨师。她经常和Rosewood在一起，虽然Rosewood年纪比她大很多，但她反过来给Rosewood提供了不少「人生哲理」。\r\n\r\n    越来越多的高调试映集使用黑人演员扮演头号角色，这也是今年新剧开发过程中最明显的特点——感谢《嘻哈帝国》、《丑闻》和《逍遥法外》，好莱坞终于意识到当今这个年代「种族多样性」高于一切。</p></div>', '摩里斯·切斯塔特 麦琪·伊丽莎白·琼斯 欧文·哈恩', '英语', '2015', '0', '/data/images/56eb67a6d708d.jpg', '欧美', '2016-05-20 18:03:26', '13', '0', '0', '689', '医务剧', '更新至21集');
INSERT INTO `movie` VALUES ('1478', '罪恶黑名单第三季', '<div class=\"endtext\"><p>NBC管理层盛赞该剧是NBC十年来「最强的一部新剧」，并对其前景十分看好。</p>\r\n<p>几十年来，绰号「红魔」（Red）的前军事情报官员Raymond Reddington一直是联邦调查局通缉犯名单上的重要人物。他为全世界形形色色的罪犯代办各种交易，撮合非法生意，被人们称作「犯罪世界的管理员」。然而令人大跌眼镜的是，他竟然主动向从来没有抓住过他的联邦调查局「自首」，并提出一个神秘但是惊人的条件：他愿意帮助联邦政府抓住所有人都认为早就死了的恐怖分子Ranko Zamani，但他只和一个联邦探员对话——Elizabeth “Liz” Keen（Megan Boone），一位刚刚结束训练成为联邦调查局初级分析师的「菜鸟」。Liz被这突如其来的情况搞得一头雾水——这可是她第一天上班啊！</p></div>', '詹姆斯·斯派德 梅根·布恩 瑞安·艾戈尔德 迭戈·克莱特霍夫 哈里·林尼科斯', '英语', '2015', '0', '/data/images/569901135a1a3.jpg', '欧美', '2016-05-20 18:02:37', '13', '23', '23', '686', '警务剧', '更新至23集/共23集');
INSERT INTO `movie` VALUES ('1479', '再见，布莱克先生', '<div class=\"endtext\">[剧 名]: Goodbye Mr.Black<br />\r\n[播 送]:韩国MBC<br />\r\n[类 型]:MBC水木剧 &nbsp;<br />\r\n[首 播]:2016年03月16日<br />\r\n[时 间]:每周三四晚间8点45分各播放一集<br />\r\n[接 档]:再一次happy ending<br />\r\n[导 演]:韩熙<br />\r\n[编 剧]:文熙贞<br />\r\n[主 演]:李阵郁 文彩元 金康宇 刘仁英 宋再临 金泰佑 李元忠 崔政宇<br />\r\n[制 作]:凤凰天使TSKS韩剧社16年韩流冲击第16波<br />\r\n[集 数]:20集<br />\r\n[简 介]: 讲述的是改编自黄美娜作家的同名漫画。以基督山伯爵为题材，男主人公被曾经信任的好朋友背叛，回到澳大利亚，之后逃到英国进行复仇。 他在澳大利亚认识了两个人，又形成了故事的新线路。被爱人和朋友背叛的男主人公忘掉过去，变成复仇的化身。</div>', '李阵郁 文彩元 金康宇 刘仁英 宋再临 金泰佑', '韩语', '2016', '0', '/data/images/56ea1cb588d19.jpg', '韩国', '2016-05-20 08:02:36', '13', '20', '20', '685', '时装剧', '更新至20集/共20集');
INSERT INTO `movie` VALUES ('1480', '芝加哥医院第一季', '<div class=\"endtext\"><p>《芝加哥医院》是《芝加哥烈焰》（Chicago Fire）的第二部衍生剧，故事描述芝加哥城中最繁忙的一家医院的日常工作——这里有一支勇敢无惧的医护团队，他们团结一致，敢于面对任何风险。每当特定事件（灾难）中的病人需要救治，或者遇到别的医生束手无策的疑难杂症，就轮到他们上场了。与此同时，他们在混乱的急诊室里培养出紧密的关系并一起渡过难关。根据NBC的构想，该剧和《芝加哥烈焰》、《芝加哥警署》将经常交换角色和情节，使三个团队（三部剧集）有机地融和在一起。Yaya DaCosta扮演长相迷人的住院护士Maggie Seaver，是《芝加哥烈焰》核心角色Kelly（Taylor Kinney）的新女友。事实上，他们高中时代就曾是一对恋人，但Kelly在某件事上一直亏欠她。</p>\r\n<p>当然，他们都经历了一段艰难岁月，因此一开始他们的关系只是单纯的友情。Severide很高兴能再见到她并与她坐下来好好谈心。S. Epatha Merkerson扮医院的负责人Sharon Goodwin。虽然管理医院的过程中时常要遇到她厌恶的「政治问题」和「权力之争」，而且她不能容忍任何胡闹的行为，但她的工作一直很出色，医院营运情况良好。Oliver Platt扮演医院精神科主任Daniel Charles。Nick Gehlfuss扮演《芝加哥警署》（Chicago PD）角色Jay Halstead的兄弟，也在这座医院中工作。Laurie Holden扮演勇敢无惧、聪明绝顶的急诊外科医生Hannah Tramble，痛苦的童年让她养成坚强彪悍的性格。在外人看来，她经常展现出「黑暗的一面」。</p></div>', '尼克·戈尔弗斯 奥利弗·普莱特 亚雅·达科斯塔 劳瑞·侯登 埃帕莎·默克森', '英语', '2015', '0', '/data/images/569fa54bf0fb1.jpg', '欧美', '2016-05-19 08:54:23', '13', '0', '0', '689', '医务剧', '更新至18集');
INSERT INTO `movie` VALUES ('1481', '芝加哥烈焰第四季', '<div class=\"endtext\"><p>没有什么工作比消防员更紧张、更危险、更令人兴奋了－－对芝加哥51号消防站应急救援队的成员来说尤其如此。美国人把他们看做英雄。每当遇到紧急情况的时候，别人都急着往外冲，但这群勇敢无惧的男女却义无反顾地冲进最危险的地方。他们每天都要和死神打交道，每天都要在最紧张的时候做出最重要选择，每天都要面对自尊与自负的考验，工作的责任和压力给他们的性格带来了巨大影响，队员们之间发生矛盾似乎是不可避免的。</p>\r\n<p>一场悲剧夺走了一名队友的生命，所有人都陷入深深的愧疚和自责。副队长Matthew Casey（Jesse Spencer）正在和妻子（Teri Reeves）打离婚官司，但他不想表露出自己脆弱的一面，而是装作「一切照旧」。可他总是和傲慢无礼的救援队副队长Kelly Severide（Taylor Kinney）闹矛盾，并且相互指责对方应该为队友的牺牲负责。不过，每当遇到紧急情况需要救援队出动时，他们会自觉地将矛盾放到一边，带领队员们通力合作，出色地完成任务。</p></div>', '杰西·斯宾塞 泰勒·金尼 莫妮卡·雷蒙德 劳伦·日尔曼 查理·班尼特', '英语', '2015', '0', '/data/images/569fa6658a969.jpg', '欧美', '2016-05-19 08:54:08', '13', '23', '23', '686', '警务剧', '更新至23集/共23集');
INSERT INTO `movie` VALUES ('1482', '神盾局特工第三季', '<div class=\"endtext\"><p>《神盾局特工》是复仇者联盟里面的分支剧情电视剧，熟悉Marvel漫画的人都知道，「S.H.I.E.L.D」是「Strategic Hazard Intervention Espionage Logistics Directorate」（国土战略防御攻击与后勤保障局，或称神盾局）的缩写，百度百科上有一个词条专门对其进行了解释。在今年的热门电影《复仇者联盟》（The Avengers）中，「S.H.I.E.L.D」的主管Nick Fury召集钢铁侠、美国上尉、绿巨人、黑寡妇、雷神索尔等超级英雄共同对抗企图统治地球的洛基（索尔的兄弟）。据称电视剧版《S.H.I.E.L.D》的剧本将由Joss Whedon亲自创作，首集也由他亲自执导，他的弟弟Jed Whedon和弟媳Maurissa Tancharoen将协助构思（他们曾和Joss Whedon共同创作网络剧《恐怖博士的欢唱博客》）。这是近年来电视广播网上第一个获得试映集预订的Marvel漫画改编项目。剧中的主要人物为：Skye，年近30年的「完美女性」，幽默、聪明、体贴他人、充满自信。她善于利用智慧和个人魅力来达到自己的目的。Grant Ward特工，典型的肉盾角色，冷酷到家。他行事鲁莽，有一点牛脾气，有时会搞砸人际关系。他平时很安静，是那种能够吸引你好感的人。Melinda May特工（温明娜），人送外号「The Calvary」（耶稣受难），是一个强悍的女战士，精通武器和飞机驾驶技术。她有过很不好的经历，因此她平时非常安静，而且人格有一点受损。在必要的时候，Melinda不惜违抗命令自行其事。Elizabeth Henstridge扮演Gemma Simmons特工，是个科学天才；Iain De Caestecker扮演Leo Fitz特工，是个技术专家。两人一同接受训练，生活中和执行任务时都喜欢待在一起——尽管他们一见面就吵个不停。他们有「Nerd」倾向，把彼此的关系看做兄妹之情。Jemma擅长生物化学方面的技术，而Leo擅长武器研发和相关技术。Brett Dalton扮演技艺高超的Grant特工，勇敢无惧、处事冷静，但不善与人交流。此前制片方已经承认《复仇者联盟》电影中的演员Clark Gregg将演出该剧，再次扮演电影中的角色Coulson特工。</p></div>', '克拉克·格雷格 温明娜 布雷特·道顿 汪可盈 伊恩·德·卡斯泰克 伊丽莎白·亨斯屈奇', '英语', '2015', '0', '/data/images/56dfdce6d9b70.jpg', '欧美', '2016-05-18 15:26:22', '13', '0', '0', '688', '科幻剧', '全集/共22集');
INSERT INTO `movie` VALUES ('1483', '山海经之赤影传说', '<div class=\"endtext\"><p>上古时代，为了应对大旱，中国古老的两个部落东夷和九黎，按照祭司的预言派人前往桃花坳寻找天降玄女。一对好友苏茉和芙儿从此背负不同命运，一个作为朱雀玄女要保护九黎百姓，另一个作为青龙玄女要带领东夷夺取上游九黎的水源。一位玄女加七位星宿使者，便能组成一个团队，唤醒相应的神兽。但朱雀团队的第一次唤醒仪式却被东夷大将军百里寒破坏。为了再次唤醒神兽，东夷和九黎开始争夺白虎和玄武神杵。百里寒利用苏茉与芙儿之间的感情纠葛，骗得神杵，成功唤醒青龙。</p></div>', '张翰 古力娜扎 关智斌 高钧贤 蓝盈莹 高伟光 吴磊', '国语', '2016', '0', '/data/images/56eebd26b8374.jpg', '大陆', '2016-05-17 23:56:04', '13', '0', '0', '684', '仙侠剧', '全集/共46集');
INSERT INTO `movie` VALUES ('1484', '幸福在一起', '<div class=\"endtext\"><p>高真真从小父母离异，跟随母亲长大的她在母亲再婚后，与继父、弟妹一起生活。高真真原本对人生充满了浪漫幻想，然而父母意外双双去世，忽然之间她的生活发生了翻天覆地的变化。面对生活的变故，真真悲痛之后整理心情，决定承担起照顾家人的责任，一家人患难与共。在真真最困难的时候，她遇到了乔敏浩，两人从互相抵触慢慢开始相识相知。在照顾家人的过程中，真真渐渐懂得了什么叫做真正的爱和责任。最终，真真自强不息的努力，感动了很多人，使他们一家人获得了帮助和爱。同时，真真也决心把这份爱传出去，回报给社会，而她也成长为一个独立坚强有担当的女孩。</p></div>', '秋瓷炫 凌潇肃 馨子 高仁 王一鸣 纪姿含 熊俊豪', '国语', '2016', '0', '/data/images/5726cc31c509d.jpg', '大陆', '2016-05-17 09:46:19', '13', '0', '0', '685', '时装剧', '全集/共42集');
INSERT INTO `movie` VALUES ('1485', '朝圣之路第一季', '<div class=\"endtext\"><p>Hulu原创新剧《朝圣之路》，由来自《绝命毒师》的\"小粉\"Aaron Paul、来自《真探》《源代码》《最好的我》的Michelle Monaghan和来自《汉尼拔》的\"小茶杯\"Hugh Dancy领衔主演。该剧主要讲述一个家庭陷入到一种鼓吹信仰治疗的类宗教团体中，探讨“现实生活和我们想要的生活”之间的矛盾。</p></div>', '亚伦·保尔 米歇尔·莫纳汉 休·丹西 马克西·艾里奇', '英语', '2016', '0', '/data/images/5701cbeb2ced8.jpg', '欧美', '2016-05-16 19:33:21', '13', '0', '0', '691', '家族剧', '更新至08集');
INSERT INTO `movie` VALUES ('1486', '殭(国语版)', '<div class=\"endtext\"><p>五百年前，曾经出现过一场惊心动魂的人僵大战，一众明朝锦衣卫力战不明来历、杀人如麻的僵尸。其时战况何其激烈，外人不得而知，但重要的是，当年多位奋不顾身的宫中高手，竟然活到现在……</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">不死人　遇上下不了杀手的僵尸</p>\r\n<p>五百多岁的不死人刑活着(郑嘉颖饰)，一直以捕杀僵尸为己任，而多年来踏遍天涯海角，只为追杀僵尸凌风(陈山聪饰)。他跟随可靠消息来到香港，接收了深宵食堂“夜吾夜”，一边享受与食客风花雪月的日子，一边静待凌风的出现。另一方面，活着又受好友金坚(秦煌饰)临终所托，接收何年(黄又南饰)、何月(陈嘉宝饰)、简霆斯(陆永饰)做徒弟，训练他们武艺，对付随处出没的僵尸。</p>\r\n<p>城中出现神秘谋杀案，活着得悉女法医蓝梦南(谢安琪饰)能够运用特异功能“一指灵”，与尸体对话一分钟，对此相当在意。果然，他发现这位曾在荷兰邂逅过的女子，真正身份是僵尸！活着本欲遵行天职，杀死梦南，但梦南祖母蓝黄紫红(罗兰饰)苦苦哀求他网开一面。活着见梦南坚持不吸人血，遂助她克服僵尸化的痛苦，此举令梦蓝对活着更添好感。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">僵尸　寻找与人和睦之法</p>\r\n<p>梦南逐渐担心抑制不住魔性，于是打算赚一笔钱留给紫红及妹妹蓝梦瑶(陈凯琳饰)，然后一走了之。可是纸包不住火，梦南竟因为一次意外，露出了僵尸的真面目，梦瑶目睹一切，受惊过度引致失语症复发！梦南知道自己没可能再与家人生活，黯然消失人前。活着于是自动请缨代为照顾梦瑶，二人一见如故，发展出一段微妙关系。</p>\r\n<p>其时，有消息指“漂泊的荷兰人”再次出现于荷兰渔港，只要喝下当中的神奇泉水，就能将僵尸变回人类。梦南动身前往寻找，希望再次变回人类，却发现隐形富豪庞应天(关礼杰饰)一路跟踪。原来应天一直以来致力研究治好僵尸的办法，因此来到荷兰寻找秘方，二人能否发现传说中的泉水？</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">不死人大战僵尸　洞见奇世秘密</p>\r\n<p>其时，僵尸大军的杀人暴行变本加厉，不死人一族认为梦南是始作俑者，要求活着交出梦南；同一时间，活着一直追捕的凌风再次现身，而他的目标原来就是梦南！</p>\r\n<p>活着一边对抗凌风和僵尸大军，一边保护梦南，被打至遍体鳞伤，奄奄一息。梦南为救活着，冒险将僵尸血输入其体内。谁知活着随即出现身体异变，更渐渐得到梦南的记忆，洞悉了一个惊天秘密……</p></div>', '郑嘉颖 谢安琪 黄又南 关礼杰 陈凯琳 陈嘉宝 陆永 赖慰玲 僵尸', '国语', '2016', '0', '/data/images/570bb8a32312a.jpg', '香港', '2016-05-16 12:24:54', '13', '0', '0', '690', '魔幻剧', '全集/共33集');
