INSERT INTO `movie` VALUES ('1488', '一马换三羊', '<div class=\"endtext\"><p>自幼在军队大院长大的巩大为（冯雷 饰）和马志军（史力嘉 饰）是一对好兄弟，不过两人的性格多有不同。大为一肚子坏水和鬼点子，经常会做一些让父辈头疼的事。他时不时突发奇想，搞得鸡鸣狗跳，骨子里却是一个重义气值得信赖的男子汉。马志军父母双亡，在大为这样的孩子头面前就如同一个永远不起眼的乖宝宝。大院里搬来了美丽女孩沈小红（刘威葳 饰），她和大为从最初的互相看不顺眼到相互理解和欣赏。</p>\r\n<p>时光流转，转眼间调皮的孩子们都已长大。在改革开放的浪潮下，他们相继成为时代的弄潮儿，而彼此性格的不同，又使得这些年轻人起起伏伏，品尝这人世间的苦辣辛酸……</p></div>', '冯雷 涂松岩 刘威葳 萨日娜 岳红 马秋梓', '国语', '2016', '0', '/data/images/5724120a37d54.jpg', '大陆', '2016-05-14 16:46:57', '13', '40', '30', '685', '时装剧', '更新至40集/共30集');
INSERT INTO `movie` VALUES ('1489', '明日传奇第一季', '<div class=\"endtext\"><p>当单个英雄还不足时，这世界需要一支传奇队伍，穿越猎人Rip Hunter在未来看到了大危机，于是决定回到过去，从起源阻止事件；他组合了一支英雄及奸角合作的队伍，不过问题是，这支乌合之众真的能阻止危机吗？据悉，《明日传奇》中的人物角色包括原子侠、冷冻队长、热浪、火风暴（博士），鹰女，时间猎手以及白金丝雀。</p></div>', '温特沃斯·米勒 布兰登·罗斯 亚瑟·达维尔 维克多·加博 凯蒂·洛茨', '英语', '2016', '0', '/data/images/56a208921f6fb.jpg', '欧美', '2016-05-14 09:50:37', '13', '15', '16', '688', '科幻剧', '更新至15集/共16集');
INSERT INTO `movie` VALUES ('1490', '地球百子第三季', '<div class=\"endtext\"><p>该剧根据一套尚未出版的小说改编。故事描述未来人类爆发核战争后，地球表面被彻底摧毁，幸存者不得不乘坐一艘太空船四处流浪。97年之后，这艘太空船上的幸存者们尝试重新对地球进行殖民。他们首先挑选了100名有犯罪记录的青少年到已经彻底改变外貌的地球表面进行探索，这些人成了人类生存下去的关键</p></div>', '克里斯·勃朗宁 玛丽·艾格洛浦路斯 戴文·博斯蒂克 亨利·伊安·库斯克', '英语', '2016', '0', '/data/images/56a43b9405e85.jpg', '欧美', '2016-05-14 09:49:29', '13', '15', '13', '688', '科幻剧', '更新至15集/共13集');
INSERT INTO `movie` VALUES ('1491', '致命诱惑第一季', '<div class=\"endtext\"><p>Alice Vaughan（Mireille Enos饰）是洛杉矶最顶级的私家侦探，她也许是你最不想惹上麻烦的一个女人。但她的未婚夫Benjamin Jones（Peter Krause饰）却诈骗了她数百万美元之后消失得无影无踪；Alice准备对他展开私人调查，无论她会调查出什么样的秘密，她都不能泄露一丝一毫，但这并不妨碍她要把她的前未婚夫追逃回来。</p>\r\n<p>Anderson/Vaughan侦探所是全国上最顶级的私家侦探所和秘密公司之一，由Alice和她最好的朋友兼生意伙伴Valerie Anderson（Rose Rollins饰）白手起家创建的。这支私家侦探的精英队伍有合伙人Danny Yoon（Jay Hayden饰），一个闹腾的不爱守规矩有时候有点无礼的人，所以当碰到需要跨越法律边线的案子时，他会派上大用场；新进成员Sophie Novak（Elvy Yost），是他们内部的法律顾问，同时也是个聪明的黑客。公司一边调查着一些最精心设计的谋杀案件，而Alice同时也在追踪她未婚夫的踪迹。但是，追踪Ben的不止她一个；FBI探员Jules Dao（Jacky Ido饰）已经在整个欧洲追踪到了他的犯罪踪迹，并且目前就快要抓住他了。Dao探员希望利用Alice的帮助将Ben和他的团伙一举抓获。与此同时，Ben又再次陷入了危险而迷人的国际犯罪案件。除了他长期合作的伙伴之外，狡猾的策划人Margot Bishop（Sonya Walger饰）和Reggie Lennox（Alimi Ballard饰）暗地里又将数百万的诈骗所得投资于下一个回报更高的诈骗工作。因为诈骗的风险极高，一步错就步步错，所以绝对不能出任何差池；但是 Ben却把这个世界级的诈骗团伙指向他的目标Alice引得越来越近。Alice和Ben两人不可置疑地为各自的目的吸引对方，这无异于两人都在玩火，而随着Alice越来越深入地追捕Ben，一场惊心动魄的猫鼠游戏即将展开。</p>\r\n<p>《隐情 The Catch》由“大妈三部曲”《丑闻 Scandal》《实习医生格蕾 Grey\'s Anatomy》和《逍遥法外How to Get Away With Murder》的制作人制作，由大妈Shonda Rhimes担任执行制片人。</p></div>', '米瑞·伊诺丝 索尼亚·瓦格尔 阿里米·巴尔拉德 罗丝·洛林斯', '英语', '2016', '0', '/data/images/56f52da89f3f9.jpg', '欧美', '2016-05-14 09:48:21', '13', '8', '13', '686', '警务剧', '更新至08集/共13集');
INSERT INTO `movie` VALUES ('1492', '太阳的后裔', '<div class=\"endtext\"><p>史诗级人文爱情大片《太阳的后裔》是以美丽的南国风光为背景展开的治愈系罗曼史，描绘了相信不是奇迹的爱情，以那爱情实现奇迹的我们心中的英雄的故事。讲述了驻扎在OURCQ首都的联合国维和部队所属部队—特战警备队大尉金始真和军医官尹明珠在韩国和派兵地区之间往返相爱的故事。以及在灾难现场不顾生命危险活跃着的人们的牺牲故事和在急迫状况下依然互相关照一点点靠近的主人公们的爱情。</p></div>', '宋仲基 宋慧乔 晋久 金智媛 李珍基 姜信日 赵太官 赵在允', '韩语', '2016', '0', '/data/images/56ce599ccb88d.jpg', '韩国', '2016-05-14 09:45:58', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1493', '吸血鬼日记第七季', '<div class=\"endtext\"><p>该剧故事以艾琳娜·吉尔伯特，一个在两个吸血鬼兄弟间左右为难的高中女孩为中心展开。</p></div>', '保罗·韦斯利 伊恩·萨默海尔德 马修·戴维斯 卡特琳娜·格兰厄姆', '英语', '2015', '0', '/data/images/56b0907fe678f.jpg', '欧美', '2016-05-13 17:40:33', '13', '22', '22', '690', '魔幻剧', '更新至22集/共22集');
INSERT INTO `movie` VALUES ('1494', '生活大爆炸第九季', '<div class=\"endtext\"><p>这是一部以 \"科学天才\" 为背景的情景喜剧，这倒非常罕见。主人公Leonard (JohnnyGalecki, \"Roseanne\") 和Sheldon (Jim Parsons \"JudgingAmy\")是一对好朋友，他们的智商绝对高人一等，因为他们对量子物理学理论可以倒背如流，无论你问他们什么问题，都难不倒他们。但是说到日常生活，这两个不修边幅的男孩就彻底没了脾气－－生活中柴米油盐这些看似简单的事情，却让他们有迷失在太空里一样的感觉，他们所掌握的那些科学原理在这里根本没有用武之地。直到有一天……隔壁搬来一位美貌性感的女孩Penny (Kaley Cuoco, \"8SimpleRules...\")，顿时吸引了Leonard的目光。Penny是个梦想成为演员的女孩，但一直没有能成功，平时只能在快餐店打工，她个性开朗，待人友善，是位与Leonard、Sheldon截然不同的追求时尚的年轻人，最重要的是——她最近刚刚变成单身。 </p>\r\n<p>Leonard和Sheldon还有两个好朋友。自认为是花花公子的Howard Wolowitz(Simon Helberg,\"Studio 60 on the Sunset Strip\")，他称自己是加州理工学院的\"卡萨诺瓦\"（1725-1798，意大利冒险家，以所写的包括他的许多风流韵事的《自传》而著称，后来该词被引申为\"风流浪子，好色之徒\")，能用六种语言泡妞，参与负责美国的火星探索计划（喜欢邀请看上的女孩去火星兜风，也因此在第二季引发一场事故，遗憾地与“火星生命发现者”的称号失之交臂），其实Howard不过是个喜欢拿一些过时的手段把妹的家伙，很多时候他的把妹手法都让对方感到恶心。来自印度的 Rajesh Koothrappali (Kunal Nayyar, \"NCIS\")患有严重的“与异性交往障碍症”，有异性在场的时候他就无法说话，只有在喝醉以后才能自在地与女孩交流。 </p>\r\n<p>一个美女和四个科学阿宅的故事就这样在笑声中悄然开始上演……</p></div>', '约翰尼·盖尔克奇 吉姆·帕森斯 凯莉·库柯-斯威汀', '英语', '2015', '0', '/data/images/5698ae24d44dc.jpg', '欧美', '2016-05-13 17:40:02', '13', '0', '0', '685', '时装剧', '全集/共23集');
INSERT INTO `movie` VALUES ('1495', '小丈夫', '<div class=\"endtext\"><p>姚澜年近三十三，终于迎来自己的婚礼，却突然遭遇新郎田坤的前女友抢婚，气得她取消婚礼愤而离开。谁知这桩闹事意外促成了姚澜和大男孩陆小贝的不解之缘。他们年龄相差八岁，可陆小贝的活力、浪漫，姚澜的成熟、稳重，使得两人深深地互相吸引。理智告诉姚澜不能沉溺于这种盲目的激情，现实中姐弟恋的诸多问题也接二连三暴露出来：价值观差异、生活节奏不合拍、家人集体反对等等。这一切令姚澜疲惫不堪，终于忍痛与陆小贝分手。姚澜重遇田坤，两人冰释前嫌。田坤欣赏并理解姚澜，请求和她共度人生。这时陆小贝回来了，风雨过后的陆小贝成熟起来，担当起所有责任，勇敢牵起姚澜的手。真爱终于让这对恋人走到了一起，也让两人都经历了人生的成长。</p></div>', '杨玏 俞飞鸿 张萌 田雨 韩童生 许娣 刘莉莉 关晓彤', '国语', '2016', '0', '/data/images/57272d96ec226.jpg', '大陆', '2016-05-13 11:37:38', '13', '0', '0', '685', '时装剧', '全集/共43集');
INSERT INTO `movie` VALUES ('1496', '恶魔之子第一季', '<div class=\"endtext\"><p>《恶魔之子》由《行尸走肉》的前任剧集总监Glen Mazzara打造，主要描述《凶兆》中的小男孩Damien Thorn（Bradley James饰）长大成人之后的故事。他并不知道自己身上有恶魔的力量，但他始终不能忘记过去的梦魇，并且身边的骇人事件接二连三地发生。他必须接受一个事实：他就是传说中的基督之敌（Antichrist），数个世代以来人世间最可怕的人。</p></div>', '布拉德利·詹姆斯 奥米德·阿布塔西 梅歌林·艾奇坤沃克', '英语', '2016', '0', '/data/images/56dfdd6270bd8.jpg', '欧美', '2016-05-11 10:56:28', '13', '0', '0', '690', '魔幻剧', '更新至10集');
INSERT INTO `movie` VALUES ('1497', '欢乐颂', '<div class=\"endtext\"><p>心怀梦想的大龄“胡同公主”樊胜美、大家闺秀闷骚文艺女关雎尔、没头脑和不高兴的综合体邱莹莹，在海市合租一套房，与高智商的海归金领安迪、做事从不按出牌的富二代小妖精曲筱绡，同住在一个名叫“欢乐颂”的中档小区的22楼，五个女人如春兰秋菊，各领风骚，上演着22楼版的“绝望的主妇”，齐心协力地解决了安迪的神秘身世的问题、曲筱绡与同父异母的两个哥哥争家产的问题、樊胜美沉重的家庭负担的问题、邱莹莹的有处女情节的男朋友的问题、关睢尔的警察男友是不是在家庭背景上撒了谎的问题…… </p>\r\n<p>生活虽然一地鸡毛，但仍要欢歌高进，成长之路虽有玫瑰有荆棘，但什么都不能阻挡坚强的心。</p></div>', '祖峰 刘涛 杨紫 王凯 蒋欣 王子文 乔欣 杨烁 靳东 张陆 张晓谦', '国语', '2016', '0', '/data/images/5714d502e1185.jpg', '大陆', '2016-05-10 21:22:14', '13', '0', '0', '685', '时装剧', '全集');
INSERT INTO `movie` VALUES ('1498', '福尔摩斯：基本演绎法第四季', '<div class=\"endtext\"><p>在大家纷纷质疑，将这位充满大不列颠绅士之味，疯狂又前卫的侦探搬到美国是不是合理时，CBS却宣布，已经与英国著名演员约翰·李·米勒(Jonny Lee Miller)签约，这位曾经出演了《神奇律师》(Eli Stone)，并客串了Showtime热门剧集《嗜血法医》(Dexter)的英国男演员，将在《Elementary》中饰演居住在纽约城中大侦探福尔摩斯。鉴于这部剧将来自CBS，那么它的风格也许无法像盖·里奇的电影版和BBC三集片一样偏幽默，沉重的故事是可以预见的。尽管如此，CBS在这样两个“前辈”的重压下，依旧敢预定导航集，可见其十足信心，很有可能这部剧将会成为明年的大热。而巧合的是，约翰·李·米勒和电影版及BBC版的演员们都有不小的交集：他和电影版的“华生医生”裘德·洛是同学，两人一同创办了Natral Nylon制片公司，还是公认的BFF。而米勒在去年，还曾经和BBC版的“夏洛克”本尼迪克特·康伯巴奇一同出演了英国著名导演丹尼·鲍尔的话剧《弗兰肯斯坦》(Frankenstein)。</p></div>', '约翰尼·李·米勒 刘玉玲 艾丹·奎因', '英语', '2015', '0', '/data/images/5699c55856f7c.jpg', '欧美', '2016-05-10 15:00:04', '13', '24', '24', '686', '警务剧', '更新至24集/共24集');
INSERT INTO `movie` VALUES ('1499', 'Mrs.Cop2', '<div class=\"endtext\">[剧 名]:Mrs.Cop 2[播 送]:韩国SBS<br />\r\n[类 型]:SBS周末剧 &nbsp;<br />\r\n[首 播]:2016年03月05日<br />\r\n[时 间]:每周六周日 韩国时间晚10:00 <br />\r\n[导 演]:刘仁植、安吉镐<br />\r\n[编 剧]:黄秀河<br />\r\n[主 演]:金成铃 金旻钟 任瑟雍 孙丹菲 <br />\r\n[制 作]:凤凰天使TSKS韩剧社16年韩流冲击第13波 <br />\r\n[集 数]:16集<br />\r\n[简 介]:讲述拥有者极高刑侦能力的女警察，在与罪恶势力作斗争的过程中，也在无形中揭露着警察局社会黑暗面的故事。</div>', '金成铃 金旻钟 任瑟雍 孙丹菲', '韩语', '2016', '0', '/data/images/56dd2f49432f7.jpg', '韩国', '2016-05-09 10:38:35', '13', '20', '20', '686', '警务剧', '更新至20集/共20集');
INSERT INTO `movie` VALUES ('1500', '我是杜拉拉', '<div class=\"endtext\"><p>三十岁的职场精英杜拉拉，不日就要问鼎总监级别。而她和王伟的恋情也瓜熟蒂落，领证结婚过上了幸福生活。不料，公司突然出现空降兵海归凯西，同为人事经理，要和拉拉竞争人事总监。凯西比拉拉年轻，但能力丝毫不逊色。两人在公司的人事招聘、年会方案等工作中短兵相接，好几次拉拉都险些败下阵来。拉拉感到压力巨大，总监之位也摇摇欲坠。但拉拉没想到的是，凯西和王家相识已久，尤其受到婆婆陆爱华的喜爱。凯西深受西方文化熏陶，想当然的和王家走的很近，给拉拉带来了不少麻烦。拉拉虽是职场精英，却是个家庭菜鸟。起初她在平衡职场和家庭间奔命，惹出不少风波，甚至和王伟有了矛盾。但拉拉骨子里的善良坚持，让她逐渐成长。最终，拉拉凭借自己的努力与对家庭的真心维护，赢得了婆婆喜爱，成长为一名好妻子好媳妇，过上了职场家庭双丰收幸福的生活。</p></div>', '王耀庆 戚薇 朱泳腾 袁冰妍 冉旭 王汀 杨昆 于小磊', '国语', '2016', '0', '/data/images/571236dda870f.jpg', '大陆', '2016-05-08 20:16:10', '13', '42', '40', '685', '时装剧', '更新至42集/共40集');
INSERT INTO `movie` VALUES ('1501', '绝命卦师', '<div class=\"endtext\"><p>40集古装悬疑侦探剧《绝命卦师》由内地实力派男演员张晓晨、90后全能艺人张浩然，“小杨幂” 卢蒽洁担纲主演。</p>\r\n<p>该剧讲述了明朝“土木堡”事件期间，皇帝亲征边疆离宫后，后宫诡异事件频发，修仙道士天目瞳（张晓晨饰）受命入宫捉妖办案，探案中与太监小蘑菇（张浩然饰）、锦衣卫女首领云湘蓉（卢蒽洁）三人之间产生的爱恨情仇。</p></div>', '张晓晨 张浩然 卢蒽洁 刘娜萍', '国语', '2016', '0', '/data/images/5710a0718297e.jpg', '大陆', '2016-05-08 20:14:04', '13', '29', '40', '692', '网络剧', '更新至29集/共40集');
INSERT INTO `movie` VALUES ('1502', '始祖家族第三季', '<div class=\"endtext\"><p>吸血鬼祖先Mikaelson家族的悲剧和胜利 迎来了新的《The Originals》乐章，正式进入第三季。原来 Klaus和他的同母异父哥哥Elijah用一千年的战斗来保护自己的家庭，但现在Klaus与Hayley有了他们的女儿 hope。这一次，他们的赌注比以往任何时候都高。第三季 兄弟两的关系进入紧张状态，加上他们要慢慢调整和失散多年的 姐姐 Freya 的关系。Hayley也遭受到了Klaus卑鄙的报复。Marcel与Davina重获统治权。与此同时，卡米尔发现自己已经陷入了一千年前始祖家族的一个惊人秘密。</p>\r\n<p>在这一季里，观众们可以看到始祖家族大团圆的画面，兄弟中的Finn Kol Rebekah 的原版扮演者Casper Zafer Nathaniel Buzolic Claire Hol 与 始祖父母Mikael Esther的原扮演者Sebastian Roche Alice Evans 都会客串出席本季，以回闪的方式出现在剧集中。</p></div>', '约瑟夫·摩根 丹尼尔·吉里斯 丹妮尔·坎贝尔', '英语', '2015', '0', '/data/images/56ad6c2c7c206.jpg', '欧美', '2016-05-08 15:20:02', '13', '20', '22', '690', '魔幻剧', '更新至20集/共22集');
INSERT INTO `movie` VALUES ('1503', '记忆', '<div class=\"endtext\">[剧 名]:记忆<br />\r\n[播 送]:韩国TVN<br />\r\n[类 型]:TVN金土剧 &nbsp;<br />\r\n[首 播]:2016年03月18日<br />\r\n[时 间]:每周五、周六晚间7点45分各播放一集&nbsp; 更新时间为第2天早上<br />\r\n[接 档]:Signal<br />\r\n[导 演]:朴灿弘<br />\r\n[编 剧]: 김지우 박찬홍<br />\r\n[主 演]:李圣旻 金智秀 朴真熙 尹邵熙 俊昊<br />\r\n[制 作]:凤凰天使TSKS韩剧社16年韩流冲击第17波<br />\r\n[集 数]:16集<br />\r\n[简 介]:主要讲述了患有阿尔茨海默病症的律师朴泰硕赌上后半生的最后一次法庭辩论，记忆渐渐消失的同时如何守护自己的人生价值与亲情的故事。</div>', '李圣旻 金智秀 朴真熙 尹邵熙 俊昊', '韩语', '2016', '0', '/data/images/56ecb897057d7.jpg', '韩国', '2016-05-08 11:28:15', '13', '16', '16', '685', '时装剧', '更新至16集/共16集');
INSERT INTO `movie` VALUES ('1504', '玉氏南征记', '<div class=\"endtext\">[剧 名]:玉氏南政基<br />\r\n[播 送]:韩国JTBC台<br />\r\n[类 型]:JTBC金土剧 &nbsp;<br />\r\n[首 播]:2016年03月22日<br />\r\n[时 间]:每周五、周六晚上9点45[韩国时间] 更新时间为第二天早上<br />\r\n[导 演]:李亨民<br />\r\n[编 剧]:朱贤<br />\r\n[主 演]:李瑶媛 尹相铉 黄灿盛 金善英<br />\r\n[制 作]:凤凰天使TSKS韩剧社16韩流冲击第19波 <br />\r\n[集 数]:16集<br />\r\n[简 介]:<span class=\"\">《玉氏南征记》讲述了一个性格急躁的男人与一个做事谨慎小心的女人之间的有趣故事</span>。</div>', '李瑶媛 尹相铉 黄灿盛 金善英 玉氏南政基', '韩语', '2016', '0', '/data/images/56ecb8d84d968.jpg', '韩国', '2016-05-08 11:27:00', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1505', '重生之名流巨星', '<div class=\"endtext\"><p>该剧讲述了经历变故后再入娱乐圈的云修，从一个名不见经传的小演员，一步步迈向顶峰的故事。被誉为韩剧画质、美剧节奏的励志悬偶剧《重生之名流巨星》，不仅集结中韩意泰优秀演员，更将多角度全景式的展现娱乐圈：作为大众情人的明星们，内心世界到底拥有怎样的色彩？星光熠熠的娱乐圈幕后，是否有着不为人知的辛酸？</p></div>', '马可 纳瓦·君拉纳拉 徐海乔 张馨予 韩彩英', '国语', '2016', '0', '/data/images/572bfcf008b69.jpg', '大陆', '2016-05-06 10:09:52', '13', '0', '0', '692', '网络剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1506', '傲骨贤妻第七季', '<div class=\"endtext\"><p>傲骨贤妻第七季将在今秋回归，有传言这将是最后一季。虽然后期在剧情上洒满了狗血，并且我们熟悉的小伙伴都逐一离开了，但这依旧是一部伟大的剧情。尽管在收视率来看，它从来不算是一个大热门剧集，但备受评论家和艾美奖待见。希望好聚好散，在第七季能看到枯木逢春。</p></div>', '朱丽安娜·玛格丽丝 乔西·查尔斯 克里斯汀·芭伦斯基', '英语', '2015', '0', '/data/images/5694daea643dd.jpg', '欧美', '2016-05-04 13:21:28', '13', '21', '22', '685', '时装剧', '更新至21集/共22集');
INSERT INTO `movie` VALUES ('1507', '鹿鼎记(梁朝伟版)', '<div class=\"endtext\"><p>韦小宝（梁朝伟）为人刁钻聪敏，因义气帮助天地会人打退清兵后，他于稀里胡涂中接受天地会命令进宫“成了”太监。结识少年皇帝康熙（刘德华）时，不识对方身份的韦小宝与之不打不相交结成莫逆之友，并因在得知其身份后协助他铲除奸臣成为宫中红人。</p>\r\n<p>韦小宝无意知晓太后是神龙教人所假扮，目的是盗取藏有清朝秘密的四十二章经后，上报康熙，在他的帮助下，康熙救出被囚禁长达十多年的太后，其后韦小宝巧设妙计令顺治与康熙父子团聚，又挑拨神龙教人自相残杀，令康熙对他更加器重，然而他天地会人的身份终没瞒过康熙双眼。此外，周旋于先后爱上的建宁、双儿等七个女人之间，也令韦小宝觉得日子没那么好混。</p></div>', '梁朝伟 刘德华 刘嘉玲 毛舜筠 商天娥', '粤语', '1984', '0', '/data/images/56e2232a97b47.jpg', '香港', '2016-05-04 10:36:34', '13', '0', '0', '687', '古装剧', '全集/共40集');
INSERT INTO `movie` VALUES ('1508', '武神赵子龙', '<div class=\"endtext\"><p>赵云（字子龙）生逢乱世，自小深感民怨深重，立下大志，要成就一番宏图大业。他秉承一身正气，惩恶除强，又在机缘巧合之下练就了一套精妙枪法，披靡沙场，无往不利，这让他在赢得众多的仰慕与赞许的同时，也为他招来了诸多的嫉恨。夏侯轻衣为东郡诸侯夏侯杰之女，投靠常山表舅袁涣时结识了赵云。他们二人彼此钦慕，却招来了心胸狭隘的袁涣长子袁怀和轻衣大哥夏侯恩的嫉恨与迫害。赵云在他怀才不遇的处境中积极求索，意外从母亲口中获知了赵家与夏侯家在上一辈结下的生死仇怨。在家族仇恨和儿女情长的历练中，赵云终于参透了恩怨，找到了赏识他的明主刘备。自此，他手执长枪，驰骋沙场，抒写出一段可歌可泣的英雄礼赞。</p></div>', '林更新 林允儿 贾青 金桢勋 赵韩樱子 邹兆龙 高以翔', '国语', '2016', '0', '/data/images/5701137239be7.jpg', '大陆', '2016-05-01 00:51:52', '13', '0', '0', '687', '古装剧', '全集/共60集');
INSERT INTO `movie` VALUES ('1509', '吹笛人', '<div class=\"endtext\"><p>该剧讲述了即使是一触即发的情况下，也要在自杀、人质、恐怖、战争等最糟糕的局面发生前，不是通过武力，而是通过对话解决问题的故事。</p></div>', '申河均 柳俊相 赵允熙 全国焕 金洪波 金钟书', '韩语', '2016', '0', '/data/images/56df8715eb874.jpg', '韩国', '2016-04-27 11:07:56', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1510', '路西法第一季', '<div class=\"endtext\"><p>当魔鬼降临天使之城洛杉矶...</p>\r\n<p>《路西法》是基于Neil Gaiman，Sam Keith和Mike Dringenberg创造的DC Vertigo同名漫画改编的电视剧，讲述首位堕落天使的故事。厌倦了做地狱之主，路西法·晨星（汤姆·艾利斯饰，《梅林》）决定抛弃王位，退休来到洛杉矶，开起了一家名叫Lux的高档夜店。</p>\r\n<p>正当英俊迷人、充满魅力的路西法享受着他惬意的退休生活--美酒、美人与音乐，一位年轻貌美的流行歌手却在Lux外惨遭杀害。一百亿年来，头一次他的内心涌起了一种奇异的感觉。是怜悯？是同情？这感觉深深困扰着他，也让他的挚友麦泽金（莱斯丽-安·布莱德饰，《图书管理员》）深感不安。</p>\r\n<p>这单谋杀案同样引起了洛杉矶警局凶杀组警探克洛伊·丹瑟（劳伦·日尔曼饰，《芝加哥烈焰》）的注意。本来对路西法不置可否的她，却被他能引诱别人说出心中秘密的能力，以及寻求正义、惩恶锄奸的渴望而吸引。他们开始合力追查歌手的真正死因，克洛伊的善良让路西法深深震撼。见惯了人性最阴暗一面的路西法，被克洛伊的纯洁所吸引，开始好奇自己的灵魂是否也能得到救赎。</p>\r\n<p>与此同时，上帝的使者，天使阿曼纳迪尔（D.B.伍德塞德饰，《诉讼双雄》《24小时》）被派来洛杉矶说服路西法回到地狱... 这名魔鬼的化身是否会弃恶从善，亦或被他的本性最终拉回邪恶？</p></div>', '汤姆·艾利斯 劳伦·日尔曼 D.B.伍德塞德 莱斯丽-安·布莱德', '英语', '2016', '0', '/data/images/56a87c0c07061.jpg', '欧美', '2016-04-27 11:05:36', '13', '0', '0', '690', '魔幻剧', '全集/共13集');
INSERT INTO `movie` VALUES ('1511', '辣妈俏爸', '<div class=\"endtext\"><p>隐居多年的江湖大盗“独孤泽南”艾丁宝自金盆洗手之后恢复幼时身份，回到故乡卧龙镇重拾家业，将酒楼生意恢复往日的兴隆。女捕快顾丹丹的出现搅乱了艾丁宝正常的生活，两人走到一起。顾丹丹怀疑丈夫是消失已久的江湖大盗，开展调查，两人关系紧张。卧龙镇接连发生的几件案件让两个人从敌对关系变成了合作伙伴，顾丹丹在案件的调查与侦破中难以抽离母亲与妻子的身份，却又在种种疑点中发现丈夫的背景扑朔迷离，艾丁宝在照顾妻子的同时也要暗地里帮助百姓解除困难，协助妻子顾丹丹一举端掉人口贩子的老窝，铲除奸臣，化解与救命恩人上官燕的情缘，最终在妻子面前亮出了真实的身份，并得到了妻子的谅解，一家三口继续在卧龙镇快乐的生活下去。</p></div>', '胡杏儿 于波 马天宇 吴孟达 谢园 方青卓', '国语', '2013', '0', '/data/images/571f4d7dd467c.jpg', '大陆', '2016-04-26 19:14:07', '13', '0', '0', '687', '古装剧', '全集/共34集');
INSERT INTO `movie` VALUES ('1512', '我的奇妙男友', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; “基因突变人“薛灵乔沉睡百年后，在一场车祸中意外被倒霉女星田净植唤醒。身世诡异、能力不凡的薛灵乔软硬兼施住进田净植家，田净植表面装作不在乎，背地里却想方设法要赶走这只“妖怪”。不料，这样的互相折磨，竟让两人的关系日渐升温，暧昧的情丝悄悄蔓延。然而，逐渐明朗的不仅是薛灵乔和田净植相爱的心，一个跨越百年的惊天大阴谋也慢慢浮出水面。</div>', '吴倩 金泰焕 沈梦辰 李昕亮 杨逸飞 徐可 付嘉', '国语', '2016', '0', '/data/images/571f4c2be4ea3.jpg', '大陆', '2016-04-26 19:08:34', '13', '0', '0', '694', '偶像剧', '全集/共28集');
INSERT INTO `movie` VALUES ('1513', '结婚契约', '<div class=\"endtext\">[剧 名]:结婚契约<br />\r\n[播 送]:韩国MBC<br />\r\n[类 型]:MBC周末剧 &nbsp;<br />\r\n[首 播]:2016年03月05日<br />\r\n[时 间]:每周六日晚间8点45分各播放一集 <br />\r\n[接 档]:我的女儿琴四月<br />\r\n[导 演]:金进民<br />\r\n[编 剧]:金顺玉<br />\r\n[主 演]:李瑞镇 金宥真 金光奎 金釉利 朴静秀<br />\r\n[制 作]:凤凰天使TSKS韩剧社16年韩流冲击第14波 <br />\r\n[集 数]:20集<br />\r\n[简 介]:]:讲述一个视钱财为人生价值的男人与站在人生悬崖边上的女人以戏剧性的关系相遇并寻找真爱意义的故事。</div>', '李瑞鎮 金宥真 金光奎 金釉利 金容建 李辉香', '韩语', '2016', '0', '/data/images/56dd2f8ca86d4.jpg', '韩国', '2016-04-25 09:50:57', '13', '0', '0', '685', '时装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1514', '碧血书香梦', '<div class=\"endtext\"><p>辛亥革命胜利之后的民国初年，江南才女沈碧云为了实现进入中国最大的私人藏书楼博览群书、为所有学子争取读书的权利的理想，也为了探查杀父仇人，不惜以终生幸福为赌注，嫁入藏书楼之主的宣家，却由此陷入宣家内部的勾心斗角、争权夺利漩涡，遭遇重重危机，尝尽人情冷暖，几度出生入死，宣家也经历了一次次浩劫，直至家破人亡，碧云仍然矢志不渝，在宣家四少爷宣孝季和进步青年吴时的帮助下，凭着坚强的信念和过人的智慧拯救了宣家，成为宣家新当家人，并查清真凶，报得父仇。最终，沈碧云冲破封建祖制开放书楼，包括碧云在内的莘莘学子得以登楼读书。</p></div>', '张檬 韩栋 蒋冰 巍子 茅子俊 吴倩 何中华', '国语', '2016', '0', '/data/images/570537ff8bd3f.jpg', '大陆', '2016-04-25 00:12:56', '13', '0', '0', '695', '年代剧', '全集/共37集');
INSERT INTO `movie` VALUES ('1515', '末代御医(国语版)', '<div class=\"endtext\"><p>“御医”，顾名思义，是专门为中国历代帝皇治病的御用医师。能够成为一代“御医”，本应是从事医师行业者的最高荣誉。然而“伴君如伴虎”，手握帝皇性命安危的“御医”，成功为帝皇驱除百病，固然能够平步青云，万一药石无灵，帝皇不治，杀头大罪亦随之而来，工作如履薄冰！</p>\r\n<p>清朝末年，面对时代洪流，弃旧立新似是当前大势，作为“末代”御医，救得了皇帝性命，却无力主宰国家兴亡！</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">治慈禧“怪病”　成一代御医</span></p>\r\n<p>“戊戌变法”失败，光绪被囚于瀛台，慈禧太后再次垂帘听政。北京城内一位医师杜仲（郭晋安饰），生性自负，恃才傲物，对到来求医之达官贵人也不屑逢迎，不时摆出臭脸，却因医术高明反而得到一众权贵青睐。其时慈禧太后(罗兰饰)身染“怪病”，杜仲奉命入宫，凭著敏锐触觉迅速治好之。慈禧对杜仲大为欣赏，破格封杜仲为御医。</p>\r\n<p style=\"font-weight:bold;\"></p>\r\n<p><span style=\"font-weight:bold;\">“空降”太医院　　救皇帝性命</span></p>\r\n<p>杜仲进入太医院后，获指派专责宫中奇难杂症，凭著天赋一一拆解“悬案”。其后，杜仲又因揭破皇帝光绪（敖嘉年饰）遭人慢性下毒，得到皇上的信任。杜仲发觉光绪实是有为君主，可惜处处受人制肘，有志难伸，遂设法令他重新振作，自己却不自觉卷入连场政治风暴……</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">发妻与知己  情义两难全</span></p>\r\n<p>杜仲当年为报救父之因，迎娶世交残障女儿洪百合(贾晓晨饰)为妻，惟妻子不能生育，杜仲遵从家人和岳父意见纳跌打馆继承人伏苓（杨怡饰）为妾。成亲当晚，伏苓竟与情郎私奔，杜仲眼见伏苓宁死不屈大为感动，写下休书成全二人。惜伏苓南下广州后遭情郎抛弃，继而投身革命行列，从事情报工作。</p>\r\n<p>伏苓奉命返回京城，与杜仲重遇，因经常上门为其妻百合按摩推拿而成为好友。伏苓觑准杜仲的御医身份，经常出入皇宫，遂利用杜仲穿针引线，借着与杜仲合力医病，与潜入宫中收集情报。二人合力破解了不少“医案”，日久生情……</p>\r\n<p>随着八国联军攻入京城，杜仲和伏苓历经生死，终确认彼此深情，惟伏苓深怕革命党员身份祸及杜仲，只得按捺爱意。然而纸始终包不了火，伏苓身份终被揭开，杜仲内心挣扎。同时，革命党人为免杜仲揭露秘密，竟命伏苓杀人灭口……</p></div>', '郭晋安 杨怡 敖嘉年 罗兰 贾晓晨 林子善 张颕康 朱晨丽', '国语', '2016', '0', '/data/images/56f9344f36eb9.jpg', '香港', '2016-04-24 13:01:41', '13', '0', '0', '687', '古装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1516', '维京传奇第四季', '<div class=\"endtext\"><p>公元9世纪至公元11世纪，一大批斯堪的纳维亚人（Scandinavian，主要指今天的丹麦、挪威、瑞典、芬兰和冰岛等地）离开故土前往他们从未去过的地方寻找财富，这些擅长航海的武士被史书称作维京人（Vikings）或者北方人（Norsemen）。其中一部分维京人乘坐当时极为先进的新型「无畏舰」跨越大西洋抵达不列颠群岛，对沿海地区进行劫掠——特别是没有任何还手之力的修道院。还有一部分维京人则把触手伸到了欧洲大陆的腹地，甚至当代俄罗斯的一部分地区、冰岛、格陵兰岛和纽芬兰岛。在接下来的三个世纪里，他们因为自己的行为被标上了各种称号：海盗、劫掠者、商人、移民。 该剧描述了维京人鼎盛时期的故事，他们在当时的北欧地区处于统治地位，因为喜好海上劫掠并不断对外扩张，被人们冠以“北欧海盗”的别号。该剧将侧重于描写维京人的生活、贸易、探索及对外侵袭的全过程。</p></div>', '崔维斯·费米尔 古斯塔·斯卡斯加德 凯瑟琳·温妮克', '英语', '2016', '0', '/data/images/56e3efa451e50.jpg', '欧美', '2016-04-23 10:30:27', '13', '10', '10', '696', '历史剧', '更新至10集/共10集');
INSERT INTO `movie` VALUES ('1517', '末代御医(粤语版)', '<div class=\"endtext\"><p>清末历经甲午战争、戊戌变法失败，光绪帝（敖嘉年饰）被慈禧太后（罗兰饰）禁闭在中南海瀛台。民间医师杜仲（郭晋安饰）因医术高明奉命入宫为慈禧诊治怪病，慈禧不药而愈大喜封杜仲为御医，杜仲虽知“伴君如伴虎”的道理但也无奈接受。杜仲身为御医期间不但能将多年未能根治的怪病、悬案迎刃而解；更因长期医治光绪，及帮助光绪、珍妃（朱晨丽饰）这段苦恋，而得到光绪的信任。杜仲虽是名医却不能治好残障妻子洪百合（贾晓晨饰），唯有求助身怀祖传推拿秘技的跌打医师伏苓（杨怡饰），帮助百合舒缓痛楚。伏苓更在杜仲引荐下，入宫为慈禧作推拿，期间伏苓不单与杜仲建立友情，还渐生情愫，但碍于百合的关系，一直将感情埋藏心底；但伏苓入宫竟有秘密任务，背后更牵连动摇清朝的阴谋！在清末这大时代下，杜仲、伏苓能否在慈禧、光绪、珍妃等人连场的政治风波下全身而退？</p></div>', '郭晋安 杨怡 敖嘉年 罗兰 贾晓晨 林子善 张颕康 朱晨丽', '粤语', '2016', '0', '/data/images/56f9344f36eb9.jpg', '香港', '2016-04-22 21:39:49', '13', '0', '0', '687', '古装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1518', '十五年等待候鸟', '<div class=\"endtext\"><p>十三岁的黎璃在进入初中的第一天就注意到了这个帅气且玩世不恭的少年裴尚轩，他像一缕阳光温暖了黎璃的生活。这对相貌平凡的女生与外表英俊的男生，品学兼优的女生与成绩倒数的男生之间注定不会是令人羡慕的佳偶天成。</p>\r\n<p>在接下来的十五年里，黎璃是裴尚轩生活里唯一不变的挚友，在他失恋的时候，失意的时候，甚至是失去自由的时候；裴尚轩则是黎璃唯一不变的真爱，在她孤独的时候，欣喜的时候，甚至是生命垂危的时刻。</p>\r\n<p>十五岁开始的每一个新年，黎璃的愿望都是：今年开始不再喜欢裴尚轩。但是这个心愿从来都没有实现过。在裴尚轩看来，黎璃是一个没有性别的朋友，他愿意保护她，安慰她，只是爱情这个词与他俩无关，十五年的点滴让这一切发生了质的变化，尚轩这才发现黎璃已是他生命里不可或缺的人。只是此刻她对他的爱已不能延续，尚轩痛心的喊出：黎璃，下辈子，我要先爱上你。</p></div>', '张若昀 孙怡 邓伦 张雪迎 李宗霖 刘美含', '国语', '2016', '0', '/data/images/56e98620950b4.jpg', '大陆', '2016-04-22 00:21:14', '13', '24', '20', '694', '偶像剧', '更新至24集/共20集');
INSERT INTO `movie` VALUES ('1519', '绝命律师第二季', '<div class=\"endtext\"><p>《绝命律师》是《绝命毒师》的前传。故事设定在Saul Goodman（Bob Odenkirk）成为Walter White的律师的六年以前。这位后来以Saul Goodman著称的男人当时还叫Jimmy McGill，是一个三流律师，用各种不正当的手段谋生存。这部电视剧将讲述Jimmy是如何成为刑事律师Saul Goodman。</p></div>', '鲍勃·奥登科克 蕾亚·塞洪 帕特里克·法比安', '英语', '2016', '0', '/data/images/56cc7edbcef7c.jpg', '欧美', '2016-04-19 23:34:26', '13', '10', '10', '686', '警务剧', '更新至10集/共10集');
INSERT INTO `movie` VALUES ('1520', '超女第一季', '<div class=\"endtext\"><p>《女超人》（Supergirl）是美国DC漫画公司的漫画人物，诞生于1959年5月。 在DC的漫画故事里曾有数人获得女超人的称号。 她们都与超人有着密不可分的联系，要么是超人的堂姐妹，要么是超人的义妹，也有是超人的女儿。将出现在这部连续剧中的女超人叫做Kara In-Ze。</p>\r\n<p>由于Kara所在的星球和超人是姊妹星，因此她和超人一样通过太阳获得了类似超人的能力，面对氪石的时候，她比超人支持的时间还要长。而根据目前披露的消息，这位“超人的表妹”此前一直隐藏着自己的能力，一直到她24岁的这一天……</p></div>', '梅丽莎·贝努瓦 麦卡德·布鲁克斯 凯乐·利 女超人第一季', '英语', '2015', '0', '/data/images/569df900eb9fb.jpg', '欧美', '2016-04-19 17:51:24', '13', '20', '13', '688', '科幻剧', '更新至20集/共13集');
INSERT INTO `movie` VALUES ('1521', '国务卿女士第二季', '<div class=\"endtext\"><p>精明干练、意志坚定、智慧超群的Elizabeth McCord（Tea Leoni）刚刚被任命为美国国务卿，她将在国际外交事务、办公室政治和各种「徊避程序」之间寻找平衡点。在解决国家大事的同时，她还面临很多个人烦恼 ——既来自白宫，也来自家中。Elizabeth过去是一位大学教授，后来又当过中情局分析师，但因为道德伦理方面的原因辞了职。前任国务卿离奇死亡，总统下令让她重返白宫，她因此回到了公众的视线中。总统尊重她没有明显政治倾向性的态度，也赏识她对中东事务的透彻认识、她能流畅说多国语言的能力及她的创造性思维。事实上……从来没有什么东西能约束她的思维。</p>\r\n<p>\r\n\r\n    McCord的团队包括其办公室主任、幕僚长Nadine Tolliver（艾美奖得主Bebe Neuwirth）、演讲稿撰写人Matt Mahoney（Geoffrey Arend）、媒体联络官Daisy Grant（Patina Miller）和长相迷人的助理Blake Moran（Erich Bergen）。Moran对Elizabeth极为忠诚，事实上在Elizabeth的团队中，他是唯一由Elizabeth亲自雇用的。 </p>\r\n<p>在争论完第三世界国家的问题、巧妙地处理好与外国政要的关系后，她拖着疲惫的身体回到温暖的家中，一直默默支持她的丈夫Henry（Tim Daly）和两个聪明伶俐的孩子（Katherine Herzer和Evan Roe）正等着她一起吃饭。对她而言，「政治」和「危机」在家中有着完全不同的含义。Henry是一位研究中世纪宗教历史的教授，对工作非常痴迷，他可以连续讲两个小时「托马斯-阿奎那」的理论并且一句话都不会重复。儿子Adam正处在青春期，是一个初露头角的无政府主义者。女儿Caroline和母亲一样美丽外向，无论在哪里都受人欢迎。</p></div>', '蒂娅·里欧妮 蒂姆·达利 莫赞·玛诺', '英语', '2015', '0', '/data/images/5694c07431b1b.jpg', '欧美', '2016-04-19 17:51:01', '13', '20', '22', '686', '警务剧', '更新至20集/共22集');
INSERT INTO `movie` VALUES ('1522', '潜伏在黎明之前', '<div class=\"endtext\"><p>1947年夏，人民解放军转入战略反攻，国民党军被迫向南收缩，以图与解放军进行总决战。战守平之弟战守安，长期潜伏在旅营保密局特别督导室，因战守平起义而受株连，被迫流落广州，幸得地下党员秦风及刘义雄以生命掩护才得以转危为安。国民党为挽回颓势，在我军上层隐藏了一张间谍网，得知此事的战守安以双重间谍的身份，返回旅营继续从事地下工作，全力侦破这个隐秘间谍网及其“天击计划”，与以爱国商人为幌子的国民党特务吕耀庭展开博弈。可最让战守安想不到的，是其兄战守平才是“天击计划”的一步要棋，他明投解放军，暗中却妄图从内部破坏解放军的渡江决战。面对最大也是最后的敌人，面对自己最信赖的亲生哥哥，战守安义正辞严晓以大义，终于在战守平企图炸坝的关键时刻，说动他放下屠刀。</p></div>', '杨烁 胡军 甘婷婷 郭珍霓 吴刚 陈丽娜', '国语', '2016', '0', '/data/images/56f202b0b0f19.jpg', '大陆', '2016-04-17 23:00:04', '13', '44', '40', '693', '战争剧', '更新至44集/共40集');
INSERT INTO `movie` VALUES ('1523', '爱的阶梯', '<div class=\"endtext\"><p>该剧讲述的是欲望的都市里，我们告别那些年少的美好和青春的璀璨，突入物欲横流的现实怀抱之中，平民之子张皓天，宋氏集团继承人宋梓杨，孤儿路风为大学时代的三兄弟，告别校园后各自走上了不同的奋斗征程，在商场上施展远大抱负。</p></div>', '张睿 张檬 杨诚诚 霍政谚 邹廷威', '国语', '2016', '0', '/data/images/56e8234eb6228.jpg', '大陆', '2016-04-15 22:38:54', '13', '71', '80', '685', '时装剧', '更新至71集/共80集');
INSERT INTO `movie` VALUES ('1524', '旋风十一人', '<div class=\"endtext\"><p>青春校园励志电视剧《旋风十一人》聚焦足球题材，讲述在“落魄教练”穆奇的带领下，一群高中足球少年在校足球联赛中一路奋力打拼的故事。</p>\r\n<p>市中学生联赛，连输两场出线无望的17中足球队迎来了新教练穆奇（胡歌饰）。穆奇强硬的执教风格引来所有队员的抵触，也为这里带来了新的生机。连刚接手足球班的实习老师裴朵（江疏影饰）也跟穆奇冲突不断。但穆奇用他特有的方法因材施教，带领这支本不被看好的球队一路由市联赛杀进了省联赛。在裴朵的帮助下，穆奇与队员们建立了深厚的情谊，曾经人人头疼的问题学生们不仅信心倍增训练积极，学习成绩也突飞猛进，穆奇和裴朵的关系也不断升温。就在一切步入正轨之际，大大小小的麻烦也接踵而来，穆奇的过去被挖了出来，队员们也面临着人生的第一次选择。面对各种压力，队员们团结一致坚持到最后一场比赛，挥洒青春、汗水与热血。赛季结束后，穆奇向学校辞去了球队主教练一职，而他带来的拼搏精神影响着所有队员。</p></div>', '胡歌 江疏影 曾黎 李子峰 钱枫 牛骏峰 唐沸潮', '国语', '2016', '0', '/data/images/56fe69b631a3e.jpg', '大陆', '2016-04-15 21:14:14', '13', '0', '0', '685', '时装剧', '全集/共28集');
INSERT INTO `movie` VALUES ('1525', '亿万/财富之战', '<div class=\"endtext\"><p>围绕两位主要人物，作风强硬的律师Rhodes(Giamatti 饰)和野心勃勃的对冲基金高手Axe (Lewis 饰)展开，以二人之视角，讲述世界金融中心华尔街的风云变幻。</p></div>', '戴米恩·路易斯 玛姬·丝弗 保罗·吉亚玛提 玛琳·阿克曼 大卫·科斯塔贝尔', '英语', '2016', '0', '/data/images/569f024a7dac7.jpg', '欧美', '2016-04-15 11:04:26', '13', '0', '0', '697', '商战剧', '全集/共12集');
INSERT INTO `movie` VALUES ('1526', '我是僵尸第二季', '<div class=\"endtext\"><p>就读于某医学院的奥利维娅·“丽芙”·摩尔（罗丝·麦克莱弗 Rose McIver 饰）学业精进，甜美可人，她原本拥有美好光明的人生，谁知一个反常的决定彻底颠覆了她既定的命运。经不住同侪的劝说，她参加了一个在轮船上举行的狂欢派对。可是派对上一种神秘的药物令所有人变成了嗜血如命的狂暴丧尸。次日一早，奥莉维娅从裹尸袋中坐起，她明明已经死去，如今则以丧尸的身份复活。外貌和气质的巨大转变以及可怕的遭遇令家人手足无措，而身体内对脑子的渴望也让她焦灼不堪。为此奥莉维娅在西雅图验尸官办公室谋得一份职业，从此她有了稳定的食物来源，与此同时她发现自己也顺势拥有了死者的记忆…</p></div>', '罗丝·麦克莱弗 莫莉·哈根 杰弗里·文森特·帕里塞 朱国安 大卫·安德斯', '英语', '2015', '0', '/data/images/56962c5bb992f.jpg', '欧美', '2016-04-15 11:00:58', '13', '0', '0', '686', '警务剧', '全集/共13集');
INSERT INTO `movie` VALUES ('1527', '回来吧大叔', '<div class=\"endtext\"><p>该剧改编自日本作家浅田次郎作品《椿山课长的七天》，讲述了“万年课长”失败老爹和前黑社会老大转生为“花美男店长”和“绝世美女”重返人间后引发的一系列故事。重生的他们历经又一轮的人生了解到各类事情的真相，领略了什么才是真正的爱情和幸福，将为观众献上感动与欢乐。</p></div>', '郑智薰 吴涟序 李珉廷 金秀路 尹博 李荷妮 崔元英', '韩语', '2016', '0', '/data/images/56ce585b9935b.jpg', '韩国', '2016-04-15 08:35:14', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1528', 'EU超时任务(国语版)', '<div class=\"endtext\"><p>如果有机会重返大灾难的一日，相信大家也会争取机会拨乱反正，避免惨剧发生。可是世界上存在着“蝴蝶效应”，当一件事被更改后，相关的事件也有相应的调节。正所谓“一石击起千重浪”，即使改变了前因，人又能否掌握后果？纵使有无限次的机会重返三日前，最终会否事与愿违？</p>\r\n<p><span style=\"font-weight:bold;\">回到三日前　企图拯救父亲</span></p>\r\n<p>新界北冲锋队新扎警长凌晨风(朱千雪饰)在某围村巡逻时遇上数名可疑分子，对他们展开追捕，却遇上了围村村长关鼎名(王浩信饰)的阻挠，让事件越闹越大，触发起枪战。晨风父亲凌海(罗乐林饰)竟出现在枪战现场，还因中流弹而死亡，晨风将责任归咎于自己！</p>\r\n<p>晨风在伤痛中遇上一个宇宙异象，让她能回到三日前，有机会将父亲拯救过来！晨风以为自己对一切已全知晓，改变事情易如反掌。事实上，这三天却令她看到事情背后另有真相，亦因为蝴蝶效应，令事情不如首次般进行，凌海仍然难逃死亡命运。</p>\r\n<p><span style=\"font-weight:bold;\">二度回到过去　被迫拯救仇人</span></p>\r\n<p>汲取教训的晨风，再度返回过去，小心行事，最终成功拯救了父亲。与此同时，晨风发现围村内有黑警对村民不利，还知悉ICAC有一线人潜伏，调查犯罪集团与黑警勾结的罪行，让正义禀然的她再次折返三日前</p>\r\n<p>晨风再次遇上了鼎名这个“杀父仇人”，也认识到他性格的另一面。眼见鼎名面临生死危机，身为警察的晨风出尽全力拯救。过程中，鼎名与晨风被逼合作揪出村内的黑警。二人性格及行事作风迥异，相处期间产生不少矛盾与冲突。</p>\r\n<p><span style=\"font-weight:bold;\">不断穿梭过去　看清同袍好友</span></p>\r\n<p>晨风多次穿梭来往三日前后，对身边的人恍似多了认识。经常与晨风不咬弦的冲锋队车长陈劲威(单立文饰)，被晨风意外发现他鲜为人知的一面，二人惺惺相惜，亦师亦友</p>\r\n<p>仇人可以变成朋友，男友及闺密亦有可能反目成仇！男友兼同袍郭尚正(袁伟豪饰)，发觉晨风与鼎名走得越来越近，拟似擦出了爱火花，令尚正与晨风的感情起了波澜。再加上晨风回到过去时，查出了一个令尚正晴天霹雳的秘密，尚正几近崩溃，做事态度一百八十度大幅转变，令晨风也受到重大打击。</p>\r\n<p>享负盛名的新界土豪乡绅贺展祥(林伟饰)，表面上是一名知识分子及慈善商人，深深吸引了晨风的记者好友李姿婷(谭凯琪饰)。晨风查出展祥牵涉非法勾当，同时得知姿婷曾与尚正有过一夜情，眼看这位“好友”主动接近展祥，堕入风眼，还有可能出卖了另一闺密好友贺小美(刘佩玥饰)。一连串的怀疑，令晨风陷入痛苦挣扎中……</p>\r\n<p><span style=\"font-weight:bold;\">穿梭过去能力 带来痛苦压力</span></p>\r\n<p>晨风拥有返回过去的超能力，让她可以将走近了死亡边缘的父亲拉回来，不过亦同时令她看到身边人背后的一段段故事，以及发生在他们身上的种种不幸遭遇；还有更重要的，是要阻止鼎名为上位而胡作非为，这一切令晨风体会到能力愈大责任愈大之苦。</p>\r\n<p>晨风萌生放弃回到过去机遇的念头，但又想为眼前的挚爱伸出援手，晨风如何面对这个痛苦的抉择？</p></div>', '朱千雪 王浩信 朱晨丽 林伟 苟芸慧 袁伟豪', '国语', '2016', '0', '/data/images/56f2529f43c6b.jpg', '香港', '2016-04-11 11:15:24', '13', '0', '0', '686', '警务剧', '全集/共22集');
INSERT INTO `movie` VALUES ('1529', '精灵守护者', '<div class=\"endtext\"><p>根据作家上桥菜穗子的玄幻小说改编，由片冈敬司执导，绫濑遥、木村文乃、藤原龙也、东出昌大、平干二朗、吉川晃司、林遣都、吹越满、神尾佑、松田悟志、清原果耶主演。讲述了以人类与精灵共同生存的世界新悠果王国为舞台，女保镖巴尔莎和年幼的小王子查克姆一起冒险的长篇故事。</p>\r\n<p>一次偶然机会，女保镖巴尔莎救下了落入河中的新龙勾皇国王子查穆。将查穆带回宫殿的巴尔莎却被告知赶快带他逃走。查穆身上带有精灵之卵，但却被称为魔物，因而被人追杀。巴尔莎带着查穆一路逃命，并教会了他守身之术。距离精灵之卵的孵化日期越来越近，他们的命运将迎来怎样的考验呢？</p></div>', '绫濑遥 小林飒 东出昌大 木村文乃 林遣都', '日语', '2016', '0', '/data/images/56efa9ca93afe.jpg', '日本', '2016-04-11 10:13:24', '13', '0', '0', '690', '魔幻剧', '全集/共4集');
INSERT INTO `movie` VALUES ('1530', 'EU超时任务粤语', '<div class=\"endtext\"><p>冲锋队是警队的先锋，一旦接获危急状况，抢先第一时间赶抵现场化危为机是冲锋队的首要任务，新紥沙展凌晨风（朱千雪饰）深明此道，往往不容有失，敦促队员争分夺秒避免任何耽误与差池。晨风一次带队巡逻演变成警匪枪战，晨风遭围村村长关鼎名（王浩信饰）诸多阻挠，不单令疑犯逃脱，更令她亲眼目睹父亲被流弹击毙，谁料突然天降异象，晨风可以由四月三日重复返回四月一日，她逆转时机救回父亲却诱发巨大的连锁反应；鼎名无意得知晨风的秘密，借故合作追查黑警，令二人化敌为友，然而，鼎名一直隐瞒自己的真正身份，而晨风一众身边人像同僚兼男友郭尚正（袁伟豪饰）、冷漠的车长陈劲威（单立文饰）、记者好友李姿婷（谭凯琪饰）等，亦遭这股超自然力量牵引，遇上连串人算不如天算的意外经历……</p></div>', '王浩信 朱千雪 袁伟豪 单立文 谭凯琪 刘佩玥 朱晨丽 苟芸慧', '粤语', '2016', '0', '/data/images/56f00a1ddc345.jpg', '香港', '2016-04-10 23:53:01', '13', '0', '0', '686', '警务剧', '全集/共22集');
INSERT INTO `movie` VALUES ('1531', 'Page Turner', '<div class=\"endtext\"><p>《Page Turner》是一部青春、言情、励志的治愈系电视剧，是韩国KBS电视台特别企划独幕剧，由曾执笔《听见你的声音》、《匹诺曹》的编剧朴慧莲担任编剧，由韩国甜美少女金所炫、金志洙、申在河等联袂演绎。韩剧《Page Turner》讲诉了曾在各种钢琴比赛中获得冠军的天才少女尹侑瑟（金所炫饰）在遭遇一场突入其来的意外事故后，她的人生发生了一百八十度的大转变。而今，身为钢琴演奏者志愿者的她将和性格拖拉莽撞的运动选手郑车植（金志洙饰）、命运般的对手真木（申在河饰）开始了新的人生……</p></div>', '金所炫 金志洙 申在河', '韩语', '2016', '0', '/data/images/56f88f52a3b2f.jpg', '韩国', '2016-04-10 21:45:42', '13', '3', '3', '685', '时装剧', '更新至03集/共3集');
INSERT INTO `movie` VALUES ('1532', '秀才遇着兵', '<div class=\"endtext\"><p>明朝时期有一名女飞贼飞鹰（米雪 饰）劫富济贫，神捕陆战（元华 饰）也被她的风姿吸引，两人结合后生下一女，名叫陆拾义（周丽淇 饰），飞鹰也就此在江湖销声匿迹。长大后的拾义成为了一名女捕快，处处为百姓伸张正义，却被衙门中的男人看轻。刚好新上任的县令水东流整治官员中腐败现象，便与拾义联手破解了多宗奇案。</p>\r\n<p>就在这个时候发生的一宗谋杀案，嫌疑犯锁定在飞鹰身上。母亲隐瞒多年的身份终于被拾义妹知道了。拾义妹为了帮飞鹰洗脱罪名，决定与水东流一起寻找真凶。</p></div>', '陈豪 米雪 周丽淇 黎耀祥  欧倩怡', '国语/粤语', '2005', '0', '/data/images/56cfb655b8edc.jpg', '香港', '2016-04-10 11:02:18', '13', '0', '0', '687', '古装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1533', '永无止境第一季', '<div class=\"endtext\"><p>改编自2011年布莱德利·库珀主演的同名电影，故事描述事业不成功且缺乏灵感的作家Brian Finch（Jake McDorman）因服用绝密的「聪明药」NZT而使生活大为改观。这种尚处在实验阶段的药物能让人发挥大脑百分之百的潜能，使服用者变成一个「完美的人」。但这种药物也给人体带来很大的副作用，而且一股黑暗势力正试图谋杀他。联邦调查局劝说Brian利用自己的能力来行善——根据CBS的传统，「行善」就是研究并破解复杂的悬案线索。</p>\r\n<p>联邦调查局纽约分部重案组派遣特别探员Rebecca Harris（Jennifer Carpenter）与Brian紧密配合。她富有创新精神，在联邦调查局内部上升得很快。但她有一段自己无法面对的黑暗背景，那正是驱使她选择执法事业的本质原因。特别探员Boyle（Hill Harper）奉命协助Rebecca工作，他曾参过军，是Rebecca的知己。他的主要任务是监测NZT药物所产生的影响和后果。特别探员 Nasreen “Naz” Pouran（Mary Elizabeth Mastrantonio）是重案组的负责人。她当过公诉人，因此很善于操纵和运用自己手中的权力。</p>\r\n<p>联邦调查局并不清楚，Brian其实还有一个「后台老板」——他与Edward Mora参议员（Bradley Cooper）保持着密切接触。Edward也经常使用NZT药物，他对Brian这个新弟子有着一整套秘而不宣的计划。更重要的是，Edward是下任美国总统的有力竞争者。</p>\r\n<p>NZT药物能够帮助Brian使用大脑百分之百的潜能，即便所有联邦探员加在一起也比不上他的高效，这使得他成为犯罪分子最大的梦魇。毫无疑问，他将成为联邦调查局有史以来最宝贵的财富。</p></div>', '詹妮弗·卡朋特 杰克·麦克道曼 玛丽·伊丽莎白·马斯特兰托尼奥 希尔·哈勃', '英语', '2015', '0', '/data/images/569fa77e2ab8d.jpg', '欧美', '2016-04-07 09:16:21', '13', '0', '0', '686', '警务剧', '更新至20集');
INSERT INTO `movie` VALUES ('1534', '美国罪案故事', '<div class=\"endtext\"><p>Ryan Murphy的《美国罪案故事 American Crime Story》根据《The Run Of His Life: The People V.O.J Simpson, ACS: O.J》改编，以律师们的视角看待辛普森谋杀案。 本剧探索了案件背后各种混乱，以及案件双方的庭审策略，也讲述了起诉方的信心是如何对抗辩方的狡猾，也揭露了洛杉矶警署是怎么处理非裔美国人的历史，向陪审团讲述了他们需要的合理质疑。</p></div>', '小库珀·古丁 莎拉·保罗森 大卫·休默 约翰·特拉沃尔塔 康妮·布里登 考特尼·万斯', '英语', '2016', '0', '/data/images/56c4821e177c2.jpg', '欧美', '2016-04-07 09:14:46', '13', '0', '0', '686', '警务剧', '全集/共10集');
INSERT INTO `movie` VALUES ('1535', '暗影猎人', '<div class=\"endtext\">该剧的首集由McG执导，该集讲述了18岁的Clary Fray在她生日那天发现了她的身份并不只是看起来那么简单，而是一个猎杀恶魔的天使与人类的混血儿，而这个故事又要从Shadowhunters开始讲起. 当她的母亲Jocelyn被绑架时，Clary与一名神秘的暗影猎手Jace（Sherwood饰演）和她最要好的朋友Simon被抛弃到一个猎杀恶魔的世界。与仙子，术士，吸血鬼与狼人生活在一起，Clary开始了探索自我的旅程，她渴望了解自己的过去以及未来。自恋并拥有致命美貌的Jace是一名意志坚定，水平出色的暗影猎手，是一名骁勇善战的战士参与着对抗恶魔的战争。在他父亲被杀死后，Jace立誓要找到杀害父亲的凶手并让他血债血偿。</div>', '凯瑟琳·麦克纳马拉 多米尼克·谢尔伍德', '英语', '2016', '0', '/data/images/56975de78fe65.jpg', '欧美', '2016-04-04 20:01:53', '13', '0', '0', '690', '魔幻剧', '更新至11集');
INSERT INTO `movie` VALUES ('1536', '行尸走肉第六季', '<div class=\"endtext\"><p>《行尸走肉第六季》全集根据托尼·摩尔（Tony Moore）的同名漫画行尸走肉改编，是美剧电视史上第一部正宗的丧尸电视剧。行尸走肉全集主要讲述的是主人公Rick在执行公务的过程中遭到枪击，伤势严重，被人紧急送往当地医院进行抢救。当Rick醒来之后，发现医院里已经空无一人。他意识到外面一定出了大事，但又不清楚到底是什么事。全剧围绕主人公 Rick（译：瑞克）在丧尸蔓延、危机四伏的美国四处逃亡时与他的同伴的经历展开，剧情扣人心弦。</p></div>', '安德鲁·林肯 钱德勒·里格斯 劳伦·科汉 查德·科尔曼', '英语', '2015', '0', '/data/images/56c195ef0dece.jpg', '欧美', '2016-04-04 17:38:56', '13', '0', '0', '690', '魔幻剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1537', '因为爱情有幸福', '<div class=\"endtext\"><p>麦可可是个抱持着现代生活理念的独立女性，深知婚姻并非两个个体的简单结合，而是两个家庭全面磨合的道理，因此她一直不敢轻易踏入婚姻的殿堂，直到各方面都无可挑剔的完美男人威廉的出现，终于打消了麦可可对婚姻的恐惧。两人新婚燕尔，租住进了居住着唐家祖孙三代人的枫龄老洋房。可让麦可可万万没想到的是，从小与家人走失的威廉，终于下决心要开始寻找当年走散的亲人。这个决定将他们完美的婚后生活打破，小小的幸福即将迎来大大的改变。</p></div>', '陈伟霆 唐艺昕 菅韧姿 李泰 魏大勋 梁田', '国语', '2016', '0', '/data/images/56cefe50a85c8.jpg', '大陆', '2016-04-03 10:37:43', '13', '0', '0', '694', '偶像剧', '全集');
INSERT INTO `movie` VALUES ('1538', '黑吃黑第四季', '<div class=\"endtext\"><p>《黑吃黑 第四季》是由葛·艾坦尼斯执导，伊万娜·米利塞维奇/Antony Starr/罗斯·布莱克维尔/Ulrich Thomsen等主演的电视剧.第四季已于2016.04.02播出。在新一季的banshee中将会出现更多的角色，并且Proctor的势力会更加的强大，他自己也当上了市长。Ana Ayora饰演Nina Cruz，她将作为Proctor安插在警局里的内线。她格斗及暗杀能力都十分熟练，是为Kai Proctor干脏活的能手。Eliza Dushku也在第四季banshee中饰演Veronica Dawson，在剧中扮演一个性感但有些鲁莽的FBI探员。</p></div>', '安东尼·斯塔尔 伊万娜·米利塞维奇 乌尔里奇·汤姆森 李勋 莉莉·西蒙斯', '英语', '2016', '0', '/data/images/5700819deaca3.jpg', '欧美', '2016-04-03 10:36:14', '13', '1', '10', '686', '警务剧', '更新至01集/共10集');
INSERT INTO `movie` VALUES ('1539', '蓝海暮色第一季', '<div class=\"endtext\"><p>《蓝海暮色第一季》是一部情节复杂的警匪剧，故事描述单身母亲、警探Harlee McCord（Jennifer Lopez）因为自身的腐败问题而遭到联邦调查局反腐败部门的调查，她被迫同意为联邦调查局从事一项绝密的卧底任务来换取特赦。Harlee来自一个非常高效、非常团结的警务部门，有着很高的破案率。然而她的新工作可能导致她背叛自己的同事，也可能导致她的同事背叛她——在这之前，他们一直在帮助她抚养女儿。Harlee的兄弟们都是警察，但为了让自己获得救赎，Harlee必须站到兄弟们的对立面上，这让她陷入道德困境。</p></div>', '詹妮弗·洛佩兹 沃伦·科尔 戴奥·奥柯奈伊 雷·利奥塔', '英语', '2016', '0', '/data/images/5698ffd404ebb.jpg', '欧美', '2016-04-02 10:00:04', '13', '0', '0', '686', '警务剧', '更新至13集');
INSERT INTO `movie` VALUES ('1540', '爱回家(粤语版)', '<div class=\"endtext\"><p>《爱回家》，TVB情境剧集《爱·回家》自2012年开播至今创下了不少纪录，不久前以804集收官。近日，TVB宣布推出全新版本，“变新”后的《爱· 回家》，马家骨干成员将相继淡出，新加盟的成员包括张继聪、黄翠如、龚嘉欣及麦长青等人气演员，故事也将变成以健身中心及海味铺作为主线。张继聪和黄翠如更将变身情侣，双双成为瑜伽导师，上演“逼婚”等戏码。</p></div>', '刘丹 黎诺懿 徐荣 郭少芸 林漪娸 朱慧敏 爱·回家', '粤语', '2012', '0', '/data/images/567e2edc3ab08.jpg', '香港', '2016-04-02 09:58:37', '13', '0', '0', '685', '时装剧', '全集/共995集');
INSERT INTO `movie` VALUES ('1541', '魔法师第一季', '<div class=\"endtext\"><p>Syfy宣布将Lev Grossman撰写的幻想三部曲小说《魔法师》改编成电视剧集。这套小说于2009年首次出版，被称作「给成年人看的《哈利波特》」。故事描述20多岁的年轻人Quentin（Jason Ralph）和Alice（Sosie Bacon）在纽约研究魔法时发现自己童年读过的「魔法奇幻世界」不仅是真实的，而且会给地球和人类带来一场灾难。《邪恶力量》的前任剧集总监Sera Gamble负责创作试映集剧本并兼任执行制片人，John McNamara 、Michael London和Janice Williams均担任执行制片人，Mike Cahill执导试映集。Syfy将用《童年的终结》（Childhood’s End）的大结局来启动《魔法师》，即在《童年的终结》大结局之后播出《魔法师》的预览集（首集）。</p></div>', '迈克·卡希尔 斯黛拉·麦薇 阿俊·古普塔', '英语', '2016', '0', '/data/images/56a9d86fb117e.jpg', '欧美', '2016-04-01 16:18:40', '13', '0', '0', '690', '魔幻剧', '更新至11集');
INSERT INTO `movie` VALUES ('1542', '流金岁月', '<div class=\"endtext\"><p>丁善本（罗嘉良 饰）在6岁时因父母沉船身亡，弟弟不知所踪。后来他被丁荣帮（秦沛 饰）收养，荣邦视善本为己出，把金业生意全盘交给善本打理，本却因养父与犯罪集团勾结而被捕，没想到的是拘捕善本的是他的亲生弟弟钟守康（温兆伦 饰）。 </p>\r\n<p>善本在澳洲公干时邂逅了程天蓝（宣萱 饰），此时二人的关系陷入僵局，虽然最后水落石出，但善本的家庭背景阻碍了两人的发展。善本因养父的关系多次与守康发生争执，为了避免影响守康的前途，善本决定不与守康相认。而善本也知道守康一直喜欢天蓝，便决定忍痛与天蓝分手。</p>\r\n<p>义弟丁善行（林峰 饰）受叔叔的挑拨继而认为善本杀害了父亲，无奈之下善本只好把刚走回正道的生意归还给善行。善本渐渐得到守康与天蓝的谅解，却再次卷入了江湖斗争中……</p></div>', '罗嘉良 温兆伦 宣萱 林峰 叶璇 杨怡 石修 向海岚', '国语/粤语', '2002', '0', '/data/images/56f2017f6246b.jpg', '香港', '2016-04-01 10:13:44', '13', '11', '45', '685', '时装剧', '更新至11集/共45集');
INSERT INTO `movie` VALUES ('1543', '汇通天下', '<div class=\"endtext\"><p>慈禧太后为庆祝六十大寿，大肆修葺颐和园，令朝廷经济陷入困境。工人支薪不足，所收白银成色又欠佳，工人愤而群起罢工，引发一宗户部冤案！</p>\r\n<p>负责颐和园工程的军机大臣徐永怀，为免工潮惊动慈禧，要求户部提前开银库取钱先行支薪予工人，不料提款时竟发现银库内数箱白银不翼而飞。徐永怀下令彻查，掌管银库的户部郎中齐学仁首当其冲被捕。学仁本是一介清官，无奈遭上司户部侍郎柴毅陷害，插赃嫁祸，含冤莫白，全家被判斩刑！</p>\r\n<p>百川来到山西平遥，身无分文。家庭巨变令百川万念俱灰，有如行尸走肉，流落街头与乞丐为伍。本业欣赏百川为人仗义具勇气，招揽百川入票号当学徒。</p>\r\n<p>票号业务蒸蒸日上，此时却产生‘逼宫’事件。润田处处争取表现，令裕泰觉得地位备受威胁，裕泰孤立无援，愤然辞职。裕泰离开鼎丰盛，受富商赏识，另起炉灶，成立永亨泰票号。裕泰对本业心存怨怼，从此两间票号势成水火，不断明争暗斗。</p>\r\n<p>崇文暗中调查福佑，发现其收入与官职不相当。崇文追查之下，发现福佑勾结盐枭，而受赂钱财正好存放鼎丰盛票号！</p>\r\n<p>裕泰乘机发放假消息，指鼎丰盛牵涉收受非法存款，即将结业。一时谣言四起，顾客恐防所存积蓄化为乌有，纷纷向鼎丰盛提款，立时群情汹涌，酿成‘挤兑’。鼎丰盛无法支付大量白银，向同业求助，同业怕受牵连而拒绝，鼎丰盛陷入绝境…</p>\r\n<p>慈禧仍不断要求修葺颐和园，朝廷知悉众票号财力雄厚，见猎心喜，竟欲众票号分摊修园费用。本业生气，遂一口拒绝。慈禧盛怒，下令崇文把本业收监。其余票号纷纷支持本业，关铺休业作无声抗议。商家及顾客哗然，因票号停业牵连甚广，朝廷受千夫所指，无奈收回成命，而崇文则成了代罪羔羊，被指办事不力，惨被罢免官职。</p>\r\n<p>百川于鼎丰盛浸淫日久，经验渐趋成熟。归化老帮区永年身患重病，本业遂派百川到归化帮忙。此时高娃任职期满，薪酬足可抵债，姐弟二人遂与百川同赴归化。</p>\r\n<p>正当百川欲拓展业务之际，俄罗斯匪帮率众来到归化大肆抢掠，又放火杀人，全城混乱一片。百川权衡轻重，为保夥计安危，决定釜底抽薪，撤庄返回山西。高娃、虎儿赤跟随百川一同离开归化，途中经历千辛万苦，百川与高娃患难相扶，相知相恋。</p>\r\n<p>月娥染病，危在旦夕，遗憾未为乔家继后香灯，眼见本业与高娃投契，临终之际欲撮合二人。高娃欲拒绝，但月娥已含笑病逝。高娃摇身一变成为票号老板娘，百川黯然神伤。</p>\r\n<p>甲午战后，百日维新夭折，本业涉嫌窝藏乱党被拘禁，震动票号界。裕泰乘机落井下石，鼎丰盛生意一落千丈！家人大惊，设法营救，无奈事涉朝廷，家人就连见本业一面亦不可。几经波折，百川终替本业洗脱罪名，本业获释，但已心力交瘁，加上眼见鼎丰盛生意跌入谷底，不堪打击，病入膏肓。</p>\r\n<p>本业临危授命，将鼎丰盛交予百川，润田大怒，竭力反对，乔蓁为令父亲安心，毅然指与百川已订婚约，堵塞众人之口！百川虽与乔蓁仅有兄妺之情，但为存忠义，答应婚事，本业含笑而逝。</p>\r\n<p>裕泰夫妇眼见鼎丰盛生意凋零，喜上眉梢。一次狭路相逢，月嫦出言欺侮，高娃不忿反驳，二人拉扯间，高娃被推跌，堕入河中！月嫦恐被追究，不肯相救，高娃沉入河底，不知所踪。虎儿赤以为高娃自尽，尸沉河底，伤心不已。</p>\r\n<p>鼎丰盛生意凋零，百川苦思无策，决孤注一掷，以仅余资金，资助湖广总督张之洞及军机大臣徐永怀兴建铁路。徐永怀感激之余投桃报李，率同僚在鼎丰盛存款，消息流传，顾客对鼎丰盛重建信心，局面立时被扭转，票号生意大有起色。</p>\r\n<p>时光飞逝，岁次庚子。崇文在父亲悉心栽培下，于官场扶摇直上，荣升京官。而鼎丰盛在百川掌管下，生意兴隆，规模声势犹胜当年。百川?同乔蓁往京城分号视察业务，竟在烟花之地重遇高娃…</p></div>', '陈豪 马俊伟 杨怡 郭羡妮 姜大伟 刘丹 黄德斌', '粤语', '2006', '0', '/data/images/56f2025b5171d.jpg', '香港', '2016-04-01 10:13:24', '13', '10', '32', '687', '古装剧', '更新至10集/共32集');
INSERT INTO `movie` VALUES ('1544', '我爱男保姆', '<div class=\"endtext\"><p>家庭煮夫方原过了五年“女主外，男主内”的生活，终于被日益强势的老婆嫌弃。为了挽救婚姻，方原毅然决然的踏上了去大城市的闯荡之路，凭借自己的一技之长，开始了全能男保姆的工作。这年头客户的要求都高：洗衣洗碗洗车、擦地擦窗擦烟机、修房修草修家电、看护看门看孩子、做饭做菜做月子餐，这些都只是基本技能，代驾代谈判代分手、送花送货送口信也不算稀奇事。碰上高小姐这样的客户，方原要给人家孩子每周当一天的爹；碰上马舒儿这样的客户，方原除了干活还得兼职心理治疗师、职业规划师；而碰上陆晴这样的客户，任凭方原十项全能，都依旧被连累得背黑锅、丢彩票，赚不到钱不说还得倒贴钱。三个女人一台戏，客户还是不能得罪的上帝，方原这个男保姆努力发挥正能量，做出口碑做出成绩。</p></div>', '雷佳音 袁姗姗 车晓 曹曦文 霍思燕', '国语', '2015', '0', '/data/images/56e7fdbbc1b38.jpg', '大陆', '2016-03-31 21:25:02', '13', '0', '0', '685', '时装剧', '全集/共35集');
INSERT INTO `movie` VALUES ('1545', '拯救肯尼迪', '<div class=\"endtext\"><p>该剧故事聚焦肯尼迪总统遇刺事件，1963年11月22日，美国得克萨斯州达拉斯市响起三声枪响，总统肯尼迪遇刺身亡，世界随之改变。如果你能改变历史，一切将会怎样？詹姆斯·弗兰科饰演的男主人公穿越时空，阻止暗杀约翰·菲茨杰拉德·肯尼迪的行动。</p></div>', '詹姆斯·弗兰科 乔什·杜哈明 莎拉·加顿 克里斯·库珀', '英语', '2016', '0', '/data/images/56c481ef27d08.jpg', '欧美', '2016-03-31 20:13:07', '13', '0', '0', '686', '警务剧', '更新至07集');
INSERT INTO `movie` VALUES ('1546', '无耻家庭第六季', '<div class=\"endtext\"><p>本剧根据英国同名剧集改编，很好地进行了「美国本土化」。这部剧集深刻揭示了美国中下阶层普通家庭的生活现状，各种各样「少儿不宜」的元素都有－－抽烟、酗酒、吸毒、滥交……与Showtime其他剧集《单身毒妈》、《如果还有明天》、《双面法医》等定位相同。</p>\r\n<p>在这部剧集里，获得艾美奖的William H. Macy扮演有六个孩子的单身父亲Frank。他收入不高，整天酗酒，根本不管儿女们的死活，不到20岁的大女儿Fiona（Emmy Rossum）不得不承担起照顾五个弟妹以及养家糊口的责任。</p>\r\n<p>读高三的Philip（Jeremy Allen White扮演）绰号「Lip」，虽然到处惹是生非，但学习还算用功。班上出了名的小荡妇Karen（Laura Slade Wiggins扮演）总是在课后找Philip「单独辅导」，并以口交作为「回报」。他们俩干那档子事的时候，Karen的母亲Sheila（Joan Cusack扮演）就在厨房里烤甜饼。</p>\r\n<p>读高二的Ian（Cameron Monaghan）是个同性恋，课余时间在当地一家杂货店里打工。Ian和老板Kesh保持着秘密的性关系。Kesh是个有家室的男人，膝下有两个孩子。尽管Kesh是个穆斯林，但他的妻子却是个白人。</p>\r\n<p>只有10岁的Debbie（Emma Kenney扮演）是家中「最正常」的孩子。与此同时，她8岁的弟弟Carl（Ethan Cutkosky扮演）虐待动物成瘾，偷人家的自行车，而且还从教堂的募捐盘里偷钱，美其名曰是「补贴家用」。</p>\r\n<p>最小的孩子Liam刚刚学会走路，是个黑白混血儿。他不是Frank的亲生儿子，而是Frank的妻子与Frank在戒酒会里的担保人「乱搞」生下来的孩子。Frank和Fiona请不起保姆，只好全家人轮流照看Liam。等轮到Debbie的时候，她把Liam带到学校里当「展览品」……</p></div>', '威廉姆·H·梅西 埃米·罗森 杰瑞米·艾伦·怀特 伊森·卡特科斯基 无耻之徒第六季', '英语', '2016', '0', '/data/images/569df4cce4445.jpg', '欧美', '2016-03-30 19:36:22', '13', '11', '12', '691', '家族剧', '更新至11集/共12集');
INSERT INTO `movie` VALUES ('1547', '卜案', '<div class=\"endtext\"><p>唐贞观初年长安案件频发，先是开远门外的多起命案，接着又有古老的汉代游侠刺客组织重现，利用木人诅咒同室操戈的皇权斗争以及终南山中频发的怪现象等一系列围绕宫廷权贵和皇室秘史的事件屡现。校尉尉迟方无法破案，“娘子军”统领平阳公主之女拂云郡主也屡被卷入案中，幸得隐居长安的青年才俊李淳风频频相助，利用中国古典医学和科学侦破案件，阻止悲剧的发生。而在此过程中，李淳风也与拂云惺惺相惜，萌生爱意。然而拂云为了完成和亲沙陀族共同的使命，远嫁他乡，两人天各一方。</p></div>', '陈浩民 任天野 赵柯 康凯 张亚坤 康福', '国语', '2016', '0', '/data/images/56ecb99418260.jpg', '大陆', '2016-03-30 10:42:06', '13', '26', '26', '687', '古装剧', '更新至26集/共26集');
INSERT INTO `movie` VALUES ('1548', '公公出宫国语', '<div class=\"endtext\"><p>国家改朝换代，帝制时代正式结束，三个刚刚失业的公公李叔恭(黎耀祥)、丹田(陈国邦)和陈小凤(曹永廉)贬为庶民自力更生，不幸遇上冒充太监的江湖骗子崔晋升(萧正楠)，三子好心做坏事全被卖入金家当下人，金家话事人金香(胡定欣)为米行大当家，外表风光，实质内里忧患重重，喜欢女扮男装的大小姐金带男 (林夏薇)经常惹祸上身，金家村无故受诅咒，金香被村民施压以招婿冲喜，叔恭误打误撞竟成了金家姑爷，四子晴天霹雳；此时，世仇徐家派卧底黄莲(唐诗咏) 潜入金家散播谣言，纠缠于二老爷金昌(姜大伟)和晋升之间，金家面临四分五裂，叔恭为妻挺身而出，可惜一直未能公开真正身份，金香软硬兼施迫叔恭为金家继后香灯，叔恭与兄弟们扭尽六壬，愈弄愈乱，险象环生……</p></div>', '黎耀祥 胡定欣 萧正楠 陈国邦 曹永廉 姜大伟 唐诗咏 林夏薇', '国语', '2016', '0', '/data/images/56bbf24d2b958.jpg', '香港', '2016-03-28 18:23:47', '13', '0', '0', '687', '古装剧', '全集/共35集');
INSERT INTO `movie` VALUES ('1549', '蒋英实', '<div class=\"endtext\"><p>讲述了以朝鲜时代为背景，描述朝鲜世宗时期科学家蒋英实的故事。</p></div>', '宋一国 朴善英 李智勋 金相庆', '韩语', '2016', '0', '/data/images/568a2d823f551.jpg', '韩国', '2016-03-28 09:56:53', '13', '24', '24', '687', '古装剧', '更新至24集/共24集');
INSERT INTO `movie` VALUES ('1550', '公公出宫粤语', '<div class=\"endtext\"><p>辛亥革命后，清朝被推翻，一班“亡国”太监被遣散出宫，一直身为奴才的公公如何运用在紫禁城学到的生存技俩重过新生活、重新得到尊严、自由与自我价值，以“人”的身份开创一片新天地？离开了波谲云诡的紫禁城，重返民间，生活从此就变得简单、安稳？</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">被逼回复自由 看尽世人冷眼</p>\r\n<p>民国政府成立后，清逊帝溥仪及一众皇室成员虽获允许继续住在紫禁城，惟建褔宫一场大火，令溥仪备受惊吓，下令解散太监！自小以紫禁城为家的三名太监李肃恭 (黎耀祥饰)、丹田(陈国邦饰)、陈小凤(曹永廉饰)，一心在此落地生根终老的计划被打乱，忽然重获自由，更使他们顿失依靠，颠沛流离。</p>\r\n<p>肃恭、丹田、小凤对宫外谋生一窍不通，眼见太监被视为封建制度的象征，为世人所鄙视，三人也只得隐藏身份、苟且偷生。一次，肃恭、丹田、小凤巧遇江湖小混混崔晋升(萧正楠饰)被反太监组织穷追猛打，误以为晋升也是“无根”太监，有见同是天涯沦落人，愤而出手相救。期间，小凤更为救晋升而中枪命危，晋升感到人间有情，视三子如手足……</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">奴才宿命难改 转为豪门下人</p>\r\n<p>四子辗转流落到深镇，肃恭、丹田、晋升为给小凤筹医药费，不惜落草为寇，打劫地方土豪金家大小姐金带男(林夏薇饰)，谁料引致带男哮喘病发，命悬一线。三人唯恐搞出人命，急送带男求诊，却被带男的三姑姐金香(胡定欣饰)人赃并获。三人为求金香救小凤一命，甘愿为奴，到金家当下人。</p>\r\n<p>肃恭、丹田、晋升甫进金家，便遇到深镇另一巨头徐家来犯。原来深镇由数条村落组成，其中金家村以金香为首，徐家村以徐大富(李成昌饰)为首，两村世代相争。肃恭、丹田、晋升见识到金香巾帼英姿，言词铿锵，处处力压徐大富的气焰，只好在金家规行矩步，但求小凤早日痊愈。</p>\r\n<p>金家米业金福隆虽在金香带领下如日方中，惟金家人丁凋零。此时，金家二小姐金带子(陈庭欣饰)与入赘夫婿方振西(胡诺言饰)努力多年，带子终于梦熊有兆。金家上下欢天喜地之际，丹田却凭昔日在御药房工作习得的医理，指出带子“吃诈糊”假孕，虽令金家陷入崩溃，但丹田的医术却因此而渐露头角，令主子另眼相看。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">寻回昔日荣誉 奴才突变主子</p>\r\n<p>一天，金家村天降异象，传出“太监的诅咒”，传闻当年李连英下咒要金家绝子绝孙，现在一一应验，以致村民人心惶惶。金香于是召开村民大会，呼吁村民积极生育，未料反被村民要求身先士卒招婿成亲，开枝散叶。</p>\r\n<p>金香为平息民愤急于成亲，却发现深镇男人皆怯于自己威名，无人问津。肃恭出谋献策，帮金家村女子以全新形象示人，顿时求亲者众。肃恭、丹田、小凤因此得到主子器重，在选婿大会中被委以重任，寻回昔日在紫禁城的归属感……</p>\r\n<p>然而招亲一事功亏一篑，经过几番波折，金香情急之下竟招肃恭为婿﹗肃恭被逼成亲后，金香渐对肃恭生好感，肃恭为隐瞒太监身份，只好对金香左闪右避。金香以为肃恭心有所属，夫妇相敬如宾，但二人油然生出真感情。肃恭自成为金家姑爷后，丹田、小凤亦从下人晋升要职，从奴才一跃成为主子……</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">刚脱宫廷凶险 复堕豪门暗涌</p>\r\n<p>正当太监三子的新生活看似渐入佳境，徐家却派出卧底黄莲(唐诗咏饰)潜入金家，接近二房老爷金昌(姜大伟饰)，并从中挑拨离间，意图令金家四分五裂。另外，晋升在金家生活并不如意，又意外发现自己竟是金家长子嫡孙，在他人怂恿之下，决意要抢夺金家财产……面对如此风浪，三子及金家上下能否同心共度难关？</p></div>', '黎耀祥 胡定欣 萧正楠 陈国邦 曹永廉 姜大伟 唐诗咏 林夏薇', '粤语', '2016', '0', '/data/images/56b9ec8951b21.jpg', '香港', '2016-03-27 21:39:41', '13', '0', '0', '695', '年代剧', '全集/共35集');
INSERT INTO `movie` VALUES ('1551', '重生第一季', '<div class=\"endtext\"><p>一位百万富翁和他的科学家妹妹把科幻小说里弗兰克斯坦的故事实现了：他们给予了一个人第二次生命。死而复生的Adam Tremble生前是一名道德腐败的退休FBI警探，重新获得生命后的他不但变得年轻，而且也变得更强壮了。现在，他要在旧身时的诱惑和新生活之间做出选择，不但要解决那些FBI解决不了的威胁，还要学会处理他和他的“制造者们”之间的关系。</p></div>', '罗伯特·卡辛斯基 阿德希尔·卡尔安 蒂姆·迪凯 菲利浦·贝克·霍尔', '英语', '2016', '0', '/data/images/56a0bd4eb8de5.jpg', '欧美', '2016-03-27 09:48:48', '13', '0', '0', '686', '警务剧', '更新至11集');
INSERT INTO `movie` VALUES ('1552', 'Baby Sitter', '<div class=\"endtext\">[剧 名]:Babysitter<br />\r\n[播 送]:韩国KBS台<br />\r\n[类 型]:KBS月火剧 &nbsp;<br />\r\n[首 播]:2016年03月14日<br />\r\n[时 间]:每周一、二晚北京时间9点05分各播放一集<br />\r\n[接 档]:武林学校<br />\r\n[导 演]:金容秀<br />\r\n[编 剧]:崔孝妃<br />\r\n[主 演]:赵茹珍 金敏俊 李承俊 申润珠<br />\r\n[制 作]:凤凰天使TSKS韩剧社16韩流冲击第18波<br />\r\n[集 数]:04集<br />\r\n[简 介]:讲述在富人家照顾3个孩子的保姆和这家主人夫妇之间发生的故事。</div>', '赵茹珍 金敏俊 李承俊 申润珠', '韩语', '2016', '0', '/data/images/56e8c2b5782aa.jpg', '韩国', '2016-03-23 10:28:36', '13', '4', '4', '685', '时装剧', '更新至04集/共4集');
INSERT INTO `movie` VALUES ('1553', '大唐双龙传', '<div class=\"endtext\"><p>隋朝末年，隋炀帝杨广好大喜功，内外失政，以致人心尽失，群雄割据，烽烟四起，形成一发不可收拾之乱。</p>\r\n<p>寇仲和徐子陵，原是两个无父无母流浪天边的小混混，寇仲为人机灵多计、重情重义、雄心壮志、不甘平凡；徐子陵则为人忠厚纯朴、感性细腻、甘於淡泊。两人自少同甘共若，互相扶持，是一对生死不离的好兄弟。机缘巧合之下，寇仲和徐子陵得到了武林中人梦寐以求的武功奇书长生诀,长生诀是打开杨公宝库要害，此宝库藏有江湖中人梦寝以求、可令人称霸武林的邪帝舍利，双龙因此惹来大野心家宇文化及的连场追捕。而长生诀的物主，来自高丽的女刺客傅君婥，为取回长生诀把双龙擒住，却发觉双龙是练长生诀内功的适合人选，遂x令双龙练长生诀，而双龙亦利用傅君卓来逃避宇文化及的追杀，双方初时互相利用，但经历过共患难的一段日子後，彼此之间竟生出真挚的母子感情。傅君婥为了守护寇仲、徐子陵，死於宇文化及刀下。两人悲愤之余，立志学好武功，发誓必杀宇文化及，替傅君婥报仇雪恨。</p></div>', '林峯 吴卓羲 李倩 杨怡 唐宁 胡定欣', '粤语', '2004', '0', '/data/images/56ad694c91b40.jpg', '香港', '2016-03-22 11:02:46', '13', '0', '0', '684', '仙侠剧', '全集/共42集');
INSERT INTO `movie` VALUES ('1554', '潮流教主国语', '<div class=\"endtext\"><p>在潮流教主葉朗（陳豪飾）統領下的時裝雜誌社猶如宮廷一樣鬥爭不絕，出版人池偉文（陳奐仁飾）表面對這位總編輯阿諛奉承，實則笑裡藏刀，故意安插名媛紀芸芸（李佳芯飾）任廣告部總監制衡葉朗在雜誌社的權力，葉朗應付內鬥易如反掌，卻一時失手惹上官非，事件牽涉一名曾來應徵編輯助理落敗的張逸寧（蔡思貝飾），葉朗藉機炒作新聞，即時聘請這位在深水埗造衫的逸寧任其助手，在雜誌社掀起一輪動盪，令死蛇懶鱔的時裝編輯范國邦（羅仲謙飾）一反頹態；逸寧以勤奮和樂天的性格衝破重重障礙，全心效力偶像葉朗，當雜誌社陷入停刊危機，逸寧連同國邦三人合力創造傳奇，助葉朗再度贏盡掌聲，但葉朗選擇此時宣布接班人選，孑然退出這個糖衣時尚圈……</p></div>', '陈豪 罗仲谦 蔡思贝 李佳芯 杨秀惠 陈山聪 庄思敏 吕慧仪 陈滢 陈奂仁', '国语', '2016', '0', '/data/images/56d45918d5246.jpg', '香港', '2016-03-22 10:26:05', '13', '0', '0', '685', '时装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1555', '夜班经理第一季', '<div class=\"endtext\"><p>自打约翰·勒卡雷（John le Carré）的小说《夜班经理》（The Night Manager）1993年问世的那一刻起，电影制片人们便产生了把这部关于军火交易的间谍小说搬上大银幕的想法。</p>\r\n<p>2009年，一部由罗伯特·唐恩（Robert Towne）编剧、西德尼·波拉克（Sydney Pollack）执导、布拉德·皮特（Brad Pitt）的公司Plan B制片的电影被提上日程。然而再也没有了下文，原因很简单：时间限制。“《夜班经理》是本好书，”勒卡雷的儿子，也是《夜班经理》剧集制片人西蒙·考威尔（Simon Cornwell）说。“书中包罗万象，两个小时无法体现出这一点。”</p>\r\n<p>于是，一部六集的迷你剧应运而生。本剧由汤姆·希德勒斯顿（Tom Hiddleston）与休·劳瑞（Hugh Laurie）主演，将于明年四月在BBC和AMC播出。希德勒斯顿的角色是一位军情六处的特工乔纳森·派恩（Jonathan Pine），非常的沉默寡言。劳瑞则扮演派恩的目标——一个游走在道德黑白边界的军火商人理查德·路普尔（Richard Roper）。</p>\r\n<p>“对于《夜班经理》，我能想到的最佳概括便是紧张刺激又基情四射，”制片人史蒂芬·加勒特（Stephen Garrett）表示。</p></div>', '休·劳瑞 汤姆·希德勒斯顿', '英语', '2016', '0', '/data/images/56d404385bdcc.jpg', '欧美', '2016-03-21 15:57:54', '13', '0', '0', '697', '商战剧', '全集/共6集');
INSERT INTO `movie` VALUES ('1556', '黑帆第三季', '<div class=\"endtext\"><p>该剧是经典小说《金银岛》（Treasure Island）的前传，故事发生在小说时间的「20年之前」，那时Flint船长（Toby Stephens）和他的「Walrus号」尚未成名。该剧将在南非开普敦拍摄，初步定于2014年播出（填补《斯巴达克斯》三部曲终结后的空档），首季为8集。Flint是文学史上最有名海盗角色之一，也是海盗黄金时代的代表人物。他和一些人在新普罗维登斯岛上建立了被称为「海盗天堂」的无政府社区，并为维持新普罗维登斯的存在而与各种敌对势力交战。在这个罪犯的避风港里，除了来自四面八方的海盗外，还有形形色色的妓女、强盗、小偷和寻宝客。 Hannah New扮演美丽、勇敢、自信的酒馆老板娘Eleanor，黑白两道都很熟。她一方面帮助低贱的海盗销赃，另一方面也为有钱有势的头面人物举办舞会。 Zach McGowan扮演Charles Vane船长，是Flint船长的竞争对手。Luke Arnold扮演传说中的著名水手John Silver，但他当时和Flint一样没有名气。来自《秘社》的Jessica Parker Kennedy扮演一个受到折磨的年轻妓女，是新普罗维登斯岛黑暗面的见证人。Mark Ryan扮演Flint船长的得力助手Gates。</p></div>', '托比·斯蒂芬斯 汉娜·纽 扎克·麦克格温 卢克·阿诺德 杰西卡·帕克·肯尼迪', '英语', '2016', '0', '/data/images/56a585b0dfc7d.jpg', '欧美', '2016-03-21 10:23:45', '13', '9', '10', '693', '战争剧', '更新至09集/共10集');
INSERT INTO `movie` VALUES ('1557', '邻家英雄', '<div class=\"endtext\"><p>讲述满腹伤痛的特工邂逅梦想成为警员的年轻打工仔，将他塑造成一名秘密特工，与恶势力对抗的故事。</p></div>', '朴施厚 权侑莉 尹泰英 李洙赫', '韩语', '2016', '0', '/data/images/56a57c0eba510.jpg', '韩国', '2016-03-21 09:14:03', '13', '15', '20', '686', '警务剧', '更新至15集/共20集');
INSERT INTO `movie` VALUES ('1558', '小城大爱', '<div class=\"endtext\"><p>年轻的香港女孩许文惠在当地一家电视台工作，因为一档名叫《小城大爱》的电视节目而被派到都江堰市蒐集各种感人故事。许文惠由于人生地不熟找不到预定的酒店而迷了路，因此意外邂逅了同样来自香港的酒吧老板梁启缘。梁启缘在四川省都江堰市内的西街经营一家酒吧，他的酒吧优雅别致，梁启缘亲手调制的独特鸡尾酒更是得到了很多都市男女的垂青。许文惠走进酒吧，被酒吧尽头的一面墙吸引驻足，这面墙上挂满了照片，许文惠仔细端详著照片，她的举动吸引著梁启缘的注意，两人攀谈起来，梁启缘告诉许文惠自己经营的酒吧有一个规矩：来店里消费的客人只要留下自己的故事和与故事相关的照片，就可免费喝到他亲手调制的鸡尾酒。</p>\r\n<p>许文惠望着酒吧照片墙上形形色色的照片，意识到自己来对了地方，自己的工作任务终于有了快捷的渠道完成。轻快的坐在吧台上，开心的点了一杯鸡尾酒，梁启缘也被眼前这个爽朗知性的香港同乡吸引，开始调制一杯特殊的鸡尾酒款待许文惠；梁启缘调制鸡尾酒的手法娴熟，不一会功夫就将一杯鸡尾酒放到许文惠面前，仔细看，这是一杯宝石蓝颜色的鸡尾酒，许文惠好奇的看着这杯酒，梁启缘开始为许文惠讲关于这杯酒爱情故事，许文惠兴致盎然的聆听……</p></div>', '马国明 杨怡 王铮 孔千千', '粤语', '2016', '0', '/data/images/56e4cdd82731b.jpg', '香港', '2016-03-21 09:12:32', '13', '0', '0', '694', '偶像剧', '更新至06集');
INSERT INTO `movie` VALUES ('1559', '潮流教主粤语', '<div class=\"endtext\"><p>“美”从来没有标准，为何杂志介绍的“潮流”，却可以操纵大众对时装的喜恶？揭开华丽光鲜的衣裳，大家发现的可能只是丑陋的人性，以及时尚界一场追逐金钱与权力的小圈子游戏……</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">编辑部内 各怀鬼胎争上位</p>\r\n<p>叶朗(陈豪饰)五年前担任时尚杂志《MODES》的总编辑，令面临停刊的杂志起死回生，他更与专门负责研究时装趋势的好友马承浩(陈山聪饰)，一起“创造潮流”，令《MODES》成为时尚界的参考指标。一期又一期的破销量成绩，使叶朗获得“潮流教主”的称号。</p>\r\n<p>叶朗号称带领时尚界的旗手，但有一次竟被网民直斥使用翻版货。一向功利的他发现事件与应征助理编辑不遂的张逸宁(蔡思贝饰)有关，于是将计就计，聘用这位自小在深水埗长大的年轻人，乘机为杂志制造话题。</p>\r\n<p>逸宁一直是《MODES》的拥趸，亦是仰慕叶朗的忠实“教徒”，但她没想到杂志社编辑部里面，由上至下都各怀鬼胎：副总编石慧珊(庄思敏饰)老谋深算，一直觊觎叶朗的“教主”地位；编辑徐以芯(杨秀惠饰)经常造谣生事，从内部矛盾中取利；助理编辑林可彤(陈滢饰)表面单纯友善，却精于利用他人感情达到目的。</p>\r\n<p>至于逸宁的直属上司范国邦(罗仲谦饰)，则是一名工作态度得过且过的挂名编辑。原来国邦曾是当红的时装模特儿，后来因与小明星胡混令名声受损，被经理人万绮华(李亚男饰)派到《MODES》做半年编辑，重建形象。充满雄心壮志的逸宁看出国邦是一头沉睡的狮子，决定不惜一切，令他重拾工作的热情。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">编辑部外 时尚舞台斗称霸</p>\r\n<p>叶朗在《MODES》呼风唤雨，然而来自编辑部以外的威胁，教他防不胜防。杂志社的出版人池伟文(陈奂仁饰)自从叶朗加盟后，被架空权力、抢夺功劳，早已怀恨在心，加上他与绮华向有私情，所以一直想将叶朗踢走。</p>\r\n<p>伟文于是安插失婚名媛纪芸芸(李佳芯饰)担任广告部总监，制衡叶朗独大的势力。充满野心的芸芸因为曾被叶朗挖开家庭伤痛，积怨甚深，她利用与高层的关系和上流社会的人脉，向叶朗发动连场权力斗争。</p>\r\n<p>另一方面，《MODES》的竞争对手《GINA》获传媒巨头入股注资，其总编辑洪诗婷(吕慧仪饰)为取代《MODES》在时尚界的地位，大举向对方挖角，令《MODES》的运作几乎瘫痪。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">内忧外患 潮流教主落谁家</p>\r\n<p>叶朗在杂志社面对内忧外患，腹背受敌。幸好，国邦在逸宁的冲劲、热诚感染下，突然一洗颓风，并凭独到的时尚触觉、模特儿界的人际关系，助临危受命的逸宁完成专栏特稿。三人在背水一战下，带领《MODES》成功过渡艰难日子，更联手创出时尚界另一传奇。</p>\r\n<p>没想到在这关键时刻，芸芸竟然找记者踢爆叶朗与品牌牵涉利益输送，假造“潮流”！“潮流教主”名誉扫地，叶朗当众宣布辞去总编一职，并指明要逸宁接棒，其后一去无踪。初入职场的逸宁如何在勾心斗角的时尚圈中力挽狂澜？叶朗的下场又是怎样？</p></div>', '陈豪 罗仲谦 蔡思贝 李佳芯 杨秀惠 陈山聪 庄思敏 吕慧仪 陈滢 陈奂仁', '粤语', '2016', '0', '/data/images/56d45918d5246.jpg', '香港', '2016-03-20 22:39:26', '13', '0', '0', '685', '时装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1560', '夜魔侠第二季', '<div class=\"endtext\"><p>剧集主要讲述主人公是一名拳击手的儿子，他在救人时接触到了一种奇异的放射性废料，导致双目失明，但其余四种感官却变得超级敏锐，使他静坐家中闭上眼帘也能看到城市的任何一处。在父亲遭歹徒袭击横死街头后，他誓言为无辜受害者复仇，与城市中的邪恶势力抗争。白天他是纽约的一名普通律师，但夜晚降临后，他便穿上红色紧身衣，化身夜魔侠，打击犯罪。</p></div>', '查理·考克斯 黛博拉·安沃尔 埃尔登·汉森 艾洛蒂·袁 罗莎里奥·道森', '英语', '2016', '0', '/data/images/56ec1f81ac970.jpg', '欧美', '2016-03-20 09:56:38', '13', '0', '0', '690', '魔幻剧', '全集/共13集');
INSERT INTO `movie` VALUES ('1561', '两个女人的战争', '<div class=\"endtext\"><p>牛、赵两家是互相帮衬的好邻居，日子虽不富裕但也其乐融融。知识青年上山下乡的风潮席卷城镇，牛淑荣和赵欣梅向家人表示了要上山下乡的决心。在黑山屯，她们共同爱上了英俊的知青模范齐伟。在各种劳动竞赛里，三人的感情关系此消彼长，不断受到外界的催化，牛淑荣和赵欣梅也因此互生芥蒂。最终，牛淑荣与齐伟成婚，赵欣梅却嫁给了牛淑荣的哥哥牛成国。</p>\r\n<p>进厂以后，面对百废待兴的局面，牛淑荣和赵欣梅共同努力，使得工厂扭亏为盈，她们也因此成为女工心目中的英雄，不过感情上的矛盾却一直没有化解，一直到齐伟因意外逝世，牛淑荣和赵欣梅的子女齐胜男和牛争彼此相爱，两个女人才悟出了生活的真谛，读解到了和谐中的幸福指数，她们共同为牛争和齐胜男的儿子取了一个响亮的名字：牛和平。</p></div>', '柳岩 周一围 毛林林 任东霖 李思博', '国语', '2015', '0', '/data/images/56ebbebf06bc2.jpg', '大陆', '2016-03-18 16:39:29', '13', '0', '0', '685', '时装剧', '全集/共41集');
INSERT INTO `movie` VALUES ('1562', '游侠笑传第二季', '<div class=\"endtext\"><p>传说在很久很久以前，有一个浪漫迷人的英雄叫Galavant（Joshua Sasse）。他是个屠龙勇士，他是老百姓的保护者，他还是穷人的守护神。但是有一天，邪恶的Richard国王（Timothy Omundson）爱上了Galavant的情人Madalena并将其绑架。在Madalena和Richard国王的婚礼日，Galavant不顾危险奋力杀入王宫营救自己的挚爱……多数童话故事会这样写：「王子救出了公主，然后他们从此幸福快乐地生活在一起。」但是在本剧中，故事自此才正式开始。 Madalena当众宣布她将选择金钱、名誉和地位，从此和Galavant一刀两断！Galavant不由得呆若木鸡，伤心欲绝。</p></div>', '约书亚·萨斯 蒂莫西·奥门德森 维尼·琼斯 马洛里 詹森 凯伦·戴维', '英语', '2016', '0', '/data/images/5694cacd18377.jpg', '欧美', '2016-03-18 12:06:45', '13', '0', '0', '690', '魔幻剧', '全集/共10集');
INSERT INTO `movie` VALUES ('1563', '请与废柴的我谈恋爱', '<div class=\"endtext\"><p>柴田美知子（深田恭子）今年30岁。之前上班的公司突然倒闭，失业的她在找工作中并不顺利。失去了工作的她却还在继续供养比她小的男人，银行存款已经见底。她身无分文却仍一心想着吃肉。就在此时，她偶遇了之前的公司里总是骂她，让她觉得很害怕很讨厌的前上司·黑泽步（DEAN FUJIOKA）。现在他是之前由他的奶奶经营的咖啡厅的老板。为了生存（也是为了吃肉），她开始在黑泽的咖啡店“向日葵”打工，每天都过着像以前那样被他怒斥与耍弄的日子。但是，在他做的蛋包饭与大人午餐等美餐面前，她败给了自己的欲望，继续着这样的生活。</p>\r\n<p>美知子的每天充满着各种各样的麻烦事，但她却发现了黑泽从未表现出的，虽然冷淡却总会伸手帮她的一面……</p></div>', '深田恭子 藤冈靛 三浦翔平 野波麻帆 铃木贵之', '日语', '2016', '0', '/data/images/5695b669ed2d0.jpg', '日本', '2016-03-17 00:19:30', '13', '0', '0', '685', '时装剧', '全集/共10集');
INSERT INTO `movie` VALUES ('1564', '青丘狐传说', '<div class=\"endtext\"><p>本剧取材于《聊斋志异》中的六个故事。</p>\r\n<p>《封三娘》：灵狐封三娘为百姓打抱不平进入孟家，却发现孟家的坏名声只是遭人陷害，于是帮助孟家脱险，收获了自己的爱情。</p>\r\n<p>《阿绣》：狐女花月冒充人间女子阿绣，与刘子固纠葛，她从贪婪人间爱情滋味，到明白人间真爱，最后牺牲自己，成全了真正的阿绣与刘子固。</p>\r\n<p>《婴宁》：天性爱笑的狐女婴宁来到王子服家，为了弄清母亲被王家残害的往事，到王家遇险时，婴宁以德报怨，赢得了所有人的尊重。</p>\r\n<p>《胡四相公》：胡四本是法力高强的男狐，因贪酒与富家公子张生结为挚友，他帮助张生寻得一桩美好姻缘后潇洒离去。</p>\r\n<p>《长亭》：收妖人石太璞助狐族驱妖，狐族老父答应将长女长亭许配给他，却一再反悔，石太璞不计前嫌拯救狐族，最终得以与长亭结成良缘。</p>\r\n<p>《恒娘》：美丽狐仙恒娘助隔壁邻居朱氏夺回丈夫的心，智斗黄鼠狼小妾。</p></div>', '张若昀 陈瑶 蒋劲夫 古力娜扎 王凯 金晨 翟天临 江铠同', '国语', '2016', '0', '/data/images/56b8b3bc00fc5.jpg', '大陆', '2016-03-16 00:09:02', '13', '0', '0', '690', '魔幻剧', '全集/共32集');
INSERT INTO `movie` VALUES ('1565', '犯罪现场调查：网络第二季', '<div class=\"endtext\"><p>这部剧集聚焦网络犯罪。曾经凭借《灵媒缉凶 Medium》拿下艾美的Patricia Arquette回归主演。</p></div>', '帕特里夏·阿奎特 托里·德维托 夏恩·杰克逊 吉尔·贝罗斯 马特·布谢尔', '英语', '2015', '0', '/data/images/5694bff46af6e.jpg', '欧美', '2016-03-15 20:20:09', '13', '0', '0', '686', '警务剧', '全集/共18集');
INSERT INTO `movie` VALUES ('1566', '安托万夫人', '<div class=\"endtext\"><p>该剧讲述了虽知晓别人心思，但却不了解自己心意的两个男女。一个能读懂别人心里所想的假算命“先生”高惠琳，和对爱情无感的心理学者崔秀贤的浪漫爱情喜剧故事。</p></div>', '盛骏 韩艺瑟 郑珍云 黄胜妍 Madame Antoine', '韩语', '2016', '0', '/data/images/56a2d84112c06.jpg', '韩国', '2016-03-14 09:59:32', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1567', '暗号/Signal', '<div class=\"endtext\"><p>主要讲述的是以过去和现在的刑警通过一台陈旧的无线电对话，进而解决长期悬而未决的案件为内容的电视剧。</p></div>', '金惠秀 李帝勋 赵镇雄', '韩语', '2016', '0', '/data/images/56a2d79ad6765.jpg', '韩国', '2016-03-13 10:20:49', '13', '0', '0', '686', '警务剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1568', '美国罪恶第二季', '<div class=\"endtext\"><p>该剧由刚刚获得奥斯卡奖的电影《为奴十二年》（12 Years A Slave）的编剧John Ridley打造，故事描述一起带有种族色彩的谋杀案及随后的审判过程给所有相关人员造成的影响——包括受害人及其家人、罪犯及其家人等。当一对住在莫德斯托市的夫妇遭人入室行凶后，由此引出的社会问题在当地引发强烈反响，人们将它视为反映当代美国人种族观、阶级观和性别政治的一面镜子。</p></div>', '菲丽西提·霍夫曼 佩内洛普·安·米勒 蒂莫西·赫顿 W·厄尔·布朗', '英语', '2016', '0', '/data/images/5699c3a75d975.jpg', '欧美', '2016-03-12 10:46:52', '13', '10', '11', '686', '警务剧', '更新至10集/共11集');
INSERT INTO `movie` VALUES ('1569', '寻找爱的冒险', '<div class=\"endtext\"><p>该剧讲述天真女孩夏梦寻在追索奶奶日记，寻找神秘故乡黄陵镇的途中，与同样寻找黄陵镇的非典型富二代唐潮相遇，并携手涉险揭开尘封多年家族恩怨的纯爱虐恋。夏梦寻、唐潮、白宙身为看似并无关联的三大家族后代，却因为三尊神秘佛首被命运联系在一起。三人几经冒险、冲破层层诡计，逐步揭开围绕在自己身上的家族之谜。而在这一系列的解密过程中，天真大小姐夏梦寻与非典型富二代唐潮，也正收获着自己冒险中的爱情。</p></div>', '蒋劲夫 程砚秋 陈翔 唐禹哲 孙骁骁 温心 翁虹 张韶涵', '国语', '2016', '0', '/data/images/569fb701814d9.jpg', '大陆', '2016-03-11 22:09:55', '13', '0', '0', '694', '偶像剧', '全集/共32集');
INSERT INTO `movie` VALUES ('1570', '再一次happy ending', '<div class=\"endtext\"><p>该剧主要讲述了离婚与再婚、昨天与今天想要再一次得到幸福的男女之间故事。剧中涵盖了婚姻长短、单身、初婚、离婚以及再婚等问题，是韩国当代感情婚姻的缩影。</p></div>', '张娜拉 郑敬淏 刘仁娜 权律 金泰勋 刘多仁 再一次快乐结局', '韩语', '2016', '0', '/data/images/56a028a481ee7.jpg', '韩国', '2016-03-11 09:46:25', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1571', '五鼠闹东京', '<div class=\"endtext\"><p>该剧根据古典名著《三侠五义》改编，讲述了北宋年间，五个结拜兄弟绰号“五鼠”，因展昭佑护包公有功被赐“御猫”封号，五鼠中年轻气盛的白玉堂对此不服，夜闯金銮殿，继而引来丁月华，上演的一段惹人欢笑的故事。 </p>\r\n<p>北宋年间陷空岛住着五个结拜兄弟绰号“五鼠”，江湖南侠展昭因佑护包公有功被宋仁宗赐 “御猫”封号，奸贼太师庞吉妒恨包公遂故意派人挑拨，说包公让仁宗赐展昭“御猫”，目的就是要灭“五鼠”的威风。五位义士大为恼火，要立赴东京与展昭一决高低。去往东京途中，五鼠得知庞吉之子庞昱在陈州的种种恶行，决定先去陈州除掉庞昱，为彻底铲除奸臣庞吉、庞昱，包公另施一计，让展昭因好赌输掉好多钱，庞吉利用此事救下展昭派往陈州助庞昱一臂之力。</p>\r\n<p>展昭以沈仲元的身份混进庞昱府中，暗中搜集庞昱的犯罪证据。五鼠等人和展昭里应外合，不仅为包公洗脱冤情，还将庞昱斩首，为陈州百姓铲除了这个无恶不作的恶霸。为报杀子之仇，庞吉又设下了惊天阴谋加害包公和五鼠等诸位英雄。</p></div>', '陈晓 严屹宽 郑爽 张芷溪 焦恩俊 谢宁 曹骏', '国语', '2016', '0', '/data/images/56c4a4e623e12.jpg', '大陆', '2016-03-10 11:02:26', '13', '0', '0', '687', '古装剧', '全集/共42集');
INSERT INTO `movie` VALUES ('1572', '女医明妃传', '<div class=\"endtext\"><p>大明国体昌盛却礼教严苛，女子地位低下，不得从医，隐疾难治。谈家为医学世家，祖上几代均为御医，因被奸人所陷害而遭遇灭顶之灾，从此留下祖训，后世不得行医。但聪慧的谈允贤从小耳濡目染，偷偷随祖母学习中医知识，不仅悬壶济世、妙手仁心，得到了普通百姓的赞扬和支持，更渐起救天下女子之心。由此，允贤不仅在学医道路上面临重重的困难和阻碍，更要面对封建礼教和世俗观念的冲击。但允贤凭借着对于医学事业的痴迷和热爱，克服重重困难，不仅在医学上广收博采、兼收并蓄、自成一派，更突破严苛的礼教束缚，开创并建立了女医制度，从救人身体到救人灵魂，再由救人到救国，传播弘扬了祖国医学文化，最终成为了一代女国医，名扬天下。</p></div>', '刘诗诗 霍建华 黄轩 李呈媛 袁文康 女医之明妃传', '国语', '2016', '0', '/data/images/56bf22e0a0fb5.jpg', '大陆', '2016-03-10 00:09:05', '13', '0', '0', '687', '古装剧', '全集/共50集');
INSERT INTO `movie` VALUES ('1573', '武林学校', '<div class=\"endtext\"><p>讲述以重视正直、信义、生存、牺牲和沟通的武林学校为背景，讲述不同国籍老师、学生之间发生的故事。</p></div>', '李玹雨 徐睿知 李弘彬 郑幼珍 申贤俊 简美妍', '韩语', '2016', '0', '/data/images/56946a8e85302.jpg', '韩国', '2016-03-09 10:11:41', '13', '16', '20', '685', '时装剧', '更新至16集/共20集');
INSERT INTO `movie` VALUES ('1574', '孖仔孖心肝粤语', '<div class=\"endtext\"><p>搞笑能手周星驰，伙拍性格演员刘青云，共谱一出轻松有趣的温情喜剧。</p>\r\n<p>一对孪生兄弟王利就（周星驰饰）与王名成（刘青云饰）自小失散。名成与母相依为命，利就则为老粗鲁辉（梁家仁饰）收养，改名为鲁板。成是电影圈的新进导演，为人精明有绰头，敢作敢为；板则为小贩，性格单纯善良具正义感。机缘巧合下两人相遇并共住一屋，但却不知大家的真正身份。板钟情于童年好友方嘉楠（陈秀雯饰），嘉楠是名成的下属，对名成心仪已久，兄弟两人更闹出一段纠缠不清的三角恋爱。鲁辉认识了嘉楠的阿姨卓龄，她为人高贵具教养，与辉分属两个世界，但龄欣赏他为人老实忠诚，最后与他展开了一段浪漫恋情。兄弟两人最后终于相认，但因性格各异而心存隔膜。后名成与友人合伙营商，却被骗而惹上官非，患难中细明白到兄弟情之珍贵，与众人共施计策，营救胞兄。</p></div>', '周星驰 刘青云 梁家仁 陈秀雯 骆应钧', '粤语', '1990', '0', '/data/images/56c1b20d2721a.jpg', '香港', '2016-03-08 09:58:31', '13', '15', '15', '685', '时装剧', '更新至15集/共15集');
INSERT INTO `movie` VALUES ('1575', '纸牌屋第四季', '<div class=\"endtext\"><p>《纸牌屋》由大卫·芬奇、鲍尔·威利蒙联合制作，凯文·史派西主演，改编自英国同名小说，BBC老版的迷你剧也是有名的经典。</p>\r\n<p>剧本由《总统杀局》的编剧鲍尔·威利蒙和Eric Roth 执笔。</p>\r\n<p>史派西饰演的角色名叫弗兰克·安德伍德，美国国会众议院多数党督导（或称多数党党鞭 the House Majority Whip in the United States Congress）。他是个政治家中的政治家，老练成熟，有令人崇拜的领导范儿，很有魅力，也很无情。他的成功来自于一个事实，他和妻子克莱尔（罗宾·怀特饰演）将不惜一切代价，爬上权力的顶峰。</p></div>', '凯文·史派西 罗宾·怀特 凯特·玛拉', '英语', '2016', '0', '/data/images/56d9ae0f9932c.jpg', '欧美', '2016-03-06 23:25:43', '13', '0', '0', '693', '战争剧', '全集/共13集');
INSERT INTO `movie` VALUES ('1576', '特工卡特第二季', '<div class=\"endtext\"><p>故事发生在电影《美国队长》之后，1946年战争结束了，和平的到来反而使特工卡特被社会排挤。随后她加入了霍华德·史塔克（钢铁侠托尼·斯塔克的父亲）的机构战略科学军团SSR (Strategic Scientific Reserve)，做一些行政和秘密任务。即使失去了史蒂夫·罗杰斯，她依然要面对人生。</p></div>', '海莉·阿特维尔 多米尼克·库珀 安维尔·乔卡亚 卡特特工第一季', '英语', '2016', '0', '/data/images/569f5f51666fe.jpg', '欧美', '2016-03-04 23:51:26', '13', '0', '0', '688', '科幻剧', '全集/共10集');
INSERT INTO `movie` VALUES ('1577', '半为苍生半美人', '<div class=\"endtext\"><p>由导演梁辛全执导的大型古装传奇剧《半为苍生半美人》，以情感纠葛为主线，以恩怨情仇为副线，讲述了一代名医华佗行医于民间，博爱于百姓，守望于爱情，智斗于权贵，游走于刀尖的传奇人生。该剧由内地当红小生何晟铭饰演男一号神医华佗。何晟铭认为此类剧目不仅弘扬了中华民族的传统文化，还进一步传递了正能量，让更多的人认识到国学医术的神奇之处。华佗这位在世人眼中行医济世、妙手回春的传奇人物，是何晟铭继《宫》之后，塑造的又一经典角色。《半为苍生半美人》将颠覆一代神医华佗的传统形象，与古典美人李依晓在剧中演绎一段撕心裂肺的痴心绝恋。令人充满期待。</p>\r\n<p>三国时期，战火纷起。年轻的华佗在家乡亳州给百姓看病，过着自由洒脱的日子。华佗妙手让太守女儿明心起死回生，获得了神医美名，也从此与明心结下不解之缘。为了研制麻沸散给明心治疗眼睛，华佗开始游历寻药。在都城，华佗与英雄关羽、奸雄曹操和师兄吴思德屡有交集，见识了官场险恶，世态炎凉。最让华佗痛心的是，心爱的姑娘明心惨遭吴思德霸占。在东吴山中，绝望的华佗受隐者指点，幡然醒悟，立志成为医人医心医国的苍生大医。红颜如水,苍生若土,水淹土没，何去何从？东汉末年，群雄逐鹿，民不聊生，董卓乱政，曹操刺杀董卓失败，逃回谯郡被华佗所救，不料连累县令之女身受重伤，展开了一系列的恩怨情仇。赤壁之战，刮骨疗毒，秘境历险。任凭风吹雨打，从不曾改变拯救苍生的赤子之心。麻沸散的研制成功，也让华佗和明心的爱情修成正果，可就在幸福来临时，曹操因病、因疑、因恨抓走了华佗，这位行医济世、妙手回春的苍生大医逝于囚牢。</p></div>', '何晟铭 李依晓 朱晓渔 李子雄 王建新 刘冠麟', '国语', '2015', '0', '/data/images/56d63f479e5e9.jpg', '大陆', '2016-03-02 09:18:00', '13', '0', '0', '687', '古装剧', '全集/共48集');
INSERT INTO `movie` VALUES ('1578', '奶酪陷阱', '<div class=\"endtext\"><p>该剧讲述了生活热情积极的女大学生洪雪和她的男友兼学长刘正等人的爱情、矛盾和各种浪漫而颇具神秘色彩的校园故事。</p></div>', '朴海镇 金高恩 徐康俊 南柱赫 李晟京', '韩语', '2016', '0', '/data/images/56946d7049723.jpg', '韩国', '2016-03-02 09:14:19', '13', '0', '0', '685', '时装剧', '预告/共16集');
INSERT INTO `movie` VALUES ('1579', '新萧十一郎', '<div class=\"endtext\"><p>新版《萧十一郎》根据古龙同名小说改编，由古装武侠剧的制作泰斗鞠觉亮导演执导，已于9月8日在横店影视城开机拍摄。讲述名动江湖的金针沈家广发英雄帖，举办比武招亲，为沈家千金、天下第一美人沈璧君。而随嫁的嫁妆将是江湖上失传已久的“割鹿刀”！</p>\r\n<p>风四娘（李依晓饰）胁迫“江湖大盗”萧十一郎（严屹宽饰）共同偷刀，却未料偷到的是一把赝品，更被扣上绑架俘虏沈璧君（甘婷婷饰）的罪名！为了洗脱冤屈，萧十一郎踏上了寻找沈璧君的征程。比武招亲的胜者连城璧发誓要找到割鹿刀、追回未婚妻，却被萧十一郎捷足先登，而完璧归来的沈璧君在生死患难中竟爱上了萧十一郎。妒忌令连城璧想尽办法陷害萧十一郎，甚至火烧沈家庄！而这些其实都是天宗宗主逍遥侯设下的圈套。眼看黑白颠倒，武林面临一场浩劫，腹背受敌的萧十一郎为了爱情、为了正义，扛起重任、力挽狂澜。</p>\r\n<p>此次甘婷婷受到导演鞠觉亮的钦点接棒朱茵，在新版中饰演女主角沈璧君。据介绍在几次合作后，导演看到甘婷婷在角色上更多可以塑造的可能性，这次将《新萧十一郎》中的天下第一美人沈璧君交给甘婷婷来饰演，相信可以合作碰撞出更多表演中新的内容给书迷和观众。《新萧十一郎》主演阵容一公布，也少不了书迷和观众的质疑声。不少的网友表示何必又要毁掉一部经典作品。甘婷婷表示也接受网友们的质疑声，《新萧十一郎》毕竟才刚开拍，对于“新”概念还有太多的未知性和可能性，开几天自己也是把原著小说和03年吴奇隆和朱茵那版的《萧十一郎》彻底的读完和看完，对于沈璧君这个角色也进行自己的分析，觉得小说中原汁原味的还是要保留下来。同时，也相信鞠导和各位演员一起注入全新活力，打造出一部新颖的古装武侠片。</p></div>', '严屹宽 甘婷婷 张含韵 李依晓 朱一龙 于清斌 王艺瞳', '国语', '2016', '0', '/data/images/56be0541bf396.jpg', '大陆', '2016-03-01 00:08:35', '13', '0', '0', '687', '古装剧', '全集/共42集');
INSERT INTO `movie` VALUES ('1580', '警犬巴打国语', '<div class=\"endtext\"><p>火爆刑警黎溢湫（黄宗泽饰）经历父亲吸毒丧母之痛，一手养大三位妹妹，其大男人性格兼冲动作风，被上司调任警犬队负责带领警犬巴打一同接受艰钜的训练课程，过程中与渔农署兼警犬队兽医马志昊（钟嘉欣饰）发生误会，二人成为冤家，但志昊希望借助溢湫修补自己与弟弟马志冲（梁烈唯饰）的关系，主动协助溢湫与巴打克服困难，巴打穿梭两人之间产生了微妙的化学作用，得到巴打帮助的溢湫对追查毒贩雷锦铛（古明华饰）更添信心，可惜拍挡费颂廉（黄浩然饰）竟因隐瞒病情知法犯法，不单令兄弟情决裂，更连累女朋友亦是溢湫的二妹黎淑姿（朱千雪饰）惹来杀身之祸，因锦铛处心复仇，利用警方线人孖生弟弟雷锦波（古明华饰）设局陷害，溢湫、志昊和巴打将如何合力破案救人……</p></div>', '黄宗泽 钟嘉欣 黄浩然 朱千雪 古明华 梁烈唯', '国语', '2016', '0', '/data/images/56bbf42909474.jpg', '香港', '2016-02-29 14:42:04', '13', '0', '0', '686', '警务剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1581', '警犬巴打粤语', '<div class=\"endtext\"><p>世上没有两个人，生下来便注定成为朋友、恋人……唯有经过沟通、接纳、磨合，方能成为真正的知己、无所不谈的家人、厮守到老的夫妻。只要愿意敞开心扉，性格南辕北辙的人，同样可以是你的好“巴打”、好“丝打”；人与动物的关系亦然！</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">沟通 - 火爆警察 Vs 警犬巴打</span></p>\r\n<p>黎溢湫(黄宗泽饰)，年幼时因父亲染上毒瘾，导致家破人亡，与三位妹妹相依为命。溢湫嫉恶如仇，黑白分明，决志成为警察保护弱小。溢湫本隶属观塘分区警署，后被调往受训做领犬员，而所分派得到的准警犬──“巴打”，竟是过去溢湫捣破毒窟时，曾与他大战一场的看门狗。</p>\r\n<p>巴打敌视溢湫，溢湫亦不懂与动物相处，一人一狗无法合作，令溢湫的警员生涯面临危机。幸得警犬队兽医马志昊(钟嘉欣饰)相助，溢湫学懂与巴打相处之道，一人一狗冲破言语界限，冰释前嫌。溢湫跟巴打的默契日趋成熟，可惜巴打有畏高症，溢湫费尽心力仍未能令牠克服心理障碍……</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">妥协 - 冷漠兽医 Vs 警司虎妈</span></p>\r\n<p>志昊虽能助溢湫与动物沟通，却能医不自医。志昊年幼时被母亲钟慧坚(陈秀珠饰)发现其天资聪敏，决定对她进行地狱式栽培，使志昊失去学习与人相处的机会。久而久之，志昊因聪明自负，受尽校园欺凌，于是以倨傲和冷漠来保护自己，拒绝与人交往，唯独能与动物作伴。</p>\r\n<p>直至志昊升读大学时，决定反抗母亲。慧坚安排她到美国读医，志昊中途转科改读兽医，慧坚知道后怒不可遏，志昊不肯屈服，母女自此不相往来。志昊认识溢湫后，在溢湫的劝导下，紧张的母女关系开始缓和，而溢湫和志昊亦越走越近……</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">价值观 - 冷静勇探 Vs 拜金港女</span></p>\r\n<p>费颂廉(黄浩然饰)，上市饮食集团太子爷，为人满腔热血，大学毕业后旋即投考警察，与溢湫成为好兄弟。溢湫的二妹黎淑姿(朱千雪饰)，相中颂廉的太子爷身份，与之交往，并常要求颂廉辞职接手家业，二人因此经常吵架。</p>\r\n<p>殊不知，一名富家公子突然热烈追求淑姿，淑姿决定与颂廉分手，向梦寐以求的少奶奶生活迈进。颂廉受到情感上的打击，寄情工作，甚至不惜一切作假证供，务求把毒枭雷锦铛(古明华分饰)入罪……</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">接纳 - 单纯幼师 Vs 赖皮小混</span></p>\r\n<p>雷锦波(古明华饰)，江湖中一介小卒，其孪生哥哥锦铛为声震江湖的毒枭。八年前，锦波被迫向溢湫供出锦铛的藏身地，锦铛被捉拿归案。锦铛出狱后，竟然要杀锦波报仇。锦波侥幸逃生，求救于溢湫，因此邂逅溢湫的大妹黎淑珠(张嘉儿饰)。</p>\r\n<p>锦波见淑珠思想单纯，想趁机骗她捞着数，尽管事情被揭破，淑珠仍对他关怀备至。锦波甚为感动，决心替淑珠完成梦想，二人因此越走越近。溢湫误会锦波“癞虾蟆想吃天鹅肉”，锦波气恼溢湫看不起他，愤而反目。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">成长 - 刁蛮人妻 Vs 贪玩人夫</span></p>\r\n<p>所谓“孻妹孻心肝”，溢湫的三妹黎淑芬(蒋家旻饰)，从小开始便受尽兄姐怜爱，有求必应，养成其贪玩任性的性格。后来，淑芬遇上志同道合的马志冲(梁烈唯饰)，闪电结婚。无奈二人无法自立生活，只好求溢湫收留，二人甚至要倒过头来，向溢湫拿取生活费度日。</p>\r\n<p>淑芬婚后无改刁蛮性格，每每跟志冲发生争执便嚷着离婚，想不到有天竟弄假成真！淑芬怀孕后，开始懂得为未来打算，志冲却依然原地踏步。面对失业的难关同时，无法承受当爸爸的责任，加上淑芬的无理责难，志冲的选择是逃避……</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">磨合 - 巴打 Vs 丝打</span></p>\r\n<p>溢湫训练巴打期间学懂忍耐和体谅，却想不到这些改变，让本专横的哥哥开始聆听，加深了跟三个妹妹的了解。锦波在淑珠的影响下踏上正途，溢湫亦大开绿灯予二人发展机会。相反，慧坚认为溢湫配不上女儿，决定棒打鸳鸯，好不容易修补的母女关系再度陷入冰封！溢湫站在尴尬的立场，如何是好？</p>\r\n<p>颂廉为拯救淑姿而被揭发作假证供，被控妨碍司法公正，人生跌落谷底！而颂廉的牺牲，也让一心嫁入豪门的淑姿踌躇起来。淑珠会明白到，唯独爱方能让她一生相依？</p>\r\n<p>腹大便便的淑芬，十月怀胎终诞下麟儿，与无谓的自尊心相比，她可以独自重整志冲的关系，共同承担父母的责任？</p>\r\n<p>溢湫与巴打合作无间，然而巴打的畏高症竟成为二人缉捕毒犯锦铛的绊脚石，一人一狗能够成为警队里的最佳拍档？</p></div>', '黄宗泽 钟嘉欣 黄浩然 朱千雪 古明华 梁烈唯', '粤语', '2016', '0', '/data/images/56b9fb7bee836.jpg', '香港', '2016-02-28 22:38:09', '13', '0', '0', '686', '警务剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1582', '班淑传奇', '<div class=\"endtext\">东汉西域都护班超的女儿班淑自小和父母失散，独自在草原长大。在父女相认前夕，班超因病身亡。为得到班氏族人承认，班淑设法入宫，先后做了邓太后开办贵族女学内学堂及男学堂宫学的女傅。开朗的她侠义心肠，却对中原诗书半通不通，在内学堂闹出不少笑话，但她不遵循常规，别出心裁的改革却让原本沉闷的学堂气氛为之一新。在 ... 教学过程中，班淑爱上了历经沧桑的宫学男傅卫英，凭借热情大胆的心，感动了这位不能忘记惨死未婚妻的男子。正当他们之间感情渐浓的时候，班淑的师姐却意外归来，班淑和卫英因此陷入了纠结之中。最终，凭着自己的聪明才智，班淑与学生们联手，让瑰丽的大汉文化深入人心，班淑最终也在事业与感情的双重历练中得到了成长。</div>', '景甜 张哲瀚 李佳航 李心艾 李晟 付辛博', '国语', '2015', '0', '/data/images/569a0938c783a.jpg', '大陆', '2016-02-27 16:06:29', '13', '0', '0', '687', '古装剧', '全集/共42集');
INSERT INTO `movie` VALUES ('1583', '黑色警报第一季', '<div class=\"endtext\"><p>该剧由《超脑特工》（Intelligence）创作人Michael Seitzman开发，根据Ryan McGarry的纪录电影改编。标题「代号黑色」是一家洛杉矶县医院急诊室（号称是全美国最繁忙的医院）对特殊情况的称呼——当大量病人涌入医院，院方没有足够的人手治疗所有病人时，其中一些病人可能因此死亡。医护人员只能拼尽全力去抢救病人，但最终的结果可能要听天由命。主人公是四名刚刚加入该医院急诊团队的医生，他们一方面艰难地面对有严重缺陷的医疗系统，另一方面竭力保护自己的理想并救治那些最需要他们的病人。很显然，他们在课堂中和书本上学到的东西和真正的急诊室有着天壤之别，更别提那些形形色色的急诊室员工……他们有的会辅导他们，有的会教育他们，但有的会恐吓他们。</p>\r\n<p>住院部主任Leanne Rorish医生（Marcia Gay Harden）处在所有混乱的「中心位置」。没有任何人敢轻视或忽视她，仿佛她天生就是个领袖。她专门在医院为最危重病人保留的「中心病房」实施高风险手术，并以不败的神话而享誉盛名。她最近刚刚接受了训练四名新住院医生的任务——Christa Lorenson（Bonnie Somerville）、Malaya Pineda（Melanie Kannokada）、Mario Savetti（Benjamin Hollingsworth）和Angus Leighton（Harry M. Ford）。Christa曾是中产阶级的专职妈妈，儿子死于癌症。她现在是一个刚刚走上新岗位的、有天赋的、专注事业的医生。她在帮助儿子对抗癌症的过程中积累了不少医学经验，再加上她敏感的直觉和多年的生活阅历，使得她看问题的角度和别人不一样。那些年轻医生忽视的细节，往往逃不过她的眼睛。 Malaya刚刚在这个繁忙的急诊室内开始自己的实习医生职业生涯。Mario初来乍到，为人热心但骄傲自大。急诊室里的高级护士Jesse Sallander（Luis Guzman）是Leanne最亲密的知己，和善可亲但为人强硬，见过各种大场面，最讨厌别人胡闹。他为四名新来的住院医生服务，但他更像是他们的管家。用他自己的话来说，「在接下来的三年里，我就是你们的老妈……你们的老妈当然知道你们何时在撒谎，何时会哭泣，何时要丧命。」优秀的医生 Neal（Raza Jaffrey）也在急诊室里工作，他有时对Leanne的「牛仔」风格并不赞同。他认为医生和病人在感情上取得共识对治疗疾病至关重要，任何用病人的生命冒险的行为都是可恶的。急诊室里的另一名医生Rollie Guthrie（William Allen Young）则是个精力充沛、积极进取、已经干了很多年的主治医生。</p>\r\n<p>在「中心病房」里，只有争分夺秒才能抢救生命。现代医学体系已经无法应对「人满为患」的局面，这些英勇的医生和护士们唯有用速度和技能来帮助他们。通常这些患者到这里来只有两种原因——要么在这里等死，要么期待奇迹的发生。</p></div>', '马西娅·盖伊·哈登 邦妮· 萨默维尔 艾米丽·阿琳·林德 紧急救援第一季', '英语', '2015', '0', '/data/images/569901da68613.jpg', '欧美', '2016-02-26 22:04:40', '13', '0', '0', '689', '医务剧', '更新至18集');
INSERT INTO `movie` VALUES ('1584', '天天有喜之人间有爱', '<div class=\"endtext\"><p>讲述古代时期，刘府富二代刘四喜(陈浩民饰)是个猎妖师，成天周旋在女人堆，一天，无意间邂逅了狐狸灵灵九(穆婷婷饰)，两人暗生情愫。天有不测风云，一只可爱的吉娃娃被人类宰杀，险些遭人食之，后被狐族女王灵千幻（刘一祯饰）救出，带回狐宫，因为之前的遭遇，便成为独眼犬妖夜犬(陈威翰饰)，后来遇到了善良可爱的九妹，慢慢暗恋上了，夜犬对九妹情有独钟，处处保护有加，总在九妹最危险的时候挺身而出，说他是痴情情圣也不为过。可是命运总是难以捉摸，真心真爱的夜犬却因为种种原因与九妹擦肩而过，后知道九妹与刘四喜有感情，自己对九妹的爱就再也藏不住了， 于是开始处处与刘四喜做对。他与喜欢了四喜很久的天贞（刘庭羽饰）一直与灵山家族做对的金蟾（林江国饰）等人，一起对付四喜，势必要得到灵灵九。</p>\r\n<p>狐宫之中，与灵灵九青梅竹马的贺擎天（陆昱霖饰）得知九妹要嫁给四喜，难过不已，他用自己的办法想得到九妹的真心，让九妹爱上自己，离开刘四喜。</p>\r\n<p>刘府之中，和四喜青梅竹马的妹妹王金珠（陈紫函饰）是刘家从小收养的养女，她一直喜欢着四喜，当四喜把灵灵九娶回家来以后，便处处与九妹作对，想要把九妹赶出刘家，使九妹与四喜的感情之路更加坎坷。</p>\r\n<p>感情路上坎坎坷坷的他们，一起经历了好多事情，在爱与恨的抉择之中，大家也懂得了好多，夜犬一直喜欢着九妹，却忽略了一直在默默喜欢着自己的灵灵八（徐申东饰）；金珠也明白，对于已经爱上了灵灵九的四喜，自己是绝对得不到他的真心的，后与妹妹银珠一起济世救人；擎天亦是如此；天贞也另觅到真爱，金蟾也不再和狐族做对。最后，大家其乐融融，灵灵九的其他八个姐妹也都寻找到了自己最爱的人，大家一起在狐宫举行了一场盛大的集体婚礼，灵灵二（王秋紫饰）和王俊（关智斌饰）灵灵八和夜犬，灵灵九和四喜，还有众多狐族公主和他们的驸马们，大家都高兴不已。最后，九妹与四喜执子之手，与子偕老，幸福快乐的生活在一起。</p></div>', '陈浩民 穆婷婷 陈紫函 陈威翰 徐申东 天天有喜2之人间有爱', '国语', '2016', '0', '/data/images/569655e922824.jpg', '大陆', '2016-02-26 20:44:13', '13', '0', '0', '684', '仙侠剧', '全集/共73集');
INSERT INTO `movie` VALUES ('1585', '苏染染追夫记', '<div class=\"endtext\"><p>本网络剧以一场「江湖恩怨」作为故事切入点，通过讲述美丽不可方物，拥有举世瞩目财富的“剧宠”苏染染背负着久治不愈的“剧毒身躯”和丧失了部分记忆的感情前史，以及被“逃婚”的“命运叛变”，让她颜面无存的羞耻之辱，义愤填膺，踏上“暗礁险滩、危机四伏”的情感复仇“追夫”之路的历程作为核心，以苏染染突破万难，展开新的人生作为结语，描写了苏染染的情感心路历程的传奇故事。</p></div>', '尹淇 金浩 孙玮伦 于果', '国语', '2016', '0', '/data/images/56a9d4faee5f4.jpg', '大陆', '2016-02-26 18:15:13', '13', '44', '50', '687', '古装剧', '更新至44集/共50集');
INSERT INTO `movie` VALUES ('1586', '沙娜拉传奇第一季', '<div class=\"endtext\"><p>故事发生在人类文明毁灭数千年之后的「新人类世界」中，远古的邪恶力量日渐复苏，笼罩北方的阴云将扩散至四方大陆。在和平的穴地谷，身上有着一半精灵血统的夏伊是沙娜拉血脉（一个世代具有魔法的家族）留存在这世上的仅存后裔，也是能使用传奇武器「沙娜拉之剑」对抗黑暗势力的最后传人。从黑衣德鲁伊上门警告那一刻起，安定平稳的生活已经是昨日幻梦，因为邪恶的骷髅使者正奉着黑魔君的追杀令，前来摧毁唯一能威胁到它的血脉。受黑暗驱使的地精与巨人大军整军待发、即将侵略四方诸国。在熟知历史的神秘德鲁伊带队之下，谷地人、高地人、边境王子、侏儒、精灵组成八人小队，怀着各自的意志，踏上路途茫茫的寻剑（寻找失落的沙娜拉之剑）之旅。</p></div>', '奥斯汀·巴特勒 阿隆·贾库本科 伊万娜·巴克罗 马努·贝内特', '英语', '2016', '0', '/data/images/56a8d5b1c0414.jpg', '欧美', '2016-02-24 21:41:22', '13', '0', '0', '690', '魔幻剧', '全集/共10集');
INSERT INTO `movie` VALUES ('1587', '寂寞空庭春欲晚', '<div class=\"endtext\"><p>康熙八年，鳌拜被擒，声势浩大的余党清剿随之开始。忠臣阿布鼐受冤遭受灭门之灾，年仅十岁的幼女良儿目睹全家被屠，侥幸逃脱。逃亡路上偶遇少年康熙，两人在不知对方身份的情况下经历生死之劫，许下再次见面的约定。而后良儿投奔表哥纳兰容若，却意外失忆。容若为保护良儿为其改名卫琳琅，留在府中照顾。时光荏苒，容若与琳琅一起长大，青梅竹马，但纳兰明珠忌惮琳琅身份引来祸患，偷偷把她送入宫中为婢。</p>\r\n<p>琳琅本以为此生就这样在深宫中寂寂而终，康熙的出现扰乱了她的生活，而她与容若的重逢也让她燃起了希望。康熙认出琳琅就是当年自己魂牵梦萦的少女，千方百计要让她记起昔日约定，而容若却暗中费尽心思要带她远走高飞。经历重重波折，琳琅终看清自己心意，爱上康熙，以为可以开始享受爱情的甜蜜，却在此时恢复了记忆。一边是血海深仇，一边是痴心爱人，琳琅无法抉择，一直潜伏在宫中的亲哥哥长庆此时现身相认，逼迫琳琅为家族报仇……</p></div>', '刘恺威 郑爽 张彬彬 张晓晨 米雪 王若心', '国语', '2016', '0', '/data/images/56af7bf7bc9a8.jpg', '大陆', '2016-02-24 00:28:04', '13', '0', '0', '687', '古装剧', '全集/共37集');
INSERT INTO `movie` VALUES ('1588', 'X档案第十季', '<div class=\"endtext\"><p>完结14年后，《X档案》全面重启，六集迷你剧将于2016年1月播出。主演大卫·杜楚尼和吉莲·安德森继续担纲，主要角色悉数回归，导演、编剧及制作团队均为老版原版人马。《X档案》一直最擅长将时事、传说与虚构阴谋情节相结合，为观众营造出以假乱真的神秘气氛。在全球进入信息化时代的今天，全球的X病人们都在期待《X档案》将如何演绎小灰人版的斯诺登事件，又会引入哪些时尚搞笑的小怪兽。</p>\r\n<p>《X档案》作为中国观众接触最早的科幻美剧，在90年代更是风靡全球。编剧们的奇思妙想再加上演员们的精湛演技，让观众大呼过瘾，剧中Mulder和 Scully探员之间“剪不断，理还乱”的感情发展，也成为了当时X病人们茶余饭后的谈资。美国最知名的电视类刊物《电视报道》（TV Guide）曾评价《X档案》为最伟大的电视剧，也是继《星际迷航》之后第二伟大的“cult电视剧”（指影迷极端狂热崇拜的电视剧）。本剧曾多次获得象征电视界最高荣誉的艾美奖和金球奖。作为一部经典科幻剧集，XF中的很多创意和拍摄手法，至今还在被很多知名科幻电视剧和电影所借鉴，不管你们信不信反正我是信了。科幻迷们绝对不容错过！</p></div>', '大卫·杜楚尼 吉莲·安德森 米彻·佩勒吉 威廉姆·B·戴维斯', '英语', '2016', '0', '/data/images/56a6d05b39cfb.jpg', '欧美', '2016-02-23 23:48:36', '13', '6', '6', '688', '科幻剧', '更新至06集/共6集');
INSERT INTO `movie` VALUES ('1589', '狄更斯世界第一季', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 和美国ABC的《传说》（Once Upon A Time）一样，该剧将许多经典文学人物「拼凑」到同一部作品中。《传说》「拼凑」的是童话、民间传说、都市传说、经典故事甚至神话中的人物，而本剧「拼凑」的是英国文学巨匠狄更斯笔下的人物。虽然该剧每集只有半小时，但是总集数达到20集，在英国的黄金档期有剧本节目中非常罕见。 在该剧中，《圣诞颂歌》、《远大前程》、《雾都孤儿》、《荒凉山庄》、《马丁-翟述伟》、《我们共同的朋友》、《老古董店》、《艾德温-德鲁德之谜》和《匹克威克外传》的人物共同生活在19世纪的伦敦城。老古董店位于三个瘸子酒吧的隔壁，老教唆犯费京的贼窝则隐藏在一条闹市街道旁的阴暗小巷中。<br />\r\n&nbsp;&nbsp;&nbsp; 当本剧开始时，富有的啤酒商郝薇香先生的尸体正被儿子亚瑟和女儿阿米莉亚送到墓地安葬。亚瑟伤心地得知，父亲的遗嘱没有给他留下任何东西，他决定复仇。与此同时，埃比尼泽-斯克鲁奇的搭档、心肠歹毒的高利贷贩子雅各布-马雷向客户催债，他为达目的不择手段。他首先来到老古董店，老爷爷正彻夜不眠地守候在病入膏肓的小妮尔床前。另一方面，老教唆犯兼皮条客费京计划让街头女孩南希去为雅各布-马雷的晚宴助兴，从而狠狠地捞上一笔。为了确保南希的安全，专干入室盗窃的流氓比尔-赛克斯将陪同她前往。思想奔放的霍诺丽亚-巴巴里偷偷与年轻的情郎詹姆斯-霍顿上尉幽会。但是……他们的偷情能维持多久？ 当有人在雪地里发现雅各布-马雷的尸体之后，所有这些人的命运都将改变。</div>', '卡罗琳·昆汀 彼得·弗斯 塔彭丝·米德尔顿 苏菲·兰朵', '英语', '2015', '0', '/data/images/5699017f780b2.jpg', '欧美', '2016-02-23 09:37:31', '13', '20', '20', '687', '古装剧', '更新至20集/共20集');
INSERT INTO `movie` VALUES ('1590', '解忧公主', '<div class=\"endtext\"><p>该剧是以汉武帝时期，汉朝派往西域乌孙国和亲的解忧公主为主人公，刻画了冯嫽、汉武帝、李陵、军须靡、翁归等一系列历史人物。解忧公主在乌孙同翁归之间真挚的爱情，与冯嫽亲如姐妹的友谊，让她在险恶的后宫政治斗争当中一次次化险为夷。解忧公主最为可贵的是她用自己的大爱、宽阔的胸怀赢得了乌孙人民的敬佩，也让匈奴人在西域的势力得以消减。解忧公主作为一介公主，不仅成为西域各族人民心中的“一代国母”，也让中原的文化和影响传播到了西域，为西域带来了真正的和平，更是开创了西域地区民族融合、民族团结史诗般的一页。</p></div>', '张歆艺 袁弘 袁文康 叶青 刘冠翔 姜晓冲 张一鸾', '国语', '2016', '0', '/data/images/56c6b65adf714.jpg', '大陆', '2016-02-21 21:42:26', '13', '0', '0', '687', '古装剧', '全集/共45集');
INSERT INTO `movie` VALUES ('1591', '铁马战车粤语', '<div class=\"endtext\"><p>交通部督察杜卓峯(黄德斌 饰)以堵截非法赛车，将快车狂徒绳之于法为己任，经常与手下驾驶隐形战车在路上巡逻，随时检控超速、危险、醉酒及无牌驾驶等罪行，卓峯为人冷傲，不苟言笑，同僚中只有意外调查队的施马(袁伟豪)最为明白他，当新丁贝心柔(蔡思贝 饰)出现，各人以为傻大姐性格的心柔经不起卓峯严厉的管教，谁料心柔竟与卓峯开展了一段情如父女的师徒关系，心柔更释除卓峯一直耿耿于怀的秘密，施马羡慕之余更游说心柔调组，因其下属姚瑶(唐诗咏 饰)的工作表现强差人意，喜欢抽丝剥茧的施马总大费周章反复调查简单的案件，而姚瑶按本子办事的态度常令二人处于剑拔弩张的对立局面。非法赛车再度肆虐，飞车党向警队作出高姿态的挑衅，卓峯率领众人部署反击行动，却将自己推向极度危险的边缘，缠绕多年的阴霾亦再度浮现……</p></div>', '黄德斌 袁伟豪 唐诗咏 蔡思贝 曹永廉 敖嘉年', '粤语', '2016', '0', '/data/images/569cfa5b2ae38.jpg', '香港', '2016-02-19 17:03:03', '13', '0', '0', '686', '警务剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1592', '铁马战车国语', '<div class=\"endtext\"><p>大家在新闻中看到的交通事故，经常会统称为意外，老实说，它们绝大部份都不是意外，而是人为；大家所认识的交通警员，从事的工作不外乎抄告票、设路障，事实上，他们的职责和日常运作，比我们想像中复杂，以及危险得多。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">铁骑巡警　冷酷 Vs 热情</span></p>\r\n<p>杜卓峯(黄德斌饰)是东九龙交通部执法及管制组(E&amp;C)的督察，平日带领苏珊(马蹄露饰)、汪大洋(曾守明饰)、戴军(冼灏英饰)等下属，驾着电自行车在路上巡逻，随时检控超速车辆，维持交通治安。</p>\r\n<p>原属警察关系科的警员贝心柔(蔡思贝饰)被调到卓峯麾下，冷若霜雪的卓峯对下属向来严厉、不苟言笑，心柔当然也逃不过卓峯的恶言斥责，可是干劲冲天的她没有介意，更经常缠着卓峯讨教，二人就这样建立起情如父女的师徒关系。</p>\r\n<p>卓峯的冷酷令同事生人勿近，就连家人亦无法忍受他严厉、固执的性格，其妻李淑桦(简慕华饰)和儿子杜启聪(焦浩轩饰)甚至故意疏离卓峯，令他的家庭生活走向破碎边缘。心柔后来得悉卓峯不近人情的性格，原来与他昔日同袍好友、兼苏珊丈夫欧顺威(曹永廉饰)的死有关，率真的心柔如何帮助卓峯走出阴霾？</p>\r\n<p>另一方面，间接害死顺威的黑帮份子荣德谦(敖嘉年饰)现身做案，卓峯全力追捕这位昔日的警队“徒弟”，在繁忙的街道上展开了激烈的铁骑较量；同时为顺威当年那件不可告人的往事，做个了断……</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">意外神探　理智 Vs 感性</span></p>\r\n<p>施马(袁伟豪饰)是刚升职调到交通意外调查组(AI)的督察，主要负责调查交通意外的成因。他为人冷静理性，对物理学着迷，认为世事皆可用数据、逻辑来解释。警员姚瑶(唐诗咏饰)是施马的下属，拥有过目不忘的惊人记忆力，而且情感丰富，喜爱帮助身边的同事。可是施马与姚瑶的工作思维南辕北辙，二人老是看对方不顺眼。</p>\r\n<p>有一次，意外调查组接获一宗电自行车司机被撞毙的案件，施马与姚瑶找到涉案的女的士司机，还发现她与死者生前交恶。所有环境证供都对的士司机不利，施马凭逻辑推理和证据，毫不留情决定落案起诉的士司机，可是姚瑶却相信的士司机没有杀人，果然，案情出现了峰回路转的发展……</p>\r\n<p>自此案之后，施马开始反思自己忽略人性的缺点，亦渐渐欣赏姚瑶的坦率性格；姚瑶亦在施马的帮助下，走出了父母双亡的心理低谷。两人愈走愈近，惹来施马女友贺珮中(陈庭欣饰)的不满。</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight:bold;\">两大部门　携手合作</span></p>\r\n<p>被心柔捉拿的贼王熊番(林伟饰)之案件提堂，E&amp;C的警员奉命为囚车开路，前赴法庭。可是当日路面不停发生交通意外，令开路的车队遇上不少障碍。施马率领AI队员在交通事故现场调查，发现所谓的意外全属人为故意造成，他推测事件背后另有蹊跷。忽然，卓峯在电台要求增援，原来E&amp;C车队在路上遇袭，发生枪战，熊番乘乱逃押，还集中火力向心柔开枪报复，心柔的性命危在旦夕……</p></div>', '黄德斌 袁伟豪 唐诗咏 蔡思贝 曹永廉 敖嘉年', '粤语', '2016', '0', '/data/images/569f169237bdb.jpg', '香港', '2016-02-19 17:02:52', '13', '0', '0', '686', '警务剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1593', 'Remember', '<div class=\"endtext\"><p>患有记忆过剩症候群的徐振宇（俞承豪饰），虽然在别人眼里是记忆天才，但真正的他，却因为拥有无论是喜悦和悲伤还是痛苦，种种记忆都比普通人深刻数百倍的能力，被医生诊断为“障碍”。积极乐观的他克服自身的障碍，开始作为律师所向披靡之时，人生再一次向他抛出了残酷命运的问卷。 誓要拯救死刑犯父亲因为社会高层的阴谋，振宇的父亲被扣上了冤屈的罪名，被指证为全国民性案件“西村女大学生杀人案”的嫌疑人，宣判为死刑。为了证明父亲的清白而成为律师的他，誓要在所有证据消失之前救出父亲。</p></div>', '俞承豪 朴敏英 南宫民 郑彗星 全光烈 儿子的战争', '韩语', '2015', '0', '/data/images/5696f743c2f34.jpg', '韩国', '2016-02-19 10:02:22', '13', '0', '0', '685', '时装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1594', '赌场风云', '<div class=\"endtext\"><p>甚有赌术天份的齐欢畅（欧阳震华饰）18岁便跻身世界扑克王大赛，而且被视为夺魁热门。可惜，畅年少气盛，在赛前关头，受到对手乔正初（苗侨伟饰）的女朋友蓝小茵（郭少芸饰）诱惑，一时意乱情迷，竟然遗失3岁的亲弟齐欢乐（黄宗泽饰）。结果决赛时候，畅彷徨不安，赌不下去，赛事宣布中止。初不费吹灰之力，重重打击了畅。</p>\r\n<p>畅自始沉沦，以赌麻醉，且交上“衰运”，逢赌必输，结果惹上一屁股赌债，辗转流落菲律宾，可幸，遇上热心助人的周福荣（许绍雄饰）。</p>\r\n<p>荣用苦肉计帮畅戒赌，畅感动不已，决重新做人。畅又因荣的关系，重遇当年积怨的初。初竟不计前嫌为畅安排工作，帮他赚钱还债，畅对初感激，视为恩人。畅、初、荣更成为好朋友。</p></div>', '欧阳震华 黄宗泽 苗侨伟 杨怡 宣萱 郭少芸', '国语/粤语', '2006', '0', '/data/images/56c3cd97afac8.jpg', '香港', '2016-02-19 10:01:21', '13', '3', '35', '685', '时装剧', '更新至03集/共35集');
INSERT INTO `movie` VALUES ('1595', '爱神搭错线', '<div class=\"endtext\"><p>Steve(梁烈唯饰)是位国际知名家具设计师，作品常在亚洲和欧洲中参展，对自我的要求极高，对爱情态度更是一丝不苟，亦是这样的性格，令他跟空姐Grace(苟芸慧饰)发展出一段三年以来都未曾见过面的网络恋情。</p>\r\n<p>这次是Steve和Grace联系三年来，唯一一次同时出现在相同城市－－台北，对于这次的会面，二人各自充满期待与彷徨......</p>\r\n<p>邱比特(黄泰安饰)这位驻点在台湾的爱神，当发现结果不如人意，就急于撮合Steve和丽丝(杨秀惠饰)这段爱情......</p>\r\n<p>想不到就在Steve和丽丝展开爱神所安排的恋爱之际，Grace的出现不得不让邱比特马上打电话到泰国给阿迪(魏焌皓饰)，求他帮忙解决自己所犯下的错......</p></div>', '梁烈唯 茍芸慧 杨秀惠 魏焌皓 黄泰安', '粤语', '2013', '0', '/data/images/56c065986ee86.jpg', '香港', '2016-02-14 19:31:50', '13', '0', '0', '685', '时装剧', '全集/共4集');
INSERT INTO `movie` VALUES ('1596', '爱情三角错', '<div class=\"endtext\"><p>狄瑾另有一男友吕怀信（吴镇宇），信擅用心理攻势，使得狄瑾陶醉於物质与浪漫的迷情中。同时，狄瑾为母亲的好友谭媚（卢宛茵）经营饮食店，因而与其拍档（高雄）发展出一段恋情。</p>\r\n<p>物质挂帅的社会中，难道细水长流的爱情，真的已不复见了吗？速食爱情取代了往日的爱情神话，真爱又将如何求得？</p></div>', '吴镇宇 温兆伦 毛舜筠', '粤语', '1990', '0', '/data/images/56c06472e1c3e.jpg', '香港', '2016-02-14 19:26:43', '13', '0', '0', '685', '时装剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1597', '曾许诺', '<div class=\"endtext\"><p>该剧改编自桐华同名小说，讲述上古时期几大家族之间的复杂故事，其中主要讲述轩辕族王姬轩辕妭（又名西陵珩）与神龙族蚩尤荡气回肠的凄美爱情故事。</p>\r\n<p>蚩尤和轩辕王姬西陵珩相爱，并许下每年四月桃花树下相见的诺言，并在此后因诺言而产生了一系列感情的纠葛。蚩尤被封为战神，智勇双全，但最让人喜爱的却是他不羁豁达的性格，这世间事只有他不愿意做的没有他做不到的，他的爱超脱一切只为真心，西陵珩出身世家，天资聪颖，心怀天下，医术高超，温柔中多了一份俏皮又不失端庄，她对爱情没有一丝扭捏，他们因缘结识，又不得不相爱相杀，就是这样一对对爱情保持着最纯真意念的男女，将让人看到大情大爱下的另一种痴缠。</p></div>', '黄晓明 宋茜', '国语', '2017', '0', '/data/images/56c036708138b.jpg', '大陆', '2016-02-14 16:10:52', '13', '0', '0', '687', '古装剧', '预告');
INSERT INTO `movie` VALUES ('1598', '战争与和平', '<div class=\"endtext\"><p>由BBC和温斯坦公司（The Weinstein Co.）联合制作的六集大型电视剧《战争与和平》（War and Peace）主演人选本周日公布，迪士尼新版《灰姑娘》主演莉莉·詹姆斯（Lily James）将出演女主角“娜塔莎”（Natasha Rostova），而《血色黑金》（There Will Be Blood）的保罗·达诺（Paul Dano）与《佳人蓓儿》（Belle）的詹姆斯·诺顿（James Norton）则将分别饰演“彼埃尔”（Pierre Bezukhov）和“安德烈”（Prince Andrei Bolkonsky）。</p>\r\n<p>《战争与和平》是俄国作家列夫·托尔斯泰（Leo Tolstoy）的大部头名著，小说通过对安德烈、彼埃尔、娜塔莎三人在1812年俄国卫国战争前后的经历，展示了当时俄国社会的风貌、反映了1805年至1820年间的许多重大历史事件。</p>\r\n<p>此次BBC再次拍摄《战争与和平》，将由《黑衣女人2》（Woman In Black: Angel Of Death）的导演——1977年出生的汤姆·哈珀（Tom Harper）执导，而编剧则是安德鲁·戴维斯（Andrew Davies）。</p>\r\n<p>这版《战争与和平》计划2015年一月份在俄罗斯、立陶宛和拉脱维亚三国取景拍摄，每一集时长一小时，共六集。</p></div>', '莉莉·詹姆斯 保罗·达诺 詹姆斯·诺顿 斯蒂芬·瑞 亚德里安·埃德蒙松', '英语', '2016', '0', '/data/images/569d92357e8a8.jpg', '欧美', '2016-02-07 23:48:26', '13', '0', '0', '693', '战争剧', '全集/共6集');
INSERT INTO `movie` VALUES ('1599', '爱情食物链国语', '<div class=\"endtext\"><p>从事食品供应的鲁佳芳（阮小仪饰）样子平凡，身材矮小，年过三十仍欠缺恋爱经验，因一次苦瓜事件，帮助餐饮业才俊刘柏业（陈智燊饰）渡过难关，令这位高富帅欣赏到佳芳的内在美，并与她渐生情愫，佳芳的邻居兼好友高贵芬（高海宁饰）对此无法释怀，卖鱼出身的贵芬样貌身材皆属女神级数，千方百计也未能令柏业过电，却召来台湾担仔面继承者洪鱻（金刚饰）的青睐，洪鱻为亲近贵芬不惜自贬身价与佳芳她们同住㓥房，贵芬得不到柏业唯有转战大哥刘利高（郑子诚饰），但后来柏业承受不了外界对女友佳芳的负评，二人关系亮起红灯；当爱情再不是饮水饱，美丑优劣再无标准，男女同时成了猎人与猎物，血肉横飞的恋爱激战即将一发不可收拾……</p></div>', '阮小仪 金刚 陈智燊 高海宁 何雁诗 谢东闵 郑子诚 杨卓娜', '国语', '2016', '0', '/data/images/5694686ee49c9.jpg', '香港', '2016-02-07 11:09:34', '13', '0', '0', '685', '时装剧', '全集/共21集');
INSERT INTO `movie` VALUES ('1600', '特种兵之霹雳火', '<div class=\"endtext\"><p>狼牙特战基地的高胜寒接到了新的任务，调到陆航旅去组建和训练一支特殊的特战分队，代号“霹雳火”。高胜寒来到了陆航，却没想到遇到了曾经的战友崔华盾和昔日恋人曾紫陌。作为军医的曾紫陌也参加了集训，她深知组建霹雳火的意义。经过各种残酷的考验，霹雳火特战分队正式成立。他们首要面临的任务便是西南地区的抢险救灾。高胜寒主动请缨要求高空跳伞，成为了进入震中的第一批救援队伍，打通了生命通道。载誉归来后，霹雳火又投入到去边境营救被贩毒武装抓获的侦察员的任务，并到非洲A国担任武装护卫。经历了重重血与火的考验，霹雳火逐渐走向成熟，开创了中国陆航的新历史。</p></div>', '任天野 牟星 程愫  陈美霖 李飞 林昌鸿 姜艺  ', '国语', '2016', '0', '/data/images/56991ab8362f2.jpg', '大陆', '2016-02-07 00:03:01', '13', '0', '0', '686', '警务剧', '全集/共45集');
INSERT INTO `movie` VALUES ('1601', '爱情食物链粤语', '<div class=\"endtext\"><p>生物学上，草食动物吃植物、肉食动物捕食草食动物，各种生物吃与被吃的关系连系起来的序列，称为食物链。人类的爱情关系，又何尝不是食物链？每人均会根据“美与丑”、“贫与富”的准则选择配偶。位于“爱情食物链”上层的“高富帅”和“白富美”当然占尽优势；相反外貌不扬、家境贫寒等人则位于底层，莫非早已输在起跑线上？<span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\">天生异禀 味觉惊人</span></p>\r\n<p>食品供应公司总务鲁佳芳（阮小仪饰）虽然个性爽朗但缺乏女性的温柔，加上外貌平庸、身材矮小，并非讨人喜欢的类型，已到达中女之龄，感情生活仍一片空白。佳芳是家中长女，父母、弟妹鲁佳麟（谢东闵饰）和鲁佳麒（王卓淇饰）均英俊漂亮、高贵大方，佳芳即使与家人站在一起也总是显得格格不入。</p>\r\n<p>纵然样貌不出众，佳芳却拥有味觉异能，所有食物经她一试，即可分析出采用了什么食材及调味料。她同时具备烹饪天份和创造力，能因应食材施展不同的烹调手法，创出千变万化的美味菜式。</p>\r\n<p>佳芳父亲及其下属邢烨源（C君饰），一次疏忽买错一批苦瓜而令公司陷入危机。公司本为最好味集团提供水果制作夏日特饮，佳芳为收拾烂摊子，竟想出以苦瓜制成夏日新颖菜式，成功帮助集团未来继承人刘柏业（陈智燊饰），战胜其二叔、太好味饮食集团的老板刘利高（郑子诚饰）。柏业因而对佳芳留下深刻印象，佳芳也被柏业的俊朗外形迷倒，可惜他只专注事业，对佳芳心意浑然未觉，佳芳只能当他背后的支持者。<span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\">厨艺高手　寻味结缘</span></p>\r\n<p>佳芳的惊人味觉，同时引来台湾著名担仔面店继承者洪鱻（金刚饰）的注意。洪鱻因父亲病倒昏迷，令家传的制面秘方无人得知，面店被迫停业，逼于无奈来到香港访寻厨艺高人助他还原秘方。一次，佳芳在一间高级分子料理餐厅秘密下厨，其高超的厨艺及味觉天赋被洪鱻发现，即苦缠佳芳，求她相助还原秘方。</p>\r\n<p>洪鱻其实亦为厨艺高手，二人相处、几番交流下，惺惺相惜！事业可以靠双手打拼，爱情却不可以。佳芳为柏业默默付出的同时；洪鱻亦为佳芳的好友、集所有女神必备条件于一身的美女鱼档老板高贵芬（高海宁饰）倾倒，可惜贵芬只钟情城中“钻石笋盘”刘柏业，对洪鱻视而不见。贵芬多番主动向柏业示好，惟柏业事业心重，对爱情反应迟钝，无动于衷。<span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\">俊男剩女 真情考验</span></p>\r\n<p>柏业这个“笋盘”，在事业上依赖佳芳的味觉异能、超凡厨艺与创意巧思，屡破难关。相处日久，柏业慢慢对这名世人眼中的“剩女”产生好感，继而擦出爱火花。随着恋情浮面，佳芳的平庸外表却惹来负评不绝，柏业始终承受不了被众人嘲笑，开始嫌弃佳芳，二人关系亮起红灯……</p>\r\n<p>与此同时，贵芬得知佳芳暪着自己暗交“高富帅”梦中情人柏业，失望与愤恨交织下，与佳芳绝交，更转投刘利高怀抱……<span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\"><br />\r\n</span></p>\r\n<p><span style=\"font-weight:bold;\">情场战争　胜败谁定</span></p>\r\n<p>在爱情的战场上，胜败难料，有人使尽千方百计，巧取豪夺也赢不到“笋盘”，有人始终坚持真性情……经历连串亲情、友情与爱情的考验，人性真面目尽现，亦引发出不少笑料。戏如人生，有喜亦有悲，笑中亦有泪！俊男配美女、灰姑娘与王子终成眷属，才算是爱情赢家？情场胜败，又该如何定夺？</p></div>', '阮小仪 金刚 陈智燊 高海宁 何雁诗 谢东闵 郑子诚 杨卓娜', '粤语', '2016', '0', '/data/images/56948bbe4416e.jpg', '香港', '2016-02-06 21:42:00', '13', '0', '0', '685', '时装剧', '全集/共21集');
INSERT INTO `movie` VALUES ('1602', '无垠的太空第一季', '<div class=\"endtext\"><p>《太空无垠》根据同名小说改编。《太空无垠》系列小说目前共有三本。2011年出版的《巨兽觉醒》（Leviathan Wakes）曾获雨果奖最佳小说奖提名和轨迹奖最佳科幻小说奖。之后又出版了《凯列班战争》（Caliban’s War）和《地狱魔王之门》（Abaddon’s Gate）两本书，均获不俗反响。</p>\r\n<p>目前Syfy预定播出《太空无垠》的前十集，而是否会继续制作则要看播出时的反响。Syfy希望借此剧重现《太空堡垒卡拉狄加》系列的辉煌。《太空无垠》故事发生在200年后的未来，一位硬派的侦探和一个走私太空舰的舰长联手调查一个神秘女孩Juliette Mao(弗罗伦丝·费佛瑞饰演)的失踪案，他们穿越太阳系揭发人类历史上最大的阴谋。 这名侦探将由托马斯·简饰演。他名叫米勒，被描述为“厌世者”，家乡是位于火星和木星之间的小行星带。他为行星带上的一家大型安保组织工作，有着粗犷的外表和敏锐的直觉。</p></div>', '托马斯·简 乔·平格 简恩·尹', '英语', '2015', '0', '/data/images/56976a7a9a896.jpg', '欧美', '2016-02-04 20:18:06', '13', '0', '0', '688', '科幻剧', '全集/共10集');
INSERT INTO `movie` VALUES ('1603', '少帅', '<div class=\"endtext\"><p>这是传奇人物张学良辉煌而坎坷的人生自传，他是大军阀张作霖钟爱的长子，却几经战争洗礼，遭受挚友举兵反奉的打击，忍受父亲被日本人谋杀的家仇国耻。从最初带兵时手足无措的青年，成长为担负家国重任的东北三省领导者。张学良风流倜傥，与原配于凤至、挚爱赵四相伴一生；他吸毒戒毒，脱胎换骨；他力排众议实行 “东北易帜”，对蒋介石绝对服从；却也因此，“九一八事变”时，让日本人一夜之间占领了沈阳。张学良在三十六岁时与杨虎城策划了 “西安事变”，结束了长达十年的内战，促成国共合作、一致抗日；他自己却因此被软禁长达半个世纪之久……</p></div>', '文章 李雪健 宋佳 张歆怡 张嘉译 柳岩', '国语', '2016', '0', '/data/images/56947b9bcd821.jpg', '大陆', '2016-02-03 23:52:13', '13', '0', '0', '693', '战争剧', '全集/共48集');
INSERT INTO `movie` VALUES ('1604', '铁血保镖', '<div class=\"endtext\"><p>镖旗岚岚，场面浩荡；男儿肝胆照，热血丹心！镖局外四面受敌，镖局内同室操戈！</p>\r\n<p>1、<span style=\"font-weight:bold;\">兄弟相残 处处惊心，内忧外患 重重险阻</span></p>\r\n<p>从《金枝玉孽》到《胭脂水粉》，女人间的明争暗斗戏已经看得够多了，而《铁血保镖》却是男人间的斗智。马浚伟、黎耀祥、刘江、黎诺懿、黄智贤等人在戏中争斗不休。再加上镖局行业日薄西山，在这内忧外患之中，身为镖局大掌柜的马浚伟如何带领众人冲破难关，重振家业？让我们拭目以待。 </p>\r\n<p>2、<span style=\"font-weight:bold;\">大场面 大制作 惊险刺激 气势恢弘 </span></p>\r\n<p>“会友镖局”闯荡江湖，却从不沾手江湖恩怨；他们是正当商人，却与黑道中人打交道；他们叱咤一时，官、商、贼三道无不留下面子三分！ </p>\r\n由于是以镖局为骨干的剧集，因此，大家经常可以看到千军万马的运镖和打斗场面，TVB非凡将会友镖队浩浩荡荡、人强马壮的押镖场面、血并山贼、峰回路转的劫镖事件、镖师被太平天国活捉等一件又一件惊险事件活现大家眼前！喜爱大场面、大制作的观众欣赏此剧时一定会过足瘾。</div>', '马浚伟 姚子羚 黎耀祥 黄智贤 黎诺懿', '粤语', '2006', '0', '/data/images/568f32fd6c825.jpg', '香港', '2016-02-03 09:37:08', '13', '0', '0', '687', '古装剧', '全集/共25集');
INSERT INTO `movie` VALUES ('1605', '制造凶手/制造杀人犯', '<div class=\"endtext\"><p>导演萝拉･瑞卡狄 (Laura Ricciardi) 和密欧拉･迪莫丝 (Moira Demos) 从 2005 年的一篇新闻报导获得拍摄灵感，耗时 10 年记录前所未见的真实惊悚案例，案情发展前後历时超过 30 年。《Making a Murderer》的场景位於美国的中西部，内容描述史蒂芬･艾弗瑞 (Steven Avery) 的悲惨故事。他无故卷入一起重大攻击事件，而後遭判入狱，并在服刑多年後获无罪释放。这起获释案例引发美国刑法体系重大的立法改革，而他也在出狱後提起诉讼，扬言揭发当地执法单位的贪腐内幕，而最後的胜诉为他带来数百万元的赔偿。然而，正当这起民事官司轰动社会之际，他忽然成为另一起恐怖案件的主嫌。</p>\r\n<p>这部纪录片将带领观众深入这起引发热议丶众所瞩目的刑事案件，个人名誉攸关一切，而案情也绝非表面一样单纯。导演从各个角度完整记录整起案件，除了密切追踪第二次调查行动与被告後续的审判，他们更向法院提出申请，以免拍摄内容必须移交法院，还亲自搜集档案资料，并访谈与案件最相关的人员。</p>\r\n<p>「《Making a Murderer》记录了百转千回的案情发展，曲折离奇得让人不敢置信这不是虚构小说剧情。」 Netflix 原创纪录片制作部副总裁西村丽莎 (Lisa Nishimura) 表示。「瑞卡狄和迪莫丝从非常复杂的案情中抽丝剥茧，统整拍摄出这个扣人心弦的系列，让观众彷佛置身在这起案件中。」</p>\r\n<p>导演萝拉･瑞卡狄和密欧拉･迪莫丝表示：「若没有亲眼目睹这些细节，我们实在很难相信这是真实发生的事件。我们希望向观众分享我们的所见所闻。多亏与 Netflix 合作，我们才能以这种形式呈现这个故事，若是透过其他管道，根本不可能办到。」</p>\r\n<p>《Making a Murderer》检视对检警不当行为的指控，包括窜改证据和逼供等。导演首先关注第一宗案件调查的谬误之处，接着提问：过去 30 年的科技发展与司法改革是否让司法体系更接近寻找真相和捍卫正义的理想？</p></div>', '史蒂芬･艾弗瑞 萝拉･瑞卡狄', '英语', '2015', '0', '/data/images/56a43ac12dd1e.jpg', '欧美', '2016-02-02 23:26:56', '13', '3', '10', '686', '警务剧', '更新至03集/共10集');
INSERT INTO `movie` VALUES ('1606', '秦时明月', '<div class=\"endtext\">这是一个懵懂少年如何成长为一代大侠的热血传奇故事。天下第一剑客盖聂，携故人之子荆天明为躲避追杀，踏上了闯荡江湖之旅。在逃亡的过程中，荆天明陆续结识了众多江湖高人，机缘巧合之下他成为了天下第一帮派的掌门人。磨砺中荆天明渐渐成长，危难时刻，他甚至挺身而出，凭借自己弱小的肩膀保护着朋友们的性命。而这一切事件的背后似乎都有着一只看不见的手在操控，江湖神秘势力阴阳家的存在渐渐浮出水面。处于阴谋核心的荆天明，由此层层剥开了自己身世以及所有阴谋背后的惊天秘密……</div>', '蒋劲夫 胡冰卿 秦俊杰 陆毅 孙艺洲 陈妍希 金晨', '国语', '2015', '0', '/data/images/56946b48db561.jpg', '大陆', '2016-02-01 23:55:05', '13', '0', '0', '687', '古装剧', '全集/共58集');
INSERT INTO `movie` VALUES ('1607', '新娘嫁到', '<div class=\"endtext\"><p>18岁的秀珠(海伦清桃饰)从越南远嫁到台湾，和丈夫俊雄(雷洪饰)以及儿子志和过着虽不富裕但尚能温饱的生活。 未料一场车祸意外使得俊雄半身瘫痪，家计重担和庞大负债全落在秀珠一人身上，她将如何撑过这些难关呢? 而微笑协会李姐(唐美云饰)和家豪(Junior饰)又会如何从旁提供协助呢?</p></div>', '雷洪 海伦清桃 唐美云 韩宜邦 傅子纯', '国语', '2016', '0', '/data/images/56947e28ddd38.jpg', '台湾', '2016-02-01 19:23:52', '13', '0', '0', '694', '偶像剧', '更新至04集');
INSERT INTO `movie` VALUES ('1608', '煮妇神探', '<div class=\"endtext\"><p>民国初年上海。家庭主妇苟吉祥遭遇不幸，丈夫离世，自己蒙冤。为查出丈夫的死因还自己清白，吉祥成为女探员。毛儒毅是吉祥的搭档，心地善良，但傲慢自大。破案中，他俩闹出许多矛盾。随着合作的深入，他们逐渐默契，顶着巡长弗兰克的压力破获多起疑案，不但让恶人得到惩罚，更帮助了很多底层的贫苦百姓。吉祥由丧失自我的家庭主妇蜕变成自信独立的新女性，儒毅也由混混噩噩的公子哥变成有责任心的勇敢神探。两人收获爱情的同时，也明白了人生的意义：立志帮助更多需要帮助的普通百姓。吉祥和儒毅在办案中，认清了帝国主义殖民者的真面目，揭穿了弗兰克与奸商的惊天阴谋。他们离开巡捕房，开设了专为百姓服务的吉祥侦探社，用青春、热血书写正义。</p></div>', '李小璐 贾乃亮 刘恩佑 黄明 傅迦', '国语', '2016', '0', '/data/images/5691bec8018bf.jpg', '大陆', '2016-02-01 00:27:41', '13', '0', '0', '685', '时装剧', '全集/共43集');
INSERT INTO `movie` VALUES ('1609', '枭雄', '<div class=\"endtext\"><p>民国初年，上海号称“东方冒险家乐园”，各路英雄豪杰云集。当时上海三大亨合力建造叱吒风云的流氓集团，素有“翟金棠(汤镇业饰)贪财，龚啸山(黎耀祥饰)善打，乔傲天(黄秋生饰)会做人”的说法，要成就大业，往往要不择手段。而傲天、啸山、金棠亦历尽大时代的波澜起跌、敌友之间的尔虞我诈。在这时局纷扰的年代，又有谁能彰显出人性的光辉？</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">乔傲天‧擅于计谋　冒起上海新势力</p>\r\n<p>年轻的乔傲天(马国明饰)出身寒微，父母早逝，只身于上海十六舖当水果店学徒，但恶势力当道，傲天为挣扎求存，决以拳头打出一片天，并与啸山不打不相识，二人旋即称兄道弟，以一人献谋、一人动武之策，合力于上海滩头打出个小名堂。</p>\r\n<p>及后，傲天于赌场打工，凭小聪明为老板娘姚桂生(陈炜饰)化解危机，桂生将他引荐给丈夫金棠，傲天再助金棠策划豪夺沈镇岳(黄柏文饰)的鸦片生意。事成后，傲天乘胜追击，拉拢金棠与啸山结盟，成立“三铿公司”，正式营运鸦片运输保险的工作，生意愈做愈大。傲天由寂寂无闻的水果小工，一跃成雄霸上海的大亨！</p>\r\n<p>傲天能够雄霸一方，全赖桂生的知遇之恩，二人合作无间，相知相交，二人产生微妙情愫，却不敢越雷池半步，并接受桂生安排，娶其近身侍女何淑英(尹诗沛饰) 为妻。傲天曾在八方会馆邂逅京剧学徒顾小楼(胡杏儿饰)，对其一见倾心，但小楼却因其黑帮身份而敬而远之。及后，傲天把对小楼的感情投射到她的同行师姐曹月兰(苏玉华饰)身上，并娶其为二太太。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">龚啸山‧好勇斗狠　只有拳头才是真理</p>\r\n<p>龚啸山人称“癫狗”，为人火爆狂妄，一生人中只顾及妻子刘美琴(梁琤饰)、儿子龚学尧(杨明饰)和乔傲天三人。啸山自幼家贫，一心参军从政，但其性格好勇斗狠，难以控制，训练中途已被开除。辗转间，啸山遇上美琴，二人不顾美琴父母反对，珠胎暗结，私奔至上海滩头，啸山决定在此大展拳脚，打出名堂，并与傲天称兄道弟。</p>\r\n<p>傲天不慎得罪当地恶势力，招来杀身之祸，幸得啸山舍命相救，二人兄弟情义更深。当啸山混得有声有色时，他越来越放肆的手段不慎得罪军阀，被对方追杀，啸山只得逃离上海。但啸山的野心未有因此而熄灭，并借着在武备学堂结识的人脉，靠拢军阀，逐渐建立起自己的武装力量。</p>\r\n<p>其后，啸山风闻傲天成为金棠和桂生的手下，并经营起运送烟土生意。啸山发现这是回归上海的好时机，便趁傲天运送鸦片时，拦途截劫，终如愿与傲天、金棠共同成立三铿公司。几年间，“三铿”飞黄腾达，雄霸鸦片市场，横行法租界，三人更兄弟相称，合称上海三大亨！</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">翟金棠‧气势如虹　问鼎上海黑白两道</p>\r\n<p>翟金棠本于巡捕房任职“包打听”，惯用黑吃黑手段，屡破奇案，深得法国殖民政府的信任，扶摇直上成督察长。金棠亦得贤妻桂生相助，为其建立的黑道势力，声势愈见浩大，旗下赌场、妓院等生意均蒸蒸日上，令金棠问鼎上海滩黑白两道！</p>\r\n<p>金棠虽已雄霸一方，但仍觊觎上海的鸦片生意，可惜以镇岳为首的八股党垄断鸦片贩卖，令他未能分一杯羮，苦无计策。此时，由桂生引荐的傲天胆识过人，金棠对他委以重任，终把八股党的鸦片业务击溃！</p>\r\n<p>得桂生及傲天扶助，金棠气势如虹，只手遮着上海半边天。及后与啸山与傲天合作成立三铿公司，令他于上海的身份地位更见显赫！金棠搭上著名歌女祝绮虹(沈卓盈饰)，左右逢源，尽享金银钱财、齐人之福，徒添几分霸气。</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight:bold;\">动荡乱世 敌我难分</p>\r\n<p>傲天、啸山、金棠逐步成为上海首屈一指的大亨，三分天下，各据一方，但三铿公司却充满外忧内患……随《国际鸦片公约》成立，市民对鸦片的遗祸怨声载道。身为总参谋副官的韩立(关礼杰饰)，被委派调查三大亨，他却在傲天的帮助下，立下大功，得委员长赏识。二人自此唇齿相依，建立互相利用的关系。</p>\r\n<p>而令人闻风丧胆的斧头帮帮主毛冠潮(敖嘉年饰)，与傲天命定为敌，但冠潮对傲天的海派作风心生敬佩，碍于身份，二人终归未能成为真正的战友……相反，黎兆匡(吴卓羲饰)作为傲天的得意门生，虽适时为其出谋献策，一解烦愁，但现实的桎梏却令他看清社会真面目，变成被利益冲昏头脑的青年，一度想要把傲天推向绝地！</p>\r\n<p>上海滩刀光剑影，人人为追求自身利益不择手段，三分天下的局面亦逐步分裂。随后日军大举侵华，上海沦陷，乔傲天、龚啸山、翟金棠三兄弟终归各走各路。走在乱世之中，谁又能成为上海滩最后的赢家？</p></div>', '黄秋生 黎耀祥 汤镇业 胡杏儿 苏玉华 马国明 吴卓羲', '国语/粤语', '2015', '0', '/data/images/56ab4c1a069dc.jpg', '香港', '2016-01-29 19:25:15', '13', '0', '0', '695', '年代剧', '全集/共32集');
INSERT INTO `movie` VALUES ('1610', '神烦警探第三季', '<div class=\"endtext\"><p>该剧故事发生在纽约市最偏远的一个警察分局里，主人公是一组个性差异很大的侦探。其中一名警探对待工作很不严肃，而他的上司偏偏是个循规蹈矩的人，不停催促他真正「成熟」起来，不要给自己的警徽抹黑。</p>\r\n<p>Andre Braugher扮演警队队长Holt，当了三十年警察才等到升职的这一天。尽管他负责的这个警察分局是全纽约条件最艰苦的，但他历来办事认真，绝不允许任何人在他的团队中和他唱反调——特别是喜欢捣蛋的首席侦探Jake。</p>\r\n<p>Andy Samberg扮演首席侦探Jake，复杂指挥日常行动。他同时将担任该剧的制片人。</p>\r\n<p>Terry Crews扮演探长Terry Jeffords。</p>\r\n<p>Melissa Fumero扮演迷人、聪明的女侦探Amy，在纽约市郊区长大。成为警察之前，Amy一直在中学里教书——与那些捣蛋的六年级学生比起来，罪犯要好对付得多。Amy坚持「不与警察约会」的原则——虽然警队中许多人都想追求她。</p>\r\n<p>Stephanie Beatriz扮演性感、强悍、固执己见的女警官Meghan，她的性格让其他警察感到害怕——他们甚至认为她和街上的罪犯一样可怕！</p>\r\n<p>Joe Lo Truglio扮演最近刚刚离婚的资深侦探Charles，在晚辈Jake面前从不摆架子。</p></div>', '安迪·萨姆伯格 泰瑞·克鲁斯 乔·洛·特鲁格里奥 安德鲁·布劳尔', '英语', '2013', '0', '/data/images/56a0790e43688.jpg', '欧美', '2016-01-28 09:53:12', '13', '13', '23', '686', '警务剧', '更新至13集/共23集');
INSERT INTO `movie` VALUES ('1611', '蜀山战纪之剑侠传奇', '<div class=\"endtext\"><p>该剧主要讲述明末期间，武林以蜀山剑派为天下正道之首，正邪两派展开江湖纷争的故事。蜀山派一直是江湖第一名门正派，一直领导武林多年。蜀山掌门诸葛驭我为保天下，对抗企图抢夺赤魂石的绿袍尊者，把赤魂石打入天赋秉异的丁隐体内，丁隐由此拜入蜀山门下修习剑法，誓要练成蜀山绝学，替天下百姓向绿袍尊者寻仇。偶然间，丁隐发现绿袍之女玉无心竟然与他逝去的爱妻长得一模一样，二人坠入情网。此时，蜀山剑派内部亦暗流涌动，一场武林浩劫即将来临。丁隐联合同门丹辰子、诸葛紫英、周青云及结拜兄弟小张，历经艰难险阻，不想却陷入更大的阴谋，令众人分崩离析。丁隐为救众生，牺牲自己，与敌绿袍尊者同归于尽；玉无心伤心欲绝，独自流浪天涯，完成丁隐心愿，造福众生。丹辰子独自留在了蜀山，接任蜀山派掌门，江湖也等着蜀山派一众去合力行侠仗义，拯救天下苍生。</p></div>', '陈伟霆 赵丽颖 吴奇隆 文咏珊 叶祖新 樊少皇 贾晓晨', '国语', '2015', '0', '/data/images/569a09ebe75cd.jpg', '大陆', '2016-01-24 00:06:32', '13', '0', '0', '690', '魔幻剧', '全季全集/共56集');
INSERT INTO `movie` VALUES ('1612', '英雄重生第一季', '<div class=\"endtext\">在Fox宣布复活《24》之后，NBC也动心了……NBC宣布复活他们曾经的招牌剧集——《超能英雄》（Heroes）。据称NBC将与原剧的（剽窃）创作人Tim Kring合作，续拍一部13集的有限剧集，做法和Fox的《24：活到另一天》（24: Live Another Day）完全一致。该剧剧名暂定为《超能英雄：重生》（Heroes: Reborn）。<br />\r\n<br />\r\n制片人Tim Kring表示，该剧将主要围绕新角色展开剧情，讲述一个全新的故事，只是这个故事设定在《超能英雄》搭建的世界中。不过他也强调，新剧会让原版剧集中一些悬而未决的问题得到解决。<br />\r\n<br />\r\n由于原版剧集中的主要演员都已经有了新工作，因此将他们重新召集起来是不现实的，但是的确会有一些老面孔出现在剧中：NBC证实Jack Coleman将演出该剧，再次扮演他在原版剧集中的标志性角色HRG（全名Noah Bennett）。他是第一位正式回归该剧的「原初演员」。在Jack Coleman之后，Masi Oka（扮演时间旅行者Hiro Nakamura）亦宣布回归。Ali Larter、Milo Ventimiglia和Hayden Penettiere均公开表示自己不会回归（Ali Larter称不排除「客串」的可能）。Zachary Quinto也确认自己不会演出该剧，这意味着这部13集有限剧集的主要反派角色不再是能够吸收各种超能力的杀人恶魔Sylar，而是「另有其人」。其他「原初演员」（Greg Grunberg、Adrian Pasdar和Sendhil Ramamurthy）意向不明。<br />\r\n<br />\r\n新加盟的演员包括：Francesca Eastwood扮演一个善于操纵别人的年轻女人；Pruitt Taylor Vince扮演一个看起来谦逊但很有说服力的男人；Ryan Guzman、Robbie Kay、Danika Yarosh、Judith Shekoni、Kiki Sukezane、Henry Zebrowski、Gatlin Green、Eve Harlow和Toru Uchikado扮演细节不详的新角色；来自《Chuck》的Zachary Levi将联合主演，角色细节同样不详（有可能是反派角色）。<br />\r\n<br />\r\n此外，NBC宣布拍摄《超能英雄：重生》的伴生节目《超能英雄：重生——网络剧》（Heroes Reborn: Digital Series）。这个伴生节目将与每一集《超能英雄：重生》配套，并在每一集《超能英雄：重生》正式播出之前通过NBC旗下的各种网络媒体平台（包括 Hulu）播出。据称这个网络剧为《超能英雄：重生》的「前传」。</div>', '杰克·科尔曼 瑞安·古兹曼 吉米·让-路易斯 罗比·凯 莱亚·吉斯特德', '英语', '2015', '0', '/data/images/569900202e071.jpg', '欧美', '2016-01-22 19:40:42', '13', '0', '0', '690', '魔幻剧', '全集/共13集');
INSERT INTO `movie` VALUES ('1613', '睡在我上铺的兄弟', '<div class=\"endtext\"><p>电影讲述的是同宿舍的四位男生，在毕业之际遭遇的故事。聪明贪玩、厚脸皮的大男孩林向宇（陈晓 饰）与女上司姐弟恋，引得周遭非议；聪明贪玩、自在逍遥的富二代李大鹏（杜天皓 饰）无所事事，拉着心爱的羊驼到处配种；硕果仅存的处男管超（刘芮麟 饰）遇到心爱的女生，却遭遇人生重大分歧；出身贫苦、仗义痴情的奋斗青年谢训（李现 饰），能否结束现实的贫穷？一方有难兄弟支援，他们为彼此两肋插刀，然而却出现了不可调和的内部矛盾……在这个过程中，四位热血兄弟成长着，改变着……</p></div>', '陈晓 秦岚 杜天皓 刘芮麟 李现', '国语', '2016', '0', '/data/images/56a0b78076cb7.jpg', '大陆', '2016-01-21 18:56:32', '13', '0', '0', '685', '时装剧', '全集');
INSERT INTO `movie` VALUES ('1614', '无心法师(粤语版)', '<div class=\"endtext\">拥有不老不死本领的法师无心(韩东君饰)，他的双眼能看见能量聚散，粘稠稀少的血液则可让违逆世间法则而聚合一起的能量消散。一次意外堕坡，偶遇到因逃婚而无家可归的姑娘月牙(金晨饰)，月牙将身上仅有的锅头分给了饥饿的无心，无心深受感动，决定报恩。<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">缘分牵引 展开捉妖之旅</span><br />\r\n<br />\r\n身无分文的无心和月牙，一同走到了由司令顾玄武(王彦霖饰)统领的文县。无心以天眼搜索到某大宅内有妖气，为求果腹，决定以捉妖形式赚取生活所需。<br />\r\n该大宅的主人原来就是坐拥丰厚身家的玄武，无心简单的施展几下本领，就引出了水井下女妖出现并消灭她。无心深得玄武之信任，答应缴付一万大洋让无心驱妖，怎料水井下被封印百年的另一女妖岳绮罗(陈瑶饰)也被一同解封。<br />\r\n绮罗对无心一见钟情，誓要从月牙手上抢得无心，还施下“纸人蛊术”，务求令月牙返回百年前，重蹈绮罗为爱人自缢的覆辙……<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">法师秘密 惹来感情危机</span><br />\r\n<br />\r\n月牙与无心相处下来，认为他是个值得信任、可以付托终身的人。不过，有感无心的工作十分艰险，无论他有何任务，月牙也抢着要一同前往，好让自己放心。<br />\r\n见证过多宗捉妖事件后，月牙发现妖魔“作孽”背后有一段段可歌可泣的爱情故事，感叹好日子短暂，希望与无心一同开心度过余下的人生。<br />\r\n无心即时向月牙求婚，让月牙甜在心头！可是无心一次严重受伤，揭露了他的一个秘密，月牙突然觉得眼前的无心有太多事情瞒着自己，让二人陷入感情危机……<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">风光无常 司令惨被出卖</span><br />\r\n<br />\r\n另一边厢，玄武亦陷入人生大危机！与玄武自小便是好友的张显宗(张若昀饰)，为夺兵权令玄武一夜间一无所有，还扬言要斩草除根稳定权势。玄武别无选择下，只好逃到月牙的住处，成为月牙与无心之间的“电灯胆”。<br />\r\n自此有任何问题，三人携手一同解决，最要急的一项任务就是要铲除对三人威胁甚大的绮罗！<br />\r\n<br />\r\n<br />\r\n<span style=\"font-weight:bold;\">百年妖女 三人携手歼灭</span><br />\r\n<br />\r\n绮罗把显宗迷得神魂颠倒，两人携手合作，力量更是提升！无心、月牙、玄武三人到青云观求助，得掌门出尘子(隋咏良饰)揭露绮罗的秘密。无心趁绮罗不备成功攻击绮罗，可惜仍未能置她于死地，反惹来显宗追杀，将无心射杀至碎片……<br />\r\n一个不速之客的出现，让无心的生活再起波澜！他是白琉璃(Mike饰)，陪伴了无心千百年的挚友。此行，他是为了带走无心而来。原来无心除了不死，还有着更大秘密，更让无心和月牙的感情面临最严峻的考验。与此同时，更大的危机也在暗中酝酿，暂时蛰伏的绮罗及显宗正在计划着一场疯狂而血腥的复仇大计！</div>', '韩东君 金晨 陈瑶 张若昀 孔连顺', '粤语', '2015', '0', '/data/images/567e30c16c381.jpg', '大陆', '2016-01-17 22:48:53', '13', '0', '0', '690', '魔幻剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1615', '太子妃升职记', '<div class=\"endtext\">《太子妃升职记》是乐视网自制古装网络剧，由侣皓吉吉执导，甘薇监制，张天爱、盛一伦、于朦胧、江奇霖、郭俊辰等主演。该剧改编自鲜橙同名网络小说，讲述了男儿心女儿身的“太子妃”一路顺利地升职为“太后”的故事。</div>', '张天爱 盛一伦 于朦胧 郭俊辰', '国语', '2015', '0', '/data/images/5694bbc63fc32.jpg', '大陆', '2016-01-17 20:26:01', '13', '0', '0', '692', '网络剧', '全集/共36集');
INSERT INTO `movie` VALUES ('1616', '请回答1988', '<div class=\"endtext\">该剧以1988年首尔道峰区双门洞为背景，以家族关系和邻里感情作为剧情主轴，生活在小巷子里的一家人为主角，讲述了住在同一屋檐下的三家人的故事。</div>', '李惠利 高庚杓 朴宝剑 刘慧英 成东日', '韩语', '2015', '0', '/data/images/569af8c1c7b56.jpg', '韩国', '2016-01-17 10:14:13', '13', '0', '0', '691', '家族剧', '全集/共20集');
INSERT INTO `movie` VALUES ('1617', '盗墓笔记', '<div class=\"endtext\">出生于“老九门”世家的吴邪（李易峰 饰），因身为考古学家的父母在某次保护国家文物行动时被国外盗墓团伙杀害，吴家为保护吴邪安全将他送去德国读书，因而吴邪对“考古”事业有着与生俱来的兴趣，在一次护宝过程中他偶然获得一张记载过古墓秘密的战国帛书，为赶在不明势力之前解开帛书秘密，保护古墓中文物不受侵害。按照帛书的指引吴邪跟随三叔吴三省（张智尧 饰）、潘子（魏巍 饰）以及神秘小哥张起灵（杨洋 饰）来到鲁殇王墓探究七星鲁王宫的秘密。 　　在古墓中吴邪结识了前来探秘的王胖子（刘天佐 饰）并救下身份不明的阿宁（唐嫣 饰），经过惊现刺激匪夷所思的事件之后，众人又发现了更多未解的谜团。吴邪等人在和不明势力斗智斗勇的同时又踏上了新的探秘之旅…</div>', '李易峰 杨洋 刘天佐 李晨浩 苏青 唐嫣', '国语', '2015', '0', '/data/images/569a063e32c37.jpg', '大陆', '2016-01-16 17:05:40', '13', '0', '0', '690', '魔幻剧', '全集/共12集');
INSERT INTO `movie` VALUES ('1618', 'Oh我的鬼神君', '<div class=\"endtext\">主要讲述了讲述被淫荡女鬼附身的胆小女厨房助理罗奉善（音译）与不信鬼神的自恋狂明星主厨姜善宇（音译）之間的浪漫搞笑故事。</div>', '赵正锡 朴宝英 林周焕 朴正雅 金瑟祺', '韩语', '2015', '0', '/data/images/569a07d8e9e93.jpg', '韩国', '2016-01-16 17:05:31', '13', '0', '0', '690', '魔幻剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1619', '华胥引之绝爱之城', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 华胥引根据中国大陆幻想言情小说作家唐七公子的同名小说改编，全书讲述了4个故事，分别是浮生尽（宋凝篇）、十三月（莺哥篇）、柸中雪（酒酒篇）、一世安（结局）。<br />\r\n<br />\r\n　　这是一个发生在乱世的故事。国破那日，卫公主叶蓁盛装从城墙上跃下，以身殉国。陈世子苏誉望着她如飞鸟般坠落，轻轻合上手中折扇，淡淡道，以公主之礼 ... ，厚葬了罢。那是后来的史书记载中，陈世子苏誉与卫公主叶蓁唯一的一次见面。<br />\r\n<br />\r\n　　而真正的风月传说，往往隐藏在丹青史笔之后……亡国公主叶蓁依靠鲛珠死而复生，流浪于九州列国，以华胥调为引，为他人编织出一个个梦境。有的人愿望实现，有的人梦想成真，而现实中的辛酸与苦涩，被轻描淡写抹去。幻术组成的琴声，生死人肉白骨，她是幻境中唯一的神，执掌生死，却握不住自己的幸福——与敌国世子的一次次相遇，身份两重，缘也两重。到底是缘分的邂逅，还是命运的戏弄？<br />\r\n<br />\r\n&nbsp;　　清平华胥调，能不能让每个人追回旧日的思念，不再悲伤？ 当赖以维生的鲛珠被击碎，叶蓁与心爱之人苏誉终究抵不过玩笑般的命运……她用尽所有力量与寿命演绎的最后一曲，为谁奏起？ <br /></div>', '郑嘉颖 林园 袁弘 蒋欣 郭珍霓 高昊', '国语', '2015', '0', '/data/images/569a075e1bf26.jpg', '大陆', '2016-01-16 17:03:26', '13', '0', '0', '687', '古装剧', '全集/共48集');
INSERT INTO `movie` VALUES ('1620', 'Oh My Venus', '<div class=\"endtext\">讲述小时候认识的两个男女长大后再次相遇，挑战减肥过程的浪漫爱情喜剧。</div>', '苏志燮 申敏儿 郑糠云 刘仁英 Oh我的维纳斯', '韩语', '2015', '0', '/data/images/569a00243bc0d.jpg', '韩国', '2016-01-16 16:32:36', '13', '0', '0', '685', '时装剧', '全集/共16集');
INSERT INTO `movie` VALUES ('1621', '老婆大人是80后', '<div class=\"endtext\">本剧讲述了汪小鹿、吴雨、白素仙三个性格截然不同的80后闺蜜，秉持着各自截然不同的婚恋观，在经历了一番生活的风风雨雨和啼笑皆非后领悟人生的故事。天真可爱的娱记汪小鹿与老公吕不凡虽然并不富裕但生活甜甜蜜蜜有滋有味。闺蜜吴雨毒舌犀利，坚持等待心目中的白马王子现身，并为此固执地守身如玉。高冷路线的白素仙毕业后就嫁了60后富豪董靖晖，虽然挥金如土但是常年独守空房。</div>', '李小冉 杜淳 张嘉译 于明加 张鲁一 王维维 朱锐 王唯伊', '国语', '2015', '0', '/data/images/56946aceea9d0.jpg', '大陆', '2016-01-15 00:46:38', '13', '41', '41', '685', '时装剧', '更新至41集/共41集');
INSERT INTO `movie` VALUES ('1622', '乡村爱情8', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 师范大学毕业生谢永强，与同村女青年王小蒙上学期间产生真挚的爱情，谢永强的父亲谢广坤一直希望儿子出人头地，听到儿子与王小蒙的事情强烈反对，并且亲自找到王小蒙的父亲王老七干预这门亲事。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;本来就对王小蒙的高攀有所顾虑的王老七也在气头上表明了态度：王小蒙就是嫁也不会嫁给谢永强。谢永强与王小蒙的爱情一下子进入一种危险境地。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;一直对谢永强的心存爱意，更对谢永强将来的工作充满幻想，长贵为了女儿香秀的幸福，亲自找到乡长、也是谢永强表叔的齐三太作媒。谢家一直把找工作的希望寄托在齐三太身上，香秀的加入在谢家引起大波。为了谢永强的工作，王小蒙劝说谢永强表面上先答应香秀的亲事。谢广坤假戏真做，瞒天过海，竟然一步步把把谢永强逼到香秀身边。经过一系列变故，王小蒙也看到了他与大学生谢永强之间确实存在着一定距离，她对她与永强的关系重新进行了反思。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;与此同时，王小蒙家请邻居赵玉田进城卖粮食，不料出了车祸，赵玉田的腿不幸受伤。赵玉田未来的岳父刘能担心玉田的腿是大问题，委托谢大脚去医院打听虚实，谢大脚看走了眼，告诉刘能玉田可能残疾。刘能将女儿刘英与玉田的亲事强行退掉。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;谢永强在阴差阳错中与香秀定了亲。村养殖场场长刘一水开始暗暗追求痛苦中的王小蒙。王小蒙无动于衷,为刘一水辞职到养殖场工作的城里姑娘谢小梅不由得暗自神伤。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;赵玉田的腿完好无损，刘能后悔莫及。刘英去玉田家看望玉田，玉田却提出要刘能道歉。刘能碍于面子没有答应，反而寄希望于赵家来求他。赵、刘两家展开了心理战。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;王老七一直对玉田的亲事充满歉意，找到媒婆谢大脚请他给玉田提亲，刘能知道他女儿刘英与玉田是合适的一对，听说这事，万分着急，央求谢大脚千万别给玉田说成，谢大脚感觉“看走眼”一事对不住刘能，暗暗帮他。玉田相了几次亲，都以失败告终。玉田一家人都很悲哀。王老七在无奈的情况下表态，如果玉田找不上媳妇，将王小蒙嫁给玉田。玉田为了得到小蒙竟然装起了瘸子。却被刘一水揭穿。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;谢永强终于没有分到城里，却莫名其妙地分到村里做小学老师，巨大的失落使谢永强抬不起头来，一直想做城里人的香秀后悔莫及，产生退亲的念头。长贵怕乡长齐三太生气，让香秀坚持一段时间。香秀却对养殖场的司机城里人李大国产生了好感，疏远了谢永强。谢广坤到这时候才看出王小蒙的可爱来，踏上了去王老七家的求亲之路。但是遭到王老七拒绝。</div>', '赵本山 毕畅 吴云飞 王小利 刘晓光', '国语', '2015', '0', '/data/images/56966e4e07c7d.jpg', '大陆', '2016-01-13 23:35:29', '13', '0', '0', '685', '时装剧', '全集/共65集');
INSERT INTO `movie` VALUES ('1623', '刀下留人(粤语版)', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 杀人无数的刽子手叶常绿（黄德斌饰）为保护恩公的媳妇阮素心（姚子羚饰）顺利产子，将素心安顿在京城享负盛名的稳婆花蕊红（邵美琪饰）家中，因而遇上离奇命案，常绿竟以其鬼头刀救活了一条小生命，谁料这名来历不明的男婴令常绿和蕊红无故卷入朝廷的政治漩涡，一冷一热的配搭化解了一次又一次的危机，两人在患难中渐生情愫；另边厢，一对同在妓院长大的小情侣赤知秋（杨明饰）和祝小满（龚嘉欣饰）来到蕊红家，苦苦哀求常绿收知秋为刽子手的学徒，知秋其心不正，只想借此逃脱受刑，常绿迟疑不决，一名神秘的彩戏师司马丑（陈山聪饰）出现，令各人关系陷入错综复杂，男婴身分之谜更因而被逐步揭开，但同时敲起了死神的丧钟……</div>', '黄德斌 邵美琪 杨明 龚嘉欣 姚子羚 陈山聪', '粤语', '2015', '0', '/data/images/567e2d29ad336.jpg', '香港', '2016-01-13 10:01:11', '13', '0', '0', '687', '古装剧', '全集/共26集');
INSERT INTO `movie` VALUES ('1624', '美丽的秘密', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 由柯翰辰执导，何润东、宋茜联决主演的都市爱情歌手成长励志剧《美丽的秘密》讲述了姜美丽（宋茜 饰）被亲生母亲遗弃，长大之后误打误撞参加歌唱比赛后一鸣惊人，历经感情波折、亲情纠葛之后，逐渐变得坚强、成熟，最终收获了自己的精彩人生的故事。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 20年前，为给女儿治病歌手汪璇耗尽积蓄，不得已听由经纪人孙锦盛将女儿送人收养，自己隐瞒实情结婚。婚礼当天汪璇逃婚寻女无果，女儿走失高烧失忆，被卡车司机姜卫国夫妇收养取名姜美丽，从此汪璇将全部母爱倾注在继女若琳身上。20年后，若琳做了歌手，在一次比赛中，与为支持妹妹而无意中参赛的快递员美丽成为对手。若琳一心想要追回的前男友制作人关毅爱上美丽，若琳要汪璇设法让美丽退赛，汪璇犹豫。而美丽的脱颖而出让梦想成名的妹妹美妍既高兴又失落，一向被美妍当作备胎男友的邻家大哥伟峰更被她发现其实真正关心的是姐姐美丽，美妍在若琳的挑拨下对美丽态度逆转。此时孙锦盛突然出现，汪璇追问女儿下落，锦盛说服美丽假扮女儿慰籍汪璇......</div>', '宋茜 何润东 魏千翔 李颖 弦子 邵雨薇', '国语', '2015', '0', '/data/images/567e2e2fb104f.jpg', '大陆', '2016-01-13 00:02:46', '13', '0', '0', '685', '时装剧', '全集/共37集');
INSERT INTO `movie` VALUES ('1625', '芈月传', '<div class=\"endtext\">战国时期，芈月是楚威王最宠爱的小公主，但在楚威王死后生活一落千丈，母亲向氏被楚威后逐出宫，芈月和弟弟芈戎躲过了一次次灾难和危机。芈月与楚公子黄歇青梅竹马，真心相爱，但被作为嫡公主芈姝的陪嫁媵侍远嫁秦国。芈姝当上了秦国的王后，芈月不得已成为宠妃。原本的姐妹之情在芈月生下儿子嬴稷以后渐渐分裂。诸子争位，秦王嬴驷抱憾而亡。芈月和儿子被发配到遥远的燕国。不料秦武王嬴荡举鼎而亡，秦国大乱。芈月借义渠军力回到秦国，平定了秦国内乱。芈月儿子嬴稷登基为王，史称秦昭襄王。芈月当上了史上第一个王太后，史称宣太后。</div>', '孙俪 黄轩 曹征 方中信 刘涛 马苏 高云翔', '国语', '2015', '0', '/data/images/567e2f8573bcc.jpg', '大陆', '2016-01-10 10:09:46', '13', '0', '0', '696', '历史剧', '全集/共81集');
INSERT INTO `movie` VALUES ('1626', '实习天使(粤语版)', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 几位准护士毕业生被派到医院实习，当中祁乐（岑丽香饰）与同学邓励帧（刘佩玥饰）和俞玥爱（吴若希饰）等一班学护被分配到地狱病房，由注册护士杨志明（洪永城饰）主责训练她们，绰号死神Ray的志明虽然经验丰富，技术了得，但性情乖僻，背景神秘，医院里各人大都对志明敬而远之，但心地善良，勇者无惧的祁乐对志明产生了莫名的好奇，总想找机会了解志明，期间发现志明背后隐藏了不为人知的故事，但志明这位魔鬼教官还在学护之间挑拨离间，引爆病房内激烈的医护斗争，最终学护们在战火下面对各项挑战，又要面对实习考试，到底死神Ray是天使还是魔鬼？学护们又如何逃出魔掌救人自救……</div>', '洪永城 岑丽香 单立文 陈炜 刘佩玥 姚子羚 吴若希', '粤语', '2015', '0', '/data/images/567e2be336dc3.jpg', '香港', '2015-12-30 12:53:44', '13', '0', '0', '689', '医务剧', '全集/共25集');
INSERT INTO `movie` VALUES ('1627', '钢刀', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 哥哥王炳生（何润东 饰），弟弟陈铁金（李东学 饰），他们曾是相依为命、甘苦与共的兄弟。甚至哥哥炳生为弟弟铁金顶罪入狱十年，满身的伤疤与玩世不恭的态度是这十年的烙印，不变的却是兄弟之间的感情。不料在命运的捉弄下，两人在兵荒马乱的世界里失散，走上了不同的人生道路……<br />\r\n再度相逢时，曾经的患难兄弟已经势不两立。手足情深与家国信仰的冲突，令昔日兄弟成为生死之敌，最终展开了一场生死较量……</div>', '何润东 李东学 夏梓桐 杨奇鸣 田原', '国语', '2016', '0', '/data/images/574e7da9777c1.jpg', '大陆', '2016-06-21 15:47:58', '1', '0', '0', '698', '战争片', 'HD版');
INSERT INTO `movie` VALUES ('1628', '踏血寻梅', '<div class=\"endtext\"><p>从湖南到东莞石门的王佳梅（春夏饰）及王佳莉（蔡洁饰）最终与妈妈（金燕铃饰）来港，但王佳梅在学校生活不愉快，而家庭亦出现磨擦。一年过后，王佳梅遇害。老差骨阿臧（郭富城饰）联同拍档烟铲（谭耀文饰）调查案件，发现梅已当上援交少女，而最终案件矛头指向脾气不佳的货车司机丁子聪（白只饰）。其后，聪自首，并供出案情。惟阿臧认为还有案情，於是从梅与聪的身边人物调查，渐渐发现内情。</p></div>', '郭富城 春夏 白只 谭耀文 金燕玲', '国语/粤语', '2015', '0', '/data/images/57219f5fb95e5.jpg', '香港', '2016-06-20 09:25:53', '1', '0', '0', '699', '剧情片', 'BD加长版');
INSERT INTO `movie` VALUES ('1629', '死亡笔记', '<div class=\"endtext\"><p>故事讲述了女孩梁倩一段离奇的经历。梁倩是奶奶从孤儿院里领养回家并一手带大的，长大后的梁倩叛逆不羁，她意外怀孕惹恼了奶奶，间接导致了奶奶脑溢血发作死去。奶奶死后留给梁倩一本记录其身世的笔记本，一份奇怪的遗嘱让她必须生下孩子，还有一个孤零零的空房子。</p>\r\n<p>梁倩在忏悔中等待孩子的出生，但一切宁静都被一个陌生的女人打破了。这个女人租借了一个房间，每天都会给梁倩做好吃的，对梁倩和肚里的孩子照顾有加，可是慢慢地，梁倩发现了她种种怪异的举动，通过偷窥、跟踪，梁倩惊愕地发现这个女人房客原来是一个食婴人！最令人恐怖的是，这个女人的手正伸向梁倩肚中的孩子……</p>\r\n<p>梁倩该怎么破？答案都在那个笔记本里。</p></div>', '曹斐然 李峥 李奔', '国语', '2016', '0', '/data/images/5766960be18fe.jpg', '', '2016-06-19 20:54:57', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1630', '猎神：冬日之战', '<div class=\"endtext\"><p>故事发生在白雪公主的故事之前和之后的7年，冰雪女王弗雷娅（艾米莉·布朗特 Emily Blunt 饰）是邪恶女王拉文纳（查理兹·塞隆 Charlize Theron 饰）的妹妹。拉文纳通过魔镜得知妹妹的女儿将会成为世界上最美的女人，弗雷娅在一次“意外”中失去了孩子。丧子之痛激发了弗雷娅巨大的魔力，从一个善良温柔的女人变成了冷酷无情的冰雪女王，不仅创建了千里冰封的冰雪王国，更是在王国内制定了“不准相爱”的规则。猎神埃里克（克里斯·海姆斯沃斯 Chris Hemsworth 饰）与女勇士萨拉（杰西卡·查斯坦 Jessica Chastain 饰）的爱情之路正是由此开始，作为弗雷娅培养的部下，二人经历艰难后将合力对抗两大女王，这不仅是一场为爱而展开的斗争，更是一场推翻女王统治的为争取自由而引发的正邪大战。</p></div>', '克里斯·海姆斯沃斯 查理兹·塞隆 艾米莉·布朗特 杰西卡·查斯坦', '英语', '2016', '0', '/data/images/57301484f16e9.jpg', '欧美', '2016-06-19 10:48:39', '1', '0', '0', '701', '科幻片', 'HD版');
INSERT INTO `movie` VALUES ('1631', '分歧者3：忠诚世界', '<div class=\"endtext\"><p>在推翻了派系制度之后，翠丝（谢琳·伍德蕾 Shailene Woodley 饰）与老四（提奥·詹姆斯 Theo James 饰）带领众人翻越了芝加哥的围墙来到全新世界。然而看似美好的新世界却隐藏着更大的杀机，翠丝与老四之间的信任也遭受到前所未有的考验。二人能否从阴谋中脱身并守住彼此？</p></div>', '谢琳·伍德蕾 提奥·詹姆斯 杰夫·丹尼尔斯 奥克塔维亚·斯宾瑟', '英语', '2016', '0', '/data/images/5746682051e4d.jpg', '欧美', '2016-06-18 23:04:40', '1', '0', '0', '701', '科幻片', 'HD版');
INSERT INTO `movie` VALUES ('1632', '北京遇上西雅图之不二情书', '<div class=\"endtext\"><p>焦姣（汤唯 饰）15岁就随父亲移民到澳门，从此在赌城安家，并成为赌场公关。罗大牛（吴秀波 饰）则生活在洛杉矶，是一位房地产经纪人。姣爷和大牛通过一本书，巧合地通过手写书信的方式互相联系，两人从最初的完全陌生，到一步步敞开自己的心扉，逐渐进行心灵的交流，再到最后爱上对方。</p></div>', '汤唯 吴秀波 惠英红 秦沛 吴彦姝 颜卓灵', '国语', '2016', '0', '/data/images/5729cbe763ae0.jpg', '大陆', '2016-06-18 11:53:33', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1633', '判我有罪', '<div class=\"endtext\"><p>美艳忧郁的女医生冯雪辉（李昕芸 饰）对男性有种致命的吸引力，但她的丈夫方文楠（吴镇宇 饰）却以冷暴力相待，两人之间似有深深隐情，他们既是仇人又是同谋。</p>\r\n<p>突然医院发生了一起惨烈的坠楼命案，由此牵出一场围绕金钱与欲望的黑幕，仿佛漩涡注定改变所有人——不得志的颓废刑警张越（田小洁 饰）视此案为事业翻身的最后机会而穷追不舍，却被冯雪辉利用引向她的目的；自负到病态的幕后黑手副院长康富荣（戴立忍 饰）早早设计圈套诱捕冯雪辉为替罪羊；暗恋冯雪辉的英俊正直的蒋力航（李至正 饰）其实是手握核心证据的人，但他被爱情深深伤害并亲手将冯雪辉投入监狱——漩涡中心里这个美艳的女人，她到底要什么？她为深藏一个不伦的秘密，她愿意付出任何代价，并誓将挡路的男人们击败，她的武器除了心计还有美丽的身体。</p></div>', '李昕芸 吴镇宇 戴立忍 田小洁 李至正', '国语', '2016', '0', '/data/images/573eebe12ba33.jpg', '大陆', '2016-06-17 09:03:20', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1634', '魔宫魅影', '<div class=\"endtext\"><p>一九三零年代的上海，争夺名利、明争暗斗。被视为阮玲玉接班人的女明星孟思凡（林心如 饰）、出身大帅家庭的不知名小导演顾维邦（杨佑宁 饰）等一班寻求着各种自身所需的青年人，也把这里当做梦想的孵化器。</p>\r\n<p>阴差阳错之间，打算开拍新电影的顾维邦结识了孟思凡，两人在丽宫电影院遇见，孟思凡向顾维邦提议一起拍摄一部以戏院为背景的惊悚爱情电影。就这样，两人开始了密集的准备工作。之后，顾维邦创作出了一个名为《夜半歌声》的剧本，孟思凡请到了当红小生主演故事的男主角。前期准备完毕，剧组准备在丽宫电影院开机，而这一家电影院正是传说中的灵异剧院，很多人劝说顾维邦放弃拍摄，然而他不信邪，坚持剧组人员进驻戏院马上开拍。</p>\r\n<p>拍摄开始之后，剧组离奇事件不断，摄影师拍摄到了奇怪的画面，但是胶片洗印出来全部曝光过度，剧组的人员也纷纷表示现场“闹鬼”.然而，更大的意外发生了，男主角离奇死亡，陈尸现场极其可怕，顾维邦的未婚妻费丽斯（黄幻 饰）介入了事件的调查。在影片拍摄的过程中意外不断，甚至闹出了一连多起离奇命案，而一切似乎都指向孟思凡、顾维邦，还有关于他们多年前的一段尘封已久的往事。</p></div>', '林心如 杨祐宁 任达华 黄幻 景岗山 林江国 孟瑶', '国语', '2016', '0', '/data/images/572bee613843c.jpg', '大陆', '2016-06-17 00:28:43', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1635', '老笠便利店', '<div class=\"endtext\"><p>这夜很离奇，自认废青的阿平来到谜之便利店第一晚上班，先遇上刻薄老板和神经质女同事，转头黑警来借厕所；刚出狱的愤怒老人即兴玩老笠，又有富豪和性感女伴乱入。众人各有故事，各怀鬼胎，一场大龙凤在便利店热闹上演。当炸弹狂徒来袭，最后殊途同归但又意想不到。笑他们太疯癫，只是这个城市病了我们看不穿，导演火火掌控节奏和精警对白非常准确，几位老戏骨交足功课，成就一部港片少见的黑色荒诞困兽斗好戏。</p></div>', '郭伟亮 林雪 冯淬帆 曾国祥 姜皓文', '粤语', '2016', '0', '/data/images/575997cc8b1e6.jpg', '香港', '2016-06-10 00:22:50', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1636', '魔兽', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 艾泽拉斯与德拉诺本是两颗祥和安宁的星球，人类在艾泽拉斯大陆上世代繁衍生息，兽人则在德拉诺的土地上辛勤耕耘。直到兽人古尔丹（吴彦祖 饰）的出现，打破了两个星球的和平。邪恶的古尔丹为了一己私利，使用恶魔能量打开了一扇传送门——黑暗之门，并残忍的破坏兽人的家园，将原本爱好和平的兽人变成一个个野蛮残暴的战士，迫使他们穿过黑暗之门到达人类的领地作恶。霜狼氏族的酋长杜隆坦（托比·凯贝尔 Toby Kebbell 饰）虽然发现了古尔丹的阴谋却为时已晚，不得不带领着自己的族人离开支离破碎的德拉诺，在举步维艰的艾泽拉斯大陆上寻找着庇护所。面临家园危机的人类在领袖洛萨（崔维斯·费米尔 Travis Fimmel 饰）的带领下一边痛击着野蛮的入侵者，一边苦苦寻求着战争之外的解救方法。两个种族面临着同样的危机，他们能够顺利的渡过这场灾难吗？</div>', '崔维斯·费米尔 托比·凯贝尔 宝拉·巴顿 吴彦祖 本·福斯特', '英语', '2016', '0', '/data/images/57584bcb9c5e1.jpg', '欧美', '2016-06-09 00:46:33', '1', '0', '0', '703', '魔幻片', 'TC720P版');
INSERT INTO `movie` VALUES ('1637', '恶人报喜', '<div class=\"endtext\"><p>查理（吴镇宇 饰）是一个假装残疾的骗子，冯仁炳（郑中基 饰）是一个无所事事的村长， 自称恶人的两人对初来村中的美女余真（江疏影 饰）一见倾心。余真因怀孕和前男友反目而出走来到此地，无依无靠之时遂心生妙计，邀查理和阿炳来到家中共度晚餐。酒醉后余真故意让两人误以为与她促成好事导致怀孕，两人上当，难辨谁为亲生父亲，于是共同照顾余真。一日， 两人发现都不是孩子的亲生父亲，于是怒把余真交还给她前男友换取钱财。事成后，二人偶然得知余真前男友想拿孩子做实验，于是查理和阿炳两人念及旧情，决定去营救余真和她即将出世的孩子……</p></div>', '吴镇宇 江疏影 郑中基 余安安 蔡瀚亿', '国语', '2016', '0', '/data/images/56cf1db5f202b.jpg', '大陆', '2016-06-08 19:21:39', '1', '0', '0', '704', '喜剧片', 'BD版');
INSERT INTO `movie` VALUES ('1638', '梦想合伙人', '<div class=\"endtext\"><p>这是一个讲述三个阶层不同性格不同的女人为金钱、家庭、地位共同淘金的故事。</p>\r\n<p>留学生卢珍溪（姚晨 饰）在美国卖假包被驱逐回国，商场精英文清（郝蕾 饰）遭遇小三插足，灰姑娘顾巧音（唐嫣 饰）家庭贫寒只想嫁个有钱人。她们从一开始的死对头变成好闺蜜，并在事业导师孟晓骏（郭富城 饰）和卢珍溪的发小俊成(李晨 饰)的支持下，成为追求财富、爱情和地位的合伙人。她们短时间内取得巨大成功。不过好景不长，公司在市场激烈竞争下出现严重问题，陷入困局，同时三人的关系也出现破裂。面对困境，卢珍溪承受严峻考验的同时，为梦想和合伙人走出了坚定的一步……</p></div>', '姚晨 郝蕾 唐嫣 郭富城 李晨 金圣柱 王一博 汤镇业 罗嘉良 林雪', '国语', '2016', '0', '/data/images/572db1a494b99.jpg', '大陆', '2016-06-08 08:50:29', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1639', '超人', '<div class=\"endtext\">影片讲述了因闯祸而被勒令去图书馆工作的高中体育运动员在图书馆与神秘少女相遇而发生的故事。<br />\r\n耀眼的开始<br />\r\n“崔道贤 崔秀贤...名字也很像，我们真的有缘吗”<br />\r\n在学校因闯祸而被勒令去图书馆工作的高中体操运动员“道贤”<br />\r\n与每天都在图书馆借书的神秘少女“秀贤”相遇，<br />\r\n由于“秀贤”的劝导从来不愿意看书的“道贤”开始看书,<br />\r\n甚至因感动而流泪...<br />\r\n<br />\r\n“书中真的有捷径吗”<br />\r\n遥望着天上的飞机，在汉江大桥高声呐喊着<br />\r\n彼此渐渐的走进了对方，“道贤”慢慢的喜欢上“秀贤”<br />\r\n激动，紧张，心动！不知所措<br />\r\n什么都不懂的“道贤”<br />\r\n他与“秀贤”的每一次相遇总是那么坎坷</div>', '金正贤 金高云 徐永嬅 金珉锡', '韩语', '2016', '0', '/data/images/575626e4ed165.jpg', '韩国', '2016-06-07 09:44:20', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1640', '名侦探洪吉童：消失的村庄', '<div class=\"endtext\"><p>洪吉童（李帝勋饰）是一个没有恐惧、没有同情心、没有记忆、没有朋友的私家侦探，委托事件解决成功率高达99%，要找的人一般不超过一天就能找到，然而他唯一捉拿不到的就是杀死自己母亲的凶手金炳德（朴根滢饰）。案件终于有了一丝线索时却发现金炳德已被绑架，洪吉童在追踪其下落时陷入了一个巨大黑暗组织当中，并发现了神秘组织光恩会的真相，与此同时神秘人姜成日（金成均饰）也一直在监视着洪吉童的动向。</p></div>', '李帝勋 高雅拉 朴根滢 金成钧 郑承华', '韩语', '2016', '0', '/data/images/5753fd8841225.jpg', '韩国', '2016-06-05 18:23:27', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1641', '记忆碎片', '<div class=\"endtext\"><p>繁华都市的边缘地带有一栋老旧而神秘的公寓，里面居住着形形色色奇怪的人，有“高帅穷”的落魄小律师（雷佳音 饰）、有倔强的90后年轻漂亮女孩（夏梓桐 饰）、有惯于溜门撬锁的蠢贼（李菁 饰），更有黑社会老大（李彧 饰）和他的美艳性感情妇（孙宁 饰）以及假药小贩（何云伟 饰）等。</p>\r\n<p>一个山雨欲来的夜里，就在这样的公寓里，突如其来多出了一具尸体……到底是谁杀了这个被所有人恨之入骨的男人？是被骗去万贯家财的他？还是被欺骗强暴了的她？抑或一直被人踩在头上的他？围绕着这具让所有人都惊慌不已的尸体，有人惊慌失措准备逃之夭夭，有人面色镇定承认杀人罪行，有人偷梁换柱企图制造自杀现场，有人咬牙切齿主动提出埋尸……在一天一夜之间各色人等都历经了一场终身难忘的记忆。而当谁是凶手的真相貌似“盖棺定论”时，意外的结局反转，让所有人都瞠目结舌…</p></div>', '雷佳音 夏梓桐 李菁 孙宁 何云伟', '国语', '2016', '0', '/data/images/575383a99cf0b.jpg', '大陆', '2016-06-05 09:43:54', '1', '0', '0', '699', '剧情片', 'TC720P版');
INSERT INTO `movie` VALUES ('1642', 'X战警：天启', '<div class=\"endtext\"><p>继漫威英雄系列巅峰之作《X战警：逆转未来》席卷全球之后，一手打造《X战警》系列的布莱恩·辛格再度亲手执导，推出更大制作的《X战警：天启》。</p>\r\n<p>“天启”是漫威X战警世界里，能力最强大并且是史上首位变种人，自人类文明开始以来，便为世人当作天神来膜拜，他汲取多位变种人的超能力，演变成一位永生不死且无人能敌的超级变种人，历经数千年后，他再度觉醒，集结了多位强大的变种人意欲毁灭一切，重建世界秩序，当中包含失志的万磁王（迈克尔·法斯宾德 Michael Fassbender 饰）。当地球面临未知的巨大危机之际，瑞雯（詹妮弗·劳伦斯 Jennifer Lawrence 饰）在X教授（詹姆斯·麦卡沃伊 James McAvoy 饰）的协助之下，必须领导年轻的X战警们力抗这史上最强大的敌人，并扭转人类命运。</p></div>', '詹姆斯·麦卡沃伊 迈克尔·法斯宾德 詹妮弗·劳伦斯 奥斯卡·伊萨克', '英语', '2016', '0', '/data/images/575383b441a35.jpg', '欧美', '2016-06-05 09:43:33', '1', '0', '0', '701', '科幻片', 'TC720P版');
INSERT INTO `movie` VALUES ('1643', '拍的不错', '<div class=\"endtext\"><p>由五个单元故事组成的GOOD TAKE，是香港电影新一代导演的创新作品，包括：</p>\r\n<p>导演曾国祥的《水泥》，讲述警员9413（周柏豪）前往报案地点查案，最后只留下电话铃声却不见其人，令人毛骨悚然；</p>\r\n<p>导演黄智亨的《囍宴》，一个小孩跟着跟爸爸（张兆辉饰）一起前赴妈妈新婚囍宴的故事，童真与成年人的无奈都尽在心头；</p>\r\n<p>导演黄进的《Good Take》，透过甘草演员泰勒(卢海鹏饰)的生活是向资深电影从业员致敬的故事；</p>\r\n<p>导演杨龙澄的《不一定》，以型格对比色彩重构暴力血腥镜头；</p>\r\n<p>导演黄精甫的《吓鬼》，Charlene（蔡卓妍饰）挑战鬼屋一夜游，遇上中国僵尸、长发贞子和辫子姑娘，过程又惊又笑！五个故事各自有着不同风格及不同戏味！</p></div>', '方中信 周柏豪 张兆辉 蔡卓妍 卢海鹏 林雪 李璨琛 应采儿 苗侨伟', '国语/粤语', '2016', '0', '/data/images/575150d42a007.jpg', '香港', '2016-06-03 17:42:54', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1644', '王牌贱谍：格林斯比', '<div class=\"endtext\"><p>《格林姆斯比》讲述一名英国间谍和一个足球流氓的有趣故事。影片原本由派拉蒙发行，近期版权易主到了索尼哥伦比亚公司手中，片方也在今日宣布影片会在2015年暑期档公映。目前影片的前期筹备工作已经基本就绪，预计在今年夏天开机拍摄。</p></div>', '萨莎·拜伦·科恩 马克·斯特朗 艾拉·菲舍尔 蕾蓓尔·威尔森', '英语', '2016', '0', '/data/images/574680cb09e95.jpg', '欧美', '2016-06-03 09:20:35', '1', '0', '0', '704', '喜剧片', 'BD版');
INSERT INTO `movie` VALUES ('1645', '已是香港明日', '<div class=\"endtext\"><p>赤裸裸的浪漫气息下，Ruby——来自洛杉矶的美籍华人玩具设计师——首次因公来到香港。在她处境困难之际遇到了Josh——在香港居住的美国人。 Josh随后带她领略了香港风光，趣味的对话，自在的氛围，两个人之间散发着不可抗拒的吸引力。导演Emily Ting充分刻画着两人之间 的荷尔蒙气息，连接着交流的自在，以及香港壮丽的夜景，展示出完美的约会。</p></div>', '杰米·钟 布莱恩·格林伯格 吴耀汉', '英语', '2016', '0', '/data/images/5750dafedc5a7.jpg', '欧美', '2016-06-03 09:20:26', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1646', '恐怖照相机', '<div class=\"endtext\"><p>蒙昊（王翔弘 饰）来到古镇并租下一座老宅。当蒙昊用老式相机给吴老太拍摄照片之后，老宅里就开始出现一系列怪异事件。</p>\r\n<p>红衣女鬼的出现惊吓到了蒙昊女友冉洁（童鑫 饰），慢慢的冉洁感觉到女鬼事件另有蹊跷并开始展开调查，在调查中怪异事件的真相开始浮出水面。</p></div>', '王翔弘 童鑫 姚雨鑫 吴晴 唐佳成', '国语', '2016', '0', '/data/images/5750db1362205.jpg', '大陆', '2016-06-03 09:20:12', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1647', '恭喜发财之谈钱说爱', '<div class=\"endtext\"><p>一个IT男屌丝（曹云金 饰），获得人生第一笔融资后，想给心爱的她一个完美的求婚，却被女友误以为出轨，上演一出群众现场捉奸的好戏。一个孜孜以求的潦倒艺术青年（孙坚 饰），辛苦多年的作品却无人能懂，最终出现在他生命里的贵人，竟然是个身价过亿的清纯女神…… 冥冥之中，这些人又都被一种神秘的力量联系在一起……</p></div>', '曹云金 周知 杜海涛 吴昕 吴宗宪', '国语', '2016', '0', '/data/images/5750db1e311a6.jpg', '大陆', '2016-06-03 09:20:04', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1648', '纽约纽约', '<div class=\"endtext\"><p>上世纪90年代的上海，许多人都为出国狂热。路途（阮经天 饰）是最年轻的五星级酒店领班，处事精明、为人仗义，无论是手下阿坤（杨旭文 饰）等一众小弟，还是打算开娱乐城的金小姐（叶童 饰），都对路途很是信任。从美国归来的精英商人米先生（苗侨伟 饰）更是看中他，邀请他担任纽约新酒店的负责人。为了去纽约，许多人怀着不同目的来接近路途，其中也包括令路途着迷的女孩阿鹃（杜鹃 饰）。纽约梦能否如愿以偿？路途和阿鹃的爱情又将何去何从？一段在欲望都市中关于选择的爱欲纠缠，就此展开……</p></div>', '阮经天 杜鹃 苗侨伟 叶童 彼得·格林纳 袁文康', '国语', '2016', '0', '/data/images/574fea499b7c7.jpg', '大陆', '2016-06-02 16:12:13', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1649', '爱丽丝梦游仙境2：镜中奇遇记', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 爱丽丝（米娅·华希科沃斯卡 Mia Wasikowska 饰）为了拯救挚友疯帽子（约翰尼·德普 Johnny Depp 饰）而重返仙境，她与白皇后（安妮·海瑟薇 Anne Hathaway 饰）及一群老朋友一起，展开了一段璀璨华美、永生难忘的奇幻冒险。然而除了邪恶的红皇后之外，爱丽丝还要面对另一位劲敌——时间（萨莎·拜伦·科恩 Sacha Baron Cohen 饰），他是传说中无人能击败的角色！爱丽丝要如何才能扭转乾坤，拯救疯帽子和仙境世界？<br />\r\n&nbsp;&nbsp;&nbsp; 影片改编自路易斯·卡罗尔广受好评的同名原作。</div>', '约翰尼·德普 米娅·华希科沃斯卡 安妮·海瑟薇 海伦娜·伯翰·卡特', '英语', '2016', '0', '/data/images/574e7dba0494c.jpg', '欧美', '2016-06-01 14:17:48', '1', '0', '0', '705', '动画片', 'TC720P版');
INSERT INTO `movie` VALUES ('1650', '山河故人', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 1999年 <br />\r\n　　中国北方小城汾阳，涛儿（赵涛 饰）一直徘徊在煤矿主张晋生（张译 饰）和矿工梁子（梁景东 饰）的三角关系之中，当上个世纪最后一个春天来临，涛儿选择嫁给张晋生，梁子远走他乡。 <br />\r\n　　2014年 <br />\r\n　　重病缠身的梁子，背井离乡15年后带着妻子（刘陆 饰）和儿子回到故乡，等待生命最后一刻的停摆。病床前涛儿与梁子相望唏嘘，涛儿已经离婚，前夫张晋生准备带儿子移民澳大利亚。涛送儿子去上海坐飞机出国，火车悠长，这是母子间最后的惜别。 <br />\r\n　　2025年 <br />\r\n　　涛的儿子（董子健 饰）长大成人，住在澳大利亚海边的城市。他不喜欢讲中文，只记得母亲的名字叫：Tao，波浪的意思。</div>', '赵涛 张译 梁景东 董子健 张艾嘉', '国语', '2015', '0', '/data/images/574e7d957e0c7.jpg', '大陆', '2016-06-01 14:16:58', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1651', '猛于炮火', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 影片由伊莎贝尔·于佩尔、杰西·艾森伯格以及爱尔兰男星加布瑞尔·伯恩共同主演。于佩尔饰演的劳拉是一名著名的战地摄影女记者，她不幸在车祸中丧生。劳拉的丈夫带着他们的小儿子一起生活。三年之后，他们的大儿子回到了家中，打算开一个回顾劳拉摄影作品的展览。对于劳拉，这位声名显赫而特立独行的女人，他的丈夫和儿子都有着不同的回忆。但是在筹备回顾展的过程中，他们发现了劳拉藏着一个令人不安的秘密——丈夫和儿子，他们中间真的有人认识那个真正的劳拉吗？还是他们自身也有秘密，在瞒着彼此？</div>', '加布里埃尔·伯恩 杰西·艾森伯格 伊莎贝尔·于佩尔 德文·德鲁伊', '英语', '2015', '0', '/data/images/574e7d7e19270.jpg', '欧美', '2016-06-01 14:16:46', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1652', '朝鲜魔术师', '<div class=\"endtext\">以朝鲜时代为背景，讲述了嫁到清国去的朝鲜公主和马戏团的少年魔术师相识相爱的故事。</div>', '俞承豪 高雅拉 郭度沅 赵允熙 李璟荣', '韩语', '2015', '0', '/data/images/56acd2b89c0d9.jpg', '韩国', '2016-05-30 15:54:31', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1653', '失眠男女', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 影片讲述了在当今社会中，有许多因高压生活而失眠的男男女女，颇具幽默感的失眠治疗师安定就是一个专门治疗失眠症的行家，在治疗失眠的过程中他偶遇到了一见钟情的保险经理人苗窕，但因为苗窕有一段痛苦的恋爱经历一直不敢轻易接触新的感情，因此安定的多次的追求都被苗窕拒绝了，在经历了一连串啼笑皆非的事件后，安定通过自己的努力和真诚终于打动了苗窕，最终二人终成眷属。</div>', '宝儿 苑琼丹 谭耀文 邓紫飞 赵毅新', '国语', '2016', '0', '/data/images/5746ed77b18ee.jpg', '', '2016-05-26 20:35:23', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1654', '我的老婆是明星', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 龙套演员朱淇（刘心悠 饰） 在娱乐圈浮沉多年，一次意外竟被电影公司老板Jeff（林德信 饰）看中，荣升贺岁片女主角。朱淇为了星途，决意隐瞒已婚身份！忽然“被单身”的娱记老公赖毛（周柏豪 饰）为帮老婆圆梦，只好事事配合。随着朱淇人气急升，二人关系日渐疏离，赖毛只好潜入剧组监视老婆，却竟发现朱淇与Jeff有暧昧关系！两人因此大吵一架……此时，娱乐圈再爆出朱淇已婚消息，杂志老总誓要赖毛查出内幕……</div>', '周柏豪 刘心悠 林德信 蔡洁 蒋志光', '国语', '2016', '0', '/data/images/5746ed39af173.jpg', '香港', '2016-05-26 20:34:19', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1655', '睡在我上铺的兄弟电影版', '<div class=\"endtext\"><p>这部张琦执导、高晓松担纲总监制的电影，以陈晓、杜天皓、刘芮麟、李现组成的“沪都大学”330宿舍为主轴，讲述当代大学生的兄弟情和“生猛”成长故事。最新曝光的概念海报中，兄弟四人在天台上“占领世界”—— “只要够diao 世界就小”，雄性荷尔蒙淋漓尽致，可谓燃值爆表。</p></div>', '陈晓 秦岚 杜天皓 刘芮麟 李现 余心恬 蓝盈莹 蒋雪鸣 王啸坤', '国语', '2016', '0', '/data/images/5705a612c40dd.jpg', '大陆', '2016-05-26 20:31:48', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1656', '夜孔雀', '<div class=\"endtext\"><p>法国女留学生埃尔莎（刘亦菲 饰）在成都爱上了丝绸研究员、尺八高手马荣（黎明 饰），后又在巴黎与马荣的兄弟、纹身师建民（刘烨 饰）之间产生情感。前者找到了一种符合他理想的蚕——夜孔雀，后者把蝶化的夜孔雀永远铭刻在艾尔莎的肌肤上。</p></div>', '刘亦菲 刘烨 余少群 黎明', '国语', '2016', '0', '/data/images/5746679de5df9.jpg', '', '2016-05-26 11:04:12', '1', '0', '0', '699', '剧情片', 'TC720P版');
INSERT INTO `movie` VALUES ('1657', '愤怒的小鸟', '<div class=\"endtext\"><p>一群不会飞的小鸟，挤在一座热带小岛上，和睦宁静。游戏中的几个经典形象成了影片的主角，分别是易怒的胖红（杰森·苏戴奇斯 Jason Sudeikis 配音），飞镖黄（乔什·加德 Josh Gad 配音）和炸弹黑（丹尼·麦克布耐德 Danny McBride 配音） 。当神秘的绿猪莱纳德（比尔·哈德尔 Bill Hader 配音）登陆岛屿时，小鸟们平静的生活被打破了。</p></div>', '杰森·苏戴奇斯 乔什·加德 丹尼·麦克布耐德 玛娅·鲁道夫', '国语', '2016', '0', '/data/images/5746674f0f5a7.jpg', '欧美', '2016-05-26 11:03:01', '1', '0', '0', '699', '剧情片', 'TC720P版');
INSERT INTO `movie` VALUES ('1658', '谁的青春不迷茫', '<div class=\"endtext\"><p>《谁的青春不迷茫》是由光线传媒出品的校园青春片，由姚婷婷执导，白敬亭、郭姝彤、李宏毅、王鹤润、丁冠森等主演。该片改编自刘同同名小说，讲述了“好学生”林天娇和“学渣”高翔，从偏见到和解，再到互有好感，反映青春期学生成长烦恼的故事。</p>\r\n<p>人生一直处于辉煌巅峰的林天娇（郭姝彤饰），面对人生最重要的一次高考加分考试却重感冒了，情急之下她想通过作弊的方式顺利过关。没想到作弊也是需要技巧的，作弊失误的林天娇被高翔（白敬亭饰）看到，掉在地上的课本被老师误解这是高翔所为，高翔选择为林天娇挡了一刀。林天娇并不知道，她的人生的轨道从那一刻开始走向了另外一根轨道。毕竟高翔是她整个学习生涯中最反感的人。和自己讨厌的人扯上关系之后，林天娇用尽了各种方式想要摆脱高翔。倒不是谁吸引着谁，而是少年时大多数的气急败坏不是因为真的讨厌，而是因为害怕别人的眼光，害怕自己会变得不一样，害怕有人进入内心，害怕看不到前方而恐慌。在这个过程中，两个人互相拆台，林天娇发誓要拼个你死我活。</p></div>', '白敬亭 郭姝彤 李宏毅 王鹤润 丁冠森 赵文龙', '国语', '2016', '0', '/data/images/57205ffe042c7.jpg', '大陆', '2016-05-25 23:32:34', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1659', '杀戮指令', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 《杀戮指令》讲述了未来世界，大兵与杀戮机器的一场世纪大战。</div>', '凡妮莎·柯比 托尔·林德哈特 大卫·阿贾拉', '英语', '2016', '0', '/data/images/57440564d130d.jpg', '欧美', '2016-05-24 15:40:45', '1', '0', '0', '701', '科幻片', 'BD版');
INSERT INTO `movie` VALUES ('1660', '女汉子真爱公式', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 悉尼大学数学统计专业女学霸何修舞（赵丽颖 饰）在硕士论文中推导出了“真爱公式”，坚信自己公式绝对无误的何修舞，却接到了自己第一个实验对象失败自杀的噩耗……<br />\r\n&nbsp;&nbsp;&nbsp; 为了早点送走可怕的学霸女，叶思逸（张翰 饰）决定亲自帮助她寻觅她的真命天子，只是这个过程中，到底是哪里变的不对了，竟然有了奇怪的化学反应.</div>', '赵丽颖 张翰 童菲 丁一宇 涂世旻', '国语', '2016', '0', '/data/images/57406ae5de508.jpg', '大陆', '2016-05-21 22:04:48', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1661', '忘想症', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 林依（程媛媛 饰）和男友孙伟（安琥 饰）正在如火如荼地发展着地下恋情，而此时，警察却突然来到林依的家中告诉他孙伟已经死亡多时；辰（洪辰 饰）所住的对楼每晚都出现同一频率的灯火，而与她夜夜灯火对谈的男生却仿佛和另一个女生有着不能言说的秘密；刘一豪（周柏豪 饰）时常看见对楼女子惨叫求救，然而当他通知警察进行解救时，却惊人地发现房内空无一人……这一切背后都藏着怎样的秘密？遭遇离奇经历的他们，甚至还面临死亡的威胁，为此他们不惜一切代价揭开真相。</div>', '周柏豪 安琥 洪辰 程媛媛 洪天明', '国语', '2016', '0', '/data/images/573d16fe0229e.jpg', '香港', '2016-05-21 12:53:09', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1662', '笔仙诡影', '<div class=\"endtext\"><p>民国初期，苏承志（王燕阳 饰）带新婚妻子和五个同门师兄妹回老家古宅游玩，一场原为娱乐的笔仙游戏昭示着众人将陷于一场恐怖危机之中。背负秘密的苏母（李艳冰 饰），情仇暗生的师兄妹，神秘的哑巴守林人，突如其来的凶杀案，一桩桩诡异事件接连发生。师兄妹中陆续有人离奇死去，凶手像一个影子一样附身在众人之间。深 山中出现神秘血尸，古宅中的灵异往事也逐渐显现，幸存者抓住最后的一线生机，企图逃离古宅。一场突如其来的暴雨将幸存者困死在深山古宅之中，生死绝境之时，尘封在古宅中二十年之久的秘密终于揭晓。</p></div>', '宋懿洁 蒋欣奇 张蓝艺 王燕阳 马丹旎', '国语', '2016', '0', '/data/images/573eebcba351b.jpg', '大陆', '2016-05-20 18:50:53', '1', '0', '0', '700', '惊悚片', 'TC720P版');
INSERT INTO `movie` VALUES ('1663', '傲慢与偏见与僵尸', '<div class=\"endtext\"><p>《傲慢与偏见与僵尸》的作者是塞斯·格拉汉姆-史密斯（Seth Graham-Smith），他沿用奥斯汀的故事设定和语言风格，讲述了伊丽莎白·班纳特所在的小镇降临了一场瘟疫，很多人都变成了僵尸，伊丽莎白立志要把僵尸全部消灭掉，然而傲慢无礼的达西先生的到来，打乱了她的计划，经过一番斗嘴和好，两人开始携起手来对付僵尸，最终拯救了小镇。</p></div>', '莉莉·詹姆斯 萨姆·赖利 杰克·休斯顿 贝拉·希思科特 傲慢与尸变', '英语', '2016', '0', '/data/images/573ec216c3534.jpg', '欧美', '2016-05-20 15:53:51', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1664', '别开门', '<div class=\"endtext\"><p>云南一个美丽的小镇，几个刚毕业的大学生在某度假村酒店实习，这无疑是他们人生中最好的时期，但往往事与愿违……随着几个年轻人的到来，尘封已久的传说被开启，不可逆转的诅咒，使得平静的酒店再一次阴影笼罩，奇怪的敲击声，鲜红的血手印，种种的不寻常将所有人拉进幽怨的诅咒中。晓菲与 华子从此人鬼殊途，肥膘和老胡使得诅咒升级，柳姐亦不再冷静沉稳，夜夜惊声尖叫使得度假村瞬间成为鬼店。这一切究竟只是主人公的幻像还是已死之人死不瞑目？看似合理的故事背后却蕴含着让人不寒而栗的真相。</p></div>', '徐立 曲少石 杨珑 刘著 刘金', '国语', '2016', '0', '/data/images/573ec1b9353cb.jpg', '大陆', '2016-05-20 15:53:20', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1665', '神战：权力之眼', '<div class=\"endtext\"><p>故事发生在矗立着宫殿和金字塔的婉转萦回的尼罗河畔。 当时的古埃及充满了魔法、怪兽和神灵。无情的黑暗之神赛特,夺取了原本属于天神荷鲁斯的埃及王权,并让曾经繁荣和平的国家陷入冲突与混乱。人类的存亡与世界的安定岌岌可危。 一位年轻的窃贼贝克被神所眷顾,为拯救世界和自己的真爱踏上了一场惊险的奇幻旅程。为了成功,他必须寻求并得到强大的荷鲁斯神的帮助,与其组成一个看似不太可能的“英雄” 联盟。随着人类生命的危在旦夕,两个英雄站了出来,开启了对抗邪恶的不归路......</p>\r\n<p>作为荷鲁斯与贝克强有力的敌人,赛特指派心腹为他们的对抗制造重重艰难险阻。如果荷鲁斯神与凡人贝克希望在这场对抗中最终获胜,他们就必须通过一系列对勇气和牺牲的考验。</p></div>', '尼古拉·科斯特-瓦尔道 布伦顿·思韦茨 杰拉德·巴特勒', '英语', '2016', '0', '/data/images/573bc486c2f94.jpg', '欧美', '2016-05-20 15:52:18', '1', '0', '0', '701', '科幻片', 'BD版');
INSERT INTO `movie` VALUES ('1666', '洛杉矶捣蛋计划', '<div class=\"endtext\"><p>落魄经纪人黄伯伦（夏雨 饰）来到美国洛杉矶寻找一位失踪艺人（杨紫 饰）不幸滞留在美国，却意外地成为了五名不同肤色的美国萌娃的爸爸。黄伯伦一边要继续寻找失踪艺人，一边还要照顾5个青春期的孩子。在经历一系列波折之后，这个不负责任的“临时奶爸”却逐渐成长为一个真正的好爸爸，得到了他人生的二次成长。</p></div>', '夏雨 宋祖儿 杨紫 吴大维 江珊', '国语', '2016', '0', '/data/images/573d0f73c9e3e.jpg', '大陆', '2016-05-19 08:57:41', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1667', '疯狂动物城', '<div class=\"endtext\"><p>疯狂动物城是一座独一无二的现代动物都市。每种动物在这里都有自己的居所，比如富丽堂皇的撒哈拉广场，或者常年严寒的冰川镇。它就像一座大熔炉，动物们在这里和平共处——无论是大象还是小老鼠，只要你努力，都能在此闯出一番名堂。不过乐观的警官兔朱迪（金妮弗·古德温 Ginnifer Goodwin 配音）却发现，作为史上第一任兔子警官，要和一群强硬的大块头动物警察合作可不是件容易事。为了证明自己，她决心侦破一桩神秘案件；追寻真相的路上她被迫与口若悬河、谎技高超的狐尼克（杰森·贝特曼 Jason Bateman 配音）联手，却发现这桩案件背后隐藏着一个意欲颠覆动物城的巨大阴谋……</p></div>', '金妮弗·古德温 杰森·贝特曼 夏奇拉 伊德里斯·艾尔巴', '国语/英语', '2016', '0', '/data/images/56e4d33db624a.jpg', '欧美', '2016-05-18 09:04:49', '1', '0', '0', '705', '动画片', 'BD版');
INSERT INTO `movie` VALUES ('1668', '百鸟朝凤', '<div class=\"endtext\"><p>老一代唢呐艺人焦三爷（陶泽如 饰）是个外冷内热的老人，看起来严肃古板，其实心怀热血。影片表现了在社会变革、民心浮躁的年代里，新老两代唢呐艺人为了信念的坚守所产生的真挚的师徒情、父子情、兄弟情。</p></div>', '陶泽如 李岷城 嵇波 胡先煦 郑伟', '国语', '2016', '0', '/data/images/573a876388a08.jpg', '大陆', '2016-05-17 10:52:20', '1', '0', '0', '699', '剧情片', '预告');
INSERT INTO `movie` VALUES ('1669', '女巫', '<div class=\"endtext\"><p>16世纪30年代的新英格兰：威廉和凯瑟琳带着5个孩子在人迹罕至的荒野附近过着虔诚的基督徒生活。可是后来他们刚出世不久的儿子突然失踪，庄稼也颗粒无收，一家人只能互相扶持。更令他们感到恐惧的是在家附近的树林里来了一个会魔法的恶魔。</p></div>', '拉尔夫·尹爱森 凯特·迪基 哈维·斯克林肖 艾丽·格兰杰', '英语', '2016', '0', '/data/images/5711cf5e60ad1.jpg', '欧美', '2016-05-15 20:16:04', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1670', '伦敦陷落', '<div class=\"endtext\"><p>英国首相神秘逝世，美国特勤局特工班宁（杰拉德·巴特勒 Gerard Butler 饰）将配合特勤局局长琳·雅各布（安吉拉·贝塞特 Angela Bassett 饰）做好准备，陪同本杰明·阿瑟总统（艾伦·艾克哈特 Aaron Eckhart 饰）前往伦敦圣保罗教堂参加英国首相的国葬仪式。\r\n由于所有大国首脑都必然要出席，这场葬礼理应是全世界安保最严密的活动。 然而，各国首脑刚刚抵达不久便遭遇暗杀，伦敦地标建筑也纷纷遭袭。阿瑟、班宁和雅各布也遭到伏击，在连天的炮火和爆炸中撤退。满目疮痍的英国首都进入封锁状态。奉雅各布之命保护阿瑟总统的班宁必须躲开敌人的视线，抢在对手的前头先下手为强，不惜一切代价保护阿瑟总统安全回国……</p></div>', '杰拉德·巴特勒 艾伦·艾克哈特 摩根·弗里曼 阿隆·阿布布尔', '英语', '2016', '0', '/data/images/571057ff0be0c.jpg', '欧美', '2016-05-15 14:27:49', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1671', '时间脱离者', '<div class=\"endtext\"><p>该片讲述了分别生活在1983年和2015年却能够通过梦境看到彼此的两个男人为了拯救所爱之人展开的惊悚追击故事。由林秀晶饰演的女主人公允真在1983年被害身亡，海报中一袭白衣的允真在奔跑中回望，配合“救救我”的文案似有留恋。而另一张海报中，身在1983年的允真的未婚夫智焕（赵正锡 饰）和身处2015年的警察建宇（李镇旭 饰）因为“不同的时代、同一起杀人事件”而产生的交集，而他们“一定要拯救她”。</p></div>', '林秀晶 曹政奭 李阵郁 郑雄仁 温朱万 李敏豪', '韩语', '2015', '0', '/data/images/5737c78eb43b3.jpg', '韩国', '2016-05-15 08:50:07', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1672', '怒海救援', '<div class=\"endtext\"><p>影片根据真实事件改编，讲述海岸警卫队在暴风雪后，营救被困油轮船员的故事。</p></div>', '克里斯·派恩 卡西·阿弗莱克 本·福斯特 艾瑞克·巴纳 荷丽黛·格兰杰', '英语', '2016', '0', '/data/images/570f2b0e2fc8d.jpg', '欧美', '2016-05-13 17:41:01', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1673', '冰河追凶', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 在零下四十度极寒之地，以周鹏（梁家辉 饰）、汪豪（佟大为 饰）为首的“追凶者”深入冰河，追查真凶寻找真相。在暗藏杀机的冷酷冰河，牵一发而动全身，每一个人都无法避免地被卷入一场场错综复杂的事件，成为“追凶”成员。而冰河下的最终真相却颠覆所有人的想象……</div>', '梁家辉 佟大为 周冬雨 邓家佳 魏晨 曹卫宇', '国语', '2016', '0', '/data/images/571f040b74a86.jpg', '大陆', '2016-05-10 18:50:18', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1674', '大唐玄奘', '<div class=\"endtext\"><p>影片讲述历史上的唐朝高僧玄奘历时17年，不畏艰难险阻，前往天竺取经的传奇故事。大唐贞观盛世，年轻的玄奘法师（黄晓明 饰）为求佛法真谛冒死偷渡出境，一路上遭遇千难万阻，天灾人祸，却也深得民间疾苦。官兵围堵、徒弟背叛、埋身沙海、断水绝粮，玄奘法师一心求法，最终抵达印度，在印度弘扬善念静心修佛，等到从无遮大会辩论成功回国之时，已经是年逾五十的老人了。</p></div>', '黄晓明 徐峥 蒲巴甲 罗晋 汤镇业 锦荣 谭凯 姜超', '国语', '2016', '0', '/data/images/573195b550051.jpg', '', '2016-05-10 16:03:23', '1', '0', '0', '699', '剧情片', 'TC720P版');
INSERT INTO `movie` VALUES ('1675', '美人鱼', '<div class=\"endtext\"><p>该片讲述了在海上航行的一艘船，突然不幸遇劫，美人鱼挺身而出，船上的一名英俊青年对她一见钟情，并由此谱写出一段惊心动魄的人鱼恋曲的故事。富豪轩（邓超 饰）的地产计划涉及填海工程，威胁靠海以为生的居民。背负家族秘密的美人鱼珊（林允 饰）被派遣前往阻止。二人在交手过程中互生情愫，虽然轩最终因为爱上珊而停止填海工作，但她因意外受伤而消失于大海。</p></div>', '林允 邓超 罗志祥 张雨绮 吴亦凡 李尚正', '国语/粤语', '2016', '0', '/data/images/569ccb3594bce.jpg', '大陆', '2016-05-10 14:52:01', '1', '0', '0', '703', '魔幻片', 'HD版');
INSERT INTO `movie` VALUES ('1676', '美国队长3', '<div class=\"endtext\"><p>影片截图：</p>\r\n<p><img src=\"http://ww1.sinaimg.cn/mw690/006qnv8Ggw1f3otiomprjj30zk0fu40f.jpg\" /></p>\r\n<p><img src=\"http://ww4.sinaimg.cn/mw690/006qnv8Ggw1f3otiomxkcj30zk0fuq4k.jpg\" /></p>\r\n<p><img src=\"http://ww4.sinaimg.cn/mw690/006qnv8Ggw1f3otiplkvej30zk0fugnl.jpg\" /></p>\r\n<p>美国队长史蒂夫·罗杰斯（克里斯·埃文斯 Chris Evans 饰）带领着全新组建的复仇者联盟，继续维护世界和平。然而，一次执行任务时联盟成员不小心造成大量平民伤亡，从而激发政治压力，政府决定通过一套监管系统来管理和领导复仇者联盟。联盟内部因此分裂为两派：一方由史蒂夫· 罗杰斯领导，他主张维护成员自由，在免受政府干扰的情况下保护世界；另一方则追随托尼·斯塔克（小罗伯特·唐尼 Robert Downey Jr. 饰），他令人意外地决定支持政府的监管和责任制体系。神秘莫测的巴基（塞巴斯蒂安·斯坦 Sebastian Stan 饰）似乎成为内战的关键人物……</p></div>', '克里斯·埃文斯 小罗伯特·唐尼 斯嘉丽·约翰逊 塞巴斯蒂安·斯坦 安东尼·麦凯', '国语', '2016', '0', '/data/images/572e95131128e.jpg', '欧美', '2016-05-08 09:24:04', '1', '0', '0', '706', '动作片', 'TC720P版');
INSERT INTO `movie` VALUES ('1677', '办公室', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 发生在办公室的恐怖故事.影片以一家人遭受的杀人事件为起点，公司职员们一个接一个被神秘杀害，而凶手却始终不知是何人。高雅星将饰演事件中心的女实习生一角。《追击者》、《黄海》、《我是杀人犯》等影片编剧洪元灿此次首执导筒，将作为导演出道。</div>', '高雅星 朴圣雄 裴成宇 金义城 柳贤静', '韩语', '2015', '0', '/data/images/572d4c08b763d.jpg', '韩国', '2016-05-07 09:59:59', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1678', '科洛弗道10号', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 在一场车祸之后，米歇尔（玛丽·伊丽莎白·温斯特德 Mary Elizabeth Winstead 饰）从不知名的地窖中醒来。限制她行动的霍华德（约翰·古德曼 John Goodman 饰）告诉她，因为外面的世界已经遭受生化攻击，他们只能躲在地底。她不知如何是好，但随着两人关系不断恶化，她决定不顾危险，自制防护衣逃到外面……</div>', '约翰·古德曼 玛丽·伊丽莎白·温斯特德 小约翰·加拉赫 布莱德利·库珀', '英语', '2016', '0', '/data/images/572d4bba285b3.jpg', '欧美', '2016-05-07 09:58:45', '1', '0', '0', '701', '科幻片', 'HD版');
INSERT INTO `movie` VALUES ('1679', '恐怖将映', '<div class=\"endtext\"><p>举世闻名的泰国清迈鬼楼电影院吸引了很多游客，一群不同身份的游客在游览了这个鬼楼电影院之后都遭遇了灵异事件，并相继离奇死亡，由此引发了一次令人惊骇万分的泰国恐怖之旅。</p></div>', '谢容儿 杨杏 游乐儿 李萌萌', '国语', '2016', '0', '/data/images/572d3d41b8989.jpg', '大陆', '2016-05-07 08:56:34', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1680', '猫脸老太太', '<div class=\"endtext\"><p>半人半猫，诈尸还魂，1924年东北猫脸老太太的传说在一座古镇再度出现。周家四兄妹的母亲在一个大雪之夜被冻死，黑猫跨尸而过，周家老太借气还魂，化身猫脸老太太，神秘灵现于古镇，周家春、夏、秋、冬四兄妹因此而陷入猫脸老太太的死亡诅咒之中。猫脸老太太诈尸回魂，黑猫附身传说再度灵现，百年古镇因此化身鬼宅阴窑，周家四兄妹试图连夜逃出古镇，摆脱猫人异鬼的阴魂纠缠，却没想到…… 影片改编自1924年东北猫脸老太太真实灵异传说。</p></div>', '王翀 王聃葳 田淼 肖彦博 吴曦', '国语', '2016', '0', '/data/images/572c429d9e41c.jpg', '大陆', '2016-05-06 15:07:17', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1681', '半熟少女', '<div class=\"endtext\"><p>半熟，是对青春期最合理的定义，它是梦开始的地方，没有深思熟虑，只有最单纯的坚定，然而，在这个充满意外的年纪，未来似乎变得很具体，又有着无限的可能性。这个故事里有女汉子与呆萌校草的啼笑初恋，有四朵姐妹花的袍泽之谊，也有学霸乖乖女与双胞胎才子的意乱情迷，他们躁动的热情在循规蹈矩的理智中突围，写成一首欢笑与痛，梦想与爱的青春禁曲。 </p>\r\n<p>也许，半熟与成熟之间，只差那次铤而走险的“叛逆”。</p></div>', '黄灿灿 敖犬 南笙 王子豪 王子杰', '国语', '2016', '0', '/data/images/572b656999156.jpg', '大陆', '2016-05-05 23:23:22', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1682', '解语花', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 影片讲述了以1930年的朝鲜京城为背景，讲述了美貌智慧兼具的郑素律和她同为歌妓的闺蜜徐妍熙，以及当时最杰出的作曲家金允宇之间的情感纠葛故事。<br />\r\n&nbsp;&nbsp;&nbsp; 1940年代的朝鲜京城，梦想着成为最顶尖艺人的郑素律（韩孝周饰）兼具美貌和歌舞实力，她与徐妍熙（千玗嬉饰）是最出色的歌妓也是彼此最好的闺蜜，一起分享快乐、分担痛苦。流行作曲家金允宇（柳演锡饰）才华横溢，他创作的多首歌曲风靡一时。素律看上了允宇的新作，但在允宇的心目中，妍熙才是演唱这首歌曲的最佳人选，素律和妍熙为了争夺这首歌赌上了友情，三人间的命运也因此相互交织在了一起 。</div>', '韩孝珠 千禹熙 柳演锡', '韩语', '2016', '0', '/data/images/572ab328642c8.jpg', '韩国', '2016-05-05 10:42:50', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1683', '火锅英雄', '<div class=\"endtext\"><p>在布满防空洞的重庆，三个从初中就“厮混”在一起的好兄弟刘波（陈坤 饰）、许东（秦昊 饰）和王平川（喻恩泰 饰）合伙开着一家火锅店，名为“老同学洞子火锅”。由于经营不善，几人落得只能转让店铺还债。为了店铺能“卖个好价钱”，三人打起了“扩充门面”的主意，自行往洞里开挖。没想 到，在扩充工程中却凿开了银行的金库！就这样，濒临倒闭的火锅店和银行金库仅有“一洞之隔”；看着眼前随手可得的成堆现金，在“拿钱还是报案”的思想拉锯战中，三兄弟偶遇上另一个女同学——初中时给老大写过情书、现在在银行上班的于小惠（白百何 饰）。四个老同学因为这个“洞”而打开重聚之门。由此，这个略显尴尬的洞，引发了一个令人意想不到的故事……</p></div>', '陈坤 白百何 秦昊 喻恩泰 王彦霖', '国语', '2016', '0', '/data/images/570c68015d58b.jpg', '大陆', '2016-05-04 22:11:15', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1684', '我的特工爷爷', '<div class=\"endtext\"><p>退休军官老丁（洪金宝 饰）因“健忘症”弄丢孙女，内疚回到老家。邻居小女孩春花（陈沛妍 饰）成为他的慰藉。可女孩的父亲（刘德华 饰）无意卷入了当地黑帮团伙的争斗中。老丁为营救春花挺身而出，也寻回那份作为军人的骄傲和弥补作为爷爷的过错。</p></div>', '洪金宝 刘德华 朱雨辰 李勤勤 冯嘉怡 陈沛妍 胡军 冯绍峰 彭于晏 宋佳 徐克 麦嘉', '国语/粤语', '2016', '0', '/data/images/5705a5930f563.jpg', '香港', '2016-05-01 00:52:13', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1685', '蝙蝠侠大战超人：正义黎明', '<div class=\"endtext\"><p>故事发生在大都会之战18个月后，在那场战斗中许多建筑和市民惨遭波及。因为超人（亨利·卡维尔 饰）帮助人类解决了很多问题而被当做神来膜拜，但超人也因与佐德之战对城市造成的破坏而遭到逮捕和审讯，一度成为都市传说的蝙蝠侠韦恩（本·阿弗莱克 饰）重新出现在人们面前，他似乎正是为了惩罚超人而来。年轻的富豪莱克斯·卢瑟（杰西·艾森伯格 饰）又在二者的矛盾中挑拨离间，神秘的戴安娜·普林斯（盖尔·加朵 饰）也因自己的目的介入其中……</p></div>', '本·阿弗莱克 亨利·卡维尔 艾米·亚当斯 盖尔·加朵 杰西·艾森伯格', '国语', '2016', '0', '/data/images/5721a24c97cc1.jpg', '欧美', '2016-04-28 13:40:50', '1', '0', '0', '701', '科幻片', 'TC720P版');
INSERT INTO `movie` VALUES ('1686', '我的新野蛮女友', '<div class=\"endtext\"><p>影片讲述了男主人公牵牛（车太贤 饰）与新“野蛮”女友星星（宋茜 饰）从相恋到结婚的浪漫经历。星星是牵牛的小学初恋，由于韩语不流利常常被周围同学欺负。牵牛最初仍无法忘记分手离别的前任“她”，直到有一天，牵牛再次遇见初恋星星后，便不顾身边人的反对和她走进婚姻殿堂，没想到摆在他面前的却是超出想象的烦恼。</p></div>', '宋茜 车太贤 藤井美菜 崔镇浩 裴晟祐', '国语', '2016', '0', '/data/images/5720dae8115d8.jpg', '大陆', '2016-04-27 23:29:46', '1', '0', '0', '702', '爱情片', 'TS版');
INSERT INTO `movie` VALUES ('1687', '反恐999', '<div class=\"endtext\"><p>影片由《无法无天》导演约翰·希尔寇特执导，讲述劫匪与腐败警察联手，通过杀害一名警官，为劫案声东击西的故事。已确认卡司包括凯特·温斯莱特、凯西·阿弗莱克、切瓦特·埃加福特、亚伦·保罗等。999是警方无线电通话代码，意思是“警官受伤”。</p></div>', '卡西·阿弗莱克 切瓦特·埃加福特 安东尼·麦凯 亚伦·保尔', '英语', '2016', '0', '/data/images/57202d804b337.jpg', '欧美', '2016-04-27 11:09:53', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1688', '死侍：不死现身', '<div class=\"endtext\"><p>该片是《X战警》系列电影的外传。讲述了前任特种兵韦德·威尔逊得了不治之症，而自愿加入“X武器计划”获得了快速自愈能力。在饱受虐待折磨后他成功逃脱并对Ajax进行追杀的故事。</p>\r\n<p>在原著漫画中，死侍本是个普通人，由于得了不治之症而自愿加入“X武器计划”，他如愿得到了金刚狼自我愈合的能力，但付出的代价是失去了容貌。史崔克将军把他作为失败品投入监狱折磨并继续研究，最终导致他的出逃。死侍是个亦正亦邪的角色，他拥有超越人类的力量、耐力、速度及自我愈合能力，精通各种武器，擅长搏击术，不过他的精神不太稳定。</p></div>', '瑞恩·雷诺兹 莫蕾娜·巴卡林 艾德·斯克林 T·J·米勒 吉娜·卡拉诺', '英语', '2016', '0', '/data/images/56c9720b5ea61.jpg', '欧美', '2016-04-27 00:11:48', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1689', '箭士柳白猿', '<div class=\"endtext\"><p>因为年少时目睹姐姐遭害，双喜（宋洋 饰）内心巨大的阴影一直挥之不去，但他意外继承高超箭术成为了一名武林仲裁人柳白猿。混血美女二冬（王燕妮 饰）和绝世名伶月牙红（李呈媛 饰）出于不同的目的接近柳白猿，柳白猿在两个女人之间为爱纠葛不清。当所有的阴谋真相大白之后，柳白猿与匡一民（于承惠 饰）两位武林高手上演生死对决，最终柳白猿成为武林的一代传奇。</p></div>', '宋洋 于承惠 李呈媛 王燕妮 赵峥', '国语', '2016', '0', '/data/images/571e3e2ab0002.jpg', '大陆', '2016-04-25 23:56:27', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1690', '奇幻森林', '<div class=\"endtext\"><p>毛克利（尼尔·塞西 Neel Sethi 饰）是一个由狼群养大的人类男孩，影片围绕他的森林冒险徐徐展开。谢利·可汗，一只受过人类伤害的老虎（伊德里斯·艾尔巴 Idris Elba 配音），发誓要将毛克利铲除。为了逃脱追捕，毛克利跟随严厉的导师黑豹巴希拉（本·金斯利 Ben Kingsley 配音）和自由自在的好友棕熊巴鲁（比尔·默瑞 Bill Murray 配音），踏上了一场精彩纷呈的自我探索旅程。在这趟旅途中，毛克利遇到了一些对他居心叵测的丛林生物，包括巨蟒卡奥（斯嘉丽·约翰逊 Scarlett Johansson 配音），她用迷人的声音和眼神迷惑毛克利；还有花言巧语的猩猩路易王（克里斯托弗·沃肯 Christopher Walken 配音），他试图通过威逼利诱让毛克利交出迷幻而致命的“红花”——火焰的秘密。</p>\r\n<p>当森林不再是安全的家园，毛克利该何去何从？而毕生难忘的伟大冒险，才刚刚拉开序幕……</p></div>', '尼尔·塞西 比尔·默瑞 本·金斯利 伊德里斯·艾尔巴 露皮塔·尼永奥', '英语', '2016', '0', '/data/images/571caa636064c.jpg', '欧美', '2016-04-24 19:13:39', '1', '0', '0', '705', '动画片', 'TC720P版');
INSERT INTO `movie` VALUES ('1691', '恐怖面纱', '<div class=\"endtext\"><p>在一个邪教成员集体自杀的30年之后，唯一的幸存者带着一个纪录片摄制组回到悲剧的现场。</p></div>', '杰西卡·阿尔芭 莉莉·拉贝 托马斯·简 珊农·沃德华德', '英语', '2016', '0', '/data/images/57182d8bed477.jpg', '欧美', '2016-04-21 09:31:56', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1692', '明月守护者', '<div class=\"endtext\"><p>故事讲述爱闯祸的无名小卒缪恩，有一天阴差阳错得成了重要的月亮守护者，而他任职第一天就造成大错，间接导致太阳被偷、月亮消失、世界大乱。于是，他不得不携手太阳守护者和蜡质姑娘茜尔，展开一场大冒险，揪出混乱背后的黑手，拯救世界。</p></div>', '奥玛·赛 伊兹雅·海格林 迈克尔·格雷戈里奥', '英语', '2015', '0', '/data/images/57182cf4b7ebf.jpg', '欧美', '2016-04-21 09:29:25', '1', '0', '0', '705', '动画片', 'BD版');
INSERT INTO `movie` VALUES ('1693', '我怒了', '<div class=\"endtext\"><p>讲述了约翰·特拉沃尔塔饰演的警察遭到了暴徒的杀妻报复，愤怒之下，决定自己靠武力为妻子报仇。</p></div>', '约翰·特拉沃尔塔 阿曼达·舒尔 瑞贝卡·德·莫妮 克里斯托弗·米洛尼', '英语', '2016', '0', '/data/images/5715ffe45657a.jpg', '欧美', '2016-04-19 17:52:36', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1694', '不速之客', '<div class=\"endtext\"><p>郑凯（黎明 饰）正在事业步入佳境的阶段，突然遭遇重大打击，下属一个无法预料的失误，他却成了唯一的担责人，面临失业及巨额赔偿。失意愤怒之时郑凯喝醉了酒，偶然被一名神秘的黑车司机（耿乐 饰）送回家，因为没有带钱，给司机留了个电话希望第二天付款，结果这个电话给他带来一断恶梦般的生活。</p>\r\n<p>第二天开始，司机频繁给郑凯打电话，要跟他做朋友，让郑凯很奇怪。郑凯在宿醉之后，根本忘了发生过什么，跟这个司机说过什么。而司机却开始认定，他们俩已经是朋友了。</p>\r\n<p>接下来，发生过冲突的上司突然被杀，各种嫌疑无可避免地指向他，而可能到来的赔偿又令他急于逃离目前的生活，然而这一切似乎有迹可寻，不停纠缠他的黑车司机以及那辆恐怖的黑车，令郑凯怀疑他与上司谋杀案有莫大关联，但郑凯面临的是如何说服妻子（韩彩英 饰）离开深圳，这可以摆脱赔偿及司机的纠缠，但来不及了，司机已经彻底了解了他的情况，并且找上门来……</p></div>', '黎明 耿乐 韩彩英 祝延平 陈海亮', '国语', '2016', '0', '/data/images/57144b6c586d9.jpg', '大陆', '2016-04-18 10:50:20', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1695', '同城邂逅', '<div class=\"endtext\"><p>有“情圣”之称的云帆（姜潮 饰）与几个恋爱达人朋友组成了“恋爱操作团”，成立了一家专门帮助单身客户解决恋爱问题的爱情中介公司——爱情公社。主要帮助那些不会谈恋爱，不懂得如何追求爱情的男女实现爱情理想，帮助他们改变形象、撰写情话、制造氛围，通过对被追对象的了解量身定制解决方案，帮助单身客户跻身恋爱的大本营。在为爱情出谋划策的过程中，云帆遇到了一位影响公司命脉的大客户，却发现被追的女主角竟然是自己一直难以忘记的前女友王妍（周韦彤 饰），两人相爱相杀，在感情刚有转机之时，一直暗恋云帆的夏薇（李漫荻 饰）揭穿了两人当年分手的真正原因.....</p></div>', '姜潮 周韦彤 李梦 于朦胧 李漫荻', '国语', '2016', '0', '/data/images/57144b2573e96.jpg', '大陆', '2016-04-18 10:49:09', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1696', '希特勒回来了', '<div class=\"endtext\"><p>由作家蒂穆尔·韦尔姆所写的同名社会讽刺小说改编，讲述的是希特勒穿越时空来到现代多文化的德国，惊讶地发现德国领导人居然是一位女人，并且通过电视和网络发现波兰仍然是一个独立国家的故事。最终希特勒在现代社会成为了一个靠讽刺批评社会、大众媒体与名人糊口的二流电视明星。</p></div>', '奥利弗·马祖奇 费比安·巴什 克里斯托弗·玛利亚·赫斯特 卡嘉·瑞曼', '德语', '2015', '0', '/data/images/57134ffcd9922.jpg', '德国', '2016-04-17 16:57:33', '1', '0', '0', '704', '喜剧片', 'BD版');
INSERT INTO `movie` VALUES ('1697', '喜乐长安', '<div class=\"endtext\"><p>这是一个小木寺俗家弟子释然，和青梅竹马的姑娘喜乐，骑着小马游走江湖的故事。</p>\r\n<p>一场大饥荒，6岁的孤儿随饥民逃荒到小木寺，冲突中只有她在夹缝中挤进了小木寺被小木寺收留，方丈给她起名为喜乐，喜乐成了大家的愿望。释然儿时看到一场在长安城妓院楼顶上对决武林盟主的盛事，却以苦当派掌门人虽然夺得盟主，被困楼顶饿死的荒诞结局而收场。江湖风云突变，人心自此大乱。</p>\r\n<p>十八岁那年，释然的师父（万仓 饰）预感小木寺将有一劫，秘密安排释然（张天阳 饰）改名长安还俗下山，去找寻一名铸剑老人（王连生 饰）。机缘巧合下，释然得到了老头赠送的当世奇兵，并用它夺取了武林盟主的称号。虽然在雪邦做了盟主，但在释然心里，霸主的位子比不上一个喜乐（何泓姗 饰）有意思。而万永（金亮 饰）一心想成为武林霸主并劫持喜乐以挟释然交出盟主之位，释然最终放弃盟主之位与喜乐归隐山林。 万永当初一手操办了雪邦比武，然而这究竟是万永在操控着江湖还是被江湖所操控？一切江湖动荡，好似一盘棋局，人如棋子，岂能由己？</p>\r\n<p>世间的事，只是人类的一个游戏，而人类，是上天的一个游戏。</p>\r\n<p>电影根据韩寒武侠题材小说《长安乱》改编。 </p></div>', '张天阳 何泓姗 万仓 金亮 冀书亥 于德江 王连生', '国语', '2016', '0', '/data/images/571070f9c4686.jpg', '大陆', '2016-04-15 12:41:31', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1698', '鬼乡', '<div class=\"endtext\"><p>影片讲述了以日本慰安妇受害者姜日出为原型，讲述了1943年日本侵占朝鲜时期，14岁少女正敏以及一群女孩们被日军强行带走后成为慰安妇的悲惨故事。 1943年日本侵占朝鲜时期，朝鲜庆南居昌郡的一个普通的村庄，天真烂漫的14岁少女正敏（姜荷娜饰）在父母的爱护下幸福地长大，某天却被日军强行拉走，和她一同被抓走的还有少女英熙（崔莉饰）以及其他差不多年纪的女孩们，她们连英语一句都不懂就被带上了火车，离开家人和家乡的怀抱去到完全陌生的国度。在第二次世界大战的冰冷战场中，正敏和其他女孩们就像被遗弃的孩子，在那里她们被日军糟蹋成为发泄工具，陷入了无尽的苦难中，战争结束后只剩下少数人能活着回到家乡。</p></div>', '姜荷娜 崔莉', '韩语', '2016', '0', '/data/images/571057c73b350.jpg', '韩国', '2016-04-15 10:53:59', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1699', '西游记之孙悟空三打白骨精', '<div class=\"endtext\"><p>影片讲述了师徒四人在西行的路上，白骨精（巩俐 饰）为夺唐僧（冯绍峰 饰）而巧设圈套，被孙悟空（郭富城 饰）识破，屡次受挫。唐僧却误会孙悟空滥杀无辜，将其逐出师门。白骨精趁虚而入，掳走唐僧。悟空闻讯前往营救，彻底击溃白骨精。师徒冰释前嫌，重新上路。</p></div>', '郭富城 巩俐 冯绍峰 小沈阳 罗仲谦 费翔 陈慧琳', '国语/粤语', '2016', '0', '/data/images/56bc57f343b60.jpg', '大陆', '2016-04-14 20:20:59', '1', '0', '0', '703', '魔幻片', 'BD版');
INSERT INTO `movie` VALUES ('1700', '陀地驱魔人', '<div class=\"endtext\"><p>黄永发，生活在旺角一带的驱鬼大师。他不用符，不用咒，只用一张嘴。鬼的怨要化不宜捉，他说。发不但能看见鬼魂，与鬼魂沟通谈判，更能“看到”鬼魂死前的痛苦经历！他的驱鬼实况更被好友 葱 拍摄下来，上载至短片分享网站，点击率极高！</p>\r\n<p>成为网络红人的发仔，引起了狗仔队记者 紫宁 的好奇，并希望借着报导发仔的真实驱鬼过程而成名！紫宁为探求新闻，不惜惹鬼上身，几乎丧命，幸得发仔出手相救，同时也被发痛斥：人鬼同一个世界，应互相尊重。这事之后，紫宁对发兴趣反而更大，暗生倾慕。不过，她在调查发仔身世时，竟发现发仔与一女鬼 江雪 同居！ 原来江雪在发仔年幼丧母时便已跟他在一起，一人一鬼既是亲人又像情侣。</p></div>', '张家辉 郭采洁 张继聪 蔡思贝 吴启华 释行宇 甄咏蓓 林嘉欣', '国语/粤语', '2015', '0', '/data/images/570f34d5f007c.jpg', '香港', '2016-04-14 14:12:51', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1701', '家有喜事', '<div class=\"endtext\"><p>老家大宅住着老老头与三个儿子，长子老良因忙于公事怠慢了老婆贤淑。贤淑心有不甘。次子老非爱上了飞车女“金毛玲”，因恐老父反对而频出怪招；三子老恭（周星驰饰）因欠赌债过百万而装疯扮傻，家中上下对其呵护有加。由于老恭举止动静均与小童无异，逐渐成为家人倾诉的对象。老恭将计就计表面疯癫，暗中为家中各人解决...</p></div>', '张国荣 周星驰 张曼玉 吴君如 黄百鸣 毛舜筠', '国语/粤语', '1992', '0', '/data/images/570b55d7b2ad7.jpg', '香港', '2016-04-11 15:44:24', '1', '0', '0', '704', '喜剧片', 'BD加长版');
INSERT INTO `movie` VALUES ('1702', '卧虎藏龙2：青冥宝剑', '<div class=\"endtext\"><p>武当弃徒戴阎王（李截 Jason Scott Lee 饰）为抢夺青冥古剑夜袭铁小贝勒府，俞秀莲（杨紫琼 饰）重出江湖，携手旧友孟思昭（甄子丹 饰）保护宝剑，被蒙蔽的魏方（岑勇康 Harry Shum Jr. 饰）助纣为虐，雪瓶（刘承羽 Natasha Liu Bordizzo 饰）告知魏方其身世之谜。一场江湖混战，众人力擒戴阎王，保护宝剑周全。</p></div>', '甄子丹 杨紫琼 岑勇康 刘承羽 李截 原丽淇 吴青芸 袁之正', '国语/粤语', '2016', '0', '/data/images/56d153e28ae72.jpg', '大陆', '2016-04-09 08:03:58', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1703', '爱情麻辣烫之情定终身', '<div class=\"endtext\"><p>李小央（秦昊 饰）、刘家毅（何润东 饰）、高东华（周一围 饰）是大学同宿舍的同学，陈心（张梓琳 饰）是他们的学妹，毕业10年李小央在陈心身边一直扮演着男闺蜜的角色，每次陈心和男朋友吵架后都会去找李小央。</p>\r\n<p>杭州，身为导游的刘家毅和杨菲（张歆艺 饰）正准备结婚，直到刘家毅接到一份工作，给来杭州游玩的邓雨琪（黄灿灿 饰）当导游，几天相处下来，让他对于婚姻有了新的认识。</p>\r\n<p>在重庆，高东华经营着一家影楼，和田小雅（田原 饰）结婚7年，经常出轨而且自认为没有被发现，直到有一天他发现了田小雅的秘密，又得知好友李小央得了癌症，所有的一切都在这一天被打破，他开始反思自己。</p></div>', '何润东 秦昊 周一围 张梓琳 田原', '国语', '2016', '0', '/data/images/5707027348424.jpg', '大陆', '2016-04-08 08:59:36', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1704', '消失的爱人', '<div class=\"endtext\"><p>一次雪山意外中，凯峰（黎明 饰）痛失爱妻秋捷（王珞丹 饰），为了寻回消失的爱人他尝试了各种招魂方法。令人意外的是，秋捷的灵魂真的回来了。凯峰找到灵媒，希望可以把妻子留在身边久一点。灵媒告诉凯峰一个秘密“只有爱她的人才会看见她，不爱她的人看不见。而且不能让她知道自己是灵魂，否则她就会很快消失。”深知这段相聚如昙花一现，始终会有完结的一日，凯峰唯有与儿子沐沐努力守着这个“秘密”。一次偶然之中，凯峰表弟Jimmy（林俊杰 饰）看见了秋捷的灵魂，而在此时雪山事件也被媒体报道，眼看秋捷是灵魂的事实将被察觉，更加意想不到的事也在步步逼近，凯峰又将如何守护他深爱的秋捷…</p></div>', '黎明 王珞丹 林俊杰 张榕容 石修', '国语', '2016', '0', '/data/images/570471ce3846a.jpg', '大陆', '2016-04-06 10:19:34', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1705', '年少轻狂', '<div class=\"endtext\"><p>大学校园里游手好闲的“二货组合”邓小余（包贝尔 饰）和胡多多（孙坚 饰），梦想在毕业舞会上给所有人上演一场华丽的屌丝逆袭，却不曾想陷入到轰动全校荒唐囧事中；一直追求真爱的呆萌校花邱樱子（陈妍希 饰），四年无视追求者，却在毕业前意外收获了一个“天外来客”的神秘礼物；而校园顶尖黑客学霸周游（郑恺 饰）古灵精怪，一直在对抗守旧老师付明，毕业前夜却意外发现了他的一个惊天秘密……</p>\r\n<p>这群年少轻狂的校园怪咖不断的寻找和猜忌，转眼到毕业临近，各种谜底能否在此前揭开？</p></div>', '陈妍希 郑恺 包贝尔 孙坚 唐艺昕', '国语', '2015', '0', '/data/images/57047223ee4fb.jpg', '大陆', '2016-04-06 10:19:21', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1706', '重生爱人', '<div class=\"endtext\"><p>电影《重生爱人》（曾用名：重生恋人、炙爱青春）由知名导演曹大伟编剧、执导，以青春校园为背景，围绕王丽坤饰演的女一号苏莹与金汎饰演的江重云，影片讲述了神秘人的出现，让苏莹惊恐的发现自己的未婚夫竟然是十几年前已死于意外火灾的高中同学。随着记忆和线索的展开，伴随着美好初恋和青春的诡异火灾以及背后的骇人真相渐渐浮出水面。同时导演在影片中注入了青春中初恋、青涩、懵懂、羞赧、暗恋、甜蜜、纯粹等生动情感，力求呈现出“心中的初恋感”，引发观众的真实共鸣。</p>\r\n<p>影片中郑元畅饰演的反一号程峰回也为影片增添更多精彩看点，他性格上的扭曲、对爱情的执拗，不仅决定了自己的成长道路，也改变了三位主人公的戏剧人生。</p></div>', '王丽坤 金汎 郑元畅 管羽 李昊宇', '国语', '2015', '0', '/data/images/5704718e35104.jpg', '大陆', '2016-04-06 10:16:47', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1707', '消失的凶手', '<div class=\"endtext\"><p>银行相继倒闭，大批失业游民流落街头。一连串离奇自杀案件仿佛指引着松东路去探究隐藏在其背后更大的黑幕。十年前被掩埋的屠村案件被揭开、疑犯通过文字游戏传递着口令，接踵而至的案件掀起了巨大的恐慌，城中风云攒动，人人自危，富商、警察、教授、学生……每个人的言行举止都充满疑点，而每个人都在猜测下一个离奇自杀的会不会是自己？究竟是谁密谋了这一切，让这个原本美好的地方变成了绝望之城？寻找真相迫在眉睫……</p></div>', '刘青云 林家栋 李小璐 江一燕 郭晓冬', '国语/粤语', '2015', '0', '/data/images/57009acd199e7.jpg', '香港', '2016-04-03 18:24:43', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1708', '澳门风云3', '<div class=\"endtext\"><p>人称“赢尽天下无敌手”的石一坚（周润发 饰），在摧毁国际洗黑钱集团 DOA后本想收山，却在女儿阿彩（童菲 饰）的婚礼上被炸成失忆，又与好友小马（张家辉 饰）一起被关进监狱，幸得“赌神家族”成员：“赌侠”刀仔（刘德华 饰）、赌神表妹高菲（李宇春 饰）、龙五（向华强 饰）之子龙十五（向佐 饰）等人合力营救。脱险后，石一坚举止恍惚，众人想办法帮他恢复记忆。期间，婚礼爆炸的幕后真凶：国际军火商易天行（张学友 饰）渐渐浮出水面。为还家人公道及将易天行绳之以法，石一坚决定：与“赌神家族”成员及管家傻强等联手，向易天行发出挑战！</p></div>', '周润发 刘德华 张家辉 张学友 余文乐 李宇春 刘嘉玲 王诗龄', '国语', '2016', '0', '/data/images/56b895295c9bb.jpg', '香港', '2016-04-02 09:05:11', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1709', '爱在深秋', '<div class=\"endtext\"><p>一段萦绕半生的婚姻关系，一段幻梦的婚外情在远离繁嚣的桂林发生，两个本应遥不可及的人在生命线上突然相遇，爱情的背后埋藏着令人错愕的真相。为配合影片意境，著名旅日画家李焱部份画作将会首次出现电影银幕。</p></div>', '温碧霞 谭耀文 赵炳锐 方皓玟 王建成', '国语', '2016', '0', '/data/images/56fe3739c1051.jpg', '香港', '2016-04-01 16:54:18', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1710', '请点赞', '<div class=\"endtext\"><p>影片讲述了现代年轻人通过SNS分享日常生活并相互点赞而陷入浪漫爱情的故事。</p>\r\n<p>各种挑剔但剧本总是大热的电视剧作家赵京儿（李美妍饰）和红得火爆的韩流明星卢镇宇（刘亚仁饰）、失恋但又多管闲事的主厨郑承灿（金柱赫饰）和无家可归的老处女含珠兰（崔智友饰）、恋爱初哥的作曲家李秀浩（姜河那饰）和恋爱高手电视剧制作人张罗延（李絮饰），本来毫不相关的三对人，就因为在网络上一个没头没脑的“点赞”牵连在了一起，并成为注定的恋人。</p></div>', '姜河那 李絮 金柱赫 崔智友 刘亚仁', '韩语', '2016', '0', '/data/images/56f9ef97696cb.jpg', '韩国', '2016-03-29 10:59:35', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1711', '回溯', '<div class=\"endtext\"><p>片围绕着心理学家皮特与他被“鬼混”侵扰的病人之间展开，随着病情研究的深入，隐藏在恐惧背后的可怕事件也将渐渐浮出水面。</p></div>', '艾德里安·布洛迪 山姆·尼尔 罗宾·麦克丽薇 布鲁斯·斯宾斯 苏西·斯蒂恩', '英语', '2016', '0', '/data/images/56f90caeb0998.jpg', '欧美', '2016-03-28 18:51:27', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1712', '诡娃/鬼娃', '<div class=\"endtext\"><p>小玲（程媛媛 饰）与金（李抒航 饰）是一对令人羡慕的情侣，迫于生活的压力，俩人住进了独居妖艳的陈女士（孔维 饰）的出租屋。每当夜幕降临，古屋的布娃娃都会制造各种恐怖事件。同时，陈女士千方百计的勾引金，让小玲步入崩溃边缘。万念俱灰的小玲饮下了千年魔汁，变成了再没有喜怒哀乐的布娃娃，而金则由于背叛爱情，堕入了万劫不复的深渊……</p></div>', '李抒航 程媛媛 孔维', '国语', '2016', '0', '/data/images/56f90c67a9edd.jpg', '大陆', '2016-03-28 18:50:16', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1713', '第五波', '<div class=\"endtext\"><p>影片改编自同名畅销小说，故事讲述地球遭到外星人攻击，人类文明退回石器时代，16岁少女凯西作为仅存人类之一，挣扎生存，寻找希望。</p></div>', '科洛·莫瑞兹 尼克·罗宾森 朗·里维斯顿 玛姬·丝弗', '英语', '2016', '0', '/data/images/56f90c0b92d4c.jpg', '欧美', '2016-03-28 18:48:43', '1', '0', '0', '701', '科幻片', 'HD版');
INSERT INTO `movie` VALUES ('1714', '红衣小女孩', '<div class=\"endtext\"><p>号称“10年来最卖座的台湾恐怖片”，改编自轰动全台真实灵异事件（台湾最出名的灵异事件）。由程伟豪执导的恐怖片，黄河、许玮宁领衔主演。 该片讲述了房地产经纪人因同住的奶奶离奇失踪，让他与女友发生一连串匪夷所思的灵异事件的故事。</p></div>', '黄河 许玮宁 刘引商 张柏舟 黄诗棋', '国语', '2015', '0', '/data/images/56f90bcc82945.jpg', '台湾', '2016-03-28 18:47:40', '1', '0', '0', '700', '惊悚片', 'DVD版');
INSERT INTO `movie` VALUES ('1715', '笨贼别跑', '<div class=\"endtext\"><p>明朝末年，被戚家军驱逐的倭寇把来不及运走的金银财宝埋藏在了石美村，并留下了一张神秘的藏宝图。数十年后，一个落魄的商人（李添诺 饰）和四个小孩无意间发现了藏宝图，却引来一个倭寇、两个笨贼和三个捕快的疯狂争夺。</p></div>', '彭波 李添诺 董向荣 韩丰 董怡君', '国语', '2016', '0', '/data/images/56f76b30e37b8.jpg', '大陆', '2016-03-27 13:10:09', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1716', '234说爱你', '<div class=\"endtext\"><p>沛熏和阿泽是彼此的初恋，在大学相恋四年，从轰轰烈烈到相知相惜，始终是旁人钦羡的班对。大学毕业后，阿泽随即入伍，沛熏则开始找工作，两人相约一起存钱，要在阿泽退伍后，一起去他们心中的巴黎。阿泽抽到金门，入伍后，月有八千元收入，多少可以存点钱，但是，时值经融风暴，沛熏根本找不到工作，在求职四处碰壁下，沛熏越来越心慌，此时，沛熏遇见了大学学姐惠婷，惠婷在帮宝叔做事。</p>\r\n<p>几年前，宝叔自征信社退休后，就以接案方式，打发时间，并只接熟人或由熟客牵线的案子，但最近有个推不掉的「感情挽回」案子，让宝叔有点为难。其实这种案子不在宝叔的业务范围内，但因委托人李太太是朋友，不得不帮忙，因此急需一位美女当第四者，去勾引李太太的丈夫李曜，让李曜离开第三者俞倩，当惠婷巧遇沛熏的那一刻，就相信沛熏是最适合的第四者人选。在惠婷游说下，沛熏决定接下「第四者」的工作，重点是，待遇不差，沛熏只要接这个案子，就能赚取前往巴黎的所有旅费。</p>\r\n<p>善于谋略的惠婷，负责规划这个案子的发展与走向，沛熏只要配合演出即可，尽管沛熏觉得接这个工作没有任何不妥，但为了避免麻烦，沛熏决定瞒着阿泽。几天以后，在惠婷的设计、布局下，沛熏化身为处境堪虑的女孩，进入李曜的生活，并引起他的注意。在沛熏一步一步与李曜建立关系的同时，由俞倩一手规划的自创品牌「murmur」也即将发表。当俞倩偶然巧遇沛熏后，就坚持找沛熏当「murmur」的平面模特儿，沛熏因此误打误撞进入时装圈，却让她勾引李曜的计划变得更加复杂。</p>\r\n<p>此时，异常忙碌的沛熏，总无法在阿泽休假时陪伴他，两人开始产生摩擦，沛熏坚持不露口风，毕竟沛熏心里相信，不论在做什么，都是为了他们的巴黎计划。然而，沛熏承受着阿泽、惠婷、李太太、俞倩等多方压力，最后却在沉稳、内敛的李曜身上得到慰藉，而李曜也让沛熏见识到另一个世界，无须为金钱烦恼的生活是如此优雅，沛熏开始怀疑自己是渴望那样的生活，还是渴望李曜。</p>\r\n<p>当沛熏完成任务，让李曜离开俞倩时，沛熏和阿泽的关系也濒临破灭。现实会咬人，它是否也会改变爱情的样貌？游移在精神与物质之间，沛熏能否看清内心最真实的渴望？</p></div>', '秦昊 林依晨 简宏霖 蔡淑臻 周姮吟', '国语', '2015', '0', '/data/images/56f5f1338c42b.jpg', '台湾', '2016-03-26 10:17:48', '1', '0', '0', '702', '爱情片', 'DVD版');
INSERT INTO `movie` VALUES ('1717', '星球大战7：原力觉醒', '<div class=\"endtext\">银河共和国被发生在银河系中的叛乱推翻，以大莫金为最高统治者的银河帝国开始统治银河系。银河帝国建立了一个威力无比的“死星”以镇压反抗者，银河帝国的各星系居民饱受暴政之苦。奥尔德兰行星的丽亚公主潜入帝国基地，偷走了足以摧毁暴君的秘密武器——“死星”中心结构资料，但却被发现行径，在沙漠行星附近被帝国军俘虏。公主将数据输入机器人R2的计算机中。公主的机器人R2和C3P0逃到了沙漠行星，在年轻人卢克的帮助下找到了吉迪族的老武士、反抗帝国的战斗中仅存的绝地骑士克诺比，并向他求助。为了给被帝国军杀害的亲人报仇，卢克决心和克诺比一起行动。他们搭乘梭罗船长的运货飞船来到已被死星毁灭的奥尔德兰星球所在的星域，却被“死星”俘虏。在和“死星”上的黑勋爵展开殊死较量后，卢克等人终于将丽亚公主救出，但克诺比却死于黑勋爵的光剑下。卢克和丽亚公主来到反抗军基地，并参加了反抗军对死星的总攻。在探明“死星”的弱点后，卢克终于摧毁了死星，反抗军取得了胜利。</div>', '哈里森·福特 马克·哈米尔 凯丽·费雪 伊万·麦克格雷格 娜塔莉·波特曼', '英语', '1977', '0', '/data/images/5691c295593ad.jpg', '欧美', '2016-03-23 11:17:46', '1', '0', '0', '701', '科幻片', 'BD版');
INSERT INTO `movie` VALUES ('1718', '一路向南', '<div class=\"endtext\">In this refreshing take on the horror anthology, a series of characters encounter sinister forces on an isolated desert road.一个清爽恐怖的剧情，一伙人在一个孤立的沙漠公路遇到邪恶势力。</div>', '法比娜·泰蕾兹 马特·贝蒂内利-奥尔平 汉娜·马克斯 达纳·古尔德 马特·皮特斯', '英语', '2016', '0', '/data/images/56ebbf7e6dfca.jpg', '欧美', '2016-03-18 16:42:38', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1719', '独家报道：良辰杀人记', '<div class=\"endtext\"><p>《独家报道：良辰杀人记》讲述的是社会部记者许武赫在偶然的机会下得到了关于连锁杀人事件的举报，误报的恶劣影响越来越严重，各家记者展开了炙热的取材竞争，然而却发生了真实的连锁杀人事件，竟然和之前报道描述的一模一样。导演卢德此前执导的处女作《恋爱的温度》于2013年上映时累计观影人数达186万人，并多次入围电影节奖项提名，导演卢德也备受关注。 </p>\r\n<p>曺政奭饰演的是一直顺风顺水的社会部记者许武赫，然而却身陷职场和家庭的双重危机。李荷娜饰演许武赫的妻子秀真。李美淑饰演冷酷的白局长。金义成饰演白局长的左右手文理事。裴成宇饰演调查杀人事件的刑警吴班长。金大明饰演提供线索的勇敢市民。太仁镐饰演许武赫的直属上司刘组长。</p></div>', '曹正锡 李荷娜 李美淑 金义城 卓在勋', '韩语', '2015', '0', '/data/images/56ebbf2141e28.jpg', '韩国', '2016-03-18 16:41:05', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1720', '鸭王2', '<div class=\"endtext\"><p>何巨峯(何浩文 饰),一代鸭王,做过歌手、明星。现在很少人叫他做鸭王,多数叫他做峯哥,更收入室徒弟 Dick(林子善 饰) 。在一次游艇派对上,峯巧遇第一次参加的电视台三四线姐仔 Monica (文凯玲 Connie 饰)。Monica 突然家中有急事,要立刻回去,峯帮忙用水上电单车带 Monica 回岸,Monica 感激而且对峯有好印象。Monica 回家后得知母亲病情严重,需要一大笔钱做手术,只好听从好姐妹 Sushi(锺采羲 Iris 饰)劝而处女下海。Monica 第一个客人就是上次游艇派对的搞手龙少(梁焯满 饰)。可惜Monica 保守古老,龙少事后还唱衰 Monica,令她没有客路。Monica 决定向鸭王拜师学做鸡,更开始对峯动了真感情。但峯其实一直有一个秘密女伴 Isabel (林莉娴 饰),峯是第一个令 Isabel 有高潮的男人。虽然互相爱着对方,但二人有协议,Isabel 结婚后,不再往来。 </p>\r\n<p>Monica 学满师后接客,但心还是钟情师父峯哥。Isabel 婚礼当天,Monica 主动和峯做爱,二人关系由师徒变情侣。另一边,Monica 好姐妹 Sushi 想和情人 Dick 买楼,决定接受变态富豪大 Deal 哥 (何华超 饰)和妻子 Mona (梁敏仪 饰)的 4P 聚会,却双双被虐待致死。Monica 与峯决定和二人报仇,Monica 勾引大 Deal 哥,成功替二人报仇。峯决定放弃一切,与 Monica 到外国,不再回来这是非地。可惜 Isabel的丈夫发现峯与 Isabel 的关系,在 Monica 幻想着与峯将会过着幸福日子时,峯却处身危险之地...</p></div>', '何浩文 林子善 文凯玲 锺采羲 梁焯满', '国语/粤语', '2016', '0', '/data/images/56ea25b0a17b6.jpg', '香港', '2016-03-17 11:34:10', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1721', '极盗者', '<div class=\"endtext\"><p>年轻的FBI特工强尼·犹他（卢克·布雷西 Luke Bracey 饰），潜伏到一队喜欢寻找刺激挑战的盗匪里，该队伍由富有个人魅力的鲍迪（埃德加·拉米雷兹 Édgar Ramírez 饰）领导。这些盗匪被怀疑是在用极不寻常的方式进行着系列犯罪。在与鲍迪这一伙人的交往中，犹他发现自己无可自拔的与这伙人产生了伙伴情谊，犹他陷入了职业伦理与追求真我之间的矛盾，他放弃了自己的一切，加入到了对人类极限界的八项巅峰挑战的追寻中……</p></div>', '卢克·布雷西 埃德加·拉米雷兹 泰莉莎·帕尔墨 雷·温斯顿', '英语', '2015', '0', '/data/images/56e3f0f98e005.jpg', '欧美', '2016-03-17 10:53:22', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1722', '高跟鞋先生', '<div class=\"endtext\"><p>宅男游戏设计师杭远（杜江 饰），从小就暗恋同校才女李若欣（薛凯琪 饰），可每次要表白的时候她都已进入了新恋情。李若欣最后一段感情被未婚夫背叛，不再相信男人，转而与闺蜜Sammi（李媛 饰）越走越近。杭远顿时万念俱灰，于是富二代“好基友”林森森（陈学冬 饰）提议他做最后一搏，想方设法接近若欣，大胆追求所爱。阴差阳错下，杭远竟成为了网络红人，一时间风光无限。 但是好景不长，若欣很快识破了他们的“计谋”。他该如何挽回和女神的破裂的关系，并成功和她在一起呢？</p></div>', '杜江 薛凯琪 余心恬 陈学冬 王祖蓝 霍思燕', '国语', '2016', '0', '/data/images/56c2e0063e1bb.jpg', '大陆', '2016-03-14 18:40:59', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1723', '纯情', '<div class=\"endtext\"><p>电影《纯情》讲述了一封在音乐节目直播过程中收到的来自23年前的信所引发的故事，描述了超越过去与现在的初恋和5名朋友之间的友情。片中，都暻秀饰演性格木讷但一片丹心的范实，金所炫饰演拥有天籁美声的少女秀玉。</p></div>', '都暻秀 金所炫 李大为 朱多英 延俊锡', '韩语', '2016', '0', '/data/images/56e657e181cca.jpg', '韩国', '2016-03-14 14:19:18', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1724', '曝光/上帝的女儿', '<div class=\"endtext\"><p>一名警探（基努里维斯饰）试图调查他的拍档死亡的真相。随着调查的深入，这件离奇的案件背后的秘密逐渐被揭开。一切都指向警局内部的腐败和一位貌似毫不相关的年轻女性。</p></div>', '基努·里维斯 安娜·德·阿玛斯 米拉·索维诺 克里斯托弗·麦克唐纳', '英语', '2016', '0', '/data/images/56e3f0b7793ed.jpg', '欧美', '2016-03-12 18:34:31', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1725', '谋杀似水年华', '<div class=\"endtext\"><p>都市白领田小麦（Angelababy 饰）即将与未婚夫盛赞（张超 饰）步入婚姻殿堂，可田父（尹铸胜 饰）的因公殉职却打破了宁静的幸福。整理遗物时，田小麦偶然发现父亲的探案笔记，不料却身陷一桩十余年前无疾而终的神秘凶案，这桩案件也勾起了小麦年少时刺痛却刻骨的初恋回忆。而同时小麦从闺蜜钱灵（热依扎 饰）那得知了一个叫“魔女区”的网店，从那里可以买到一切东西甚至是爱情回忆。但在她买下一条神秘紫色丝巾后，各种意外接踵而至，一切似乎都与那桩悬案、那个年少时的爱人——秋收（阮经天 饰）有关。田小麦调查着当年悬案的蛛丝马迹，并通过“魔女区”寻找自己的初恋秋收。可随着调查一点一点深入，田小麦发现自己的爱情和那场凶案紧紧纠缠在一起，甚至连盛赞一家也卷入其中。时如逝水，一去不返，田小麦能否重新寻回那段刻骨的爱情，而秋收又将带着什么样的秘密回来，紫色丝巾下的爱恨又会带领他们走向怎样的结局......</p></div>', '杨颖 阮经天 张超 热依扎 郝蕾', '国语', '2016', '0', '/data/images/56e188719707d.jpg', '大陆', '2016-03-10 22:45:06', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1726', '叶问3', '<div class=\"endtext\"><p>1959年，叶问（甄子丹饰）与张永成（熊黛林饰）将大儿子叶准送回广东，小儿子叶正继续在香港读书。在与马鲸笙（谭耀文饰）与其老板（泰森饰）所带领的帮派抗争的过程中，叶问带领着自己的弟子保卫了小学，并结识了依靠拉车和在地下赌场斗武为生的张天志（张晋饰），二 人惺惺相惜。然而 此时，自称 “咏春正宗” 的张天志却向叶问公开宣战，要为自己新开的武馆争取名誉。可是张永成突然病危，让叶问不得不肩负起照顾妻儿的责任。面对家庭和武术，叶问究竟会作何选择？他是否会应战张天志，夺回属于他 “咏春正宗” 的头衔？</p></div>', '甄子丹 熊黛林 张晋 迈克·泰森 喻亢 郑则仕 吴千语', '国语/粤语', '2015', '0', '/data/images/56b894b7b96fb.jpg', '香港', '2016-03-10 12:02:18', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1727', '饥饿游戏3：嘲笑鸟', '<div class=\"endtext\"><p>施惠国爆发了全面战争，凯特尼斯（詹妮弗·劳伦斯 Jennifer Lawrence 饰）将在最后关头对峙斯诺总统（唐纳德·萨瑟兰 Donald Sutherland 饰）。在盖尔（利亚姆·海姆斯沃斯 Liam Hemsworth 饰）、芬尼克（山姆·克拉弗林 Sam Claflin 饰）和皮塔（乔什·哈切森 Josh Hutcherson 饰）等好友的陪伴下，凯特尼斯和十三区的小队一起为了解放施惠国的人民而冒险抗争，并且策划暗杀越来越执迷于杀死她的斯诺总统。凯特尼斯将面对致命陷阱、劲敌和道义上的选择，而这些挑战都不曾出现在饥饿游戏的竞技场中。</p></div>', '詹妮弗·劳伦斯 乔什·哈切森 利亚姆·海姆斯沃斯 伍迪·哈里森', '英语', '2015', '0', '/data/images/56df86c07a401.jpg', '欧美', '2016-03-09 11:00:09', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1728', '八恶人', '<div class=\"endtext\"><p>寒冷的怀俄明州山谷中，一辆马车载着赏金猎人“绞刑者”约翰·鲁斯（库尔特·拉塞尔 Kurt Russell 饰）及其价值一万美元的猎物黛西·多摩格（詹妮弗·杰森·李 Jennifer Jason Leigh 饰）踏雪而行。途中，黑人赏金猎人马奎斯·沃伦少校（塞缪尔·杰克逊 Samuel L. Jackson 饰）和新人警长克里斯·马尼克斯（沃尔顿·戈金斯 Walton Goggins 饰）相继登上马车，红石镇是他们共同的目标。由于风雪太大，马车停在了米妮男装店，然而熟悉的店主人不知去向，却另有四名不速之客百无聊赖地待在店里。约翰时刻担心他人抢走猎物，马奎斯警惕地扫视面前的陌生人们，多嘴多舌的克里斯不时为紧张的气氛中加油添醋，黛西则似乎等待更大的风暴到来。</p>\r\n<p>仿佛与世隔绝的小店内，即将刮起一场更为猛烈的风暴……</p></div>', '塞缪尔·杰克逊 沃尔顿·戈金斯 詹妮弗·杰森·李 蒂姆·罗斯', '英语', '2015', '0', '/data/images/56dbe341864a4.jpg', '欧美', '2016-03-06 15:58:59', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1729', '功夫熊猫3', '<div class=\"endtext\"><p>该片接续前作《功夫熊猫2》的剧情，故事围绕神龙大侠熊猫阿宝在探寻自己身世之谜的过程中重遇生父，并发现了离散多年的同胞下落，然而就在此时，邪恶力量开始席卷中原大地，熊猫们可能再次遭遇厄难。</p>\r\n<p>与阿宝失散已久的生父突然现身，重逢的父子二人一起来到了一片不为人知的熊猫乐土。在这里，阿宝遇到了很多可爱有趣的熊猫同类。当拥有神秘力量的大反派企图横扫神州大地，残害所有功夫高手时，阿宝必须迎难而上，把那些热衷享乐、笨手笨脚的熊猫村民训练成一班所向披靡的功夫熊猫！而且还有可能遇到新的“女朋友”，但两位的最后发展如何，观众还要拭目以待。</p></div>', '杰克·布莱克 凯特·哈德森 布莱恩·科兰斯顿 黄磊 杨幂 成龙 周杰伦', '英语', '2016', '0', '/data/images/56a887ad9d5e7.jpg', '欧美', '2016-03-06 15:55:45', '1', '0', '0', '705', '动画片', 'HD版');
INSERT INTO `movie` VALUES ('1730', '杜拉拉追婚记', '<div class=\"endtext\"><p>30好几的杜拉拉（林依晨 饰）二次归来，一心想与王伟（周渝民 饰）结婚的她遇到劲敌美少女沙当当（林珍娜 饰），而另一名追求者陈丰（陈柏霖 饰），和新上司曲络绎（邬君梅 饰）的出现，让杜拉拉对人生的选择陷入迷惘。面对接踵而来的问题，杜拉拉是否能再次“升职”成功呢？</p></div>', '周渝民 林依晨 陈柏霖 林珍娜 李佳航', '国语', '2015', '0', '/data/images/5685f969c05b8.jpg', '大陆', '2016-03-04 23:49:35', '1', '0', '0', '702', '爱情片', 'BD版');
INSERT INTO `movie` VALUES ('1731', '大空头', '<div class=\"endtext\"><p>这部影片将镜头对准了2008年全球金融，讲述华尔街几位眼光独到的投资鬼才在2007年美国信贷风暴前看穿泡沫假象，通过做空次贷CDS而大幅获益，成为少数在金融灾难中大量获利的投资枭雄的故事。据悉，瑞恩·高斯林将扮演一个能把40亿美元单子做成37亿美元收入的德银代理人格雷格-李普曼 (Gregg Lippmann) ；克里斯蒂安·贝尔扮演独眼基金管理人迈克尔·巴里(Michael J. Burry) ；史蒂夫-卡瑞尔扮演华尔街世家出身的史蒂夫·艾斯曼（Steve Eisman）；布拉德·皮特将扮演康沃尔资本的本·霍克特（Ben Hockett）。</p></div>', '克里斯蒂安·贝尔 史蒂夫·卡瑞尔 瑞恩·高斯林 布拉德·皮特', '英语', '2015', '0', '/data/images/56d9ae73d75a3.jpg', '欧美', '2016-03-04 23:49:08', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1732', '海洋深处', '<div class=\"endtext\"><p>本片根据纳撒尼尔·菲尔布里克（Nathaniel Philbrick）的小说改编。故事讲述了埃塞克斯捕鲸船所经历的真实的海难。1819年，这艘船在南太平洋沉没，事故的原因是该船被一头足有梅尔维尔在《大白鲸》中描写的那么大的鲸鱼所碰撞。幸存的海员挤在三只小船上，在大海上漂流了90天，这期间他们经历了病痛、饥饿，最终竟演化到相互残杀、同类相食。</p></div>', '克里斯·海姆斯沃斯 本杰明·沃克 基里安·墨菲', '英语', '2015', '0', '/data/images/56d280294b58d.jpg', '欧美', '2016-02-28 13:05:45', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1733', '奔爱/在世界的中心呼唤爱', '<div class=\"endtext\"><p>苏乐琪（章子怡 饰）和寿司师傅冯裕健（彭于晏 饰）相遇于日本小樽，刚分手的乐琪能否治愈情伤？</p>\r\n<p>矛盾重重的夫妻周宏毅（张译 饰）和唐静（梁静 饰）带着女儿彤彤（李一情 饰）游览伊斯坦布尔，女儿的走失让小夫妻意识到彼此的珍贵。</p>\r\n<p>假结婚的 陆杰（王千源 饰）和关月（吴莫愁 饰）绝症面前开始了美国66号公路的“逃亡”之旅，假夫妻的真恋爱让人唏嘘。</p>\r\n<p>为了治愈情伤来到挪威尤坎小镇的莉莉（陈妍希 饰），犹如挪威寒冬般尘封的心能否被一缕人造阳光所温暖？</p>\r\n<p>回到爱情开始的塞班岛去结束爱情的叶依依（佟丽娅 饰），如何面对丈夫的情人白茄子（周冬雨 饰）的纠缠？ </p></div>', '章子怡 彭于晏 佟丽娅 周冬雨 梁静', '国语', '2016', '0', '/data/images/56c2d50329251.jpg', '大陆', '2016-02-26 17:45:48', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1734', '上身', '<div class=\"endtext\"><p>顶级精神科医生Sharon，为了挤身上流社会，不顾女儿Jenny的意愿，撮合她与社会名流凌公子，令Jenny变得更为反叛。一次晚宴上，Jenny 竟刻意在贵宾前失禁，令所有人认定Sharon有一个精神病的女儿，并开始疏远她。大受打击的Sharon，此时才发现Jenny的不妥，面对行为愈来愈失常的女儿，连Sharon也出现精神问题，须靠药物稳定情绪。Sharon好友为她介绍的驱魔神父，一口咬定Jenny被怨灵缠身。然而，成功驱魔后，Jenny看似回复正常，但怪事仍接二连三地发生...到底是恶鬼难驱，还是心魔作祟？</p></div>', '惠英红 陈颖欣 黄德斌', '粤语', '2015', '0', '/data/images/56d004843d5e0.jpg', '香港', '2016-02-26 15:53:43', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1735', '真相禁区', '<div class=\"endtext\"><p>费鑫（任达华 饰）和仇乐（霍建华 饰）接下一件案子…… </p>\r\n<p>区鉴（张赫 饰）的妻子南方（热依扎 饰）生下本不该属于他的孩子，笃定被戴绿帽的他本想查清孩子来路，却遭杀手索命，惶惶度日发现一切都是妻子和奸夫的阴谋。蒙冤入狱5年的谢天佑（霍建华 饰）开始了对区鉴的报复行动，决定利用高智商犯罪夺回本该属于自己的一切。在费鑫查到区鉴与新进职员唐蝉关系微妙同时，南方发现一直为自己鸣不平的好友沈嘉美竟是区鉴前妻。</p>\r\n<p>与杀手的对抗，与妻子的周旋，与女职员的邂逅，与前妻的重逢，区鉴深陷危机。每个人的爱里都隐藏着不为人知的秘密……</p></div>', '任达华 霍建华 张赫 热依扎 车晓 千田爱纱 连凯 韩志硕 高捷', '国语', '2016', '0', '/data/images/56cf30bb2d935.jpg', '大陆', '2016-02-26 00:50:03', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1736', '荒村怨灵', '<div class=\"endtext\"><p>电影《荒村怨灵》改编自1945年湘西真实灵异事件，首度将“湘西赶尸”、“苗族蛊毒”等湘西苗地惊悚秘闻搬上大银幕。影片主创深入湘西山区和苗地古寨，发掘灵异蛊毒秘闻，寻访湘西赶尸传人，将“赶尸匠”、“摄魂铃”、“山中鬼域的蛊毒”等众多湘西苗地惊悚元素融合，再现神秘赶尸术，揭秘百年湘西赶尸传说的终极谜底。昼伏夜行的赶尸人、阴间路上回响的摄魂铃、使活人致幻死人坐起的苗地蛊毒、红衣轿中见之即亡的鬼新娘，众多灵异湘西秘闻将在电影《荒村怨灵》中首度灵现大银幕。</p></div>', '王小毅 黄白露 徐少强 宗立群 肖轶', '国语', '2016', '0', '/data/images/56cebeebd336a.jpg', '大陆', '2016-02-25 16:44:28', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1737', '恶棍天使', '<div class=\"endtext\"><p>查小刀（孙俪 饰）智商极高，但性格软弱怕事，莫非里（邓超 饰）不过是一介混混，但个性嚣张跋扈，一场车祸让两人相遇，莫非里毫无意外的狠狠在查小刀的身上诈了一笔。亲情淡漠，工作受挫，又遭恶人欺压，查小刀心灰意冷，无意之中得知了有一位名为折耳根（梁超 饰）的神医专治各种疑难杂症，于是便起了向他寻求良方的念头。 </p>\r\n<p>让查小刀没有想到的是，莫非里居然也是折耳根的病人，常年的失眠困扰着他令他痛不欲生。折耳根告诉两人，他们其实正是彼此的“良药”，为了“治病”，查小刀和莫非里结为搭档共同进退，惹出了无数的麻烦和笑话，与此同时，亦结下了深厚的感情。</p></div>', '邓超 孙俪 代乐乐 梁超 杨新鸣 王砚辉', '国语', '2015', '0', '/data/images/56975668e0640.jpg', '大陆', '2016-02-24 23:10:54', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1738', '冰美人', '<div class=\"endtext\"><p>一个女人对心爱男人的一份期许，一个男人对心爱女人的一份忠贞不渝！一个二战后残留下的冰冷地窖，一具风干的男骷髅身上的一个绣烂的口琴，从而慢慢揭开一具冰封60年的美丽女子的失踪之谜......</p></div>', '维纳格拉多娃·卡捷琳娜 安德烈·拉泽夫 水原碧衣 喜莲娜 赵慧仙', '国语', '2016', '0', '/data/images/56cc1376f09a2.jpg', '大陆', '2016-02-23 16:08:23', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1739', '劫匪帮', '<div class=\"endtext\"><p>喜剧惊悚片，重现了马克·吐温的文学人物全部“《哈克贝利·费恩历险记》”和“汤姆历险记”作为当前天成熟的男人。</p></div>', '亚当·尼 梅丽莎·贝努瓦 凯尔·加尔纳 马修·格雷·古柏勒 史蒂芬·朗', '英语', '2016', '0', '/data/images/56c986d14d22e.jpg', '欧美', '2016-02-21 17:43:45', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1740', '老炮儿', '<div class=\"endtext\">老炮儿在北京话中，专指提笼遛鸟，无所事事的老混混儿。 <br />\r\n六爷（冯小刚 饰）就曾是”横行“老北京的老炮儿之一，如今过着悠闲自得的日子，却不想自己的儿子晓波（李易峰 饰）被卷入了与“小爷”小飞（吴亦凡 饰）的纠纷中。六爷试图出面摆平这起纠纷，并找来了昔日老友闷三儿（张涵予 饰）、话匣子（许晴 饰）、灯罩儿（刘桦 饰）帮忙，却发现这个时代已经有了一群新的“话事人”，自己这个顽主的江湖地位已经动摇，并且以往固守的生活方式已经渐渐被时代所抛弃，廉颇老矣尚能饭否？</div>', '冯小刚 许晴 张涵予 刘桦 李易峰 吴亦凡 梁静 白举纲', '国语', '2015', '0', '/data/images/5697554b7f186.jpg', '大陆', '2016-02-20 13:17:47', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1741', '索命暹罗之按摩师', '<div class=\"endtext\"><p>中国女孩莫兰（袁百梓卉 饰）在儿时失去了母亲，但母亲突然离奇的死亡一直是一个谜，这也成为了一直困扰她的心魔。长大后的莫兰孤身投奔母亲的师弟——远在泰国的按摩师尹正（林保怡 饰），想要查清母亲的死亡之谜。莫兰到泰国后，身边各种离奇死亡事件接二连三的发生，这让莫兰母亲之死更加扑朔迷离。 </p>\r\n<p>泰国警察（黄恺杰 饰）在深入调查死亡事件时发现，这些人的死都与按摩院有着千丝万缕的关系，厉鬼缠身、尸油致命、下蛊诅咒等恐怖事件也被逐渐发现。 </p>\r\n<p>层层迷案最终揭露了一场掩盖18年的震撼真相……</p></div>', '林保怡 袁百梓卉 高捷 黄恺杰 钮蔚淇', '国语', '2015', '0', '/data/images/56c59e7d9d5c2.jpg', '大陆', '2016-02-18 18:35:41', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1742', '分手再说我爱你', '<div class=\"endtext\">林嘉华（方力申 饰）和邝美宝（邓丽欣 饰）结婚十周年，决定到瑞士滑雪庆祝，但在出发前，华重遇几年前的老友琪琪（盛朗熙 饰），二人发觉对对方的情愫从未减退。那边，阿宝竟突然提出不去瑞士，而她对阿华原来也有一个不可告人的秘密。</div>', '方力申 邓丽欣 李丽珍 邵仲衡 张继聪', '国语/粤语', '2015', '0', '/data/images/569c7f9d2d26d.jpg', '香港', '2016-02-18 15:17:02', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1743', '奎迪', '<div class=\"endtext\"><p>前世界重量级拳王洛奇在本作中担任起阿多尼斯约翰逊（Adonis Johnson）的教练和导师。Adonis是他已故的朋友和昔日的对手阿波罗（Apollo Creed）的儿子。</p></div>', '迈克尔·B·乔丹 西尔维斯特·史泰龙 泰莎·汤普森', '英语', '2015', '0', '/data/images/56c3d2475e6bd.jpg', '欧美', '2016-02-17 09:52:07', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1744', '新尸骨无存', '<div class=\"endtext\"><p>《人皮客栈》系列电影导演伊莱·罗斯，将为新版《尸骨无存》电影担任监制。《少狼》女星Gage Golightly将与《灵动：鬼影实录3》男星达斯汀·英格拉姆等一同主演。</p>\r\n<p>担任该片导演的是曾为《惊叫大电影》等片担任艺术指导的Travis Zariwny。电影已经于本周在美国奥勒冈州的波特兰市开机，并将于2015年上映。故事和伊莱·罗斯执导的原版《尸骨无存》相似，一群大学生相聚来到山林中的小屋度假，并开始成为致命病毒的牺牲者。</p></div>', '伊莱·罗斯 马修·达达里奥 盖琦·格莱特利 达斯汀·英格拉姆', '英语', '2016', '0', '/data/images/56c3d1c963c5e.jpg', '欧美', '2016-02-17 09:50:01', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1745', '危机大逆袭', '<div class=\"endtext\"><p>电影根据2005年同名纪录片改编，聚焦南美洲的美国政治竞选策略。</p></div>', '桑德拉·布洛克 比利·鲍伯·松顿 安东尼·麦凯 乔昆姆·德·阿尔梅达', '英语', '2015', '0', '/data/images/56c3d18b40704.jpg', '欧美', '2016-02-17 09:48:59', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1746', '那天的氛围', '<div class=\"endtext\"><p>影片中偶然于KTV中相遇的一对男女,在釜山度过了率真淡泊的24小时.以美丽的海滨城市釜山为背景,全面描述了男女主人公从相遇到相恋再到分手的爱情故事</p></div>', '文彩元 柳演锡 赵在允', '韩语', '2016', '0', '/data/images/56c2ddee39d5b.jpg', '韩国', '2016-02-16 16:29:35', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1747', '神秘感染：第二阶段', '<div class=\"endtext\"><p>故事讲述的是好友萨曼莎意外感染不明病毒，在病毒摧毁她意志和占据她整个世界之前，莱利需要寻找到治愈疾病和阻止悲剧的方法...</p></div>', '娜嘉拉·汤森德 玛莉安娜·帕卡 爱丽丝·麦克唐纳 约翰·恩尼斯 劳雷尔·韦尔', '英语', '2015', '0', '/data/images/56c152ba438a8.jpg', '欧美', '2016-02-15 12:23:23', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1748', '唐人街探案', '<div class=\"endtext\"><p>天赋异禀的结巴少年秦风（刘昊然 饰）警校落榜，被姥姥遣送泰国找远房表舅——号称“唐人街第一神探”，实则猥琐的大叔唐仁（王宝强 饰）散心。不想一夜花天酒地后，唐仁沦为离奇凶案嫌疑人，不得不和秦风亡命天涯……穷追不舍的警探黄兰登（陈赫 饰）、无敌幸运的警察坤泰（肖央 饰）、穷凶极恶的匪帮三人组、高深莫测的唐人街教父、美艳风骚的老板娘阿香（佟丽娅 饰）等悉数登场！七天！唐仁、秦风必须取长补短、同仇敌忾！他们能否躲避警察追捕、匪帮追杀、黑帮围剿，在短短七天内，完成找到失落的黄金并查明真凶，为自己洗清罪名这些逆天的任务？</p></div>', '王宝强 刘昊然 佟丽娅 陈赫 小沈阳 肖央', '国语', '2015', '0', '/data/images/569754ac4c225.jpg', '大陆', '2016-02-14 13:33:27', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1749', '仙班校园', '<div class=\"endtext\"><p>八仙这次不闹海，复读留级闹校园！为了封印远古邪祟梦煞的煞之心，八仙中的七位变身人间一所中学的万年留学生，不能使用仙法的他们乐得在校园里逍遥快活。然而，美女老师雯雯的出现打破了这种平静和平衡……八仙之间的信任竟日渐瓦解，一盘散沙的他们将如何度过这次危机…..</p></div>', '吴樾 释小龙 包贝尔 林子聪 罗家英 景岗山', '国语', '2016', '0', '/data/images/56bee95f59b4f.jpg', '大陆', '2016-02-13 16:54:02', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1750', '极限挑战之皇家宝藏', '<div class=\"endtext\"><p>“极限男人帮”黄渤、孙红雷、黄磊、罗志祥、王迅、张艺兴在拍摄《极限挑战》时，意外被雷“劈”回到几百年前的大明朝，六人得到皇帝恩宠，却因为一个失误造成皇帝驾崩。六人跌跌撞撞穿越回现代后，却发现历史已经被改写，他们也变成了没有身份的“黑户”。为找回身份，他们被迫根据皇帝留下的“圣火令”寻找黄家宝藏，踏上玩命之旅。</p></div>', '黄渤 孙红雷 黄磊 罗志祥 王迅 张艺兴 赵丽颖 于和伟', '国语', '2016', '0', '/data/images/569d9d4eb55de.jpg', '大陆', '2016-02-13 11:12:21', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1751', '蒸发太平洋', '<div class=\"endtext\"><p>《蒸发太平洋》讲述了一个发生于2020年的科幻冒险故事，一架大洋航空新客机在首航中遭遇意外，迫降到怪物肆虐的好运岛上，包括王子、明星、记者在内的乘客随之与机组人员一起陷入了危险中。</p></div>', '布兰登·罗斯 张雨绮 王盛德 维森特·M.沃德 戴阳天', '国语', '2016', '0', '/data/images/56b8c3314aa48.jpg', '大陆', '2016-02-09 00:32:49', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1752', '锅盖头3：绝地反击', '<div class=\"endtext\"><p>一股中东恐怖分子包围了美国大使馆所在地，驻守在大使馆的士兵们必须竭尽全力保护使馆。</p></div>', '斯科特·阿金斯 查理·韦伯 艾瑞克·瓦德兹 丹特·巴斯克 丹尼斯·海斯伯特', '英语', '2016', '0', '/data/images/56b5fb8517667.jpg', '欧美', '2016-02-06 21:56:31', '1', '0', '0', '698', '战争片', 'BD版');
INSERT INTO `movie` VALUES ('1753', '小门神', '<div class=\"endtext\"><p>故事发生在当代的人间江南小镇和神界。</p>\r\n<p>门神神荼和郁垒是两兄弟。因为近年人间不再关注神仙，神界经济萧条，门神、土地爷、八仙等等小神们面临下岗失业的危险。门神郁垒决定去人间，做一番惊天动地的事情，证明门神的价值。郁垒和神荼先后来到人间，遇到了小镇上的单亲母女小英和雨儿，之后发生了一系列意想不到的有趣惊险故事……</p></div>', '高晓松 易小星 白客 季冠霖', '国语', '2016', '0', '/data/images/56a8948d81a5a.jpg', '大陆', '2016-02-05 21:07:57', '1', '0', '0', '705', '动画片', 'HD版');
INSERT INTO `movie` VALUES ('1754', '一狱一世界：高登阔少蹲监日记', '<div class=\"endtext\"><p>于日辰（王宗尧 饰），身边充斥名车美女的富二代，一次酒后驾驶， 女途人被撞至重伤。肇事48小时内面对法庭裁决，判监一年半！踏进监狱生 涯，惊觉铁窗后的天地，是自成一国、奉行暗秩序的宇宙。只要懂得融入生 存法则，便可安然渡过刑期。于日辰利用自己的富二代思维及财势，执意将 刻板的监狱生活品质高度优化。我们熟悉的监狱，从此变得不一样！他的死 敌阿积（张建声 饰）竟也被判到同一监狱服刑。阿积一贯的狂妄放任，在 狱中恃财勾结少数族裔及大圈帮横行。在铁窗绝境之中面对强大压力，他将 如何自处？</p></div>', '蔡瀚亿 廖启智 张建声 何家驹 黄光亮 姜皓文 王宗尧 张松枝 陈奂仁 余安安', '国语/粤语', '2015', '0', '/data/images/56b2dba6dd9e0.jpg', '香港', '2016-02-04 13:03:35', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1755', '哪一天我们会飞', '<div class=\"endtext\"><p>余凤芝（杨千嬅 饰）和彭盛华（林海峰 饰），一对相识于中学的中年夫妻，过着寻常而压抑的生活。二人竭力维持的婚姻外壳，却被一次旧生同学联欢会彻底戳破。当时在学校里，曾存在一个谜样的男同学，他与她与他构成青葱的三角；在尘封的记忆深处，埋下一个令人动容的秘密……</p></div>', '杨千嬅 林海峰 苏丽珊 游学修 吴肇轩 赵学而 乔宝宝 钟丽淇 杨诗敏 谭玉瑛', '国语/粤语', '2015', '0', '/data/images/56b2d7a943a4e.jpg', '香港', '2016-02-04 12:59:09', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1756', '寻龙诀', '<div class=\"endtext\"><p>上世纪80年代末，胡八一（陈坤 饰）、王凯旋（黄渤 饰）与Shirley杨（舒淇 饰）在美国打算金盆洗手，本来叱咤风云的摸金校尉沦为街头小贩被移民局追得满街跑。就在此时，意外发现20年前死在草原上的初恋对象丁思甜（杨颖 饰）可能还活着，胡八一、王凯旋、Shirley杨决定再入草原千年古墓……</p></div>', '陈坤 黄渤 舒淇 杨颖 夏雨 刘晓庆 颜卓灵 鬼吹灯之寻龙诀', '国语', '2015', '0', '/data/images/569755dfdfd21.jpg', '大陆', '2016-02-03 21:50:38', '1', '0', '0', '703', '魔幻片', 'HD版');
INSERT INTO `movie` VALUES ('1757', '不要忘记我', '<div class=\"endtext\"><p>由李允珍执导，郑雨盛、金荷娜主演的爱情电影，该片根据同名短篇电影改编，讲述了因遭遇事故而失去十年记忆的男子锡元与出现在他面前的神秘女子真英之间的爱情故事 。</p></div>', '郑雨盛 金荷娜 裴成宇 张英南 温宙完', '韩语', '2016', '0', '/data/images/56b1d6e4765c2.jpg', '韩国', '2016-02-03 18:31:00', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1758', '云中行走', '<div class=\"endtext\"><p>影片改编自法国杂技艺术家菲利普·帕特的个人自传。从小喜爱杂技表演的菲利普·帕特（约瑟夫·高登-莱维特 Joseph Gordon-Levitt 饰），长大后成为法国杂技名人，他来到纽约，想要完成在摩天大厦之间走钢索的梦想，在遭遇了一系列的怀疑、误解、受伤之后，依然坚定地站在了世贸大楼之间的钢索之上。众目睽睽下，垫钢索的木 块突然碎裂，在众人的惊呼声中，400多米高空之上的他，是否可以完成自己的梦想？</p></div>', '约瑟夫·高登-莱维特 本·金斯利 夏洛特·勒邦 詹姆斯·戴尔', '英语', '2015', '0', '/data/images/569cc9cdb228f.jpg', '欧美', '2016-02-03 16:59:52', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1759', '我是路人甲', '<div class=\"endtext\"><p>大学毕业后，怀揣着成为一名演员的梦想的万国鹏（万国鹏 饰）孤身一人背井离乡，远赴大名鼎鼎的浙江横店，希望能够在这里打拼出一片属于自己的天地。然而，现实远比想象之中要残酷得多，在这个弱肉强食的世界里，空有一份对于梦想的热情还远远不够，在经历了无数挫折和失败后，万国鹏总算混出了点名堂，成为了一名专业的群众演员。 </p>\r\n<p>在横店，万国鹏见到了无数和他极为相似的年轻人，他们中，有人最终获得了成功实现了梦想，有人误入歧途人生毁于一旦，但更多的，是经历了千辛万苦却放弃了梦想，回归了平淡的生活。一次偶然中，万国鹏结识了名为王婷（王婷 饰）的女孩，她仿佛一束光，照亮了王国鹏的前路。</p></div>', '万国鹏 王婷 蒿怡帆 沈凯 徐小琴 林晨 魏星 姜涛', '国语', '2015', '0', '/data/images/56aec4f8cef5b.jpg', '大陆', '2016-02-01 10:37:45', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1760', '一家老小向前冲', '<div class=\"endtext\"><p>年关将至，北漂虚荣男严子贵（彭宇 饰）想要荣归故里却一直不能如愿，自带怂人属性导致与青梅竹马的旋风少女颜子兰（柳岩 饰）一直不能佳人合璧，还有个土豪金链汉子大牛（杜海涛 饰）在一旁百般讨好虎视眈眈。租宝马回家，想要欢度春节却要面临着各种危机，不能如愿的情感最终能否终成眷属，被股票深深套牢走火入魔的大哥弄得家里鸡飞狗跳、媳妇出走，大哥一家该何去何从，专心造娃不见娃的二哥到底给不给力，这个年到底还能不能好过啊......</p></div>', '彭宇 柳岩 杜海涛 陈英俊 王永光', '国语', '2016', '0', '/data/images/56aec4bf0652a.jpg', '大陆', '2016-02-01 10:36:48', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1761', '灯塔下的恋人', '<div class=\"endtext\"><p>陈家声（尹扬明 饰）、周启光（林俊贤 饰）和李玉兰是青梅竹马的好朋友，灯塔成为他们经常流连的地方。家声和阿光发觉他们同时爱上了玉兰，最后玉兰选择了家声，阿光带着怨愤黯然离开了澳门。 45年后的阿光已是澳门的富豪。阿光的女儿Debbie（邓丽欣 饰）从少就独立有个性，每日都忙着帮父亲打理业务，本来沈闷的每一天却因遇到赌场的荷官子华（黄又南 饰）而改变…</p>\r\n<p>杨振强（刘浩龙 饰）是家声、玉兰的女婿，他们的女儿五年前因为车祸丧生，留下了振强和8岁儿子滔滔。滔滔和同学小欣籍口把父亲和小欣姨姨黎梓芬（刘心悠 饰）拉在一起…</p>\r\n<p>细坚（Babyjohn 饰）自少受父亲的影响成为了车迷，他的女友Phillis（陈慧敏 饰）热爱唱歌，一次偶然的机会受到音乐监制的欣赏并安排她到日本培训。他们两个都察觉到：只要Phillis一当上歌星，他们的爱情就会终结…</p>\r\n<p>最后到底他们的爱情故事会走到怎样的结局?</p></div>', '邓丽欣 黄又南 薛凯琪 杨奇煜 刘浩龙', '国语/粤语', '2015', '0', '/data/images/56ae3dc848351.jpg', '香港', '2016-02-01 01:00:56', '1', '0', '0', '702', '爱情片', 'BD版');
INSERT INTO `movie` VALUES ('1762', '十月初五的月光', '<div class=\"endtext\"><p>1999年在澳门回归这一天，文初（张智霖 饰）、琪琪（陈乔恩 饰）及一众街坊替Q姨（薛家燕 饰）举行生日会，移民美国多年的君好（畲诗曼 饰）也突然出现生日会，文初却发现她心事重重。 已成为赌城大亨的万金胜（唐文龙 饰）前来道贺，忽然一队司警以涉嫌非法经营外围赌场罪名把他拘捕，最后被判入狱七年。文初收到消息，礼信在美国因交通意外离开人世，更发现君好在下榻的酒店自寻短见。君好出院后每天把自己困在家中，文初和Q姨等人用尽方法希望她能早日走出阴霾。</p>\r\n<p>经过多年风风雨雨，文初、君好、金胜、Q姨等人尝尽人生的喜怒哀乐，生命的甜酸苦辣。但重要的是他们还在一起，一起奋斗，一起分担，一起快乐。可是，文初却在一次意外中碰伤了头部，由于一直没有妥善治疗，瘀血在脑内已经扩散。医生告诉文初，他需要尽快进行手术，可是文初可能会因手术而失去记忆…</p></div>', '张智霖 佘诗曼 陈乔恩 薛家燕', '国语/粤语', '2015', '0', '/data/images/56adba7d748bd.jpg', '香港', '2016-01-31 15:44:38', '1', '0', '0', '702', '爱情片', 'BD版');
INSERT INTO `movie` VALUES ('1763', '死開啲啦', '<div class=\"endtext\"><p>圆月之下的寂静地盘，努力工作中的「黑工」无意中弄醒了一名长期住客，「他」就是身穿洋服的邓显祖。</p>\r\n<p>醒后的祖走进繁荣都市，眼下尽是缤纷喧哗地道的港人生活，此时，饿上百年的他却遇上为情自杀的港女APPLE，这机缘让他俩走在一起。</p>\r\n<p>饥饿的祖尾随着APPLE，却又错有错着的替她赶走收楼职员。APPLE的祖母 (卿) 提出收留，好利用祖以抗外敌！自此，港女APPLE与钟情粤剧但性格神化的卿、潦倒英籍租客DICKENS和来历不明的祖共同生活。APPLE父 (权) 极力游说卿交出业权。为此父女二人势成水火，但卿却处处维护这独生子，作为孙女儿的APPLE只感独力难支，祖向APPLE不停开解，此时地产商已蠢蠢欲动，已发动第二波的收楼行动。</p>\r\n<p>职员汇报行动中怪事重重，英为确保收楼顺利，特意派出道士、神父两大高手前往对付，祖却不用大开杀戒，轻松击退二人。为保障利益，地产商不容即将兴建的大型骨灰龛场和一连串主题发展有所延误，故决定派手下 (英) 把障碍铲除。</p>\r\n<p>最后关头，殭尸皇出现。</p>\r\n<p>此刻的祖活像一头发疯了的野兽，拼命的与殭尸皇搏斗………</p></div>', '林德信 雷琛瑜 河国荣 吴浣仪 徐智勇', '国语/粤语', '2015', '0', '/data/images/56acd589c7dc4.jpg', '香港', '2016-01-30 23:23:58', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1764', '桃李花歌', '<div class=\"endtext\"><p>朝鲜高宗时代著名潘索里作曲家申在孝为了弟子陈彩仙而创作的短歌，电影也预计讲述这对师徒的故事。潘索里（Pansori）是朝鲜传统的叙事性说唱艺术。</p>\r\n<p>裴秀智将在片中饰演弟子彩仙，而彩仙的师傅一角则有一线男演员柳承龙扮演。陈彩仙是出生于贫苦家庭不幸沦落到妓院，打破原来只有男人可以唱板索里的时代偏见，成长为朝鲜最初的女性名唱。宋清晨将在片中饰演潘索里学堂里的声乐老师和鼓手金世宗，会帮助处于困境的主人公。</p></div>', '柳承龙 裴秀智 宋诗曦 金南佶', '韩语', '2015', '0', '/data/images/56ab8a8363931.jpg', '韩国', '2016-01-29 23:51:31', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1765', '碟仙碟仙', '<div class=\"endtext\"><p>敏(庄思敏饰)、龙(沈震轩饰)、强(陆骏光饰)和芬(曾淑雅Jumbo饰)是大学同学，四人眼见网上游戏生意势头正旺，遂把多年积储集腋成裘成立工作室，致力开发网上商机。</p>\r\n<p>一名叫黄太(鲍起静饰)的女人找上门，还提出跟四人合作名叫“碟仙”的网上游戏模式。四人顿时变得士气高涨，矢志创造网上游戏史上一款崭新游戏模式。可是四人第一次接触“碟仙”便被藏在碟仙中的灵体所缠，原来背后隐藏着一段不可告人的秘密….</p></div>', '罗兰 鲍起静 邵音音 庄思敏 沈震轩 曾淑雅', '国语/粤语', '2015', '0', '/data/images/56aaf394dfc1a.jpg', '香港', '2016-01-29 13:07:33', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1766', '末日崩塌', '<div class=\"endtext\"><p>影片的故事讲述了由于圣安地列斯断层，加利福尼亚地区发生了9次大规模的地震。雷·盖恩斯（道恩·强森饰）是消防部空军中队的一名飞行员，他必须驾驶飞机往返于洛杉矶和旧金山，努力寻找并营救自己的女儿。</p>\r\n<p>雷驱车前往旧金山，随着一声巨响，周围的树木与电线杆变得七扭八歪，紧急刹车查看状况的强森被眼前的景象“惊呆了”：公路被一条深不见底的裂隙截断，甚至错位，加油站被裂成两半隔着“峡谷”遥遥相对。随着这场超级地震毫无预兆的来袭，整个城市浓烟滚滚、火光冲天，高楼大厦相继倒塌，到处都是惊慌失措的市民。而且强烈的地震“摧枯拉朽”般粉碎了坚实的大坝，洪水如猛兽一般涌向已经水深火热的城市，“天崩地陷”的景象犹如“末日”已然来临。</p></div>', '道恩·强森 亚历珊德拉·达达里奥 卡拉·古奇诺', '英语', '2015', '0', '/data/images/56aad3f25bdbd.jpg', '欧美', '2016-01-29 10:52:35', '1', '0', '0', '701', '科幻片', 'BD版');
INSERT INTO `movie` VALUES ('1767', '消失的爱人', '<div class=\"endtext\"><p>一次雪山意外中，凯峰（黎明 饰）痛失爱妻秋捷（王珞丹 饰），为了寻回消失的爱人他尝试了各种招魂方法。令人意外的是，秋捷的灵魂真的回来了。凯峰找到灵媒，希望可以把妻子留在身边久一点。灵媒告诉凯峰一个秘密“只有爱她的人才会看见她，不爱她的人看不见。而且不能让她知道自己是灵魂，否则她就会很快消失。”深知这段相聚如昙花一现，始终会有完结的一日，凯峰唯有与儿子沐沐努力守着这个“秘密”。一次偶然之中，凯峰表弟Jimmy（林俊杰 饰）看见了秋捷的灵魂，而在此时雪山事件也被媒体报道，眼看秋捷是灵魂的事实将被察觉，更加意想不到的事也在步步逼近，凯峰又将如何守护他深爱的秋捷……</p></div>', '黎明 王珞丹 林俊杰 张榕容', '国语', '2016', '0', '/data/images/56a888f5962f9.jpg', '大陆', '2016-01-27 17:11:58', '1', '0', '0', '702', '爱情片', 'TS版');
INSERT INTO `movie` VALUES ('1768', '回到从前', '<div class=\"endtext\"><p>《深海长眠》导演亚历桑德罗·阿曼巴新片《Regression》，这是个充满悬念和惊悚的故事，警探探肯纳（伊桑·霍克饰演）调查一起父亲性侵女儿（艾玛·沃森饰演）的案件，遭遇层层谜团，最后还卷入了震撼整个国家的阴谋里……</p></div>', '伊桑·霍克 艾玛·沃森 大卫·休里斯 戴文·博斯蒂克', '英语', '2015', '0', '/data/images/56a8368c603bc.jpg', '欧美', '2016-01-27 11:16:28', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1769', '史蒂夫·乔布斯', '<div class=\"endtext\"><p>影片将取材于沃特·艾萨克森撰写的乔布斯生前唯一授权的传记，本片将不同于传统传记电影，由三段故事组成。索尔金的剧本会聚焦乔布斯生前三件关键性产品的发布时刻——1984年第一台Mac电脑的问世、乔布斯离开苹果后创立的NeXT电脑公司和1998年苹果首次推出的iMac。</p></div>', '迈克尔·法斯宾德 凯特·温丝莱特 塞斯·罗根 杰夫·丹尼尔斯 凯瑟琳·沃特斯顿', '英语', '2015', '0', '/data/images/56a83612122ae.jpg', '欧美', '2016-01-27 11:15:34', '1', '0', '0', '699', '剧情片', 'DVD版');
INSERT INTO `movie` VALUES ('1770', '最后的巫师猎人', '<div class=\"endtext\"><p>作为世界上最后一个女巫猎人，寇特（范·迪塞尔 Vin Diesel 饰）被黑巫后诅咒，得到了不死之身。如今，寇特寄居在纽约的一所教堂，与教会派来的第37代助手多兰（伊利亚·伍德 Elijah Wood 饰）联手斩妖除魔。与此同时，黑巫后得到秘术即将复活，邪恶女巫们倾巢而出 ，企图释放超级瘟疫灭绝人类。势单力薄的寇特，求助于善良的梦之女巫克洛伊（露丝·莱斯利 Rose Leslie 饰），在她的帮助下，寇特与邪恶女巫之间的终极之战一触即发。</p></div>', '范·迪塞尔 伊利亚·伍德 露丝·莱斯利 朱莉·恩格尔布雷希特', '英语', '2015', '0', '/data/images/56a835d0d1089.jpg', '欧美', '2016-01-27 11:13:21', '1', '0', '0', '703', '魔幻片', 'BD版');
INSERT INTO `movie` VALUES ('1771', '万万没想到西游篇', '<div class=\"endtext\"><p>屌丝小妖王大锤（白客 饰），他生来便与常人不同，两耳尖尖，又有些小法力，总是自诩本地妖王。但让他万万没想到的是，在遇到唐僧师徒四人组后，他的命运发生了逆转；而对于唐僧师徒四人组来说，遇见王大锤也是无比郁闷的第八十二难。双方因此上演了一出相爱相杀，令人捧腹的奇幻冒险。</p></div>', '白客 杨子姗 陈柏霖 马天宇 刘循子墨 麦克 易小星', '国语', '2015', '0', '/data/images/56975708a6437.jpg', '大陆', '2016-01-25 18:13:12', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1772', '东京攻略', '<div class=\"endtext\"><p>Maise（陈慧琳 饰）与男友高桥裕二（仲村亨 饰）相恋多时，高桥却在结婚当天突然失踪了。Maise决定前往东京寻找高桥，同时装修师父毕大勇（郑伊健 饰）为了追逃Maise欠下的装修费用，便决定跟着她前往东京。互相不信任的二人到了高桥在东京的家，遇到了一直跟踪高桥的私家侦探林贵仁（梁朝伟 饰），原来高桥与黑帮伊藤（阿部宽 饰）的妻子有奸情，于是失踪了。三人最后联手起来，决定一定要找到失踪的高桥，与黑帮抗争。随着追踪的层层深入，Maise也知道了高桥、毕大勇还有林贵仁的真实身份。</p></div>', '梁朝伟 郑伊健 陈慧琳 张柏芝 仲村亨', '国语/粤语', '2000', '0', '/data/images/56a58d5567ced.jpg', '香港', '2016-01-25 10:50:06', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1773', '最佳损友闯情关', '<div class=\"endtext\"><p>咸湿超（陈百祥 饰）即将与女友Dorlina（吴君如 饰）结婚，损友牛精帆（冯淬帆 饰）、口臭奇（曹查理 饰）极力阻止。</p>\r\n<p>这时候他们的好友之一徐定贵（刘德华 饰）的哥哥徐定富因为经营不善而导致自己的公司负债累累，欠下了霍氏公司一大笔债务，定富的公司被迫宣告破产。为了帮助哥哥，徐定贵与咸湿超等几位好友潜进了霍氏公司，希望能对复兴公司有所帮助。</p>\r\n<p>定贵的办事能力得到老板的赏识，霍氏便把女儿Nicole（关之琳 饰）介绍给定富认识，怎料在Nicole的生日舞会上，定贵的女友豆豆（邱淑贞 饰）出现了…</p></div>', '刘德华 关之琳 郑裕玲 冯淬帆 邱淑贞', '国语/粤语', '1988', '0', '/data/images/56a58d1535343.jpg', '香港', '2016-01-25 10:49:06', '1', '0', '0', '704', '喜剧片', 'BD版');
INSERT INTO `movie` VALUES ('1774', '最佳损友', '<div class=\"endtext\"><p>徐家父亲逝世了，身在美国的徐定贵（刘德华 饰）应叔父的邀请回到了香港承继遗产。徐定贵有个同父异母的哥哥徐定富，定富对于这个前来分家产的弟弟十分不满，刚好叔父要求定贵在公司工作，并要求他表现良好才能顺利领得遗产。</p>\r\n<p>为了能独吞财富，假仁假义的定富故意招来了三位出名的损友，跟定贵成为朋友后把他教坏。意想不到的是这三位损友不但没有把定贵教坏，四人还成为了好友。当他们知道了定富的阴谋之后，决定联手对付卑鄙的定富。</p></div>', '刘德华 陈百祥 冯淬帆 邱淑贞 陈玉莲', '国语/粤语', '1988', '0', '/data/images/56a58cba94e80.jpg', '香港', '2016-01-25 10:47:55', '1', '0', '0', '704', '喜剧片', 'BD版');
INSERT INTO `movie` VALUES ('1775', '跟踪', '<div class=\"endtext\"><p>黄文展“狗头”（任达华 饰）和何家宝“猪女”（徐子珊 饰）是香港CIB（Criminal Intelligence Bureau）的职员。CIB俗称香港警察中的狗仔队，里面人人行动低调样貌平凡，但却对罪犯有极其灵敏的嗅觉。</p>\r\n<p>狗头和猪女这次的任务是追踪珠宝劫案的疑犯陈重山（梁家辉 饰）。陈重山是个犯案“天才”，对躲避警察追捕有丰富经验和巧妙手段。这次CIB行动，比平时都更为艰巨。尽管已经警方十面埋伏，狗头和猪女都使出浑身解数，陈重山还是屡屡逃脱。一路的跟踪就好像猫捉老鼠，没完没了。陈重山似乎有神奇的力量，闻到警察追到身边的气味。眼看有警员在追踪过程中殉职，狗头和猪女心急如焚。</p></div>', '梁家辉 任达华 徐子珊 张兆辉 黎耀祥 林雪 邵美琪 彭敬慈', '国语/粤语', '2007', '0', '/data/images/56a4704065be1.jpg', '香港', '2016-01-24 14:33:37', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1776', '古惑仔之只手遮天', '<div class=\"endtext\"><p>「东英」在龙头骆驼重整之后蠢蠢欲动。而「洪兴」在蒋天生（任达华）领导下更加活跃，陈浩南（郑伊健）正式成为铜锣湾区Fit人。乌鸦（张耀扬）布局在荷兰伏击蒋天生，嫁祸浩南。洪兴社为此误会陈浩南，指定由大飞（黄秋生）追杀陈浩南。乌鸦眼见龙头大哥骆驼病重，乘机下毒手杀害，但仍替其风光大葬。丧礼之日，警方如临大敌，江湖人马致祭者极多，场面壮观，浩南山鸡（陈小春）二人忽然出现……</p></div>', '郑伊健 陈小春 黎姿 任达华', '国语/粤语', '1996', '0', '/data/images/56a429ac80fef.jpg', '香港', '2016-01-24 09:32:28', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1777', '搏击迷城', '<div class=\"endtext\"><p>生长于内蒙古大草原的年轻摔跤手——娜仁（赵柯 饰），应邀前往日本表演摔跤。临行前，金月婆婆（斯琴高娃 饰）托她寻找离别十多年的孙子赤那思（陈伟霆 饰）。</p>\r\n<p>摔跤会主持人波士，永远戴着小丑面具，表现狂妄自大。摔跤会中，娜仁结识了被丈夫一度离弃的真和子（渡边奈绪子 饰），以及来自香港，与父亲冲突而离家出走的月月（李菲儿 饰）。波士诱使她们答应组队应战另一支凶猛的女子自由摔跤队。娜仁找到今月婆婆的孙子，他改名成若男，从事足疗按摩。出乎意料，若男拒绝一起回大草原的请求。波士和经纪人小百合利欲熏心，在娜仁事先不知的情形下，临时将比赛改为泥浆摔跤。娜仁忍辱参赛。随后发现波士的真实身份正是温纯的若男，也即五年前被迫退出相扑界的赤那思。愤恨之余，娜仁决心以爱唤醒童年伙伴的良知，找回迷失的自我。</p>\r\n<p>终于，赤那思与娜仁携手回到大草原，重披搏克服，继承蒙古族悠久的摔跤文化……</p></div>', '陈伟霆 赵柯 李菲儿 渡边奈绪子', '国语/粤语', '2015', '0', '/data/images/56a429717b8ce.jpg', '大陆', '2016-01-24 09:31:29', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1778', '家在水草丰茂的地方', '<div class=\"endtext\"><p>一对兄弟，两只骆驼，七天六夜，五百公里。</p>\r\n<p>弟弟阿迪克尔和哥哥巴特尔在同一个班级上学，住在爷爷家，远离自己的父母。因为不同的童年遭遇，哥哥对弟弟心存隔阂。暑假来了，爷爷意外去世，而父亲并没有来接他们，他们成了世界上最孤独的人。　　阿迪克尔说服巴特尔一起上路，寻找在草原上的家。他说父亲曾教过，放牧时如果迷路，一定要顺着河流走，有水的地方水草才会茂盛，而牧民的家在水草丰茂的地方。</p>\r\n<p>两人骑着骆驼，踏上漫漫西部千里长路。勇敢的少年将遭遇怎样的风景和奇遇？心结是否可以解决？故事的最后，他们的家还在水草丰茂的地方吗？</p></div>', '汤龙 郭嵩涛 白文信 郭建民 马新春', '国语', '2015', '0', '/data/images/56a2fc74dd0ab.jpg', '大陆', '2016-01-23 12:07:16', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1779', '四平青年3偷天换日', '<div class=\"endtext\"><p>二龙湖浩哥最新作品，铜锣湾大B哥仗义出演。浩哥、老三、蓝百万、李老八等大部分主要角色全部回归。</p>\r\n<p>李老八刑满出狱迷上了风水，对刘半仙尊敬有加。刘半仙劝说李老八凑齐三件古董为自己转运，不巧其中两件便在蓝百万手中。李老八于是命令一鸣派人去偷。</p>\r\n<p>二龙湖浩哥带众兄弟进城找蓝百万帮忙成立农副产品公司，不巧吃饭时发现钱包被人偷走。浩哥大发雷霆，抬头却看到一个小偷正从一户人家中逃走，便带兄弟将小偷打了一顿，抢走了小偷身上的一件挂饰。</p>\r\n<p>次日，蓝百万见到浩哥身上的挂饰却将他误会成小偷。原来，昨天那小偷正是一鸣派去蓝百万家偷古董的。</p>\r\n<p>浩哥为证清白，四处寻找小偷；李老八为凑齐转运古董，不断逼一鸣出手；蓝百万更是请出了铜锣湾大B哥为自己撑腰……一时间三方人马在四平市再次搅出一个个爆笑的故事。</p></div>', '张浩 吴志雄 李野 蓝波', '国语', '2016', '0', '/data/images/56a2fc2f8ccd6.jpg', '大陆', '2016-01-23 12:06:07', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1780', '局内人', '<div class=\"endtext\"><p>电影《局内人》改编自尹太浩作家的同名漫画，是通过论述委员及国会议员、大企业高管、黑帮、刑警、纪录片作家等犀利解剖韩国社会腐败及不正之风的作品。李秉宪在影片中将饰演作为有权者的走狗做尽坏事，变成废人之后举刀复仇的角色。预计将在片中展现此前未曾演绎过的粗犷强烈形象，令人们更加充满期待。曹承佑饰演”禹长勋检察官”一角,是个在检察官组织中让踢人就踢人让掩盖罪行就掩盖罪行的腐败政治人。</p></div>', '李秉宪 曹承佑 白允植 李璟荣 赵在允', '韩语', '2015', '0', '/data/images/56a1f08159382.jpg', '韩国', '2016-01-22 17:04:02', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1781', '灵臆事件', '<div class=\"endtext\"><p>该片根据“北京375路公交车”、“成都僵尸围城”、“广州尸油”、“哈尔滨猫脸老太”这“四大灵异事件”改编。张灵（朱雨辰 饰）与女朋友苏白（石天琦 饰）处在感情危机时刻。这日，他在广播中听到了375路公交车失踪的事件。而他，刚刚从公交上逃生，惊魂未定。 本来，张灵和苏白是在成都读书的同学，某日，学校内爆发僵尸，张灵奋勇保护心爱的女生苏白对抗大批僵尸袭击。其后，二人走到了一起，准备结婚。不料，苏白在拍摄婚纱当日被神秘人毁容，自此终日不愿见人……</p></div>', '朱雨辰 石天琦', '国语', '2015', '0', '/data/images/56a07b818f50c.jpg', '大陆', '2016-01-21 14:32:34', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1782', '坏蛋必须死', '<div class=\"endtext\"><p>假期来临之际，在釜山当中文老师的强子（陈柏霖 饰）和从中国家乡远道而来的好哥们三儿（乔振宇 饰）、大头（丁文博 饰）和弟弟帕帕（杨旭文 饰）相约，一起到济州岛散心。狂飙的小混混、性感的韩国女人（孙艺珍 饰）、执着的老警察（张光 饰）、神秘的尾随者（申贤俊 饰）、不着调的牧师（朴哲民 饰）接连出现在他们身边。期盼已久的旅程，因为这些人的存在而鸡飞狗跳、险象环生，好像每个人都做了坏事。此时一只神秘小黑猪出现让所有人杀红了眼，更将众人推向生死危急的关口……</p>\r\n<p>到底怎样才能脱离险境？究竟谁才是那个真正该死的“坏蛋”？</p></div>', '陈柏霖 孙艺珍 乔振宇 申贤俊 张光', '国语', '2015', '0', '/data/images/569e1012b1045.jpg', '大陆', '2016-01-19 18:30:23', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1783', '间谍之桥', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 冷战初期，纽约律师詹姆斯·多诺万（汤姆·汉克斯 Tom Hanks 饰），为苏联情报员鲁道夫·阿贝尔（马克·里朗斯 Mark Rylance 饰）辩护，当时美苏关系紧张，詹姆斯仍然秉持公平正义的原则，毫不偏私地为阿贝尔抗辩，阿尔贝欣赏他的正直，他也欣赏阿贝尔的忠诚，虽然最后输了官司，两人却建立起微妙的情谊。不久之后，美军U2高空侦察机在执行机密任务时，被苏联军方击落，詹姆斯受雇于中情局，代表美方与苏联谈判，试图在极其渺茫的机会中，与苏联交涉换囚条件，营救被劫持的美国飞行员。<br />\r\n&nbsp;&nbsp;&nbsp; 影片根据美国律师詹姆斯·多诺万真实经历改编。</div>', '汤姆·汉克斯 马克·里朗斯 艾米·莱安 阿伦·阿尔达 奥斯汀·斯托维尔', '英语', '2015', '0', '/data/images/569c671760969.jpg', '欧美', '2016-01-18 12:16:25', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1784', '007：幽灵党', '<div class=\"endtext\">这一集007电影将首次聚焦邦德的童年。詹姆斯·邦德是在苏格兰长大的孤儿，天幕庄园承载着他童年的记忆。天幕庄园炸毁之际，唯有一张幸存的老照片令邦德难以释怀。照片上，邦德父亲站在邦德和另一个孩子中间，那个孩子的身份令人生疑，他为何会与邦德家人留下合影，他是否与幽灵党有着千丝万缕的关系？邦德行为背后复杂的生活轨迹，在幽远静穆的天幕庄园里，失去父母的邦德童年里，或许布满了荆棘和陷阱。这段让邦德欲言又止的童年，也许正注定了他的一生将在心灵风暴中与肉体磨炼中度过，最终或沉沦、或带着无数伤痕超越自我。</div>', '丹尼尔·克雷格 莫妮卡·贝鲁奇 克里斯托弗·瓦尔兹', '英语', '2015', '0', '/data/images/569b53a2bdb5b.jpg', '欧美', '2016-01-17 16:43:12', '1', '0', '0', '706', '动作片', 'BD版');
INSERT INTO `movie` VALUES ('1785', '新律政英雄电影版', '<div class=\"endtext\">2014年同名作品的电影版，由铃木雅之执导，福田靖编剧，木村拓哉，北川景子，杉本哲太，吉田羊等人主演。 该片以东京地方检察院城西支部为舞台，以检察官久利生公平和城西支部所属成员们为刻画对象的系列群像剧。</div>', '木村拓哉 北川景子 杉本哲太 滨田岳 正名仆蔵', '日语', '2015', '0', '/data/images/5699aa57db639.jpg', '日本', '2016-01-16 10:26:33', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1786', '师父', '<div class=\"endtext\">民国年间南派咏春传人陈识（廖凡 饰）来到天津，结识了天津武术泰斗郑山傲（金世杰 饰），为在武术界开馆立足，郑山傲建议陈识用教徒弟踢馆的传统方式达成目的。几经周折，陈识娶了一名天津绝色女子赵国卉（宋佳 饰）为妻，还收下了本地青年耿良辰（宋洋 饰）为徒代其踢馆，夫妻二人暂居在贫民窟，防被踢馆的仇家前来寻仇。陈识与妻子原本看不上好斗好色的耿良辰，但接触后也发觉了耿良辰的可取之处。但随着第八家武馆邹馆长（蒋雯丽 饰）和军界人士林希文（黄觉 饰）的介入，天津武术界面临着一场巨变，靠武术复兴家业的愿望、对妻子的爱意，以及作为师父的责任，让陈识陷入了两难之境。</div>', '廖凡 宋佳 蒋雯丽 金士杰 宋洋', '国语', '2015', '0', '/data/images/5698ff23c8b05.jpg', '大陆', '2016-01-15 22:16:04', '1', '0', '0', '706', '动作片', 'HD版');
INSERT INTO `movie` VALUES ('1787', '东北偏北', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 在东北地带，性侵案件频发，却始终抓不到罪犯，甚至没人能看清罪犯真容。公安队长李占山（班赞 饰）对刑侦知识没有太多认识，徒有一腔破案热情，对恶行深恶痛疾。当他遇见劳改下放的中医老教授蔡滨（李滨 饰），并与她成为破案搭档，大老粗搭档知识分子，英雄遭遇书生，彼此就成为了对方最大的问题，新鲜组合妙趣横生。在土方法和科学推理不断碰撞不断磨合下，诸多证据逐一浮现，来无影去无踪的罪犯也渐渐清晰。<br />\r\n　　灵感启发自真实事件，抓流氓抓出一段旧时代人情义理之故事。情节曲折丌过丐道颠沛，巧合中洞见丐事之必然不偶然。让人笑也让人叹。</div>', '班赞 李滨 赖迦童 战鹤文 吴优', '国语', '2015', '0', '/data/images/5698ad60a0fd2.jpg', '大陆', '2016-01-15 16:27:13', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1788', '花街柳巷', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 无论是日间或夜晚，总有不同类型的男士，在深水埗一座旧唐楼进进出出。显然这不是一座普通的唐楼，内里乾坤足以让男人们如痴如醉！唐楼的走廊布置迷幻，每一个单位的门前都布置得五光十色，更甚的是，每一道门前都站着一个衣着极度性感的女人，眼前景像足令无数男人目不暇给，这就香港著名的红灯区，一楼一凤！<br />\r\n　　丽姐(吴家丽 饰)是这座大厦的管理人，向这座大厦的妓女们收取租金。她和这里的租客感情十分要好，众人都唯丽姐马首是瞻。可是，这座大厦即将要面临被拆卸的命运，曾是江湖中人的丽姐却不会轻易就范，即使面对黑道的威吓丽姐也从容不迫。但是，她们不知道的是，死神正悄悄地向他们迫近…<br />\r\n　　一切都从妓女阿萍失踪开始。阿萍是丽姐其中一个租客，育有一个女儿小贵子。阿萍失踪的消息打乱了丽姐与众人的冬至饭局，她们起初以为是黑道为迫迁而不择手段，原想私下解决，可是众人在找寻过程中却逐渐发觉事件扑朔迷离，丽姐此时才知道，一直有不少妓女在这大厦内失踪，却竟然无人发现！丽姐不敢掉以轻心，正当她逐步接近真相之时，身边的同伴却竟相继被杀，大厦亦无故与外界隔绝！一场血腥大屠杀就此展开！<br />\r\n　　一夜之间，丽姐众人既要找出阿萍所在，亦要与看不到的凶手斗智斗力。众人更怀疑，凶手甚至隐藏于他们之中，令他们步步为营。正当凶手呼之欲出之际，一个隐藏了二十多年悲惨真相，亦逐渐被揭开…</div>', '吴家丽 洪天照 许雅婷 符晓薇', '粤语', '2015', '0', '/data/images/56987fad47172.jpg', '香港', '2016-01-15 13:12:13', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1789', '僵尸来了之伏魔夜', '<div class=\"endtext\">《僵尸来了》是一部集剧情、惊悚、喜剧于一身的僵尸题材网络系列大电影。本片主要讲述小城市惊现僵尸，主角郝帅携手肖涵联合道家传人钟叔组成除僵尸特工队，与僵尸斗智斗勇。并揭露恶道士玄贞子炼尸阴谋最后智斗可怕尸王“伏尸僵”的故事。</div>', '于海勇 汤厉昊 海萍 刘占领', '国语', '2016', '0', '/data/images/5696f7995854a.jpg', '大陆', '2016-01-14 09:19:21', '1', '0', '0', '700', '惊悚片', 'HD版');
INSERT INTO `movie` VALUES ('1790', '我的青春期', '<div class=\"endtext\">赵闪闪（包贝尔 饰）是一位单纯善良的少年，默默喜欢着美丽女孩李春霞（孙怡 饰），两人考入了同一所高中，随着时间的推移，青涩的感情渐渐生根发芽，两人之间的距离越来越近。然而，来自学校和家长的压力让赵闪闪和李春霞不得不暂时分开，他们许下承诺，共同努力考入同一所大学，再续前缘。<br />\r\n然而，赵闪闪落榜了，深受打击的他陷入了郁郁寡欢之中。经历了种种波折，赵闪闪总算进入了理想的大学，然而，随之展现的丰富多彩的大千世界让赵闪闪眼花缭乱，李春霞那美好的身影渐渐在他的脑海里模糊起来。当赵闪闪发现自己内心真正的感情之时，一切都已经来不及了。</div>', '包贝尔 孙怡 冯四', '国语', '2015', '0', '/data/images/5696f6f1c40c6.jpg', '大陆', '2016-01-14 09:16:35', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1791', '超能太监', '<div class=\"endtext\">公元1664年（崇祯十七年）三月十八，闯王李自成率领大顺军攻克北京推翻明王朝，明崇祯帝煤山上吊，留下惠妃和公主。被阉割后拥有超能力的明朝太监大宝负责照顾两个女孩，开始了寻找大宝的“宝贝”之旅。三人一路艰辛曲折，最终战胜恶敌，大宝找回自己的“宝贝”，变回了男人，并和惠妃得有一子，取名“小宝”。</div>', '高成龙 彭禺厶 刘宇珽 张珂影', '国语', '2016', '0', '/data/images/5696638511e34.jpg', '大陆', '2016-01-13 22:47:33', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1792', '鸡皮疙瘩', '<div class=\"endtext\">影片《鸡皮疙瘩》是根据R.L.斯坦的同名畅销丛书《鸡皮疙瘩》改编而来的。《鸡皮疙瘩》丛书是90后群体的一大童年记忆，故事中充斥黑暗恐怖的元素，同时超级反转的结局也让人印象深刻。电影不仅截取了书中的故事，更将作者R.L.斯坦融入情节之中。杰克·布莱克就将扮演丛书的作者斯坦。影片的故事讲述了迪兰·米内特饰演的邻居家男孩在一次偶然中，将斯坦书里奇幻而恐怖的生物带到了真实世界。为了避免这些数量巨大的恐怖怪物毁灭宁静的小镇，斯坦必须联合他的邻居和女儿进行殊死抵抗······</div>', '杰克·布莱克 迪兰·明奈特 奥德娅·拉什 艾米·莱安 李·瑞恩', '英语', '2015', '0', '/data/images/5695a52894831.jpg', '欧美', '2016-01-13 09:15:20', '1', '0', '0', '703', '魔幻片', 'BD版');
INSERT INTO `movie` VALUES ('1793', '荒野猎人', '<div class=\"endtext\"><p>该片根据Michael Punke同名小说改编，由Mark L. Smith编剧。故事讲述19世纪一个皮草猎人被一头熊所伤，他乘的船的船长试图把他带回文明世界，但形势所迫，他无法做到，于是只好雇了两个人留下，目的是让他们送这个猎人最后一程。但这两个人利欲熏心，他们把这个受伤的可怜人洗劫一空，之后把他一个人抛弃在荒凉冰冷的野外等死。然而猎人奇迹般的活了下来，之后开始寻找这两个人开始复仇…</p></div>', '莱昂纳多·迪卡普里奥 汤姆·哈迪 威尔·保尔特 多姆纳尔·格里森', '英语', '2016', '0', '/data/images/567e301bdb3a9.jpg', '欧美', '2016-01-12 16:41:34', '1', '0', '0', '707', '预告片', '预告');
INSERT INTO `movie` VALUES ('1794', '实验者', '<div class=\"endtext\">影片根据1961年耶鲁大学权利服从电击实验事件改编，实验者毫无节制地提升惩罚电压，电压早已超过人类承受的极限。每个普通人只要服从了规则，则可能无意识地变成杀手，教授由此开始怀疑人性，普通人只是受人操纵的傀儡。</div>', '塔恩·曼宁 薇诺娜·瑞德 凯南·鲁兹 安东·叶利钦 约翰·雷吉扎莫', '英语', '2015', '0', '/data/images/5694bafd2217e.jpg', '欧美', '2016-01-12 16:36:13', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1795', '假装热情', '<div class=\"endtext\">讲述的是某娱乐记者在采访现场孤军奋斗而逐渐成长的故事。</div>', '郑在咏 朴宝英 吴达洙 卓在勋 柳贤静', '韩语', '2015', '0', '/data/images/56947eb89135c.jpg', '韩国', '2016-01-12 12:19:04', '1', '0', '0', '704', '喜剧片', 'HD版');
INSERT INTO `movie` VALUES ('1796', '通灵神探', '<div class=\"endtext\">一系列手法怪异且毫无动机的连环杀人案让FBI特别行动组特工乔（杰弗里·迪恩·摩根 饰）和女搭档凯瑟琳（艾比·考尼什 饰）一筹莫展。迫于无奈，他们只得邀请隐居的通灵神探约翰（安东尼·霍普金斯 饰）重出江湖。<br />\r\n在追查线索的过程中，约翰赖以成名的读取过去、感知未来的通灵能力接连遭到挑战。藏在暗处的连环杀手（科林·法瑞尔 饰）好似开了天眼，不仅再度行凶，甚至在犯罪现场留下纸条，写明警方的到达时间进行挑衅。<br />\r\n随着案情逐渐明朗，约翰才意识到，原来这个连环杀手有着比自己更强的通灵能力，之前追查案情时所找到的“线索”，全是杀手故意留下的！就在这场灵能对决即将陷入完败之时，连环杀手却主动现身，将杀人动机与约翰痛苦的过去联系在一起。<br />\r\n横祸已至，通灵神探该如何面临这场行至绝境的通灵对决……</div>', '安东尼·霍普金斯 科林·法瑞尔 杰弗里·迪恩·摩根 玛丽·谢尔顿', '英语', '2015', '0', '/data/images/56947df41831c.jpg', '欧美', '2016-01-12 12:15:50', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1797', '陪安东尼度过漫长岁月', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 影片根据安东尼的同名畅销作品改编。讲述的是关于一个男生从20岁到23岁、从大学到工作、从国内到国外的生活片段及内心感悟。安东尼（刘畅 饰）是一个不特别、不会说很酷话的普通男生，在20岁的时候从大连留学墨尔本，并遇到了小萱（唐艺昕 饰）、家明（白举纲 饰）、小黑（宋芸桦 饰）、Pierre（布鲁斯 饰）等一众好友。在这漫长岁月里，发生了一系列或浪漫、或甜蜜、或可笑、或感人的故事。而他同时也记挂着远在日本的小樱（白百何 饰），时隔两年后在东京相见的他们，会发生怎样的故事……</div>', '刘畅 白百何 唐艺昕 白举纲 金世佳', '国语', '2015', '0', '/data/images/567e3e0e04519.jpg', '大陆', '2016-01-10 10:10:07', '1', '0', '0', '702', '爱情片', 'HD版');
INSERT INTO `movie` VALUES ('1798', '人质', '<div class=\"endtext\">沉湎于毒品的单身母亲阿什利·史密斯（凯特·玛拉 Kate Mara 饰）在自己家中，被忽然闯入的黑人男子布莱恩·尼科尔斯(大卫·奥伊罗 David Oyelowo 饰）劫为人质，布莱恩是一名越狱的逃犯，警方还认为他杀害了审查他案件的法官。然而，这段劫持与被劫持的经历最终让他们拯救了彼此的人生。<br />\r\n本片改编自《意外的天使》，由阿什利·史密斯根据亲身经历所著。</div>', '凯特·玛拉 大卫·奥伊罗 迈克尔·威廉姆斯 咪咪·罗杰斯 蕾奥娜·维埃拉', '英语', '2015', '0', '/data/images/5691bd2d075c6.jpg', '欧美', '2016-01-10 10:08:45', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1799', '神探夏洛克', '<div class=\"endtext\">《神探夏洛克》（Sherlock）2016年推出特别篇，福尔摩斯回归原著维多利亚时代，调查一宗神秘的幽灵新娘谋杀案。Thomas Ricoletti惊讶地发现，几小时前自杀身亡的妻子Emelia Ricoletti身着旧婚纱再次出现了，她的幽灵带着强烈的复仇欲望在街上徘徊。从迷雾笼罩的莱姆豪斯到被废弃的教堂深处，福尔摩斯、华生以及他们的朋友不得不想尽办法对付这个“从坟墓里爬出来”的敌人，但最终的真相却出乎所有人的意料…</div>', '本尼迪克特·康伯巴奇 马丁·弗瑞曼 鲁珀特·格雷夫斯', '英语', '2016', '0', '/data/images/568a2f7495b56.jpg', '欧美', '2016-01-08 10:07:11', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1800', '我的少女时代', '<div class=\"endtext\">成功白领林真心（陈乔恩 饰）因被上司压迫、下属吐槽，陷入了少女时代的深深回忆。原来曾是平凡少女（宋芸桦 饰）的真心有着一段爆笑却有充满甜蜜的初恋回忆。少女真心曾经暗恋校草欧阳非凡（李玉玺 饰），却总是不敌校花陶敏敏（简延芮 饰）的魅力，令她苦恼不已，一次意外却让她与校霸徐太宇（王大陆 饰）组成了“失恋阵线联盟”，他们势要夺爱，上演了一幕幕生猛、搞笑的青春趣事，而在相处中两人的情感也发生了微妙的变化……若干年后，来到成人世界的林真心又能否重拾初心呢？</div>', '宋芸桦 王大陆 李玉玺 陈乔恩 简廷芮 刘德华', '国语', '2015', '0', '/data/images/56860c88a12b1.jpg', '大陆', '2016-01-04 16:35:28', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1801', '吉祥酒店', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 音乐创作人黄立民来到马来西亚，被一所古老大宅吸引，还结识一名内向的小说家阿牛，立民决定留下来创作一首未完成的歌曲。<br />\r\n&nbsp;&nbsp;&nbsp; 偶然的机会，立民救了摄影师比堤和模特儿比蒂。这四人在古老大宅遇到很多奇异怪诞的事情，并引来古老大宅的看守人包公和神秘的龙婆关注。 同时又遇上30年前死在大宅里的香港粤剧红伶陈小蝶，四人被小蝶悲惨的往事打动，不禁仗义为她寻找当年杀害她的真凶。 他们往找私家侦探叶志远，希望他能帮小蝶翻案，但志远不相信鬼神之说，没有受理。 他们唯有到处找线索，终发现……</div>', '周柏豪 连诗雅 罗兰 卢海鹏 艾威', '国语/粤语', '2015', '0', '/data/images/5684faa747426.jpg', '香港', '2015-12-31 18:04:43', '1', '0', '0', '700', '惊悚片', 'BD版');
INSERT INTO `movie` VALUES ('1802', '精灵旅社2', '<div class=\"endtext\">人类青年乔纳森（安迪·萨姆伯格 Andy Samberg 配音）与吸血鬼梅菲丝（赛琳娜·戈麦斯 Selena Gomez 配音）婚后生下了混血儿子丹尼斯。精灵旅社也放宽了入住规则，面向人类游客开放，生意更加兴隆。吸血鬼公爵德古拉（亚当·桑德勒 Adam Sandler 配音）用尽浑身解数，只为激发孙子丹尼斯的吸血鬼潜能。德古拉的老爸弗拉德（梅尔·布鲁克斯 Mel Brooks 配音）突然造访，古板的弗拉德无法接受孙女与人类相爱，一怒之下决定毁掉旅社，精灵旅社顿时人仰马翻。就在这时，丹尼斯的身体却发生了奇妙的变化……</div>', '亚当·桑德勒 安迪·萨姆伯格 赛琳娜·戈麦斯 凯文·詹姆斯', '英语', '2015', '0', '/data/images/567e2d921d7c0.jpg', '欧美', '2015-12-30 18:09:15', '1', '0', '0', '705', '动画片', 'HD版');
INSERT INTO `movie` VALUES ('1803', '落跑吧爱情', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 《落跑吧爱情》是由任贤齐自导自演，舒淇、狄龙、九孔联合主演的一部爱情喜剧片。影片讲述了一个富家女千里逃婚，因缘巧合邂逅澎湖岛，一路遭遇穷光蛋阿武的追爱，个性完全相反的两个人上演了一系列啼笑皆非的故事。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 这年夏天，娇气的千金小姐纷纷（舒淇 饰）因逃避家人催促婚姻，戴着外婆留下的一卷录音带，一路找到澎湖打算体验歌里描述的风情。迎接她的民宿主人阿武（任贤齐 饰），正面临民宿被弟弟（李国毅 饰）抵押投资失败，民宿因此即将遭查封，这事件令平时深居简出的民宿大家长（狄龙 饰）震怒。纷纷与阿武一家人连日相处，试图协助阿武一家人让民宿免被查封。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 然而，家人正在飞往澎湖的飞机上，法院的封条即将贴上民宿门窗，他们能突破难关留住民宿与两人日渐萌芽的好感吗？</div>', '任贤齐 舒淇 九孔 李国毅 马念先', '国语', '2015', '0', '/data/images/567e30783e703.jpg', '台湾', '2015-12-30 12:55:11', '1', '0', '0', '702', '爱情片', 'BD版');
INSERT INTO `movie` VALUES ('1804', '解救吾先生', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 春节假期的夜晚，市中心的酒吧一条街繁华喧嚣，香港电影明星吾先生（刘德华 饰）走出酒吧就被冒充警察的张华（王千源 饰）一伙人持枪绑架到一个与世隔绝的郊外小院里。吾先生意外发现绑匪还绑架了另外一个人质小窦（蔡鹭 饰）经过与张华的一番谈判，吾先生将小窦从死亡线拉回。两人开始了争取生机并相依为命的惊险20小时。<br />\r\n&nbsp;&nbsp;&nbsp; 接到报案的警方迅速组织最强警力，刑警队长刑峰（刘烨 饰）和曹刚（吴若甫 饰）联手展开侦破工作。但狡猾狂妄的绑匪张华有很强的反侦察能力，对同伙和人质也都不讲规矩，单独出门与吾先生的好友（林雪 饰）交收赎款。但是他在取得赎金之际交代同伙到晚上九点，无论能不能拿到赎金都要将人质杀害。<br />\r\n&nbsp;&nbsp;&nbsp; 经过几番侦查和对抗，警方掌握了张华的行踪，邢峰和曹刚精准配合，在极度危险的情况下将张华抓获。此事离绑匪约定好的撕票时间还剩下两个小时。深夜九点即将到来，邢峰和曹刚再次联手与垂死挣扎的张华展开心里较量，并在最后时刻找到突破口，但张华的同伙却打算提早撕票……<br />\r\n影片改编自2004年的“吴若甫绑架案”。</div>', '刘德华 刘烨 吴若甫 王千源 林雪', '国语', '2015', '0', '/data/images/567e2fbfa2f9f.jpg', '大陆', '2015-12-30 12:54:27', '1', '0', '0', '699', '剧情片', 'BD版');
INSERT INTO `movie` VALUES ('1805', '一个勺子', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 影片根据短篇小说《奔跑的月光》改编，陈建斌自编自导自演的处女作。<br />\r\n&nbsp;&nbsp;&nbsp; 农民拉条子（陈建斌 饰）在镇上遇到一个讨饭的傻子（金世佳 饰），傻子跟着他回了家。拉条子贴了寻人启示，不久有人认领了傻子。紧接着又有自称傻子的家人陆续出现，说拉条子把傻子卖了。麻烦接踵而至，拉条子自知上当受骗却有口难言，他想不明白，好事怎么就成了坏事？他开始以一位农民最淳朴的办法想自证清白。而为了寻找傻子，他成了另一个到处缠着别人的傻子……</div>', '陈建斌 蒋勤勤 王学兵 金世佳', '国语', '2015', '0', '/data/images/567e233c36f96.jpg', '大陆', '2015-12-30 12:45:35', '1', '0', '0', '699', '剧情片', 'HD版');
INSERT INTO `movie` VALUES ('1806', '海贼王', '<div class=\"endtext\"><p>财富，权力，曾经拥有一切的海贼王戈尔多·罗杰，在临死前畱下暸一句话：“想要我的财富吗？那就去找吧，我的一切都在那裏，在那伟大的航道！”于是越来越多的人奔嚮大海，驶入伟大的航道，世界迎来暸大海贼时代！</p>\r\n<p>很多年后，一个小孩对这一个断暸手臂的海贼髮誓：“我一定要成为海贼王！”于是10年后，一个伟大的传说开始暸。</p>\r\n<p>这是个关于一群爱做梦孩子的故事，他们拥有热情，他们拥有毅力，他们拥有伙伴......&nbsp; </p>\r\n<p>《海贼王》：本理想成为海贼王的路飞，误食了香克斯（有版本翻译成“杰克”）收藏的恶魔果实，而变成了橡皮人，恶魔果实的副作用却使他永远不能游泳。</p>\r\n<p>不过他的理想仍然没有改变——成为海贼王，并且找到传说中哥尔·D·罗杰的秘宝-One Piece，冒险就此开始了……</p>\r\n<p>在某个时代海贼是个光荣而又快乐的职业，虽然政府并不支持他们，但是海上的风浪和海上的美丽还是将无数人，特别是男人的梦想完全地吸引了进去。在这个时代的某一天，海盗业忽然疯狂了起来，原来一个著名的大海盗在临刑前忽然说出了他的秘密：他将他那无法衡量的财产藏在了某个小岛上，而去这个小岛的路线就叫伟大航线——One Piece！</p>\r\n<p>路飞所生长的小村庄里曾经是一群以“红发香克斯”为首的海盗们的暂居地，而小小的路飞一直希望自己可以成为他们的一员，可惜，在一次非常意外的情况下，他吃了一种叫做“橡皮果实”的恶魔果实而变成了橡皮人，恶魔果实给予了他奇特的本领，但是吃了恶魔果实的人是再也无法学会游泳的……</p>\r\n<p>“没有关系，我只要不掉到海里去就行了……”天性乐观单纯的路飞并没有放弃他的海盗之路，他和香克斯约好，总有一天他会集齐伙伴，成为海贼王。</p>\r\n<p>怀揣着对这个世界的憧憬和对自己梦想的执著，路飞长大以后摇着条小船就出海了，这一路上还真让他找到了许多身怀绝技的朋友：目标成为第一剑客的索隆，有着非常优秀的航海直觉的娜美，一流的海上厨师香吉士，特别善于说大话的乌索普，一流的船医驯鹿乔巴，成熟富有女人味的考古学家罗宾，以及顶级的船匠弗兰克，和立志与鲸鱼拉布重逢的骷髅音乐家布鲁克。当然要得到这些伙伴是非常不容易的，路飞一路千辛万苦地和他所遇到的敌人们战斗着，他最大的长处就是那笑对死亡和永不言败的精神！</p>\r\n<p>伟大航路！这是一个任凭再优秀的海盗也无法预料其危险的地方，这是一个埋葬了无数的厉害人物的地方，这是一个摧毁人类一切常识信心和勇气的地方……可是路飞他们终于进入了，One Piece的故事将要完全展开了。</p></div>', '田中真弓 中井和哉 山口胜平 大谷育江', '日语', '1999', '0', '/data/images/5695b14620372.jpg', '日本', '2016-06-19 18:22:47', '24', '0', '0', '708', '动漫', '更新至746集');
INSERT INTO `movie` VALUES ('1807', '龙珠超', '<div class=\"endtext\"><p>《龙珠》远负盛名，代表了一代人，自然是神作，而自负“超”字的本作，便是超神作了。《龙珠》整体上保持着打来打去的节奏一步步发展，从“赛亚人”这一设定出现以来经历了“超级赛亚人”、“超一”、“超二”等等直到最新的“超赛神SS”，打得地球是千疮百孔，反正地球也渐渐满足不了他们了。这种纯粹的娱乐体验是《龙珠》最显著的特征，鸟山明老师自称不擅长感情戏，便将娱乐做得更为纯粹，能从姿势中捕捉出速度与力量，从对射中感受到气势与心情，连篇的动作戏却不会让人无聊，这是《龙珠》最为成功的一点。</p>\r\n<p>在角色塑造方面，鸟山明老师也对悟空提出了一些见解，他对赛亚人越来越夸张的形象感到不满，因此“超赛神”的造型单纯是出于一种“把头发简短”的心情，而从 “超赛神”到“超赛神SS”这种红蓝发色的转变也为广大网友调侃，也算是贯彻了“娱乐”的使命。在《龙珠超》中，除了破坏神比鲁斯还有复活的弗利萨之外或许还会出现“远超布欧”的角色，究竟会使用怎样的单位去描述新角色的战斗力令人期待。</p>\r\n<p>动画的改编方面，监督地冈公俊有丰富的演出、分镜经验，而悟空也沿用了老牌声优野泽雅子，也辛苦这位79岁高龄的第一代声优了。</p></div>', '野泽雅子 堀川亮 鹤弘美 草尾毅 古川登志夫', '日语', '2015', '0', '/data/images/5695b056924b1.jpg', '日本', '2016-06-19 18:22:24', '24', '0', '0', '708', '动漫', '更新至48集');
INSERT INTO `movie` VALUES ('1808', '名侦探柯南', '<div class=\"endtext\"><p>工藤新一，米花高中二年极学生，与小兰是青梅竹马，两人感情很好。继续了父亲的超强推理能力，被誉为高中生名侦察。他喜欢看推理小说，最崇拜福尔摩斯，另外踢足球的水平也是一流。不幸被卷入黑衣组织的交易被灌下毒药APTX4869，但是没有死，只是变成了小孩，改名江户川柯南（取自两个侦察小说里的人名）。幸亏智力没有衰退，还可以帮着毛利小五郎办案以寻找黑衣组织的线索，而体力上的不足靠阿栗博士的发明来弥补。变小后就读于米花小学1年纪B班，熟悉了步美、元太、光彦三人，还成立了少年侦察团。不管是变小前后，都是音痴，唱歌走音非常夸张。★★知道他真实身份的有：阿栗博士、他父母（听博士说的）、服部平次（与柯南一起破案过程中自己发现的）、怪盗Kid（与柯南的较量中自己发现的）、灰原哀（变小前奉黑衣组织之命调查新一时发现的）。因为变小后有和小兰一起洗澡，还睡同一张床，所以柯南最怕自己的真实身份被小兰知道，否则小兰的空…</p></div>', '工藤新一', '日语', '1996', '0', '/data/images/5691c03470186.jpg', '日本', '2016-06-19 18:22:03', '24', '0', '0', '708', '动漫', '更新至834集');
INSERT INTO `movie` VALUES ('1809', '火影忍者', '<div class=\"endtext\"><p>十多年前一只拥有巨大威力的妖兽“九尾妖狐”袭击了木叶忍者村，当时的第四代火影拼尽全力，以自己的生命为代价将“九尾妖狐”封印在了刚出生的鸣人身上。木叶村终于恢复了平静，但村民们却把鸣人当成像“九尾妖狐”那样的怪物看待，所有人都疏远他。</p>\r\n<p>鸣人自小就孤苦无依，一晃十多年过去了，少年鸣人考入了木叶村的忍者学校，结识了好朋友佐助和小樱。佐助是宇智波家族的传人之一，当他还是小孩的时候他的哥哥——一个已经拥有高超忍术的忍者将他们家族的人都杀死了，然后投靠了一直想将木叶村毁灭的大蛇丸，佐助自小就发誓要超越哥哥，为家族报仇。</p>\r\n<p>鸣人他们在忍者学校得到了教官卡卡西的精心指点，在他的帮助下去迎接成长中的一次又一次挑战！</p></div>', '旋涡鸣人 宇智波佐助 春野樱', '日语', '2002', '0', '/data/images/567e3fb9ea4a1.jpg', '日本', '2016-06-18 23:05:23', '24', '0', '0', '708', '动漫', '更新至685集');
INSERT INTO `movie` VALUES ('1810', '甲铁城的卡巴内瑞', '<div class=\"endtext\"><p>全世界被产业革命的波澜推动，自近世变迁至近代之时，不死的怪物突然出现。被钢铁的皮膜包覆，只要心脏不被破坏就不会消灭，被它啃咬的人似乎也会在死过一次之后复生，并开始袭击人类。之后被称为卡巴内的这些怪物爆发性地增殖，并覆盖了全世界。</p>\r\n<p>远东岛国日本的人们，为了对抗卡巴内的威胁而在各地建造名为“驿”的城寨，并困守在其中，想方设法残存下去。能够在驿之间来往的只有装甲蒸汽机车（通称骏城），驿之间通过各自生产物的融通，总算是保证了生活。</p>\r\n<p>住在以炼铁和蒸汽机的生产为业的显金驿的蒸汽锻冶少年，生驹。他为了打倒卡巴内，开发出独自的武器“贯筒”，同时期盼着有朝一日能够发挥出自己的力量。</p>\r\n<p>某天，穿越前线的骏城之一甲铁城来到了显金驿。为了车辆的清扫整备而被召唤的生驹，目击到了从义务性的卡巴内检阅中被免除的不可思议少女。</p>\r\n<p>当晚，生驹与自称为无名的那位白天的少女再会，此时骏城突然暴走并突入了显金驿。乘务员全灭，而且全部变成了卡巴内！</p>\r\n<p>卡巴内从显金驿中溢出。如同要从被恐慌袭击的人浪中逆行一般，生驹奔跑着。这一次不能逃避，我要，我要用贯筒打倒卡巴内！</p>\r\n<p>——于是，为了成为真正能闪耀光辉的男人，生驹的战斗开始了。</p></div>', '畠中祐 千本木彩花 内田真礼 增田俊树', '日语', '2016', '0', '/data/images/572dd7f545333.jpg', '日本', '2016-06-17 09:49:56', '24', '10', '12', '708', '动漫', '更新至10集/共12集');
INSERT INTO `movie` VALUES ('1811', '地狱归来', '<div class=\"endtext\">三个打小一块儿长大的好伙伴雷米（斯旺森配音）、奥吉（T.J.米勒配音）以及科特（里格尔配音）的“生死之旅”。当科特被损友不小心传送进地狱后，两位好基友雷米和奥吉发誓要不计一切代价把他从地狱大魔王手里给“捞”出来。</div>', '尼克·斯旺森 米拉·库尼斯 鲍勃·奥登科克 T·J·米勒 罗伯·里格尔', '英语', '2015', '0', '/data/images/56e63a8c580f8.jpg', '欧美', '2016-03-14 12:14:04', '24', '0', '0', '708', '动漫', 'HD版');
INSERT INTO `movie` VALUES ('1812', '年兽大作战', '<div class=\"endtext\"><p>“过大年”，是中国人一年到头最重要的事，也是维系中国人情感的纽带。可天宫里的年兽（雷佳音 配音）却并不爱过年！为了取消春节，年兽险些捅下大篓子，他不得不来到人间，结识了小女孩沙果（周冬雨 配音）。一个超级大坏蛋和叛逆小萝莉的奇幻之旅即将开始，一场欢乐热闹的爆笑喜剧就此展开……</p></div>', '雷佳音 周冬雨 陈赫 陶虹 郭涛', '国语', '2016', '0', '/data/images/56e3f06dc3eb8.jpg', '大陆', '2016-03-12 18:33:19', '24', '0', '0', '708', '动漫', 'HD版');
INSERT INTO `movie` VALUES ('1813', '鼠来宝4:萌在囧途', '<div class=\"endtext\"><p>《鼠来宝4：萌在囧途》还是以三只可爱的花栗鼠为主角，讲述了花栗鼠艾文（贾斯汀·朗 Justin Long 配音）、赛门（马修·格雷·古柏勒 Matthew Gray Gubler 配音）以及喜多（杰西·麦卡尼 Jesse McCartney 配音）由于一系列误会，以为它们的主人大卫（杰森·李 Jason Lee 饰）要在迈阿密向其新女朋友求婚，并有可能抛弃它们。它们得赶往迈阿密，找到大卫并阻止求婚。因为这样不仅不会失去大卫，还可能避免获得一位可怕的伙伴 ——大卫新女友的“小恶魔”儿子。一场跨越美国的音乐之旅即将爆笑启程</p></div>', '贾斯汀·朗 马修·格雷·古柏勒 杰西·麦卡尼', '英语', '2015', '0', '/data/images/56de319aac2fe.jpg', '欧美', '2016-03-08 09:57:47', '24', '0', '0', '708', '动漫', 'BD版');
INSERT INTO `movie` VALUES ('1814', '熊出没之熊心归来', '<div class=\"endtext\"><p>每年雨季前熊大都会带领动物们对狗熊岭堤坝进行修缮加固，但是小动物们偷懒拖沓，让熊大日渐不满。一日暴雨突降，堤坝倒塌，熊大愤然离开家园，没想到却被泥石流冲走。当它醒来时发现自己在一个落魄的马戏团里，一场偶然表演救场，让熊大被留下，成为马戏团的一员。而同时，森林里的动物们却一个接一个神秘失踪……</p>\r\n<p>熊大用自己的方式表演马戏，虽然与马戏团中动物们的头儿黑猩猩之间爆发冲突，但是获得成功并成为大明星的快感，让它渐渐习惯这里的新生活，渐渐忘记了森林以及森林的小伙伴们。</p>\r\n<p>一日，焦急的熊二终于找到了熊大并希望它跟自己回家，但是熊大拒绝。而后黑猩猩化解熊大和小动物表演的意外，也让熊大了解了黑猩猩的苦衷。</p>\r\n<p>但此时马戏团背后的秘密渐渐露出端倪，熊大面临两难的选择：逃避，继续自己安逸的明星生活？还是面对，做回“熊大”站出来对抗？ 被光头强意外搭救后,它准备反省自己，找回责任，做回“熊大”站出来对抗！</p>\r\n<p>于是在盛大的嘉年华马戏表演的舞台上，熊大带领动物们上演了一场别开生面的胜利大逃亡，奔向自由 ！</p></div>', '张伟 张秉君 谭笑', '国语', '2016', '0', '/data/images/56dd2d86447c7.jpg', '大陆', '2016-03-07 15:28:06', '24', '0', '0', '708', '动漫', 'HD版');
INSERT INTO `movie` VALUES ('1815', '摩登原始人：石器时代大乱斗', '<div class=\"endtext\"><p>当弗雷德不小心把家人出去旅游度假的钱弄丢的时候，他开始计划用他的头脑把钱再弄回来。他打算举办一场空前的摔跤赛事，并说服一直都是他最好的朋友 BarneyRubble（KevinMichaelRichardson配音）成为职业摔跤选手，他甚至作为发起人邀请那些非常受欢迎的摔跤选手加入，包括JohnCenastone（约翰·塞纳配音）和TheUndertaker（马克·卡拉韦配音）。这场赛事引发了人群的沸腾，人们疯狂的从售票口涌入赛场，同时赛事的火爆也引起了世界摔角娱乐（WWE）总裁VinceMcMagma（文斯·麦克马宏配音）的目光。该片由许多WWE摔跤手和相关人员为其人物提供他们的声音。</p></div>', '约翰·塞纳 妮可·加西亚 CM朋克', '英语', '2015', '0', '/data/images/56cdb488cba36.jpg', '欧美', '2016-02-24 21:48:20', '24', '0', '0', '708', '动漫', 'BD版');
INSERT INTO `movie` VALUES ('1816', '史努比：花生大电影', '<div class=\"endtext\">总是闹出一堆笑话的查理·布朗（诺亚·施纳普 Noah Schnapp 配音）这一次有了暗恋的“红发小女孩”（弗朗西斯卡·卡帕尔迪 Francesca Capaldi 配音），他能否获得她的注意呢？而史努比（比尔·莫伦茨 Bill Melendez 配音）也将自己的幻想能力升级，变成王牌飞行员，飞上蓝天追逐自己的头号敌人“红色男爵”，还邂逅了梦中情人“菲菲”（克里斯汀·肯诺恩斯 Kristin Chenoweth 配音）……</div>', '诺亚·施纳普 比尔·莫伦茨 弗朗西斯卡·卡帕尔迪 马里埃尔·希茨', '英语', '2015', '0', '/data/images/5691c386e4b87.jpg', '欧美', '2016-02-19 23:31:31', '24', '0', '0', '708', '动漫', 'BD版');
INSERT INTO `movie` VALUES ('1817', '蝙蝠侠：血脉恩仇', '<div class=\"endtext\"><p>老爷(Batman/Bruce Wanye)离奇失踪，在管家(Alfred Pennyworth)对外掩盖此事的同时大少(Nightwing/Dick Grayson)和四少(Robin/Damian Wayne)不得不担起保卫哥谭的重任。与此同时，母蝙蝠(Batwoman/Kathy Kane)与蝙蝠翅(Batwing/Luke Fox)等也开始插手这一事件</p></div>', '斯图尔特·艾伦 莫蕾娜·巴卡林 盖乌斯·查尔斯 杰森·奥玛拉 肖恩·马希尔', '英语', '2016', '0', '/data/images/56a324d80c5c3.jpg', '欧美', '2016-01-23 14:59:36', '24', '0', '0', '708', '动漫', 'BD版');
INSERT INTO `movie` VALUES ('1818', '大圣归来', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 大闹天宫后四百年多年，齐天大圣成了一个传说，在山妖横行的长安城，孤儿江流儿（林子杰 配音）与行脚僧法明（吴文伦 配音）相依为命，小小少年常常神往大闹天宫的孙悟空（张磊 配音）。<br />\r\n&nbsp;&nbsp;&nbsp; 有一天，山妖（吴迪 配音）来劫掠童男童女，江流儿救了一个小女孩，惹得山妖追杀，他一路逃跑，跑进了五行山，盲打误撞地解除了孙悟空的封印。悟空自由之后只想回花果山，却无奈腕上封印未解，又欠江流儿人情，勉强地护送他回长安城。<br />\r\n&nbsp;&nbsp;&nbsp; 一路上八戒（刘九容 配音）和白龙马也因缘际化地现身，但或落魄或魔性大发，英雄不再。妖王（童自荣 配音）为抢女童，布下夜店迷局，却发现悟空法力尽失，轻而易举地抓走了女童。悟空不愿再去救女童，江流儿决定自己去救。<br />\r\n&nbsp;&nbsp;&nbsp; 日全食之日，在悬空寺，妖王准备将童男童女投入丹炉中，江流儿却冲进了道场，最后一战开始了……</div>', '张磊 林子杰 吴文伦 童自荣 刘九容', '国语', '2015', '0', '/data/images/569cc47fb19bd.jpg', '大陆', '2016-01-18 18:54:57', '24', '0', '0', '708', '动漫', 'HD版');
INSERT INTO `movie` VALUES ('1819', '一线娱乐', '<div class=\"endtext\">娱乐资讯杂志式节目《一线娱乐》正式开催！卫志豪、周奕玮、谢文欣、梁丽翘为观众多方位了解娱乐圈最新动向，剖析皇牌剧集及综艺娱乐节目制作背后，鲜为人知的故事，直击闲人免进的拍摄现场，解构当中秘密。<br />\r\n撇开剧集及综艺节目的“世界”，港人对艺员的其他范畴也大感兴趣，《一线娱乐》为你喜爱的艺人送上生日祝福，并将艺员的欢乐透过大气电波与大家分享。另外，TVB艺人多才多艺，节目为他们度身订造一些考验，测试他们的实力，艺员们必以精湛表现赢得更多电视迷的芳心。<br />\r\n有《一线娱乐》，少不免有一线主角及红星接受专访，剖白自己的深心处。记住《一线娱乐》，逢星期“一”看尽无“线”电视的“娱乐”资讯！</div>', '周奕玮 卫志豪 谢文欣 梁丽翘', '粤语', '2015', '0', '/data/images/56946a42ec60a.jpg', '香港', '2016-06-21 09:19:19', '25', '0', '0', '709', '综艺', '更新至38集');
INSERT INTO `movie` VALUES ('1820', 'Sunday好戏王', '<div class=\"endtext\"><p>继《Sunday扮嘢王》、《Sunday靓声王》后，TVB延续周日“王者”系列，呈献全新游戏节目《Sunday好戏王》，邀请TVB一众“好戏”艺人，透过不同的游戏环节大斗演技，并将欢乐带给每位观众！</p>\r\n<p>《Sunday好戏王》由主持森美、陈敏之坐镇，每星期召集四位“好戏王”驾临。TVB艺员多才多艺，四位嘉宾会先来一个维肖维炒的“扮嘢热身赛”，展示出场“戏势”！他们接着会接受多个“斗戏”挑战，包括“我系大话精”、“七情上面报新闻”、“我对手唔系人”、“认真谷戏”、“扮Friend食老虎”、 “讲一套做一套”，以无比“戏力”、深厚“戏功”博取嘉宾评判的欢心，争夺每个回合的丰富奖品。</p>\r\n<p>此外，TVB戏剧组卧虎藏龙，好些在电视剧中未必显眼的绿叶角色，都起着不可或缺的作用。节目特别向这群“另类好戏王”致敬，加深剧迷对他们的认识。另外，一班近年毕业的艺训班同学亦会带来歌唱、舞蹈等不同表演，展示潜藏体内的演艺天份，为每集节目暖场，率先掀起激烈“戏氛”！</p></div>', '森美 陈敏之', '粤语', '2016', '0', '/data/images/569d90d3ca554.jpg', '香港', '2016-06-20 09:13:37', '25', '0', '0', '709', '综艺', '更新至19集');
INSERT INTO `movie` VALUES ('1821', '学是学非S4', '<div class=\"endtext\"><p>“是非之地”遍布全世界，又岂止香港一处，梁嘉琪、李佳芯(Ali)、黄心颖(Jacqueline)、麦美恩(Mayanne)、张秀文(Sammi) 和汤洛雯(Roxanne)六名“是非精”，眼见家乡的是与非已难以“喂饱”她们的“是非之欲”，索性冲出香港“揾是揾非”！ </p>\r\n<p>    “是非精”强势回归，一起踏足外地，从各地特色中寻找科学资讯。汤兆升、黄健耀、吴恒亮、曾明蕙、陈钧杰等专家学者，以及“神出鬼没”的Captain森美，继续提供可靠的“技术支援”，结合各项有趣的实验，深入浅出地拆解健康、生活等方面的“是”与“非”，以科学角度辩证谬误。 </p>\r\n<p>除了科学之外，法律、文字、俗语等文科范畴亦多生“是非”，“是非精”势必发挥所长，在这些领域中发掘更多、更新的题材。一向颇受欢迎的中文正字、俗语解说等环节陆续有来，依旧由人气甚高的欧阳伟豪讲解。</p></div>', '梁嘉琪 李佳芯 黄心颖 麦美恩 张秀文 汤洛雯', '粤语', '2016', '0', '/data/images/569a14aba971a.jpg', '香港', '2016-06-20 09:12:43', '25', '0', '0', '709', '综艺', '更新至20集');
INSERT INTO `movie` VALUES ('1822', '奔跑吧兄弟第四季', '<div class=\"endtext\"><p>《奔跑吧兄弟第四季》是浙江卫视引进韩国SBS电视台综艺节目《Running Man》推出的大型户外竞技真人秀节目，由浙江卫视节目中心制作。节目共12期，第四季七位固定主持仍是邓超、Angelababy（杨颖）、李晨、陈赫、郑恺、王祖蓝、鹿晗。《奔跑吧兄弟》每期节目有不同的主题，分为不同的队伍进行比赛，明星们需要根据各种线索来破解最终的谜题，最后获胜一方将获得称号或奖品。《奔跑吧兄弟第四季》于2016年4月15日每周五晚21:10接档《王牌对王牌》、《二十四小时》在浙江卫视首播。</p></div>', '邓超 Angelababy 李晨 陈赫 郑恺 王祖蓝 鹿晗', '国语', '2016', '0', '/data/images/5711b7b3312c7.jpg', '大陆', '2016-06-18 00:17:46', '25', '0', '0', '709', '综艺', '更新至10集');
INSERT INTO `movie` VALUES ('1823', '乜都搞掂晒', '<div class=\"endtext\"><p>《乜都搞掂晒》（英语：My Handy Man）是香港电视广播有限公司的生活资讯节目，由薛家燕、岑丽香、林颖彤、张致恒、魏焌皓担任主持。</p></div>', '薛家燕 岑丽香 张致恒 林颖彤 魏焌皓 陈展鹏', '粤语', '2016', '0', '/data/images/575626cc5e7ce.jpg', '香港', '2016-06-17 09:02:57', '25', '0', '0', '709', '综艺', '更新至09集');
INSERT INTO `movie` VALUES ('1824', '星星探亲团粤语', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 讲述TVB的艺员来自五湖四海，部分曾经在外地成长，或者去过不同国家留学、工作。大家前往旅游的海外地方，随时是他们年轻时的家园。陈凯琳、麦美恩、沉震轩、李施嬅、苟芸慧、麦明诗、陈庭欣、陈智燊、宋熙年、蔡思贝、王贻兴、岑丽香十二位艺人，分别重返加拿大、英国、澳纽、日本，一连十五集实地回忆自己的成长日记。<br />\r\n　　每集艺人游走昔日生活的场所，在故居、学校、上班地方与好友、旧邻居、前同事、老同学聚首，甚至找回初恋情人话别往事。他们又推介私藏旅游景点，在最熟悉的地方展露生活化的一面，让大家发掘自己出道前鲜为人知的故事。一趟只凭回忆、毋须地图的旅程，正式启航！</div>', '陈凯琳 麦美恩 苟芸慧 李施嬅 岑丽香 王贻兴', '粤语', '2016', '0', '/data/images/57318717d2e15.jpg', '香港', '2016-05-31 18:56:59', '25', '0', '0', '709', '综艺', '全集/共15集');
INSERT INTO `movie` VALUES ('1825', '跟住矛盾去旅行粤语', '<div class=\"endtext\"><p>《跟住矛盾去旅行》历史性邀请多组背景矛盾对立的社会名人，一同出游外地，展开五日四夜的另类行程。</p></div>', '曾钰成 梁国雄 林日曦 蒋丽芸 邵音音 戴梦梦 连诗雅 叶蕴仪 何韵诗', '粤语', '2016', '0', '/data/images/5705b2c0ebbb7.jpg', '香港', '2016-04-24 09:42:15', '25', '0', '0', '709', '综艺', '更新至05集');
INSERT INTO `movie` VALUES ('1826', '有乜好过去camping', '<div class=\"endtext\"><p>马国明、梁烈唯、唐诗咏到德国露营，先在慕尼黑大型野外活动用品店入货，做好准备，还走入汽车博物馆稍作参观。首站到达菲希塔赫一个以玩野外活动为主的营地，三个露营初哥要先扎营，马明的男神形象在此时幻灭了！</p></div>', '马国明 梁烈唯 唐诗咏', '粤语', '2016', '0', '/data/images/57158c44903a8.jpg', '香港', '2016-04-23 10:08:04', '25', '0', '0', '709', '综艺', '更新至05集');
INSERT INTO `movie` VALUES ('1827', '为食3姊妹', '<div class=\"endtext\"><p>俗语有云“想抓住男人的心，先要抓住男人的胃”，三位入得厨房、出得厅堂的女神级人马，“高Ling”高海宁、“Selena”李施嬅及“豹嫂”胡蓓蔚，为了让厨艺更上一层楼，决定组成《为食3姊妹》，请教各路顶级厨师，钻研厨艺，让亲朋好友在她们的厨房中畅游美食世界。</p>\r\n<p>每集节目均以牛、鸡、鱼、猪等不同的食材作为主题，尝试从多方面了解食材的可塑性，深入钻研食材的处理方法，尝试中西各地特色菜肴的烹煮方法。节目亦请来几位“星级厨师”，肥妈(Maria Cordero)、陈国强、余健志(Jacky)、黎志安(Ricky)等让三位美女拜师学艺，向他们请教烹饪小贴士。</p>\r\n<p>经过一番紧凑课堂，高Ling、Selena及豹嫂亦学以致用，各自设计一道菜式，亲自下厨，宴请嘉宾好友，享受相聚一刻。</p></div>', '胡蓓蔚 李诗韵 高海宁', '粤语', '2016', '0', '/data/images/56c0832d4a8f1.jpg', '香港', '2016-04-17 09:16:31', '25', '0', '0', '709', '综艺', '更新至09集');
INSERT INTO `movie` VALUES ('1828', '在那遥远的地方‧古巴', '<div class=\"endtext\"><p>古巴是位于加勒比海北部的群岛国家，自上世纪六十年代初与美国断交后，长期面对西方的经济封锁，亦令这个岛国数十年来未能长足发展。满街五十年代的古董车、路旁尽是西班牙殖民时代遗下的特色建筑、行人呼出的雪茄烟圈；置身古巴国境，仿如走过时光隧道，回到半世纪前的光景。</p>\r\n<p>直至2014年，古巴与美国的关系开始破冰，并于2015年正式复交。随着禁制逐步解封，古巴也似乎无可避免地需要变天。继亚洲的北韩后，“旅游达人”洪\r\n永城（Tony）延续“遥远之旅”，把握国际关系的重要时刻，踏足全美洲唯一实行社会主义的铁幕国家－ \r\n古巴，亲身探索这个神秘国度、从心感受当地的风土人情。</p>\r\n<p>Tony与摄制团队引领观众游历古巴首都夏湾拿、哲古华拉长眠之地圣克拉拉等多个城市，登上顶级雪茄出产地云尼斯山谷等，从而了解古美关系改善，为古巴人民带来的影响。</p></div>', '洪永城', '粤语', '2016', '0', '/data/images/570ca7905114e.jpg', '香港', '2016-04-16 09:18:53', '25', '0', '0', '709', '综艺', '全集');
INSERT INTO `movie` VALUES ('1829', '我是歌手第四季', '<div class=\"endtext\"><p>《我是歌手》是中国首档顶级歌手音乐巅峰对决节目，前三季都带来了激烈的反响。节目由洪涛团队打造，每期邀请7位已经成名的歌手之间进行竞赛。7位歌手，七首歌，七种质感，七码荡气回肠的真实音乐大戏，首席组合羽泉获得第一季歌王称号，韩磊获得第二季歌王称号，韩红获得第三季歌王称号。</p></div>', '李玟 李克勤 信 哈雅乐团 徐佳莹 关喆 黄致列 赵传', '国语', '2016', '0', '/data/images/5699e12603be3.jpg', '大陆', '2016-04-10 21:49:25', '25', '2016', '4', '709', '综艺', '2016-04-08');
INSERT INTO `movie` VALUES ('1830', '第35届香港电影金像奖', '<div class=\"endtext\">香港的电影工业一直有赖众多幕前演员，以及幕后电影工作者的群策群力，造就香港电影数十年来佳作涌现，蜚声 ......</div>', '刘青云', '粤语', '2016', '0', '/data/images/57024f72e7158.jpg', '香港', '2016-04-04 19:43:29', '25', '0', '0', '709', '综艺', '全集');
INSERT INTO `movie` VALUES ('1831', '凑仔攻略粤语', '<div class=\"endtext\"><p>“男主外、女主内”是中国人的传统思想，而“全职妈妈”照顾子女也曾被视为正常不过的事情。然而，随着社会的不断改变，这个固有想法看来已经不合时宜。 “凑仔”再非太太们的“专利”，加上爸爸们越来越重视亲子关系，社会上涌现不少“凑仔公”，近年的演艺圈亦不乏“潮爸凑仔公”，更对宝贝子女百般关顾、呵护。</p>\r\n<p>全新亲子节目《凑仔攻略》，林盛斌（Bob）、区永权与黄长兴，以其真实爸爸的身分，透过轻松、幽默的短剧，道出“现代凑仔公”因家庭角色转变的内心挣扎、苦与乐；节目还广邀“星级”爸爸，例如麦长青、曹永廉等分享“凑仔经”，与养育、教导小朋友的看法。此外，圈中男神马国明、与好戏之人黄智贤等也会参演亲子趣剧，体验“为人父亲”感受。</p>\r\n<p>节目还会请来专家讲解育儿资讯，并示范各类育儿产品的正确使用方法。无论是已为人父、正计划生儿育女的准爸爸，或对生育仍未拿定主意的男士们，都欢迎和家庭成员一起打开这本“凑仔攻略”参详一番。</p></div>', '林盛斌 区永权 黄长兴', '粤语', '2016', '0', '/data/images/56cbb84971e94.jpg', '香港', '2016-03-05 12:03:50', '25', '0', '0', '709', '综艺', '全集/共10集');
INSERT INTO `movie` VALUES ('1832', '新春开运王', '<div class=\"endtext\"><p>新年伊始，万象更新。初踏猴年，不少市民都想快人一步掌握运程，为流年做足准备。主持农夫、黎芷珊、陈自瑶兵分几路，找来苏民峰算财运、麦玲玲测姻缘、李丞责讲文昌、李居明看家宅。这四位全港顶尖的堪舆学家，一连九集从风水、面相、术数等方面讲解开运贴士。主持又邀请多位圈中艺人出席“人气王饭局”，由几位师傅以命理角度分析嘉宾的流年运程，透过他们做例子教各位趋吉避凶。另一方面，四位大师还到访艺人家中拜年，示范利用不同的风水摆设，为“明星风水屋”延续旺势、扭转颓风！</p></div>', '黎芷珊 陈自瑶 陆永权 郑诗君', '粤语', '2016', '0', '/data/images/56babeffd1497.jpg', '香港', '2016-02-20 09:42:34', '25', '9', '9', '709', '综艺', '更新至09集/共9集');
INSERT INTO `movie` VALUES ('1833', '第58届格莱美奖颁奖典礼', '<div class=\"endtext\"><p>美国当地时间15日晚(北京时间16日上午)，2016年度第58届格莱美音乐奖的颁奖典礼将在洛杉矶的斯台普斯中心举行。泰勒·斯威夫特夺得年度专辑和最佳音乐录音带和最佳流行演唱专辑三项大奖,成为了历史上第一位两次夺得格莱美年度最佳专辑的女歌手。Justin Biber凭借《Where Are U Now》获得最佳舞曲录制奖,这是他首次获得格莱美奖。The Weekend夺得最佳R&amp;B歌手奖,Meghan Trainor获得年度新人奖。火星哥Bruno Mars和Mark Ronson的《Uptown Funk》则拿下了年度制作以及年度流行组合(合作）奖。</p></div>', '泰勒·斯威夫特', '英语', '2016', '0', '/data/images/56c735282d6fa.jpg', '欧美', '2016-02-19 23:31:04', '25', '0', '0', '709', '综艺', '全集');
INSERT INTO `movie` VALUES ('1834', '星级打工时代', '<div class=\"endtext\">年轻人对世界充满好奇，趁着青葱岁月前往不同国家，花上在一至两年时间留在当地一边打工、一边体验不一样的生活乐趣，借着working holiday找寻梦想，是难能可贵的人生经验。一班已在娱乐圈打拼多年、暂见成绩的艺人陈敏之、姚子羚、袁伟豪、罗仲谦、敖嘉年、唐诗咏、梁烈唯，以及出炉“视后”胡定欣、大马“双料”视帝陈展鹏，竟然打算暂别娱乐圈重新选择职业，在想像以外的工作环境中寻找人生得着！九位艺人成功争取宝贵的 working holiday，在马来西亚亲身投入动物义工、五星级酒店大厨、健身教练、雨林导赏员、时装设计师，以至为民拯命的消防员等行业。到底他们理想中的工作和现实可有差别？试工过程中又遇上什么困难与难忘经历？一连九集节目，以真人骚方式直击这班“星级打工仔”的工作、生活实录。</div>', '陈敏之 姚子羚 陈展鹏', '粤语', '2015', '0', '/data/images/5695a066ea520.jpg', '香港', '2016-02-17 09:38:36', '25', '0', '0', '709', '综艺', '更新至09集');
INSERT INTO `movie` VALUES ('1835', '2016国泰航空新春国际汇演之夜', '<div class=\"endtext\"><p>“2016国泰航空新春国际汇演之夜”在农历大年初一华丽登场！巡游汇演除了有13辆五光十色、美轮美奂的主题花车，还有22支来自本地及世界各地的顶尖演出团队呈献精彩表演，势将尖沙咀街头变成新春缤纷乐园。</p></div>', '汪明荃 吴家乐 吕慧仪 陈贝儿 陆浩明 邓梓峰', '粤语', '2016', '0', '/data/images/56b9b8d01cefb.jpg', '香港', '2016-02-09 18:00:48', '25', '0', '0', '709', '综艺', '全集');
INSERT INTO `movie` VALUES ('1836', '暖DD食平D', '<div class=\"endtext\"><p>中国人习惯在冬天进补，给身体提供足够的营养，度过寒冬。然而补身、养生向来丰歛由人，除了鲍参翅肚之外，平民食材同样可进补！肥妈（Maria Cordero）与契仔陆浩明（六号）延续先前三辑“食平D”精神，继续发挥“悭钱”大智慧，全新一辑《暖DD．食平D》，教大家以实惠预算轻轻松松炮制出一道道暖身又窝心的冬天时令菜。</p>\r\n<p>肥妈与六号会亲身到访全港街市，搜购时令及特色食材，构思“鱼翅瓜苹果雪梨汤”、“石斛淮山杞子乌鸡汤”、“深薯油鸭煲”、“西式生炒糯米饭”等一系列冬季菜式，当然也少不了“干酪挞”、“紫菜水果包”等各式“人气”小食、滋味甜品。各位家庭观众只需跟随肥妈，便可以“街坊价”享受星级食府的美馔佳肴，兼可补身健体。在买菜期间，肥妈还会与各街坊交流，解答大家烹饪方面的疑难。</p>\r\n<p>今辑节目，肥妈以“暖DD”为主题，每集都会示范不同暖笠笠菜式之余，为配合现今流行的“每周一素食”健康饮食模式，节目逢周一特设“食Green D”环节，示范素菜美食；而在“Happy Friday”，肥妈与六号还会炮制冬日“大茶饭”，邀请三五知已亲临录影厂，一边煮、一边玩，迎接周末假期！</p></div>', '陆浩明', '粤语', '2015', '0', '/data/images/56946603c5caa.jpg', '香港', '2016-02-06 09:05:24', '25', '0', '0', '709', '综艺', '更新至30集');
INSERT INTO `movie` VALUES ('1837', '2016湖南卫视小年夜春晚', '<div class=\"endtext\"><p>小年夜猴年年货重磅来袭，芒果TV将于2月2日晚20:20，以三大视角独家直播湖南卫视2016年小年夜春晚，除此之外，特别推出“星”年house——明星群访间，和明星互动花式看春晚盛宴，只需动动手指，让凛冬在室内开启狂欢模式！</p></div>', '汪涵 何炅 谢娜 杨乐乐 杜海涛 沈梦辰', '国语', '2016', '0', '/data/images/56b1a36bc9e3d.jpg', '大陆', '2016-02-03 14:51:24', '25', '0', '0', '709', '综艺', '全集');
INSERT INTO `movie` VALUES ('1838', '快闪厨房', '<div class=\"endtext\"><p>时下“潮人”凡事讲求自由、即兴，讨厌“死板”、规律的东西，于是Pop Up活动或“快闪”文化越来越盛行。为了减低成本及有效吸引人潮，越来越多活动单位、品牌、餐厅响应“快闪”文化，以富有趣味的营运方式设立“快闪活动”、“快闪店”、“快闪食物车”等，利用“突如其来的事物特别矜贵”的心态，成功引来不俗的回响。</p>\r\n<p>主持梁芷珮(Christy)对美食情报或Pop Up活动触觉敏锐，今次设立《快闪厨房》，不但带大家直击各式各样Pop Up活动现场，了解活动盛况，还会找来“厨艺达人”、“甜品达人”合作，挑战突击“美食任务”，如跟随厨师在时装店内即兴设立“Pop Up Kitchen”、追踪厨师在餐厅的一天工作、为车会制作具代表性的3D蛋糕等等。</p>\r\n<p>当中亦不得不提一个“星级”任务，Christy诚邀甜品师制作独一无二的3D立体蛋糕，并登上乐坛新贵郑俊弘(Fred)演唱会舞台，为Fred送上惊喜！</p></div>', '梁芷珮', '粤语', '2015', '0', '/data/images/56ad686bb3de3.jpg', '香港', '2016-01-31 09:50:35', '25', '0', '0', '709', '综艺', '更新至10集');
INSERT INTO `movie` VALUES ('1839', '2016国际中华小姐竞选', '<div class=\"endtext\"><p>14位来自不同国家及地区的佳丽，齐集将军澳电视广播城，准备好参与由郑丹瑞、郑裕玲、黎芷珊担任司仪的国际大型选美盛事《2016国际中华小姐竞选》。为争夺冠、亚、季军及友谊小姐，各佳丽在舞台上散发最强的魅力，亦希望获得一众担任钻石评判团及华丽评判团的男、女艺员青睐。各位佳丽预备好穿上代表自己地区的民族服饰、展示中华小姐气质的旗袍、华丽动人的晚装，将美好的身形及满满的自信呈现于观众眼前，还准备回答三位司仪复杂的提问及动感舞蹈演出，争取高分数。每个环节后司仪会公布三强走势，但相关数字只包括20位华丽评判团成员。三个回合后，大会将连同钻石评判团6位成员的分数，筛选出最后五强，邀请五强佳丽为观众献出最具自信的才艺表演，争夺晋身三甲的宝座！观众亦可透过TVB fun应用程式参与游戏，一同竞猜冠军谁属，赢取丰富奖金奖品。</p></div>', '郑丹瑞 郑裕玲 黎芷珊', '粤语', '2016', '0', '/data/images/56a4310b9ae53.jpg', '香港', '2016-01-24 10:03:55', '25', '0', '0', '709', '综艺', '全集');
INSERT INTO `movie` VALUES ('1840', '第73届电视电影金球奖颁奖典礼', '<div class=\"endtext\">第73届美国电影电视金球奖已确定颁奖日期，本届金球奖颁奖典礼将于2016年1月10日在比佛利山庄希尔顿酒店举行。与去年一样，NBC电视台将会实时直播颁奖礼。<br />\r\n好莱坞外国记者协会（HFPA）宣布，第73届金球奖提名名单将于2015年12月10日公布，而作品报名截止日期为10月30日。11月25日评委会提交提名选票，并在12月7日之颁奖典礼精彩瞬间前完成票数统计。<br />\r\n金球奖从1944年起每年举办一次，是由好莱坞外国记者协会和迪克·克拉克影视制作公司共同举办。作为美国一个电视电影奖项，其最终结果是由96位记者投票产生，评选影片来自全球一百六十多个国家。</div>', '瑞奇·热维斯', '英语', '2016', '0', '/data/images/569affbad3d0b.jpg', '欧美', '2016-01-17 10:44:38', '25', '0', '0', '709', '综艺', 'HD版');
INSERT INTO `movie` VALUES ('1841', '舌尖上的新年', '<div class=\"endtext\">这是一部关于“重回时间”、“寻找年味儿”的电影，将透过中国广袤大地上奇绝的年货食物，串接一个个新年故事，展示东方的文化习俗，用鲜活的镜头语言保存一部民族生活史和文化档案，带观众重寻旧日的习俗和年味儿。</div>', '李立宏', '国语', '2016', '0', '/data/images/569a5f504abab.jpg', '大陆', '2016-01-16 23:18:40', '25', '0', '0', '709', '综艺', 'HD版');
INSERT INTO `movie` VALUES ('1842', '奔跑吧兄弟第三季', '<div class=\"endtext\">&nbsp;&nbsp;&nbsp; 《奔跑吧兄弟》是浙江卫视推出的一档新的大型户外真人秀节目。节目原型为韩国超人气综艺节目《Running Man》。浙江卫视还将携手韩国SBS电视台的原班制作团队，并邀请中国国内知名综艺节目团队</div>', '邓超 杨颖 李晨 陈赫 郑恺 包贝尔 王祖蓝', '国语', '2015', '0', '/data/images/567e23cd848a0.jpg', '大陆', '2016-01-16 12:47:05', '25', '2016', '1', '709', '综艺', '2016-01-15');
INSERT INTO `movie` VALUES ('1843', '今晚唔睇李', '<div class=\"endtext\">由李思捷监制、并与单立文(豹哥)一同主持的综艺节目《今晚睇李》，在数月前经已完满落幕，然而节目引伸的是是非非似未平息。据“可靠消息”指，“罪魁祸首”根本是思捷本人，因其自视过高、嚣张、“手多多”个性，不停“辣著”台前幕后工作人员及节目嘉宾，引起公愤！节目相关人士决不再隐瞒实情，遂亲自露面，并搜罗从未在节目中曝光的绝密片段，大数思捷的“罪行”！</div>', '李思捷 单立文', '粤语', '2016', '0', '/data/images/56947e5d8140d.jpg', '香港', '2016-01-12 12:17:33', '25', '0', '0', '709', '综艺', '更新至01集');
INSERT INTO `movie` VALUES ('1844', '荒野猎人', '<div class=\"endtext\"><p>该片根据Michael Punke同名小说改编，由Mark L. Smith编剧。故事讲述19世纪一个皮草猎人被一头熊所伤，他乘的船的船长试图把他带回文明世界，但形势所迫，他无法做到，于是只好雇了两个人留下，目的是让他们送这个猎人最后一程。但这两个人利欲熏心，他们把这个受伤的可怜人洗劫一空，之后把他一个人抛弃在荒凉冰冷的野外等死。然而猎人奇迹般的活了下来，之后开始寻找这两个人开始复仇…</p></div>', '莱昂纳多·迪卡普里奥 汤姆·哈迪 威尔·保尔特 多姆纳尔·格里森', '英语', '2016', '0', '/data/images/567e301bdb3a9.jpg', '欧美', '2016-01-12 16:41:34', '12', '0', '0', '707', '预告片', '预告');
